(72784, 'deDE', 'Unterstützung für den Kobaltkonvent', 'Sprecht mit Venthi im Kobaltkonvent.', 'Genau zur rechten Zeit, $n.\n\nHab Ihr schon mal vom Kobaltkonvent gehört? Das war einst ein wundersamer Ort, an dem die meisten meiner Art gelebt haben.\n\nDie Splitterflammen haben uns vertrieben und sich dort niedergelassen.\n\nWir hatten die Hoffnung, unser Zuhause wieder zurückzuerobern, doch neuesten Informationen zufolge kämpfen wir eine verlorene Schlacht.\n\nKönnt Ihr uns Eure Unterstützung leihen? Trefft Euch mit Venthi im Kobaltkonvent, wenn Ihr könnt.', '', '', '', '', '', 'Sprecht mit Venthi im Kobaltkonvent.', 47187),
(72783, 'deDE', 'Handwerksaufträge', 'Sprecht mit Bürovorsteherin Mimzy Funkelstein und erfahrt mehr über das Erfüllen von Handwerksaufträgen.', 'Das ist ein schickes Ding, das Ihr da von dem Titanengerät bekommen habt. Her damit!\n\nKleiner Spaß! Ich wüsste nicht einmal, was ich damit machen soll. Ihr etwa?\n\nSprecht mit Mimzy Funkelstein. Ihr ganzes Ding ist es, Leute zu finden, die sogenannte \"Handwerksaufträge\" erledigen.\n\nIhr bringt ihnen Sachen, jemand nimmt sie und stellt daraus was für Euch her.\n\nEinfach, stimmt\'s? Redet mimt Mimzy und probiert es aus! Und sagt ihr nicht, dass ich Euch geschickt habe.', '', '', '', '', '', '', 47187),
(72773, 'deDE', 'Genialität erlernen', 'Trefft Greyzik Flickfinger innerhalb von Valdrakken.', 'Es gibt einige Goblilns in Valdrakken, die ein herrenloses Titanengerät untersuchen.\n\nUm ehrlich zu sein sorgen sie für ganz schön Aufsehen. Einige sind besorgt, Ihre Forschung könnte mehr Schaden als Gutes anrichten.\n\nDie Einwohner von Valdrakken würden es begrüßen, wenn Ihr diesen Goblins einen Besuch abstattet und versucht, eine Lösung für Ihre Untersuchung zu finden.\n\nOhne Teile unserer Stadt zu zerstören.', '', '', '', '', '', 'Trefft Greyzik Flickfinger innerhalb von Valdrakken.', 47187),
