(72729, 'deDE', 'Der Große Flunk', 'Bringt die rostige Münze der Inseln zum Großen Flunk auf den Ebenen von Ohn\'ahra.', 'Eine ungewöhnliche Münze, die auf den Dracheninseln aus dem Wasser gefischt wurde.\n\nAndere Fischer haben Euch Gerüchte erzählt, dass auf den Ebenen von Ohn\'ahra eine Kreatur leben soll, die solche Dinge sammelt.', '', '', '', '', '', '', 47187),
(72728, 'deDE', 'Die Welt wartet', 'Schließt 10 Weltquests auf den Dracheninseln ab.', 'Wisst Ihr, was ein klares Zeichen von Härte ist? Der Gemeinschaft der Dracheninseln zu helfen!\n\nHier gibt es haufenweise Probleme, die es zu lösen gilt. Zeigt mir, wie hart Ihr seid, indem Ihr aushelft!', '', '', '', '', '', '', 47187),
(72709, 'deDE', 'Die Finanzierung einer Schatzsuche', 'Kauft die Artefaktaufzeichnungen des Archäologen von Katalogisiererin Jakes.', '<Katalogisiererin Jakes wühlt schnell durch ihre eigene Vorratstasche und holt eine frisch gezeichnete Karte hervor.>\n\nEiner unserer Archäologen hat soeben neue Ergebnisse bezüglich eines verlorenen Artefakts gemeldet, das sich in diesem Gebiet befinden soll.\n\nWenn Ihr die Vorräte spendet, um die nächste archäologische Expedition zu finanzieren, könnt Ihr diese Karte haben. Sie wird Euch zu einem Schatz führen, der sich in der Nähe befindet.', '', '', '', '', '', '', 47187),
(72708, 'deDE', 'Vorräte der Dracheninseln', 'Liefert die Vorratstasche der Dracheninseln an Katalogisiererin Jakes in der Botschaft von Schwingenrast.', '<Dieser Protodrache muss sich die Tasche mit Vorräten von einem unglücklichen Mitglied der Drachenschuppenexpedition geschnappt haben.\n\nKatalogisiererin Jakes in der Botschaft von Schwingenrast sollte wissen, was damit zu tun ist.>', '', '', '', '', '', 'Liefert die Vorratstasche der Dracheninseln an Katalogisiererin Jakes in der Botschaft von Schwingenrast.', 47187),
