(72686, 'deDE', 'Sturmwoge', 'Besiegt elementerfüllte Kreaturen und sammelt Elementarüberfluss, während Ihr Euch in einem Elementarsturm befindet.', 'Die Primalisten haben wütende Elementarstürme überall auf den Dracheninseln beschworen, $n.\n\nWenn Ihr einen aktiven Sturm findet, geht hin und erschlagt die elementerfüllten Kreaturen dort.\n\nDann sammelt den Elementarüberfluss von den erschlagenen Feinden. Denkt daran, dass Ihr mehr Elementarüberfluss von stärkeren Feinden sammeln könnt.\n\nWir können nicht zulassen, dass die elementare Verderbnis der Primalisten ungehindert fortschreitet.', '', '', '', '', '', '', 47187),
