(72585, 'deDE', 'Freie Orientierung', 'Schließt die Orientierungsquests in jedem größeren Fraktionshauptquartier ab: Drachenschuppenbasislager, Maruukai, Iskaara und Valdrakken.', 'Ihr habt viel für die Dracheninseln getan, $gHeld:Heldin;.\n\nViele sind Euch dankbar für Euren Beitrag und wollen Euch vollständig in ihrer Gemeinschaft willkommen heißen. Geht zu ihnen und lernt jede Gruppe und deren Spezialitäten kennen.\n\nGanz wie Ihr den Dracheninseln vieles zu bieten habt, haben viele von uns so einiges, was sie Euch gerne als Gegenleistung anbieten möchten.', '', '', '', '', '', '', 47187),
(72584, 'deDE', 'Das eigene Netz auswerfen', 'Werft Euer Fischernetz am Angelloch der Flussmündung aus.', 'Wollt Ihr Euer Netz ausprobieren? Geht an die Flussmündung südlich der Küste des Erwachens und sucht einen Ort, an dem es viele Fische gibt. Das sollte ein guter Ort sein, um das Netz auszuwerfen.', '', '', '', '', '', '', 47187),
