(72525, 'deDE', 'Basiskatalogisierungsausrüstung', 'Nutzt das Expeditionsversorgungspaket, um Katalogisierungsausrüstung zu erforschen.', 'Jeder Katalogisierer der Expedition braucht eine eigene Kamera!\n\nIhr müsst Eurer keinen besonderen Namen geben, aber ich würde es Euch dennoch raten. So macht es viel mehr Spaß!\n\nPfadfinder Jeb sollte Euch mit allem versorgen können, was Ihr braucht.\n\nIch habe noch nie etwas gebraucht, was er nicht bei sich hatte. Er ist unglaublich!', '', '', '', '', '', '', 47187),
(72524, 'deDE', 'Basiskletterausrüstung', 'Nutzt das Expeditionsversorgungspaket, um Kletterausrüstung zu erforschen.', '<Pfadfinder Jeb deutet auf den Versorgungspaket neben sich.>\n\nIhr werdet Vorräte brauchen, um hier draußen zu überleben.\n\nBesorgen wir Euch, was Ihr zum Klettern braucht.', '', '', '', '', '', '', 47187),
(72519, 'deDE', 'Temporale Zweistimmung', 'Wendet den Chronokristall auf Eternus und Chromie in Azmerloth an, um zu verhindern, dass sie weiter durch die Zeit fallen.', 'Ich verstehe... Sie fallen durch Möglichkeiten und die Zeit selbst.\n\nBeeilt Euch, ich habe einen weiteren Punkt in der Zeitlinie entdeckt, an dem wir sie auffangen könnten. Er ist... ungewöhnlich, aber lasst Euch nicht von der Fremdartigkeit dieser Welt ablenken. Chronormus Schicksal liegt in Euren Händen.', '', '', '', '', '', 'Kehrt zu Nozdormu in die Gegenwart zurück.', 47187),
(72512, 'deDE', 'Eine flüsternde Brise', 'Nähert Euch Ohn\'ahra in Ohn\'ahras Horst.', '<Godoloto legt den Kopf schräg, nickt Euch zu und sieht Euch schließlich in die Augen. Nach einem langen Moment hebt sie den Blick zum Himmel... und dem Berg neben Maruukai. Ihr spürt, dass sie Euch bittet, zu Ohn\'ahras Horst hinaufzureisen.', '', '', '', '', '', 'Nähert Euch Ohn\'ahra in Ohn\'ahras Horst.', 47187),
(72488, 'deDE', 'Fortgeschrittene Tour in Thaldraszus', 'Fliegt jedes fortgeschrittene Rennen in Thaldraszus.', 'Einmal mehr auf nach Thaldraszus mit seinen Gipfeln und Tälern und Rennstrecken, die nur auf Euch warten!\n\nSuch meine bronzenen Kollegen auf, um die fortgeschrittenen Rennen zu fliegen und Eure Tour auf den Dracheninseln zu beenden!', '', '', '', '', '', '', 47187),
(72487, 'deDE', 'Tour in Thaldraszus', 'Fliegt einmal auf jeder Rennstrecke in Thaldraszus.', 'Thaldraszus. Es ist die Heimat des Sitzes der Aspekte und eines Großteils der Geschichte der Drachenheit. \n\nEs ist außerdem die Heimat schwindelerregender Gipfel und steile, tiefe Schluchten, die geradezu zu einem Überflug einladen!\n\nMeine Bronzekollegen haben wie immer Rennstrecken in Thaldraszus aufgebaut, die Ihr fliegen könnt, während Ihr das Land erforscht. \n\nWarum seht Ihr sie Euch nicht an und schließt Eure Tour der Dracheninseln ab?', '', '', '', '', '', '', 47187),
(72486, 'deDE', 'Fortgeschrittene Tour im Azurblauen Gebirge', 'Fliegt jedes fortgeschrittene Rennen im Azurblauen Gebirge.', 'Die fortgeschrittenen Strecken im Azurblauen Gebirge sind darauf ausgelegt, Euren Fertigkeiten im Drachenreiten zu neuen Höhen zu verhelfen! \n\nAber... fallt bitte bloß nicht aus eben jenen Höhen!\n\nWenn Ihr bereit seid, sucht meine bronzenen Kollegen auf und fliegt ihre Strecken!', '', '', '', '', '', '', 47187),
(72485, 'deDE', 'Tour im Azurblauen Gebirge', 'Fliegt einmal auf jeder Rennstrecke im Azurblauen Gebirge.', 'Rennstrecken im Azurblauen Gebirge sind eine einzigartige Erfahrung. Die hohen Gipfel, das schneebedeckte Terrain und die dichten Wälder bieten zahlreiche interessante Hindernisse... und Herausforderungen!\n\nSucht nach meinen bronzenen Kollegen, wenn Ihr dort seid, und probiert Euch an ihren Strecken!', '', '', '', '', '', '', 47187),
(72484, 'deDE', 'Fortgeschrittene Tour auf den Ebenen von Ohn\'ahra', 'Fliegt jedes fortgeschrittene Rennen auf den Ebenen von Ohn\'ahra.', 'Die fortgeschrittenen Strecken sollten etwas herausfordernder sein, aber ich bin mir sicher, dass Ihr auch damit zurechtkommen solltet!\n\nMeine bronzenen Kollegen haben auf den Ebenen von Ohn\'ahra fortgeschrittene Strecken mit ein paar Hindernissen und Überraschungen für Euch vorbereitet. Ihr könnt dort auch gegen Eure eigenen Bestzeiten antreten!\n\nViel Glück!', '', '', '', '', '', '', 47187),
(72483, 'deDE', 'Tour auf den Ebenen von Ohn\'ahra', 'Fliegt einmal auf jeder Rennstrecke der Ebenen von Ohn\'ahra.', 'Ah, die Ebenen von Ohn\'ahra. Ausgedehnte, freie Flächen, Windböen, ungetrübte Aussicht... Und noch mehr Rennstrecken!\n\nWie auch schon an der Küste des Erwachens gilt, wenn Ihr jemanden meiner bronzenen Kollegen trefft, dann sprecht ihn doch auf die Rennstrecke an.', '', '', '', '', '', '', 47187),
(72482, 'deDE', 'Fortgeschrittene Tour an der Küste des Erwachens', 'Fliegt jedes Rennen an der Küste des Erwachens.', 'Nun, da Ihr die Basisrennen auf den ganzen Dracheninseln geflogen seid und Euer Können unter Beweis gestellt habt, wie wäre es mit einer neuen Herausforderung?\n\nDie fortgeschrittenen Rennkurse ähneln den Standardkursen, die Ihr bereits kennt, aber viele haben angepasste Flugstrecken oder zusätzliche Hindernisse, die Eure Fähigkeiten auf die Probe stellen.\n\nFangen wir doch mit den Strecken an der Küste des Erwachens an!', '', '', '', '', '', '', 47187),
(72481, 'deDE', 'Tour an der Küste des Erwachens', 'Fliegt einmal auf jeder Rennstrecke der Küste des Erwachens.', 'Und was macht am meisten Spaß, wenn es ums Drachenreiten geht? Rennen!\n\nMeine bronzenen Kollegen haben überall auf den Dracheninseln Rennstrecken entworfen. Die Landschaften sind einfach so vielseitig und dynamisch, dass sie fast schon darum betteln, bei Höchstgeschwindigkeiten erkundet zu werden.\n\nWarum probiert Ihr es nicht aus, wenn Ihr mal in der Nähe einer unserer Rennstrecken an der Küste des Erwachens seid?', '', '', '', '', '', '', 47187),
(72456, 'deDE', 'Folianten des Vertrauens', 'Findet Bände der Obsidiangenealogie und bringt sie zu Furorions und Sabellians Rüstmeistern.', 'Obwohl wir die oberen Ebenen der Obsidianzitadelle sichern konnten, plündern die Streitkräfte der Djaradin weiterhin den Innenhof. Doch dort lagern lauter unbezahlbare historische Aufzeichnungen! Wir müssen schnell handeln, um alles zu retten, das die Abstammung des schwarzen Drachenschwarms dokumentiert.\n\nFurorion und Sabellian brauchen diese Informationen, Ihr könntet Euch also gut bei ihnen einschmeicheln, wenn Ihr jedem einen Folianten mitbringt.\n\nGeht zum eingestürzten Turm der Zitadelle, dort solltet Ihr etwas Wertvolles finden können.', '', '', '', '', '', '', 47187),
(72448, 'deDE', 'Das Vermächtnis sichern', 'Eliminiert zwei seltene Gegner in der Obsidianzitadelle oder dem Schlackensumpf.', 'Ich habe nicht so hart gearbeitet und bin so weit gekommen, um die Zitadelle jetzt zu verlieren!\n\nLeider sind neue Bedrohungen aufgetaucht. Kann ich mich auf Eure Unterstützung bei deren Beseitigung verlassen?\n\nHelft, die Gegend zu sichern. Findet zwei unserer mächtigsten Gegner und löscht sie aus.', '', '', '', '', '', '', 47187),
(72447, 'deDE', 'Die größte Bedrohung', 'Eliminiert zwei seltene Gegner in der Obsidianzitadelle oder dem Schlackensumpf.', 'Mächtige Djaradin und andere Kreaturen bedrohen die Obsidianzitadelle und die Sicherheit meines Schwarms.\n\nDas können wir nicht zulassen.\n\nHelft uns, das Gebiet zu sichern. Findet und eliminiert zwei unserer stärksten Feinde.', '', '', '', '', '', '', 47187),
(72435, 'deDE', 'Ausrichtung: Iskaara', 'Lernt einige Händler mit wertvollen Waren kennen.', 'Willkommen in Iskaara.\n\nGeschichten über Eure Taten in Brackenfell haben bereits unser Volk erreicht. Ihr habt schon viele von uns getroffen und es gibt noch viele andere, die gerne Wissen und Waren mit Euch austauschen würden.\n\nBitte, nehmt Euch einen Moment, um einige der freundlichen Gesichter in Iskaara kennenzulernen. In unserer Gemeinschaft hilft man sich gegenseitig, so viel Ihr uns also zu bieten habt, so viel haben unsere Leute Euch im Gegenzug anzubieten.', '', '', '', '', '', '', 47187),
(72434, 'deDE', 'Rubinlebensschrein-Schleife', 'Schließt die Rubinlebensschrein-Schleife ab.', 'Sie sagen, ich bin noch nicht groß genug, um einige dieser Strecken zu fliegen.\n\nAber ich kann anderen dabei zusehen. Ihr solltet das Rennen fliegen! Dann kann ich Euch zusehen!', '', '', '', '', '', 'Schließt die Rubinlebensschrein-Schleife ab.', 47187),
(72429, 'deDE', 'Ausrichtung: Maruukai', 'Trefft die Hüterin des Ruhms und den ruhmreichen Rüstmeister in Maruukai.', '<Als Sansok Khan seufzt, spricht Okir für sie.>\n\nDas Volk der Maruuk hat sich nicht gegen Außenseiter verschworen, aber alle möglichen Verbündeten müssen sich uns gegenüber dennoch beweisen. Während Ihr die Klans trefft und unterstützt, werden sich Geschichten über Eure Taten bald herumsprechen.\n\nAuf der unteren Ebene des Krutals auf dem Hügel könnt Ihr eine der Töchter der Khanam Matra finden. Sie kann Euch sagen, wie es um Euren Ruf bei unserem Volk steht. Vergesst nicht, Euch bei ihr vorzustellen.', '', '', '', '', '', '', 47187),
(72428, 'deDE', 'Flunkerbunker', 'Sammelt 20 stinkende Edelsteine von den Flunkern auf den Dracheninseln für Gnoklin Quirkspule bei der Drachenschuppenexpedition.', 'Es ist kein Geheimnis, dass die Flunker dieses Landes eine Faszination für Edelsteine, Juwelen und alles, was glitzert, aufweisen. Erst vor Kurzem fand ich einen sehr wertvollen Edelstein in Flunkerkot!\n\nEs ist vielleicht nicht die angenehmste Arbeit, aber anscheinend sammeln die Flunker Wertgegenstände nicht nur, sie fressen sie auch.', '', '', '', '', '', '', 47187),
(72427, 'deDE', 'Belebte Infusion', 'Sammelt 13 stachelige Blätter von den Peitschern der Dracheninseln für Dhurrel von den Zentauren der Maruuk.', 'Ich habe heute eine einfache Bitte an Euch.\n\nDen Alchemisten geht eine Zutat aus, die sie für ein besonders heikles Gebräu brauchen. Das Kraut ist aber leicht zu finden. Ihr müsst nur einige aggressive Pflanzen finden, denen Ihr Proben entnehmen könnt. Fühlt Ihr Euch dem gewachsen?', '', '', '', '', '', '', 47187),
(72423, 'deDE', 'Den Sturm überstehen', 'Sammelt 12 Sturmwaffen von den Zentauren der Nokhud auf den Dracheninseln für Temnaayu von den Tuskarr von Iskaara.', 'Ah, Ihr kommt genau rechtzeitig! Wir haben gehört, dass die Zentauren der Nokhud mächtige, gefährliche Waffen mit Sturmverzauberungen haben. Wir würden unseren Verzauberern gerne einige Exemplare bringen, damit sie sie studieren können.\n\nIm schlimmsten Fall können wir die Waffen immer noch entladen und für gute Zwecke einsetzen.', '', '', '', '', '', '', 47187),
(72410, 'deDE', 'Viele Zangen, spitze Nadeln', 'Sammelt 10 spitze Zangen von den Scythiden der Dracheninseln für Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Uns gehen bald die Nähnadeln aus. Diese verflixten Dinger brechen ständig ab!\n\nEinige spitze Teile der Scythiden in der Gegend könnten gut als Ersatz herhalten.', '', '', '', '', '', '', 47187),
(72406, 'deDE', 'Ausrichtung: Valdrakken', 'Trefft die wichtigen Versorger des Abkommens in Valdrakken.', 'Willkommen in Valdrakken, $p. Ich bin Unatos, Hüter des Ruhms für das Valdrakkenabkommen.\n\nAls Anerkennung für Eure Unterstützung für die Drachenschwärme wurden einige Zulieferer in der Stadt autorisiert, Euch mit einigen unserer besten Waren zu versorgen.\n\nWarum nehmt Ihr Euch nicht die Zeit, ihre Standorte und Waren kennenzulernen?', '', '', '', '', '', '', 47187),
(72399, 'deDE', 'Der Einsiedlergarten', 'Sprecht mit Szareth an der Schattenklippe.', 'Unsere Eltern sagen immer, wir sollen die Gärten über Gelikyr nicht besuchen. Sie glauben, der Gärtner ist böse und gefährlich.\n\nAber das stimmt nicht. Er ist ein bisschen grummelig, aber wirklich nett! \n\nKeiner von uns war da oben, seit die Primalisten aufgetaucht sind. Jetzt ist es wirklich zu gefährlich. Aber ich hoffe, dem Gärtner geht es gut. Würdet Ihr bitte nach ihm sehen, wir können ihn ja nicht mehr besuchen.', '', '', '', '', '', '', 47187),
(72397, 'deDE', 'Ausrichtung: Drachenschuppenbasislager', 'Trefft die wichtigen Versorger im Drachenschuppenbasislager.', 'Willkommen im Basislager, $p.\n\nToddy und ich haben eine Weile gebraucht, um den perfekten Platz für ein Lager zu finden, aber unsere Wahl könnte mich nicht glücklicher machen.\n\nLeichter Zugang zu Ruinen, Brutplätze der Protodrachen und natürlich die Drachenschwärme.\n\nWarum nehmt Ihr Euch nicht ein paar Minuten, um Euch das Lager anzusehen und einige der Versorger kennenzulernen, die die Expedition am Laufen halten?', '', '', '', '', '', 'Trefft Toddy Schnurrbart im Zelt des Drachenschuppenbasislagers.', 47187),
