(72380, 'deDE', 'Zusammen sind wir nicht aufzuhalten', 'Kehrt zum Sitz der Aspekte zurück und informiert Alexstrasza darüber, was nach dem Sieg über Raszageth im Gewölbe der Inkarnationen geschehen ist.', '$n, Ihr müsst Alexstrasza und Nozdormu erzählen, was hier passiert ist.\n\nKhadgar und ich werden Euch in Kürze am Sitz der Aspekte treffen.', '', '', '', '', '', 'Kehrt zu Alexstrasza der Lebensbinderin am Sitz der Aspekte in Valdrakken zurück.', 47187),
(72374, 'deDE', 'Helft dem Abkommen: Drachenfluchfestung', 'Reist an die Küste des Erwachens und belagert die Drachenfluchfestung. Führt Eure Bemühungen fort, dem Valdrakkenabkommen und seinen Verbündeten auf den ganzen Dracheninseln zu helfen.', 'Unsere Verbündeten brauchen einmal mehr Eure Unterstützung bei ihren Vorhaben auf den Inseln. In Valdrakken gehen Worte des Trostes um, die davon sprechen, wie Ihr geholfen habt, unsere Zukunft zu formen.\n\nZurück zum Geschäft.\n\nEine lauernde Bedrohung der Djaradin bewegt sich tief im Inneren des schwelenden Infernos der Drachenfluchfestung auf die Küste des Erwachens zu. Wir müssen diesen Vorstoß aufhalten.\n\nWir erwarten Eure Rückkehr, $n.', '', '', '', '', '', '', 47187),
(72373, 'deDE', 'Helft dem Abkommen: Die Jagd ist eröffnet', 'Helft den Maruuk bei einer Jagd auf den Dracheninseln. Führt Eure Bemühungen fort, dem Valdrakkenabkommen und seinen Verbündeten auf den ganzen Dracheninseln zu helfen.', 'Unsere Verbündeten auf den Ebenen von Ohn\'ahra haben nach allen und jedem geschickt, die in diesen Landen jagen, um sie zu bitten, ihre Sache zu unterstützen.\n\nWährend Ihr Euren Bemühungen auf den Inseln nachgeht, stattet doch unseren Verbündeten in ihren Jagdlagern einen Besuch ab und helft Ihnen ein wenig aus.\n\nEs gibt viel zu tun. Trödelt nicht.', '', '', '', '', '', '', 47187),
