(72354, 'deDE', 'Die Große Schatzkammer', 'Holt Euch eine Belohnung aus der Großen Schatzkammer.', 'Über die Jahre hinweg haben die Aspekte und ihr Volk viele bemerkenswerte Artefakte und Waffen angesammelt. Die Aspekte haben die Konstruktion einer verzauberten Schatzkammer in Auftrag gegeben, um sie zu lagern, bis eine würdige Seele auf der Suche nach ihrem Inhalt eintrifft.\n\nIhr findet diese Schatzkammer innerhalb der Mauern der Bank. Vielleicht wird sie Euch einen Teil des uralten Schatzes der Aspekte gewähren, wenn Ihr Euren Eifer beweist.', '', '', '', '', '', '', 47187),
(72338, 'deDE', 'Großer Obsidianschlüssel', 'Findet $1oa zusammengesetzten Schlüssel.', 'Bringt mir einen zusammengesetzten Schlüssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel bei einer beliebigen Fraktion innerhalb der Schwarzdrachenzitadelle ab.', 47187),
