(72293, 'deDE', 'Abenteuer auf den Dracheninseln', 'Betrachtet die Späherkarte, um eine Gegend auf den Dracheninseln auszusuchen, die Ihr unterstützen wollt.', 'Oh, ich weiß, was ich tun kann!\n\nDie Drachenschuppenexpedition hat eine schöne Karte der Dracheninseln in der Nähe aufgehängt.\n\nIhre Zeichnungen sind sehr genau und detailliert, wie ich finde. Verzeiht, Ihr wollt keine Kunstanalyse hören.\n\nIhr solltet Euch die Karte ansehen, um herauszufinden, welche Gegenden auf den Dracheninseln Eure Hilfe brauchen können!', '', '', '', '', '', '', 47187),
(72292, 'deDE', 'Geschichte eines spektakulären Sieges', 'Erzählt der Ältesten Poa in Iskaara von Eurem Sieg.', 'Das war ein majestätischer Kampf!\n\nÄlteste Poa in Iskaara wird an der Geschichte dieses beeindruckenden Sieges interessiert sein.', '', '', '', '', '', '', 47187),
(72291, 'deDE', 'Geschichte eines denkwürdigen Sieges', 'Erzählt der Ältesten Poa in Iskaara von Eurem Sieg.', 'Das war ein guter Kampf! \n\nÄlteste Poa in Iskaara wird an der Geschichte dieses Sieges interessiert sein.', '', '', '', '', '', '', 47187),
