(72269, 'deDE', 'Thaldraszus', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 'Alexstrasza die Lebensbinderin plant ein Treffen am Sitz der Aspekte, um über die Bedrohung durch die Primalisten zu sprechen.\n\nSie hat alle hilfsbereiten Abenteurer eingeladen.', '', '', '', '', '', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 47187),
(72268, 'deDE', 'Azurblaues Gebirge', 'Sprecht mit Masud dem Weisen auf den Ebenen von Ohn\'ahra.', 'Die Kirin Tor brauchen alle Hilfe, die sie bekommen können, wenn es darum geht, den Schwurstein der blauen Drachen aufzuspüren.\n\nEinige ihrer Magier wurden hilfesuchend auf den Ebenen von Ohn\'ahra gesehen.', '', '', '', '', '', '', 47187),
(72267, 'deDE', 'Ebenen von Ohn\'ahra', 'Trefft Botschafter Taurasza im Außenposten der Rubinschuppen.', 'Der grüne Drachenschwarm braucht die Hilfe von Abenteurern. Doch Ihr müsst Euch erst mit den Zentauren der Ebenen verbünden.\n\nBotschafter Taurasza kann Euch helfen.', '', '', '', '', '', '', 47187),
(72266, 'deDE', 'Küste des Erwachens', 'Trefft Sendrax an der Küste des Erwachens.', 'Die Drakonide Sendrax sucht Hilfe für die Unterstützung der Neuankömmlinge an der Küste des Erwachens.', '', '', '', '', '', '', 47187),
(72263, 'deDE', 'Kavallerie vor', 'Lernt, Euer persönliches Vorquinreittier zu reiten.', '$gRufer:Ruferin;! Hier gibt es noch immer Vorquinherden!\n\nIch habe ein paar der Tiere zusammengetrieben, die als Reittiere dienen könnten, wenn Eure Schwingen müde werden. Wisst Ihr noch, wie man reitet?\n\nDieses Exemplar wird Euch zugeteilt, schließlich scheuchen Euch die Schuppenkommandanten ziemlich viel herum. Bitte kümmert Euch gut darum.', '', '', '', '', '', '', 47187),
(72261, 'deDE', 'Mehr als ein Gefängnis?', 'Bringt das uralte Gewölbeartefakt zu Lillian Mondenschein.', '<Das uralte Artefakt sieht elementar aus. Lillian Mondenschein in Valdrakken kann Euch vielleicht mehr sagen.>', '', '', '', '', '', '', 47187),
(72260, 'deDE', 'Gewölbeartefakte', '', '', '', '', '', '', '', '', 47187),
(72259, 'deDE', 'Gewölbeartefakte', '', '', '', '', '', '', '', '', 47187),
(72256, 'deDE', 'Die Dunkelkrallen', 'Überbringt die Befehle der Schuppenkommandantin an Kodethi und die Dunkelkrallen.', 'Naleidea scheint voller Begeisterung, aber sie ist Historikerin, keine Soldatin. Sie hat keine Ahnung von den Gefahren, denen wir uns auf den Dracheninseln gegenübersehen werden.\n\nNicht, dass irgendjemand sich Sorgen machen müsste. Schließlich werden die Dunkelkrallen die Expedition schützen.\n\nIch werde mit Ebyssian und den Anführern Eurer Horde die Missionslogistik besprechen.\n\nMein Leutnant Kodethi erkundet mit den anderen Dracthyr die Stadt. Seid so gut und gebt ihm Bescheid, dass wir uns am Zeppelinturm versammeln. Er wird meine Befehle an die anderen weitergeben.', '', '', '', '', '', 'Trefft Naleidea am Zeppelinturm außerhalb von Orgrimmar.', 47187),
(72254, 'deDE', 'Angler Tinnaks Geist', '', '', '', '', '', '', '', '', 47187),
(72253, 'deDE', 'Angeln auf den Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72252, 'deDE', 'Angeln auf den Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72251, 'deDE', 'Kochkunst der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72250, 'deDE', 'Kochkunst der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72249, 'deDE', 'Schneiderei der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72247, 'deDE', 'Juwelierskunst der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72246, 'deDE', 'Ruhige Träume', 'Sprecht mit dem Badmanager.', 'Willkommen im Bad der Ruhigen Träume!\n\nIch muss mich entschuldigen, wir können wegen gewisser Umstände, die außerhalb unserer Kontrolle liegen, keine neuen Gäste aufnehmen!\n\nLasst mich Euch an Xijan Dornenpranke, den Badmanager, verweisen. Er ist qualifiziert, Euch alle Fragen zu beantworten.', '', '', '', '', '', '', 47187),
(72245, 'deDE', 'Alchemie der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72244, 'deDE', 'Inschriftenkunde der Dracheninseln', '', '', '', '', '', '', '', 'Sprecht mit Jessamine Spitz in der Botschaft von Schwingenrast.', 47187),
(72243, 'deDE', 'Kräuterkunde der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72242, 'deDE', 'Ingenieurskunst der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(72241, 'deDE', 'Lektionen der Vergangenheit', 'Sprecht mit Schuppenkommandantin Glutthal.', 'Ich bin Glutthal, eine Schuppenkommandantin der Dracthyr. Furorion half uns, nachdem wir aus unserer langen Stasis erwacht waren, und nun ist es an mir, ihm zu helfen.\n\nIhr habt zweifellos viele Fragen über mein Volk und unsere Geschichte. Bis vor Kurzem hatte ich das auch.\n\nAber Nozdormu der Zeitlose hat viele verlorene Wahrheiten über die Dracthyr aufgedeckt. Er hat mir eine Vision unserer Herkunft gezeigt... und warum wir weggesperrt wurden. \n\nLasst mich Euch von den Dingen erzählen, die ich gesehen habe.', '', '', '', '', '', '', 47187),
(72240, 'deDE', 'Die Obsidianwächter', 'Überbringt die Befehle des Schuppenkommandanten an Derwischian und die Obsidianwächter.', 'Die Begeisterung dieser Toddy ist bewundernswert. Ich hoffe nur, dass sie vor lauter Enthusiasmus nicht die Gefahren ignoriert, die uns auf den Dracheninseln erwarten.\n\nDennoch, die Obsidianwächter sind zum Schutze der Expedition verpflichtet.\n\nIch muss mit Furorion und dem Lordkommandanten über die Mission sprechen.\n\nDie anderen Dracthyr erkunden die Stadt. Sucht meinen treuen Leutnant Derwischian und gebt ihr Bescheid, dass wir uns an den Docks versammeln. Sie wird meine Befehle an den Rest der Truppe weitergeben.', '', '', '', '', '', 'Überbringt die Nachricht von Eurem Erfolg Toddy Schnurrbart am Hafen von Sturmwind.', 47187),
(72193, 'deDE', 'Die Akademie von Algeth\'ar', 'Lasst Euch durch das Gelände der Akademie von Algeth\'ar führen.', 'Mir ist zu Ohren gekommen, dass die Akademie von Algeth\'ar sich wieder dem Rest der Welt geöffnet hat.\n\nVor langer Zeit waren ihre geheiligten Hallen nur für Drachen geöffnet, doch in den vergangenen Jahren wurde die Direktorin von der Weisheit ereilt, jeden willkommen zu heißen, der lernbegierig ist. Sie bat mich um Empfehlungen zu vielversprechenden Studenten.\n\nEs wäre mir eine Ehre, Euch, als $ggroßartigen Verbündeten:großartige Verbündete; der Drachenheit, an unserer ebenso großartigen Akademie zu wissen. Es obliegt ganz allein Euch, dieses Angebot anzunehmen oder nicht, aber ich bin mir sicher, dass Doragosa Euch gerne wenigstens eine Führung über das Akademiegelände geben würde.', '', '', '', '', '', '', 47187),
(72192, 'deDE', 'Hallen der Infusion: Entropie zu Ordnung', 'Betretet die Hallen der Infusion und besiegt den urtümlichen Tsunami.', 'Die Primalisten wollen das elementare Chaos in die Welt zurückbringen und machen vor nichts Halt, wenn es darum geht, ihr Ziel zu erreichen.\n\nIch habe üble Neuigkeiten erhalten, dass sie in die Hallen der Infusion unter Tyrhold eingedrungen sind. Sie versuchen, die Werke von Hüter Tyr für ihre eigenen niederträchtigen Zwecke zu missbrauchen.\n\nBitte, Ihr müsst die Bedrohung der Primalisten aus diesen heiligen Hallen vertreiben, $n.', '', '', '', '', '', '', 47187),
(72191, 'deDE', 'Belohnungen sind knapp', '', '', '', '', '', '', '', '', 47187),
(72190, 'deDE', 'Reservoirreservierungen', 'Findet Zuttiki.', '$C! Ich kenne da jemanden, der dringend Eure Fähigkeiten benötigt.\n\nDas Tyrholdreservoir wurde von den Primalisten angegriffen. Ich konnte gerade noch entkommen, aber andere hatten weniger Glück.\n\nEs ist gleich nördlich von hier. Findet Zuttiki, sie kann Euch weitere Details nennen.\n\nDas heißt... wenn sie noch lebt.', '', '', '', '', '', '', 47187),
(72189, 'deDE', 'Gartenvielfalt', 'Sprecht mit Gryrmpech.', 'Gefällt Euch der Schmetterlingsgarten?\n\nWisst Ihr, südlich von hier gibt es einen noch viel größeren Garten. Ein alter Drakonid namens Gryrmpech kümmert sich darum.\n\nEr kann immer ein Paar helfende Hände brauchen. Er hat einen \"Assistenten\", aber ich habe ihn noch nie gesehen. Ich glaube nicht, dass er eine große Hilfe ist.\n\nWenn Ihr vorbeikommt, sagt ihm, dass Xina Euch geschickt hat.', '', '', '', '', '', '', 47187),
(72188, 'deDE', 'LFGDungeons - DF - Heroic Random - Nth', '', '', '', '', '', '', '', '', 47187),
(72187, 'deDE', 'LFGDungeons - DF - Heroic Random - 1st', '', '', '', '', '', '', '', '', 47187),
(72185, 'deDE', 'LFGDungeons - DF - Raid Finder - Nth', '', '', '', '', '', '', '', '', 47187),
