(72182, 'deDE', 'LFGDungeons - DF - Normal Random - Nth', '', '', '', '', '', '', '', '', 47187),
(72181, 'deDE', 'LFGDungeons - DF - Normal Random - 1st', '', '', '', '', '', '', '', '', 47187),
(72175, 'deDE', 'Eine szeptakuläre Zeit', 'Stellt $1oa Szepter des Spektakels: Feuer und $2oa Szepter des Spektakels: Luft für Soragosa in Valdrakken her.', 'Diese Woche sind einige aufregende Bestellungen reingekommen! Die Studenten der Akademie von Algeth\'ar werden sich Kopf über Horn auf diese Szepter stürzen.\n\nWarum helft Ihr uns nicht mit der Herstellung einiger Szepter?', '', '', '', '', '', '', 47187),
(72172, 'deDE', 'Essenz, Splitter, und chromatischer Staub', 'Stellt $1oa chromatischen Staub für Soragosa in Valdrakken her.', 'Die Basiskomponenten scheinen bei uns immer knapp zu sein. Essenzen, Splitter... und unser Vorrat an chromatischem Staub ist beinahe aufgebraucht.\n\nWenn es Euch nichts ausmacht, uns mit dem Aufstocken zu helfen, halten wir vielleicht mehr als einen Tag durch, ohne die Vorräte auffüllen zu müssen.', '', '', '', '', '', '', 47187),
(72171, 'deDE', 'Im Einzel beweisen', 'Schließt 12 Runden im gemischten Einzel ab.', 'Euer Eifer, selbst den Konflikt zu suchen, gefällt mir. Wenn Ihr so sehr auf Eure Fähigkeiten vertraut, dann werde ich hierbleiben und zusehen. Zur Belustigung.\n\nBeweist Euch, dann kehrt zu mir zurück.', '', '', '', '', '', '', 47187),
(72168, 'deDE', 'In Geplänkeln beweisen', 'Verdient Ehre in Arenageplänkeln.', 'Ihr habt Vertrauen in Eure taktischen Fähigkeiten, wie? Mir ist zu Ohren gekommen, dass es oft kleinere Geplänkel unter Euch Sterblichen gibt. Sucht Euch einige Gegner, gegen die Ihr antreten könnt.\n\nBeweist Euch, dann kehrt zu mir zurück.', '', '', '', '', '', '', 47187),
(72167, 'deDE', 'Im Krieg beweisen', 'Verdient Ehre auf epischen Schlachtfeldern.', 'Ihr wollt also eine \"echte Herausforderung\"? So sei es. Ich kenne einige große Konflikte, die sogar für mich eine Herausforderung darstellen könnten.\n\nIch bin neugierig, wie schnell Ihr scheitert... ich meine gewinnt. Wollen wir sehen, ob Ihr Euch mir gegenüber beweisen könnt.', '', '', '', '', '', '', 47187),
(72166, 'deDE', 'In der Schlacht beweisen', 'Verdient Ehre auf zufälligen Schlachtfeldern.', 'Wenn Ihr Sterblichen es so sehr liebt, um jedes Land zu streiten, das Ihr findet, dann bitte.\n\nWenigstens wird es amüsant. Für mich zumindest. Dann lasst uns doch einmal sehen, wie gut Ihr Euch \"beweisen\" könnt.', '', '', '', '', '', '', 47187),
(72159, 'deDE', 'Wie Schuppen für die Augen', 'Sammelt $1oa schimmernde Schuppenbälge für Ralathor den Zerfurchten in Valdrakken.', 'Schuppen haben vielerlei Verwendungszwecke. Sie bieten Schutz, in einigen Fällen aber auch eine glatte, reflektierende Oberfläche. Viele unserer besten Spiegel sind eigentlich Schuppen.\n\nGenau diese Spiegel werden zufälligerweise auch stark nachgefragt. Besorgt mir einige schimmernde Schuppenbälge, dann teile ich ein paar Geheimnisse meiner Kunst mit Euch.', '', '', '', '', '', '', 47187),
(72154, 'deDE', 'Skag der Werfer', '', '', '', '', '', '', '', '', 47187),
(72137, 'deDE', 'Kükenpläne', '', '', '', '', '', '', '', '', 47187),
(72135, 'deDE', 'Neltharus: Verborgenes Wissen', 'Findet $1oa von Neltharions Notizen, $2oa Obsidiantagebücher und einen Forschungsfolianten in Neltharus.', 'Wir haben ein Problem, $gReisender:Reisende;. Zuerst erschienen die Djaradin innerhalb von Neltharus, also werden sie dessen Hallen plündern!\n\nNeltharus enthält viele Schätze, aber vor allem viel Wissen. Die Geschichte unseres Schwarms, dessen Fall... Sabellian und Furorion suchen nach Informationen über Neltharions Leben und seine Bestrebungen.\n\nVersucht, möglichst viel davon zu finden, bevor die Djaradin alles mitnehmen!', '', '', '', '', '', '', 47187),
(72134, 'deDE', 'Abenteuerassistenz', 'Verwendet die Späherkarte, um Eure erste Zone auszuwählen.', 'Wir haben herausgefunden, dass es auf den Verheerten Inseln, das Land, über dem wir schweben, viele Probleme gibt. \n\nWir werden von hier aus tun, was wir können. Ich möchte Euch bitten, auf der nahegelegenen Karte nachzusehen, wem Ihr als erstes helfen könnt.', '', '', '', '', '', '', 47187),
(72131, 'deDE', 'Überbestand', '', '', '', '', '', '', '', '', 47187),
(72130, 'deDE', 'Vergessener Greif', '', '', '', '', '', '', '', '', 47187),
(72129, 'deDE', 'Khadgar zur Hilfe', 'Trefft Khadgar in der Violetten Zitadelle in Dalaran.', 'Willkommen in Dalaran, $n. Ich bin froh, dass Ihr es geschafft habt.\n\nTrefft mich in der Violetten Zitadelle, es gibt viel zu tun.', '', '', '', '', '', 'Trefft Khadgar in der Violetten Zitadelle in Dalaran.', 47187),
(72128, 'deDE', 'Enkine der Gefräßige', '', '', '', '', '', '', '', '', 47187),
(72127, 'deDE', 'Hauptmann Lancer', '', '', '', '', '', '', '', '', 47187),
(72126, 'deDE', 'Schlabbro, die unglaubliche Schnecke', '', '', '', '', '', '', '', '', 47187),
(72122, 'deDE', 'Ehemalige Ökologen', 'Sucht nach den verschollenen Ökologen.', 'Die Verwundeten sind stabilisiert, aber meine Sorgen sind noch nicht vorüber, $n.\n\nZwei Drachenbrutökologen sind zum Außenposten gekommen, um das Sumpfland zu untersuchen. Seit dem Angriff hab ich keine einzige Schuppe von ihnen erblickt und das bereitet mir Sorgen.\n\nKönntet Ihr Euch nach ihnen umsehen und ihnen helfen, wenn Ihr hinauszieht?\n\nUnd passt dabei auf. Angeblich lauern im Sumpf Gorlocs.', '', '', '', '', '', '', 47187),
(72121, 'deDE', 'Der Große Panzerkhan', '', '', '', '', '', '', '', '', 47187),
(72117, 'deDE', 'Kultureller Austausch', '', '', '', '', '', '', '', '', 47187),
(72116, 'deDE', 'Liskron der Blendende', '', '', '', '', '', '', '', '', 47187),
(72114, 'deDE', 'Acrosoth', '', '', '', '', '', '', '', '', 47187),
(72113, 'deDE', 'Gestalten hinter dem Schleier', '', '', '', '', '', '', '', '', 47187),
(72090, 'deDE', 'Primalistenpläne stören', '', '', '', '', '', '', '', '', 47187),
(72089, 'deDE', 'Zum Himmelhochobservatorium', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(72083, 'deDE', 'Mein Glücksköder', 'Findet Kapitän Haabs Glücksköder.', 'Ihr sucht mich in einer schweren Zeit auf, $R, und nicht, weil ich tot bin.\n\nIch bin auf der Jagd gestorben, um sicherzugehen, dass die Bestie, die meine Mannschaft getötet hat, nie wieder töten kann.\n\nNein, das Problem ist, dass der Kampf unentschieden ausging!\n\nDer Geist der Bestie ist immer noch da draußen, so sicher ich hier vor Euch stehe. Aber als Geist kann ich nicht einmal meinen Glücksköder von den Aasfressern zurückholen, die meine Knochen abgenagt haben, um es nochmal zu versuchen!\n\nWürdet Ihr mir helfen?', '', '', '', '', '', '', 47187),
(72079, 'deDE', 'Gemeinschaftliches Festmahl', '', '', '', '', '', '', '', '', 47187),
(72075, 'deDE', 'Heißes Lager', 'Sammelt Fische, um das Angelloch zu bestücken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische könnten etwas besser beißen, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach sind diese Lavaseen nicht immer voller hitzeliebender Fische. Angeblich wurden diese Becken mit Fischen bestückt, als die Drachen darüber segelten und sie fallen ließen! Könnt Ihr das glauben?\n\nVielleicht könntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(72072, 'deDE', 'Drachenquellensturz', 'Sammelt Fische, um das Angelloch zu bestücken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische könnten etwas besser beißen, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach waren diese Seen und Flüsse nicht immer voller Fische. Angeblich wurden diese Wasserlöcher mit Fischen bestückt, als die Drachen darüber segelten und sie fallen ließen! Könnt Ihr das glauben?\n\nVielleicht könntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(72071, 'deDE', 'Runde zwei, angelt!', 'Tötet Mochoby.', 'Was haltet Ihr von ein wenig Angeln, $n?\n\nGleich vor der Küste gibt es einen Schwarm Köderfische, der immer von dieser dummen Bestie angegriffen wird, sobald sie sich versammeln... Sie vergisst einfach, dass sie längst tot ist.\n\nSchwimmt raus und wedelt mit dem Köder, tut vielleicht, als wärt ihr eine verwundete Robbe, dann kann die Bestie nicht widerstehen.', '', 'Ein Schrecken der Tiefe.\n\nKapitän Haabs Jagd bedeutete das Ende für beide, aber nicht einmal der Tod konnte seine Rachsucht beenden.', 'Mochoby', '', '', '', 47187),
(72068, 'deDE', 'Unterstützung für das Abkommen: Ein Festmahl für alle', 'Reist nach Iskaara im Azurblauen Gebirge und nehmt an einem gemeinschaftlichen Festmahl teil. Führt Eure Bemühungen, dem Valdrakkenabkommen und seinen Verbündeten auf den ganzen Dracheninseln zu helfen, fort.', 'Unsere Verbündeten benötigen Hilfe, $n!\n\nEure Bemühungen auf den Inseln sind nicht unbemerkt geblieben. Unsere Vertrauten im Süden, die Tuskarr von Iskaara, möchten Eure Errungenschaften mit einem unübertroffenen Festmahl feiern!\n\nReist in das Land von Iskaara, während Ihr Eure Arbeit an der Seite der Mitglieder des Abkommens fortführt. Wenn Ihr die schimmernden Gewässer der Südlande erreicht, zögert nicht, Euch den Festlichkeiten anzuschließen!', '', '', '', '', '', '', 47187),
(72067, 'deDE', 'Zeit für Entspannung!', 'Geht zum Bad der Ruhigen Träume.', 'Ihr da!\n\nIhr seht erschöpft aus. Verbraucht. Als bräuchtet Ihr dringend etwas Ruhe und Erholung. Da habe ich genau das Richtige! Das Bad der Ruhigen Träume ist der Ort, den Ihr sucht!\n\nGenießt unsere neuen Yougakurse, die sind GROSSARTIG. Oder vielleicht habt Ihr eher Lust auf eine Schlammmaske als Gesichtsbehandlung? Ich empfehle beides.\n\nDas Bad liegt gleich nördlich der Stadt!', '', '', '', '', '', '', 47187),
(72063, 'deDE', 'Gebt Yennus Spielzeugboot zurück', 'Bringt das Spielzeugboot zu Yennu in der Nähe zurück.', 'Das ist Yennus Spielzeugboot. Er wird froh sein, es wiederzubekommen.', '', '', '', '', '', '', 47187),
(72061, 'deDE', 'Sturmruferin Veldra', '', '', '', '', '', '', '', '', 47187),
(72060, 'deDE', 'Sonderbehandlung', 'Bringt die Sonnenbrille zu Zeldis zurück. Noch einmal.', '<Die Schlammmaske scheint gespannt hinsichtlich Eurer Pläne, ist aber auf diesem Ast in die Enge getrieben.>', '', '', '', '', '', '', 47187),
(72052, 'deDE', 'Rubinlebensschrein-Schleife - Test', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
