(72019, 'deDE', 'Den Feind durchschauen: Nezascar', '', '', '', '', '', '', '', '', 47187),
(72008, 'deDE', 'Den Berg besiegen: Krolkoth', '', '', '', '', '', '', '', '', 47187),
(71242, 'deDE', 'Unterstützung für die Sturmforscher', 'Bringt das Bündel an Elementarüberfluss zu einem Forscher in Valdrakken.', 'Das sieht aus wie ein Bündel überschwellender Kraft von Kreaturen im Sturm der Primalisten.\n\nIn Valdrakken gibt es sicher einen Forscher, der sich dafür interessiert.', '', '', '', '', '', '', 47187),
(71241, 'deDE', 'Mit Enten auf Jagd', 'Stellt die Fallen des Klans Aylaag im Urzeitlichen Tal neu.', 'Das Urzeitliche Tal ist erfüllt von der Magie der alten Drachen. Eine dort lebende Slyvernart wird bei meinem Volk für ihr Fell geschätzt, aber sie ist scheu und schwer zu finden.\n\nAnstatt zu versuchen, sie aufzuspüren, könnt Ihr nach unseren Jagdfallen in der Gegend suchen. Nehmt Fleisch der hiesigen Wasservögel, um sie neu zu stellen. Ich werde dann einige Klanmitglieder aussenden, um den Fang einzusammeln.', '', '', '', '', '', '', 47187),
(71239, 'deDE', 'Im Himmel verloren', 'Findet Harleen Hohnzirper an den Blaufederklippen.', 'Ich brauche einen Gefallen, und Ihr seht aus wie jemand, der gerne Gefallen erledigt.\n\nEine alte Freundin von mir, Harleen Hohnzirper, sollte mich vor ein paar Tagen in der Stadt treffen. Wir wollten uns durch das Rubinfestmahl probieren, zum Frisör gehen und dann dieses schicke Auktionshaus besuchen, das es dort gibt.\n\nAber sie ist nicht gekommen. Sie verliert sich oft in ihrer Arbeit, aber ich würde mich besser fühlen, wenn ich wüsste, wo sie ist.\n\nVersucht es in den Bergen südlich von hier. Sie hat erwähnt, dass sie einen Abstecher dorthin machen will.', '', '', '', '', '', '', 47187),
(71238, 'deDE', 'Das Rubinfestmahl!', 'Sprecht mit den Köchen Rumiastrasza und Schnabuli beim Rubinfestmahl.', 'An alle aufstrebenden Kulinariker!\n\nStrebt Euer Herz nach den ultimativen Genüssen dieser Welt? Sucht Ihr nach Möglichkeiten für großartige Forschungen? Seid Ihr gewillt, Leib und Leben für vollkommen Fremde zu riskieren?\n\nDann sprecht mit dem unübertroffenen, angesehenen, weltberühmten Kochduo Rumiastrasza und Schnabuli! Zurzeit veranstalten sie das Rubinfestmahl in Valdrakken!', '', '', '', '', '', '', 47187),
(71235, 'deDE', 'Feldmagier', 'Seht nach den Magiern der Kirin Tor in der Nähe von Slyvernsturz im Azurblauen Gebirge.', 'Lok\'tar, $R.\n\nWenn Ihr Zeit habt, gibt es zwei Magier in der Nähe, die sicher Hilfe bei der Feldarbeit brauchen könnten.\n\nDieses Land ist in seinen besten Zeiten sehr gefährlich.\n\nUnd es sind nicht gerade die besten Zeiten.', '', '', '', '', '', '', 47187),
(71234, 'deDE', 'Neuigkeiten in jedem Winkel', 'Besucht den Walfängerwinkel im Azurblauen Gebirge.', 'Ihr da, $R.\n\nIhr seht weit gereist aus.\n\nMein Cousin Wayun hat einen Fang vom Walfängerwinkel mitgebracht und... merkwürdige Zeitgenossen erwähnt, die da ihr Lager aufgeschlagen haben.\n\nSie scheinen sich zu benehmen, aber würdet ihr nach Wayun sehen?\n\nEr ist schnell eingeschnappt.', '', '', '', '', '', '', 47187),
(71233, 'deDE', 'Fallendes Wasser', 'Sprecht mit Willa am Dreifällerundblick im Azurblauen Gebirge.', 'Ich liebe Wasserfälle.\n\nWollt Ihr wissen, was besser ist als ein Wasserfall?\n\nZwei Wasserfälle!\n\nUnd das Einzige, was noch besser ist, als das... seht Euch Dreifälle im Westen an, dann erfahrt Ihr es!\n\nDie Gastwirtin dort ist ganz nett.', '', '', '', '', '', '', 47187),
(71232, 'deDE', 'Ruhm der Dracheninseln', 'Sprecht mit Therazal innerhalb von Valdrakken.', 'Es gibt nach wie vor vieles, das getan werden muss, um den Dracheninseln zu helfen.\n\nIch würde Euch darum bitten, mit Therazal zu sprechen. Er hat viele Informationen dazu, wer in diesen Landen Hilfe braucht.', '', '', '', '', '', 'Sprecht mit Therazal innerhalb von Valdrakken.', 47187),
(71231, 'deDE', 'Ruf der Jagd', 'Sprecht mit Trainer Frodrum auf den Ebenen von Ohn\'ahra.', '<Roki drückt Euch eine Nachricht in die Hand.>\n\n$n, Klan Shikaar lädt Euch zur großen Jagd ein. Trefft Trainer Frodrum auf den Ebenen von Ohn\'ahra.', '', '', '', '', '', '', 47187),
(71230, 'deDE', 'Angelausrüstung der Tuskarr', 'Sprecht mit Tavio bei Iskaara im Azurblauen Gebirge.', 'Hallo noch mal, $n.\n\n<Rowie sieht sich um und summt ein Lied.>\n\nOh, stimmt! Tavio hat mir ein neues Netz gemacht und gesagt, sie könnte Euch auch eines machen. Sie kann auch andere Angelausrüstung machen, wenn Ihr das ganze Zeug zu ihr bringt.\n\nIhr solltet mit ihr reden.', '', '', '', '', '', '', 47187),
(71229, 'deDE', 'Ruf der Ebenen', 'Sprecht mit Hadari Khan auf den Ebenen von Ohn\'ahra.', '<Roki drückt Euch eine Nachricht in die Hand.>\n\n$n, Klan Aylaag hat Geschichten von Euren großen Taten gehört. Wir laden Euch ein, unseren Klan zu treffen und unsere Wege zu erfahren.\n\nHadari Khan', '', '', '', '', '', '', 47187),
(71227, 'deDE', 'Luftige Herausforderungen', 'Sprecht mit einem Bronzezeithüter, um mehr über die luftigen Herausforderungen zu erfahren.', '<Flatter flattert aufgeregt mit den Flügeln und lässt eine Nachricht und ein angesengtes Nagetier vor Eure Füße fallen.>\n\n$gDrachenreiter:Drachenreiterin;! Euer Heldenmut ist weithin bekannt. Beweist Euch in luftigen Herausforderungen überall auf den Dracheninseln.\n\nSprecht mit einem Bronzezeithüter, um anzufangen.', '', '', '', '', '', '', 47187),
(71226, 'deDE', 'Tötet Steinschnecken', 'Tötet $1oa Hasen der Verdammnis auf dem Übungsplatz.', 'Hilfe! Diese Hasen verschlingen mein Fleisch! Bitte, tötet sie, bevor sie uns alle töten!', '', '', '', '', '', '', 47187),
(71219, 'deDE', 'Wegbehüter auf Abwegen', 'Findet Wegbehüterin Alvi.', 'Scheinbar haben einige der jüngeren Wegbehüter in letzter Zeit ihre Pflicht vernachlässigt. \n\nWegbehüterin Nori hat mich gebeten, nach ihrer jüngeren Schwester Alvi zu sehen, die an der Mündung des Zeitenflusses stationiert ist. Ihre Leistung war in letzter Zeit wohl ungenügend.\n\nWenn Ihr nach Osten reist und zufällig auf Wegbehüterin Alvi trefft, erinnert sie bitte daran, wie wichtig ihre Position ist und dass ihre Schwester sich Sorgen um sie macht.', '', '', '', '', '', '', 47187),
(71212, 'deDE', 'Angriff auf die Brackenfelle', '', '', '', '', '', '', '', '', 47187),
(71210, 'deDE', 'Zur Drachenfluchfestung!', 'Reist an die Küste des Erwachens und schließt Euch den Obsidianausgestoßenen bei der Belagerung der Drachenfluchfestung an.', '<Flatter lässt eine leicht angesengte Notiz in Eure Hand fallen.>\n\n$n, die Obsidianausgestoßenen haben Geschichten über Euren Mut gehört. Unsere frühere Heimat, die Drachenfluchfestung, ist in die Hände der Djaradin gefallen. Wir können das nicht auf uns sitzen lassen. Helft uns, unser Land zurückzuerobern.\n\nBoss', '', '', '', '', '', '', 47187),
(71209, 'deDE', 'Wildtier der Ebenen', 'Nehmt Lizis Zügel an.', 'Ich glaube, Lizi ist bereit, wieder zu einem Wildtier der Ebenen zu werden. Sie ist Euch und mir gegenüber so zahm geworden, aber ich kann ihr ansehen, dass sie zurück in die Wildnis will.\n\nEines Tages, wenn ich eine Windweise bin, werde ich die ganze Welt jenseits dieser Quellen erkunden. Aber erst stehen meine Halbjahresprüfungen für Initianden an! Wie die Zeit vergeht.\n\nIch habe Sattel und Zaumzeug aus der Wolle hergestellt, die Ihr gesammelt habt. Lizi kommt sicher gern, wann immer Ihr sie ruft.\n\nBitte nehmt sie auf vielen Abenteuern mit, $p.', '', '', '', '', '', '', 47187),
(71205, 'deDE', 'Wassertuskarr', '', '', '', '', '', '', '', '', 47187),
(71202, 'deDE', 'Winziger Manageistnahkämpfer', 'Besiegt Arkantus in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71199, 'deDE', 'Donnerrückgrat zähmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71198, 'deDE', 'Donnerrückgrat zähmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71197, 'deDE', 'Donnerrückgrat zähmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(71196, 'deDE', 'Donnerrückgrat zähmen leicht gemacht', 'Sammelt $1oa Portionen fluoreszierende Flüssigkeit von Insekten auf den Dracheninseln sowie $2oa Vorräte der Dracheninseln.', 'Ich bin so froh, dass Lizi bei uns in Sicherheit ist.\n\nLeider heilen ihre Wunden aber langsamer als gedacht. Ich hoffe nur, die Magie, der sie ausgesetzt war, hat keine bleibenden Schäden hinterlassen.\n\nKönntet Ihr mir wohl helfen, Insektensekret zu sammeln? Ich weiß, es klingt unappetitlich, aber es ist die Basis von vielen Heilsalben.', '', '', '', '', '', '', 47187),
(71195, 'deDE', 'Donnerrückgrat zähmen leicht gemacht', 'Holt Meluuns grünes Curry in den Quellen von Ohn\'iri und $2oa Vorräte der Dracheninseln.', 'Ich schätze, das hier ist Lizis neuer Lieblingsplatz. Sie wollte nicht wirklich wieder heimkommen. Immerhin ist sie ein wildes Tier.\n\nIch muss zugeben... ich habe nicht mehr mit Meluun gesprochen, seit wir Lizi gerettet haben. Ich sehe ja ein, dass sie recht hatte, aber ich weiß nicht, wie ich mit ihr sprechen soll. Ich kann es ihr einfach nicht recht machen. Ich weiß, dass ich mich mehr um meine Ausbildung kümmern muss.\n\nMeluun macht ein Curry zum Dahinschmelzen, das Lizi bestimmt lieben würde. Könntet Ihr sie wohl danach fragen? Sie arbeitet normalerweise in ihrem Haus westlich der Quellen.', '', '', '', '', '', '', 47187),
(71194, 'deDE', 'Frösche des Feuers', 'Bringt ein paar Hornstacheln bei, Eiszapfengebräu zu vermeiden.', 'Ich habe den perfekten Ort gefunden für ein Fischernetz. Ein Problem bekümmert mich jedoch... diese Hornstachel. Ich bin mir ziemlich sicher, dass sie die Netze zerreißen werden, sobald sie ungestört sind. Was sollen wir tun?\n\nIch habe eine Idee. Wir behandeln unsere Lavafischnetze mit Eiszapfengebräu, um sie hitzeresistent zu machen. Wir müssen den Hornstacheln nur zu verstehen geben, sich von dem Geruch fernzuhalten.\n\nWerft ein Fläschchen Eiszapfengebräu auf einen Hornstachel und fügt ihm dann Schaden zu. Stellt nur sicher, dass Ihr sie nicht tötet. Sie können nicht lernen, wenn sie tot sind, oder?', '', '', '', '', '', '', 47187),
(71193, 'deDE', 'Unterwasserbedrohung', 'Verwendet 5 ominöse Muscheln am Angelloch von Tyrhold, um eine riesige Unterwasserbestie anzulocken, und nehmt einen Beweis ihres Ablebens mit.', 'Habt Ihr das gesehen? Unter Wasser! Ein riesiges, gepanzertes, hungriges Ungeheuer! Auf keinen Fall gehe ich mit meinem Netz an das Wasser, während so eine Monstrosität da lauert. Wenn Ihr wollt, könnt Ihr sie mit einer Handvoll ominöser Muscheln hervorlocken, die sollten nicht zu schwer zu fangen sein.', '', '', '', '', '', '', 47187),
(71192, 'deDE', 'Raubtierkontrolle', 'Stellt die furchteinflößenden Bildnisse auf.', 'Seid gegrüßt.\n\nIch habe nach einem geeigneten Platz gesucht, um ein paar Fischernetze auszulegen, aber die Watschlerbevölkerung in dieser Gegend ist zu dicht... sie fressen die meisten kleinen Fische auf, bevor sie überhaupt erst dazu kommen, heranzuwachsen.\n\nIch habe ein paar Bildnisse gemacht, um zumindest ein paar dieser gefräßigen Vögel zu verscheuchen. Das wird uns dabei helfen, die üppigen Fischgründe der Drachenquellen zu erhalten.\n\nKönnt Ihr mir dabei helfen, sie aufzustellen?', '', '', '', '', '', '', 47187),
(71191, 'deDE', 'Gut vernetzt', 'Findet das Netz des bärbeißigen Fischers in den Eislöchern im Azurblauen Gebirge.', 'Oh je, mein Fischernetz wurde von der Strömung davongetragen. <Seufz> Ich nutze nicht gerne Angelruten, wie meine Freunde...\nWenn Ihr zufällig mein Fischernetz irgendwo findet, bringt es doch bitte zurück.', '', '', '', '', '', '', 47187),
(71182, 'deDE', 'Archivare auf Abwegen', 'Trefft Sindragosa im oberen Archiv der Azurarchive.', 'Ihr da, Dracthyr.\n\nZwei von Eurer Art haben die Archive südlich von hier durchsucht. Ich habe mich ihnen noch nicht vorgestellt und wüsste Eure Gesellschaft zu schätzen.\n\nFalls Ihr Zeit habt, können wir uns im oberen Archiv treffen.', '', '', '', '', '', '', 47187),
(71179, 'deDE', 'Blick zum Rundblick', 'Sprecht mit Kommandant Thadezus am Rundblick der Gelikyr.', '$n, ich habe eine neue Aufgabe für Euch.\n\nEs gibt Berichte von Primalistenaktivitäten in der Nähe des Postens der Gelikyr, die unsere Kontrolle über Tyrhold gefährden.\n\nSprecht mit Kommandant Thadezus und seht zu, wie Ihr helfen könnt.', '', '', '', '', '', 'Sprecht mit Kommandant Thadezus am Rundblick der Gelikyr.', 47187),
(71178, 'deDE', 'Portal: Schattenzuflucht', 'Findet das inaktive Portal bei der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Unsere Expedition berichtet von einem inaktiven Stein bei den üppigen Hängen im Südwesten. Es ist ein gutes Stück entfernt, aber es lohnt sich, jemanden mit Eurer Kenntnis für die Untersuchung dort hinzuschicken.', '', '', '', '', '', '', 47187),
(71166, 'deDE', 'Die älteste Libelle', 'Besiegt Flunk in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71165, 'deDE', 'Portal: Grenze des Äons', 'Findet das inaktive Portal an der Grenze des Äons in Thaldraszus.', 'In weiter Ferne, in den Bergregionen von Thaldraszus gibt es ein kleines Gasthaus, das dort am Berghang steht. Gleich hinter dem Eingang liegt ein längst vergessener, inaktiver Stein.\n\nWas meint Ihr? Lust auf ein neues Abenteuer, $n?', '', '', '', '', '', '', 47187),
(71162, 'deDE', 'Portal: Algeth\'era', 'Findet das inaktive Portal auf dem Turm in Algeth\'era in Thaldraszus.', 'Neuer Stein, neuer Turm.\n\nAm besten macht Ihr Euch auf den Weg. Das wird eine ordentliche Wanderung und gefährlich noch dazu! Zumindest, wenn man ihren Entdeckern glauben kann.\n\nSeid Ihr bereit?', '', '', '', '', '', '', 47187),
(71161, 'deDE', 'Portal: Vakthros', 'Findet das inaktive Portal auf dem Turm in Vakthros im Azurblauen Gebirge.', 'Wir haben einen Bericht von einem weiteren der inaktiven Steine in der winterlichen Region im Südosten erhalten.\n\nBevor Ihr jetzt ganz aufgeregt werdet, solltet Ihr wissen, dass nicht viele freiwillig da hingehen würden, aber wenn Ihr Lust auf ein möglicherweise tödliches Abenteuer habt, ist es genau das Richtige!\n\nSeid Ihr schon überzeugt? Gut!\n\nWerft Euch in Eure wärmsten Klamotten. Geht anschließend nach Osten, bis der kalte Wind Euch an der Nase kitzelt, und geht dann immer weiter. Ihr werdet wissen, dass Ihr in der Nähe seid, wenn Euer Atem steif und Eure Knochen kalt werden.', '', '', '', '', '', '', 47187),
(71157, 'deDE', 'Portal: Himmelhochobservatorium', 'Findet das inaktive Portal am Himmelhochobservatorium an der Küste des Erwachens.', 'Einige unserer Entdecker aus dem Norden berichten, dass sich ein weiterer dieser Steine hoch oben auf dem Turm im Nordosten befindet.\n\nIch hab gehört, dass es ziemlich schwierig ist, da oben ranzukommen, aber ich wette, dass Ihr einen Weg findet!', '', '', '', '', '', '', 47187),
(71155, 'deDE', 'Das Azurblaue Gewölbe', 'Haltet die Splitterflammen im Azurblauen Gewölbe auf.', 'Wir haben ein Problem, $n.\n\nUnter den Azurarchiven ruht das Azurblaue Gewölbe. Ich habe im Laufe meines Lebens so manche wichtige und gefährliche magische Kuriosität darin eingelagert.\n\nJetzt ist eine große Gruppe von Splitterflammen ins Gewölbe eingebrochen, in der festen Überzeugung, dass es wertvolle Geheimnisse birgt.\n\nBitte, Ihr müsst hineingehen und diesen törichten Überfall aufhalten, sonst entfesseln sie Gefahren, die sie nicht begreifen können.\n\nDiese Diebe ahnen nicht, was im Gewölbe lauert.', '', '', '', '', '', '', 47187),
(71153, 'deDE', 'Weltquests, Bonusziele und Szenarien, oje', 'Schließt 3 Weltquests der Tortollaner ab.', 'Unterstützt die Tortollaner, indem Ihr 3 Weltquests abschließt.', '', '', '', '', '', 'Kehrt zu Sammler Kojo zurück.', 47187),
(71152, 'deDE', 'Zurück zur Haupthalle', 'Trefft Euch mit Toddy in der Haupthalle.', 'Nun, da wir auf die Überbrückungskonsolen zugegriffen haben, sollten wir an dieser Barriere vorbeikommen.\n\nTrefft mich in der Haupthalle, dann erledigen wir das!', '', '', '', '', '', '', 47187),
(71151, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Der Brief ist sauber, unzerknittert und trägt das Siegel der Drachenschuppenexpedition.\n\nThaelin Schwarzamboss verlangt Eure Anwesenheit.>', '', '', '', '', '', '', 47187),
(71150, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Das Pergament verströmt einen unangenehmen, schimmligen Geruch. Nachdem Ihr Euch gesammelt habt wird Euch klar, dass Thaelin Eure Unterstützung auf der Suche nach Antworten zu seinen jüngsten Funden braucht.\n\nIhr fragt Euch nur, was Ihr nun mit dem unerträglich stinkenden Pergament machen sollt.>', '', '', '', '', '', '', 47187),
(71149, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Überaschenderweise hat der Bote Euch diesmal weder ein Säckchen noch eine Notiz gebracht, sondern einen Gegenstand aus Thaelins persönlicher Sammlung.\n\nBei genauerer Betrachtung findet Ihr dennoch eine Nachricht von Thaelin, der einmal mehr um Eure Unterstützung bittet.>', '', '', '', '', '', '', 47187),
(71148, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Das merkwürdige Tierchen vor Euch hält Euch eine Notiz entgegen, gezeichnet und gesiegelt von der Drachenschuppenexpedition.\n\nVielleicht ein Hilferuf von einem berühmten Forscher.>', '', '', '', '', '', '', 47187),
(71146, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Der Forscher-in-Ausbildung gibt Euch eine zusammengerollte Notiz. Sie scheint von einem alten Freund zu stammen, Thaelin Schwarzamboss, der Euch um Hilfe bittet.\n\nBevor es davonhuscht, streckt das kleine Tier Euch eine Hand entgegen, als würde es um eine Belohnung bitten. Kurz darauf ertönt ein schriller Schrei, als die seltsame Kreatur mit leeren Händen davonprescht.>', '', '', '', '', '', '', 47187),
(71145, 'deDE', 'Der Großmeister', 'Besiegt Flicki in einem Haustierkampf', '', '', '', '', '', '', '', 47187),
(71144, 'deDE', 'Allianzschlächter', 'Während ein Kopfgeld auf Euch ausgesetzt ist, tötet 10 Mitglieder der Allianz, ohne zu sterben.', 'Ja! Weiter so, tötet diese Allianztölen!\n\nWenn Ihr noch ein paar Allianzler tötet, könntet Ihr einen neuen Rekord aufstellen, $C.\n\nAber das wird nicht leicht, denn die Allianz hat einen Preis auf Euren Kopf ausgesetzt! Passt auf Euch auf!\n\nFür die Horde!', '', '', '', '', '', '', 47187),
(71143, 'deDE', 'Hordenschlächter', 'Während Ihr von der Horde gejagt werdet, tötet 10 ihrer Mitglieder, ohne zu sterben.', 'Toll! Immer weiter so, $gSoldat:Soldatin;!\n\nTötet ein paar mehr von der Horde, dann werdet Ihr in die Geschichtsbücher der Allianz eingehen.\n\nAber das wird nicht ganz leicht. Die Horde hat ein Kopfgeld auf Euch ausgesetzt, also seid vorsichtig!\n\nFür die Allianz!', '', '', '', '', '', '', 47187),
(71141, 'deDE', 'Krasse Kiemen', 'Tötet Gurblbrblr den Eindringling am Klippensturzlager.', 'Kad\'irsza ist leichtsinnig, aber sie kennt ihre Krabben. Die Gorlocs sind zu weit gegangen!\n\nIch habe bemerkt, dass die Gorlocs für alles zu Gurblbrblr gehen. Vor allem erklärt er ihnen, wie man Krabben fängt. Das darf nicht so weitergehen, weder für das Gleichgewicht des Lebens noch für die Sicherheit derjenigen, die es pflegen.\n\nBesiegt Gurblbrblr. Nehmt ihnen die Möglichkeit, sich jenseits dies Flusses auszubreiten!', '', 'Gorlocs von beängstigender Größe? Dieser hier ist zumindest real.', 'Gurblbrblr der Eindringling', '', '', '', 47187),
(71140, 'deDE', 'Zwei und zwei zusammen', 'Besiegt Bakhushek in einem Haustierkampf.', '', '', '', '', '', '', '', 47187),
(71139, 'deDE', 'Leuchtendes arkanes Juwel', 'Bringt das leuchtende arkane Juwel zu Noriko der Allererinnernden im Lager Antonidas.', '<Dieses Juwel scheint sehr mächtig zu sein. Es verströmt ein unheimliches Licht.\n\nVielleicht wäre es das Beste, es den Kirin Tor zu bringen, damit es sicher verwahrt werden kann.>', '', '', '', '', '', 'Bringt das leuchtende arkane Juwel zu Noriko der Allererinnernden im Lager Antonidas.', 47187),
(71138, 'deDE', 'Portal: Rusza\'thar-Vorstoß', 'Findet das inaktive Portal beim Rusza\'thar-Vorstoß auf den Ebenen von Ohn\'ahra.', 'Ein Expeditionsmitglied hat berichtet, dass auf einem Ausguck auf den Ebenen von Ohn\'ahra ein inaktiver Stein gesichtet wurde.\n\nBereit für ein Abenteuer?', '', '', '', '', '', '', 47187),
(71135, 'deDE', 'Ungeklärte Angelegenheiten', 'Stellt Frostbiss am Schneebalglager im Azurblauen Gebirge.', 'Wenn ich eines von meiner Zeit in der Wildnis gelernt habe, dann dies: Wenn man sich nicht um das Böse kümmert, wenn man es findet, und wenn man nicht seine Knochen bricht und seine Wurzeln ausreißt, dann wächst es nur weiter. Und dann wird es nur schwerer zu töten.\n\nDiese Berge leiden schon unter Frostbiss\' Existenz, seit ich ein kleiner Welpe war wie Ihr. Und es wird nur schlimmer werden, wenn er die volle Kontrolle über den Schneebalgstamm erringt.\n\nIch hätte vor langer Zeit etwas gegen ihn unternehmen müssen, und nun sind wir die Einzigen, die diesen Fehler wiedergutmachen können.', '', 'Setzen wir Frostbiss\' grausamer Herrschaft ein Ende.', 'Frostbiss', '', '', '', 47187),
(71097, 'deDE', 'Eine helfende Klaue', 'Aktiviert das Artefakt im Turm über dem Kobaltkonvent und beobachtet Venderthvans Handlungen.', 'Also gut, Ihr habt das Artefakt aufgeladen. Dann aktiviert es...\n\n...und hört auf, mich so anzusehen. Tut nicht so, als wärt Ihr nicht neugierig, ob es funktioniert.\n\nSchüttelt es noch einmal, entfernt Euch langsam und lasst es mich zu Ende bringen.', '', '', '', '', '', '', 47187),
(71096, 'deDE', 'Eine Klaue zweifellos', 'Versucht, das Artefakt zu aktivieren.', '<Venderthvan reibt sich die Augen und stöhnt vor Schmerzen.>\n\nNa gut. Wenn Ihr es mit nicht gebt, könnt Ihr selbst herausfinden, wie es funktioniert.\n\nIch werde es Euch abnehmen, wenn Ihr fertig seid. Mit Gewalt, wenn es sein muss.\n\nAlso nur zu. Schüttelt es oder so.', '', '', '', '', '', '', 47187),
(71095, 'deDE', 'Eine Klaue in Not', 'Fragt Venderthvan, wie Ihr ihm helfen könnt, und tut, was er sagt.', 'Mal sehen, wie wir diesem Kerl helfen können!\n\n<Heleth lehnt sich zu Euch vor und flüstert.>\n\nKeine Sorge, wir werden ihn nichts klauen lassen oder so. Lasst uns nur etwas Spaß haben!\n\nEs ist ewig her, dass jemand hergekommen ist, um nach uns zu sehen. Uns ist SO langweilig!\n\n<Heleth zwinkert Euch zu.>\n\nWarum fragt Ihr ihn nicht, was er will?', '', '', '', '', '', '', 47187),
(71094, 'deDE', 'Helfen ist unser Weg!', 'Findet Verbände im Turm über dem Kobaltkonvent, um Venderthvan zu heilen.', 'Hallöchen!\n\nSeid Ihr auch hier, um zu helfen? Ihr seht sehr hilfreich aus!\n\n<Heleth deutet auf den verletzten Dracthyr.>\n\nDer da drüben hat sich beim Versuch, hier hochzufliegen den Flügel verletzt! Er sieht aus wie einer von den Bösen von da unten, aber ich habe keine Angst vor ihm! Ich werde ihm so oder so helfen, weil wir das nun mal so machen!\n\n<Heleth strafft die Schultern.>\n\nIch werde auf ihn aufpassen, während Ihr ein paar Verbände sucht!', '', '', '', '', '', '', 47187),
(71093, 'deDE', 'Vermächtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman: Vermächtnis von Tyr im Ödland und bergt die Scheibe.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, müssen wir die Macht der Aspekte wiederherstellen.\n\nUnglücklicherweise sind die Titanen mit anderen Dingen beschäftigt und Hüter Tyr ist schon lange tot.\n\nKönigin Alexstrasza hat jedoch einen Plan vorgebracht. In den Tiefen des Ödlands liegt eine Titanenanlage namens Uldaman. Anscheinend haben Verbündete Tyrs dort eine Scheibe mit seinen Erinnerungen versteckt.\n\nJedoch wurde diese Anlage angeblich von Troggs überrannt. Sammelt Eure Verbündeten und begebt Euch nach Uldaman. Beschlagnahmt die Scheibe im Namen der Drachenkönigin!', '', '', '', '', '', '', 47187),
(71091, 'deDE', 'Die höchste Ehre', '', '', '', '', '', '', '', '', 47187),
(71090, 'deDE', 'Von Herzen für die Herzen', '', '', '', '', '', '', '', '', 47187),
(71089, 'deDE', 'Auf zum Horn', '', '', '', '', '', '', '', '', 47187),
(71085, 'deDE', 'Repräsentation zählt', '', '', '', '', '', '', '', '', 47187),
(71083, 'deDE', 'Ein erwartetes unerwartetes Geschenk', '', '', '', '', '', '', '', '', 47187),
(71079, 'deDE', 'Kommt zum Punkt', '', '', '', '', '', '', '', '', 47187),
(71075, 'deDE', 'Ihre Anmut verstehen', '', '', '', '', '', '', '', '', 47187),
(71074, 'deDE', 'Freunde mit Wind und Schwingen', '', '', '', '', '', '', '', '', 47187),
