(71030, 'deDE', 'Jagdtaktiken: Mentorschaft der Shikaar', '', '', '', '', '', '', '', '', 47187),
(71029, 'deDE', 'Jagdtaktiken: Begleiterausbildung', 'Wählt eine zusätzliche Begleiterfähigkeit für die große Jagd.', 'Euer Ruhm unter den Maruuk wächst weiter. Für Eure Mühen werde ich Euch beibringen, wie Ihr Euren Jagdbegleiter im Kampf effektiver einsetzen könnt.', '', '', '', '', '', '', 47187),
(71028, 'deDE', 'Jagdtaktiken: Segen von Ohn\'ahra', 'Wählt einen Segen von Ohn\'ahra für die große Jagd.', 'Euer Ruhm unter den Maruuk wächst. Hört gut zu, dann bringe ich Euch bei, wie Ihr einen Segen von Ohn\'ahra herbeiruft, um Euch und Eure Verbündeten zu schützen.', '', '', '', '', '', '', 47187),
(71027, 'deDE', 'GESUCHT: Mara\'nar der Donnernde', 'Tötet Mara\'nar den Donnernden im Urzeitlichen Tal und erbeutet eine seiner Panzerplatten.', 'Ich bin auf der Suche nach einem mächtigen Jäger, um eine wütende Bestie zur Strecke zu bringen!\n\nEine Donnerechse namens Mara\'nar der Donnernde hat sich ihren Weg vom Donnerrückgratdickicht bis zum Urzeitlichen Tal gebahnt und stört die örtliche Tierwelt. Sie hat Wasser elektrisiert, Bäume niedergerissen und Entennester zerstört.\n\nDiese Geißel muss aufgehalten werden. Erledigt sie und bringt eine ihrer Panzerplatten zu Khanswache Jebotai als Beweis.\n\nMöge Ohn\'ahra Euch leiten.', '', 'Diese Bestie bringt die örtliche Tierwelt im Urzeitlichen Tal durcheinander, aber bald hat sie ihr letztes Entennest zerstört.', 'Mara\'nar der Donnernde', '', '', '', 47187),
(71026, 'deDE', 'Entgegen aller Wahrscheinlichkeit', 'Tötet 25 Hordemitglieder der Stufe 70 auf den Dracheninseln.', 'Obwohl Ihr mickrigen Sterblichen einen Waffenstillstand geschlossen habt, habe ich Gerüchte gehört, dass einige von Euch sehr nachtragen sind.\n\nWenn Ihr ein paar Freunde versammelt, kann ich Euch einen Ort zeigen, an dem Ihr der anderen Seite beweisen könnt, wer wirklich überlegen ist.\n\nUnd um es spannender zu machen, habe ich einen Preis für Euch, solltet Ihr gewinnen.', '', '', '', '', '', '', 47187),
(71024, 'deDE', 'Chaos und Aufruhr', 'Helft Erima, den Zwischenfall im unteren Stockwerk des Sitzes der Aspekte zu untersuchen.', '$n! Habt Ihr das gehört? Da ist etwas im unteren Stockwerk passiert.\n\nEiner meiner vertrauten Ermittler, Erima, war als erstes dort. Er braucht Eure Hilfe beim Sammeln der Beweise, während er versucht, die Schaulustigen zu befragen.', '', '', '', '', '', '', 47187),
(71023, 'deDE', 'Angesehen beim Valdrakkenabkommen', 'Sprecht mit Unatos in Valdrakken.', 'Eure Taten entsprechen Eurem sagenhaften Ruf, den Ihr vor Eurer Ankunft auf den Dracheninseln erlangt habt.\n\nIch möchte Euch unterstützen, indem ich Euch mit weiteren Vorräten versorge. Sucht mich in Valdrakken auf.', '', '', '', '', '', '', 47187),
(71022, 'deDE', 'Wider den Widder', 'Befehlt Taivan, sich dem störrischen Widder der Herde zu stellen.', 'Die Riesenwildschafe scheinen schon mal wenig Respekt vor Taivan zu haben. Wir sollten als Nächstes probieren, ob er mit dem Widder der Herde zurechtkommt.\n\nDer Widder ist Chef aller Riesenwildschafe hier und ein ziemlich sturer Kerl. Wenn Taivan seine Dominanz über den Widder behaupten kann, wird die Herde ihm gehorchen.\n\nIhr findet ihn dort auf dem Hügel. Viel Glück, Taivan. Ich fürchte, wenn auch das nicht klappt, bleibt wenig Hoffnung, dass Taivan es noch zum Hirtenbakar schafft.', '', '', '', '', '', '', 47187),
(71020, 'deDE', 'Gewölbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Großstabs von Bruthüterin Diurna im Gewölbe der Inkarnationen auf mythischem Schwierigkeitsgrad.', 'Bruthüterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewölbe überwacht. Wenn Ihr Teile ihres Großstabes erbeuten könnt, sollten wir ihren Bau damit direkt angreifen können.\n\nDrei sollten reichen. Vier könnten zu viel sein.', '', '', '', '', '', '', 47187),
(71019, 'deDE', 'Gewölbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Großstabs von Bruthüterin Diurna im Gewölbe der Inkarnationen auf heroischem Schwierigkeitsgrad.', 'Bruthüterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewölbe überwacht. Wenn Ihr Teile ihres Großstabes erbeuten könnt, sollten wir ihren Bau damit direkt angreifen können.\n\nDrei sollten reichen. Vier könnten zu viel sein.', '', '', '', '', '', '', 47187),
(71018, 'deDE', 'Gewölbe der Inkarnationen: Knackt ein paar Eier', 'Sammelt 3 Splitter des Großstabs von Bruthüterin Diurna im Gewölbe der Inkarnationen auf normalem Schwierigkeitsgrad.', 'Bruthüterin Diurna ist irgendwo in dieser Festung, wo sie von ihrer Kammer aus zweifellos das Gewölbe überwacht. Wenn Ihr Teile ihres Großstabes erbeuten könnt, sollten wir ihren Bau damit direkt angreifen können.\n\nDrei sollten reichen. Vier könnten zu viel sein.', '', '', '', '', '', '', 47187),
(71017, 'deDE', 'Nalukis Brief', 'Bringt Nalukis Fischkopf zum alten Grimmhauer.', 'Lasst mich raten: Grimm hat Euch verboten, den Brief zu öffnen?\n\nAnscheinend habt Ihr Euch daran gehalten. Kein Wunder, dass er Euch so sehr vertraut!\n\nGebt ihm diesen Fischkopf von mir. Er weiß, was das bedeutet.', '', '', '', '', '', 'Bringt Nalukis Fischkopf zu Grimmhauer.', 47187),
(71016, 'deDE', 'Grimmhauers Schwester', 'Überbringt Grimmhauers Brief seiner Schwester Naluki in Iskaara.', 'Zuletzt kommt meine Schwester Naluki. Sie hilft im Gasthaus in Iskaara aus.\n\nGebt ihr einfach diesen Brief.\n\nÖffnet ihn nicht.', '', '', '', '', '', 'Überbringt Grimmhauers Brief seiner Schwester Naluki in Iskaara.', 47187),
(71015, 'deDE', 'Nur Muskeln, kein Gehirn', 'Find Varsek im Uralten Aussichtspunkt.', 'Varsek ist einer der zähesten Drakoniden, die Ihr je gesehen habt. Aber auch einer der dümmsten, auch wenn er das nie zugeben würde.\n\nDie Sache mit Frostbiss hat ihn erschreckt und er hat sein Leben überdacht... oder so. Er sagte, er wäre nie dazu gekommen, die Ruinen seiner Vorfahren zu studieren. Ist davongelaufen, um ein \"Gelehrter\" zu werden.\n\nHolt Varsek zurück. Er gehört da sowieso nicht hin!', '', '', '', '', '', 'Find Varsek im Uralten Aussichtspunkt.', 47187),
(71014, 'deDE', 'Ein entfernter Furbolgfreund', 'Findet Barst auf der Langklaueninsel.', 'Barst war einer der härtesten Furbolgs, die ich je kannte. Es sagt viel über Frostbiss aus, dass seine Meute ihn im Kampf besiegt hat.\n\nAls ich zuletzt von Barst gehört habe, war er auf dem Weg zu einer Insel vor der Küste von Iskaara. Er hat etwas von \"Ruhestand\" und lauter so Unsinn gefaselt.\n\nSagt Barst, dass es an der Zeit ist, sich wieder an die Arbeit zu machen.\n\nOh, und lasst Euch nicht von seiner Sprechweise irritieren. Er reißt Euch entzwei, wenn Ihr ihn nur komisch anseht.', '', '', '', '', '', 'Findet Barst auf der Langklaueninsel.', 47187),
(71013, 'deDE', 'Keine Rache auf leeren Magen', 'Angelt $2oa gefrorene Schwanzflitzer in Grimmhauers Unterschlupf.', 'Da wir wieder beim Thema sind, müssen wir Stoßzahn zu Stoßzahn reden. Dieser Gnoll, Frostbiss? Mit dem Ihr geredet habt?\n\nWir haben eine Vorgeschichte mit ihm.\n\nEs könnte eine Weile dauern, es zu erklären. Geht und holt etwas Fisch, während ich es Euch erzähle, Kind. Wir brauchen Essen für alle. Sie müssen gestärkt sein für das, was kommt.', '', '', '', '', '', '', 47187),
(71012, 'deDE', 'Varsek rekrutiert', 'Berichtet Grimmhauer, dass Ihr Varsek rekrutiert habt.', 'Ich schätze, ich werde die Rätsel dieses Ortes in Zukunft problemlos lösen können.\n\nLasst uns einfach nicht mit dem alten Grimmhauer hierüber sprechen, in Ordnung?\n\nIch werde mich auf den Weg zum Unterschlupf machen. Ich glaube, ich kann es jetzt vertragen, etwas angestauten Frust an Frostbiss auszulassen.', '', '', '', '', '', 'Kehrt zu Grimmhauer zurück.', 47187),
(71011, 'deDE', 'Gesucht: Reißende Lilie', 'Findet die reißende Lilie.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten demütig alle Expeditionsteilnehmer, nach der reißenden Lilie für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie beim Rundblick der Gelikyr in Thaldraszus eine mächtige Primalistin gesehen haben, die eine Blume an ihrem Kragen trägt. Es ist nicht bekannt, ob es sich dabei um die legendäre reißende Lilie handelt, aber es ist ein guter Ort, um mit der Suche zu beginnen.', '', 'Eine mächtige Wasserprimalistin in Thaldraszus trägt die reißende Lilie an ihre Kapuze gesteckt.', 'Alora Nebelhauch', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(71010, 'deDE', 'Gesucht: Zeitfernrohr', 'Findet das Zeitfernrohr.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten demütig alle Expeditionsteilnehmer, nach dem Zeitfernrohr für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie mitgehört haben, wie ein Zwerg in den Gasthäusern von Südthaldraszus mit seinem magischen Fernrohr angibt. Wir schlagen vor, die Suche auf diese Region zu konzentrieren.', '', 'Ein Ausguck der Primalisten in Thaldraszus nutzt das Zeitfernrohr, um seinen nächsten Angriff zu planen.', 'Ausguck Mordren', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(71009, 'deDE', 'Das ist elementar, mein lieber Drakonid', 'Helft Varsek, das Mysterium des Uralten Aussichtspunkts zu lösen.', 'Grimmhauer will sich die Zähne an Frostbiss ausbeißen, was? Ich will ihn ungern enttäuschen, aber ich habe dieses Leben hinter mir gelassen, um ein Gelehrter zu werden.\n\nIch versuche, die Geschichte aufzudecken... und selbst Geschichte zu schreiben! Aber ich hänge an diesem esoterischen Rätsel dieser uralten Ruinen fest.\n\nDas Rätsel ist Folgendes: Wenn Ihr einen Kristall in der Nähe berührt, sagt er \"Folgt dem Muster\". Aber ich habe nicht die leiseste Ahnung, was das bedeutet!\n\nIch sage Euch was: Wenn Ihr mir helfen könnt, dieses Rätsel zu lösen, werde ich Grimmhauer helfen, Frostbiss ein für alle Mal den Garaus zu machen.', '', '', '', '', '', '', 47187),
(71008, 'deDE', 'Gesucht: Steinherz\' steinernes Herz', 'Findet Steinherz\' steinernes Herz.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten demütig alle Expeditionsteilnehmer, nach Steinherz\' steinernem Herz für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie Steinherz in einer Höhle im Zentrum des Azurblauen Gebirges gesehen haben.', '', 'Steinherz bewahrt sein steinernes Herz in... na ja, da kommt Ihr bestimmt selbst drauf.', 'Steinherz', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(71004, 'deDE', 'Gesucht: Massenbindungstotem für Ohuna', 'Findet das Massenbindungstotem für Ohuna.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten demütig alle Expeditionsteilnehmer, nach dem Massenbindungstotem für Ohuna für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie auf der Windspielanhöhe auf den Ebenen von Ohn\'ahra einen besonders fähigen Primalisten gesehen haben, der die Macht dieses Totems beherrschen soll.', '', 'Eine mächtige Luftprimalistin auf den Ebenen von Ohn\'ahra, die das Massenbindungstotem für Ohuna führt.', 'Prozela Windschuss', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(71002, 'deDE', 'Bester Zauber aller Zeiten', 'Lest \"Manastürmen für Anfänger\" und entdeckt Millhaus\' geheimen Zauber.', '<Dieses sacht schwebende und Arkanmagie verströmende verzauberte Buch enthält zahllose Zauber und Verzauberungen, die dem chaotischen und doch wunderschönen Verstand von Millhaus Manasturm entsprungen sind.>', '', '', '', '', '', '', 47187),
(71001, 'deDE', 'Gesucht: Erdgebundener urzeitlicher Kern', 'Findet den erdgebundenen urzeitlichen Kern in Neltharus.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten demütig alle Expeditionsteilnehmer, nach dem erdgebundenen urzeitlichen Kern für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nJüngste Erkenntnisse und Berichte aus der Obsidianzitadelle deuten darauf hin, dass er einst im Drachenhort von Neltharus gelagert wurde. Seine aktuelle Position ist jedoch unbekannt.', '', 'Es heißt, der Kern wäre im Drachenhort von Neltharus verschollen.', 'Erdgebundener urzeitlicher Kern', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(71000, 'deDE', 'Barst rekrutiert', 'Berichtet Grimmhauer, dass Ihr Barst rekrutiert habt.', 'Abgemacht ist abgemacht. Wenn Grimmhauer Hilfe braucht, um Frostbiss endgültig zu töten, dann bin ich dabei.\n\nDen Hass, den ich noch in mir trage, hebe ich mir für Frostbiss auf. Hat Grimmhauer Euch gesagt, was passiert ist?\n\nWir alle, die mit Grimmhauer auf die Jagd gingen, dachten, wir wären unaufhaltsam. Bis wir Frostbiss trafen.\n\nFrostbiss hat uns nicht nur besiegt. Er hat uns vor allen anderen im Unterschlupf gedemütigt.\n\nWir wurden blutig und geschlagen im Unterschlupf zurückgelassen. Frostbiss hat ein Exempel an uns statuiert.\n\nJetzt ist es an der Zeit für Rache.', '', '', '', '', '', 'Kehrt zum Alten Grimmhauer zurück.', 47187),
(70996, 'deDE', 'Tang-o am Strand', 'Besiegt den wilden Tangelementar auf der Langklaueninsel.', 'Oje, das klingt, als wäre Grimmhauer in Schwierigkeiten. Ich würde sagen, ich habe genug von den Konflikten des Festlands, aber...\n\nFrostbiss und ich haben eine Vorgeschichte. Und eine Rechnung zu begleichen.\n\nAch, Schande! Ich kann die anderen hier aber nicht ohne Verteidigung lassen... Wir hatten Probleme mit einem Elementar, der am Strand für Ärger gesorgt hat. Ich bin der Einzige, der es mit ihm aufnehmen kann. Das ist ein schlüpfriger Geselle... buchstäblich\n\nIch sage Euch was: Wenn Ihr Euch für mich um den Elementar kümmert, latsche ich mal rüber zu Grimmhauers Lager.\n\nWie sieht\'s aus, Champ?', '', 'Ab mit Euch!', 'Tangelementar', '', '', '', 47187),
(70995, 'deDE', 'Gesucht: Fenistraszas Schädel', 'Findet Fenistraszas Schädel.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten alle Expeditionsteilnehmer, nach Fenistraszas Schädel für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass er im Besitz eines verstoßenen Djaradin in den westlichen Bergen sein soll. Aber es konnte ihn niemand davon überzeugen, ihn herauszurücken.', '', 'Ein zurückgezogener Djaradin stellt den verzauberten Schädel in seinem Alkoven aus.', 'Tarjin der Blinde', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(70994, 'deDE', 'Absauglösungen', 'Saugt $1oa glitzernde Ströme in der Höhle östlich der Ruinen des Lebensgewölbes auf.', 'Wollt Ihr die Ehre haben, der weltberühmten Chefgeologin der Drachenschuppenexpedition zu assistieren? Ja, das ist richtig. Ich bin genau die, für die Ihr mich haltet. Und ich stecke in der Klemme!\n\nIch habe diesen Fluss nach neuen Sedimentproben abgesucht, aber dann begann das Wasser, die interessantesten Schlickanteile mitzureißen!\n\nIch habe hier meine patentierte Wasserfangvorrichtung, aber es braucht dringend jemanden, der herumläuft und die Elementare in sie hineinzieht.\n\nMeint Ihr, Ihr bekommt das hin?', '', '', '', '', '', '', 47187),
(70992, 'deDE', 'Gesucht: Verlorener Tuskarrdrachen', 'Findet den verlorenen Tuskarrdrachen.', '<Die angebrachte Notiz ist mit schöner Kalligrafie verziert.>\n\nDie Archivare bitten alle Expeditionsteilnehmer, nach dem verlorenen Tuskarrdrachen für unser Artefaktarchiv zu suchen.\n\nIm Falle des Funds bitte bei Katalogisiererin Jakes zur Bearbeitung und Vergütung abgeben.\n\nEinige Expeditionsmitglieder haben berichtet, dass sie einen solchen Drachen an einem Tuskarrtransporter befestigt an der Westküste gesehen haben. Aber niemand konnte ihn erreichen, da der Transporter ihn in der Luft und damit außer Reichweite hält, wenn er in Bewegung ist.', '', 'Der Drachen segelt stolz hinter dem verlorenen Arvillo, während er sich fortbewegt...', 'Verlorener Tuskarrdrachen', '', '', 'Kehrt zu Katalogisiererin Jakes im Drachenschuppenbasislager zurück.', 47187),
(70990, 'deDE', 'Wo die Wolle ist, ist auch ein Weg', 'Schert die Wolle von Klippenhufschafen.', 'Obwohl fast unsere gesamte Wolle von unseren eigenen Riesenwildschafen stammt, müssen wir doch mitunter das Land nutzen, wenn die Herde schrumpft.\n\nAuf den nahen Ebenen leben wilde Riesenwildschafe. Sie sind meist temperamentvoller als die unseres Klans. Wenn Ihr diese Klinge nehmen und ihre Wolle scheren könntet, wäre das ein großer Dienst für Aylaag.', '', '', '', '', '', '', 47187),
(70989, 'deDE', 'Mitglied der Meute', 'Jagt den gefräßigen Drachen mit Taivan und dem Rudel Jagdbakar.', 'Vielleicht muss sich Eurer Bakar von Artgenossen abschauen, wie man ordentlich jagt.\n\nIhr könnt Euch einige von unseren trainierten Bakar ausleihen. Nehmt sie und holt den kreisenden Protodrachen vom Himmel.\n\nSchauen wir doch mal, wie Taivan sich in einem Rudel mit seinesgleichen verhält.', '', '', '', '', '', '', 47187),
(70987, 'deDE', 'Stärke des Herzens', 'Sprecht mit Meliane Enorath in den Ruinen des Lebensgewölbes an der Küste des Erwachens.', 'Was könnte besser sein als ein Essen, das Ihr auf Erkundungsreisen mitnehmen könnt?\n\nStraßenimbisse sind aus den belebten Städten dieser Welt nicht mehr wegzudenken. Aber nicht jedes Gericht lässt sich gut transportieren. Die Basis großartiger Gerichte zum Mitnehmen ist die Stärke, die unterwegs alles zusammenhält. Brot, Kartoffeln, Reis und was Euch sonst noch einfällt sind das Herz der bestecklosen Küche.\n\nIch würde meinem Pandarenkollegen gerne ein köstliches Exemplar servieren, das als Springmais bekannt ist. Schnabuli hat ihn mir gezeigt, als wir uns in der Nähe einer Ruine der Titanen an der Küste des Erwachens kennenlernten.', '', '', '', '', '', '', 47187),
(70986, 'deDE', 'Gefreite Shikzar', '', '', '', '', '', '', '', '', 47187),
(70985, 'deDE', 'Die einsame Späherin', 'Sprecht mit Dryaden in der Schattenzuflucht.', 'Ich weiß, ich weiß, es ist albern. Eine Zentaurin und eine Dryade. Wir könnten kaum unterschiedlicher sein.\n\nAber seit ich die Smaragdgärten zum ersten Mal erblickt habe, wollte ich eine Dryade besser kennenlernen. Aber es will mir einfach nicht gelingen, das Richtige zu sagen oder zu tun, damit sie an mir Interesse hätten.\n\nWie ich höre, mögen sie... Pflanzen. Und niedliche Tierbabys. Und womöglich machen sie gern Jagd auf Wilderer? Ach, ich weiß nicht, wo ich anfangen soll.\n\nKönntet Ihr vielleicht mit ihnen reden? Fragt einfach ein bisschen herum, was sie gern mögen. Vielleicht habe ich dann eine Chance.', '', '', '', '', '', 'Kehrt zu Späherin Santuun zurück.', 47187),
(70984, 'deDE', 'Wogenbrecher', '', '', '', '', '', '', '', '', 47187),
(70983, 'deDE', 'O\'nank Strandsieb', '', '', '', '', '', '', '', '', 47187),
(70981, 'deDE', 'Vollmundige See', 'Sprecht mit Wayun im Walfängerwinkel im Azurblauen Gebirge.', 'Der Duft der See! Könnt Ihr das riechen, $n? Riecht Ihr die Vielzahl von Mineralien und das Meersalz? Sagt schon!\n\nWas den heutigen Genüssen noch fehlt, ist eine seltene Fischart, die ich einst in der Nähe von Iskaara im Azurblauen Gebirge gekostet habe. Zwei Tuskarr haben einfach einen über einem Feuer gegrillt und das hat die eisige Tundra mit dem köstlichsten Duft erfüllt.\n\nVersucht doch, einen für uns zu finden. Ich bin sicher, unsere Gäste werden ebenso bezaubert von dem Geruch der See sein, wie ich an diesem Tag.', '', '', '', '', '', '', 47187),
(70979, 'deDE', 'Magmaton', '', '', '', '', '', '', '', '', 47187),
(70978, 'deDE', 'Sagen der Champions der Dracheninseln', '', '', '', '', '', '', '', '', 47187),
(70977, 'deDE', 'Ruckscaps', '', '', '', '', '', '', '', '', 47187),
(70976, 'deDE', 'Schwänzen und Schlittenfahren', 'Sucht Kiopo auf der Insel im Südosten auf.', 'Wie Ihr vielleicht wisst, sind die Kinder von Iskaara sehr selbstständig. Sie lernen von klein auf, sich selbst zu versorgen.\n\nEs ist eine Art Mutprobe unter den älteren Kindern, sich auf den Eisberg südwestlich von hier zu schleichen. Kiopo, das älteste unserer Kinder, ist gerade dort. Sagt ihm, dass ich Euch geschickt habe, dann wird er Euch einen unserer Schlitten anbieten!\n\nAh, das erinnert mich an meine Jugend... da draußen... mit meinen Freunden...', '', '', '', '', '', '', 47187),
(70972, 'deDE', 'Unsere treuen, schlaksigen Reittiere', '', '', '', '', '', '', '', '', 47187),
(70971, 'deDE', 'Waffen für jeden Arm', '', '', '', '', '', '', '', '', 47187),
(70970, 'deDE', 'Gute Absichten', 'Haltet Alia Segelstrahl auf und zerstört das Artefakt Valthrux.', 'Ich weiß vielleicht, wo das Artefakt ist. Alia hat fanatisch vor sich hin geflüstert, als Ihr all die Splitter zurückgebracht habt.\n\nSie sprach ständig von einer \"Höhle\" und davon, wie die Spinnen von ihr angezogen werden.\n\nIn der Gegend vor uns gibt es keine Höhle, deswegen glaube ich, dass tiefer in den Ruinen eine liegen könne.\n\nWir bleiben hier und halten den Fluchtweg offen, $n. Bitte rettet Alia und zerstört dieses verfluchte Artefakt.', '', 'Ich hoffe, wir kommen rechtzeitig dort an, bevor Alia von dem Artefakt überwältigt wird.', 'Valthrux', '', '', '', 47187),
(70969, 'deDE', 'Teil der Gemeinschaft werden', '', '', '', '', '', '', '', '', 47187),
(70968, 'deDE', 'Teil des Stoffs, Teil der Gemeinschaft', '', '', '', '', '', '', '', '', 47187),
(70967, 'deDE', 'Fischige Unterhaltung', '', '', '', '', '', '', '', '', 47187),
(70966, 'deDE', 'Einfach handeln', '', '', '', '', '', '', '', '', 47187),
(70964, 'deDE', 'Echt anziehend!', '', '', '', '', '', '', '', '', 47187),
(70963, 'deDE', 'Halt fürs Handgelenk', '', '', '', '', '', '', '', '', 47187),
(70962, 'deDE', 'Ein gemütlicher Sitz', '', '', '', '', '', '', '', '', 47187),
(70961, 'deDE', 'Die nötige Rüstung auf sich nehmen', '', '', '', '', '', '', '', '', 47187),
(70960, 'deDE', 'Händlerkleidung', '', '', '', '', '', '', '', '', 47187),
(70959, 'deDE', 'Knuffig und knuddelig', '', '', '', '', '', '', '', '', 47187),
(70958, 'deDE', 'Perfektes Pilzpanorama', 'Sprecht mit Wächterhauptmann Sinjoirmi am Temporalen Konflux in Thaldraszus.', 'In der gehobenen Küche dreht sich alles darum, die genauesten Techniken auf die erlesensten Zutaten anzuwenden. Die Gerichte der gehobenen Küche sind oft den Reichen und Betuchten vorbehalten, aber hier beim Rubinfestmahl wollen wir davon nichts wissen!\n\nSchnabuli hat mir von der perfekten Zutat für das heutige Motto erzählt. Eine so seltene und exquisite, dass sie... noch nicht existiert! Verlockend, nicht wahr?\n\nDie Bronzenen haben ein Portal in eine gefährliche Zukunft entdeckt. Eine, in der es einen schwarzen Trüffel von unvorstellbarer Köstlichkeit gibt.\n\nIhr müsst dorthin!', '', '', '', '', '', '', 47187),
(70957, 'deDE', 'Die See im Westen', 'Sprecht mit Zuckerzweig in der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Gefällt Euch die grüne Landschaft um uns herum, $n?\n\nSie erinnert mich an ein Gericht von zwei Dryadenschwestern und deren Treantfreund, das ich einmal probieren durfte. Zuckerzweig war sein Name! Er lebt in der Schattenzuflucht an der Westküste der Ebenen.\n\nEs war eine Variation aus frischen Kräutern, Gemüse und Gewürzen. Und das Herz des Gerichts war eine Lage des köstlichsten Seetangs, den Ihr je gegessen habt!\n\nWas? Ihr habt noch nie Seetang gegessen? Dann müsst Ihr einfach welchen sammeln. Und bringt doch bitte genug für alle mit!', '', '', '', '', '', '', 47187),
(70956, 'deDE', 'Von azurblauen Schuppen', '', '', '', '', '', '', '', '', 47187),
(70955, 'deDE', 'Faszinierende Flieger', '', '', '', '', '', '', '', '', 47187),
(70954, 'deDE', 'Steigende Neugier', '', '', '', '', '', '', '', '', 47187),
(70953, 'deDE', 'Kopfbedeckung der Tuskarr', '', '', '', '', '', '', '', '', 47187),
(70952, 'deDE', 'Aufgebene... oder versteckte Truhen', '', '', '', '', '', '', '', '', 47187),
(70950, 'deDE', 'Noch größere Fische aufspießen', '', '', '', '', '', '', '', '', 47187),
(70948, 'deDE', 'Petri Heil, Petri Dank und Petri-hinfort-mit-Euch!', '', '', '', '', '', '', '', '', 47187),
(70947, 'deDE', 'Schatzbesessener Trambladd', '', '', '', '', '', '', '', '', 47187),
(70946, 'deDE', 'Niemand darf es führen', 'Überredet Alia, Valthrux zu zerstören.', 'Was Ihr gefunden habt, klingt, als hätte die Macht des Artefakts alle, die sie bisher beansprucht haben, ins Verderben gestürzt.\n\nDie Drachenbrut, die hier lebte, hat sich deswegen gegenseitig umgebracht. Die Splitterflammen scheinen ebenfalls von seinem Einfluss korrumpiert zu werden.\n\nWir müssen dieses Artefakt finden. Es muss zerstört werden, bevor es noch mehr Schaden anrichten kann.\n\nWir müssen Alia und Kattigat davon überzeugen.', '', '', '', '', '', '', 47187),
(70945, 'deDE', 'Danke, sehr Netz', '', '', '', '', '', '', '', '', 47187),
(70944, 'deDE', 'Eisfischen', '', '', '', '', '', '', '', '', 47187),
(70943, 'deDE', 'Harpunieren', '', '', '', '', '', '', '', '', 47187),
(70942, 'deDE', 'Hochlandfischen', '', '', '', '', '', '', '', '', 47187),
(70941, 'deDE', 'Angellöcher', 'Sprecht mit Nunvuq bei Iskaara im Azurblauen Gebirge.', 'Erneut hallo! Wusstet Ihr, dass ich der besteste Fischer im Dorf werde? Ich habe mal einen riesigen Piranha gefangen. Er hat versucht, mein Gesicht zu fressen!\n\n<Rowie schaut sich gedankenverloren um.>\n\nOh, ja! Ich habe eine Nachricht für Euch. Nunvuq in Iskaara will Euch etwas über Angellöcher beibringen.', '', '', '', '', '', '', 47187),
(70940, 'deDE', 'Sagen des Champions der Tuskarr', '', '', '', '', '', '', '', '', 47187),
(70939, 'deDE', 'Kochgerät', '', '', '', '', '', '', '', '', 47187),
(70938, 'deDE', 'Gemeinschaftliche Festmahle', 'Sprecht mit dem großen Kinook bei Iskaara im Azurblauen Gebirge.', 'Da seid Ihr ja, $n! Die Suppe steht auf dem Tisch!\n\nBeeilt Euch besser und geht nach Iskaara. Der große Kinook sucht nach Euch.\n\nEinmal hat er mir gesagt, ich soll einen schleimigen, ekligen Stachelfisch für die Suppe holen, und ich wollte nicht, als rief ich: \"Nein, Chefkoch!\"\n\nEr war so wütend, dass ich dachte, er würde mich in die Suppe werfen!', '', '', '', '', '', '', 47187),
(70937, 'deDE', 'Was Valthrux einst war', 'Findet Hinweise darauf, was das Artefakt Valthrux wirklich ist.', '<To\'tik flüstert.>\n\nDas gefällt mir nicht. Mysteriöse Artefakte, die großartige Versprechen flüstern? Das klingt nicht gut.\n\nAber wir können nicht einfach umkehren... ansonsten bekommen die Splitterflammen es noch in die Finger. Was auch immer \"es\" ist...\n\nIch kenne mich mit Ruinen wie diesen gut aus. Die blauen Drachen haben oft Notizen über ihre Arbeit zurückgelassen. Haltet die Augen offen, dann könnt Ihr vielleicht welche finden.\n\nWir können die Hinweise, die Ihr entdeckt, nutzen, um Alia und Kattigat zu warnen.', '', '', '', '', '', '', 47187),
(70936, 'deDE', 'Gestohlene Tuskarrtotems', '', '', '', '', '', '', '', '', 47187),
(70935, 'deDE', 'Fangen und freilassen: Inselfinnenschwertfisch', '', '', '', '', '', '', '', '', 47187),
(70932, 'deDE', 'Ein würziges Leben', 'Sprecht mit Gaunah am Obsidianthron.', 'Für viele gehört Fleisch zu einem Essen einfach dazu. Aber was gehört zu jedem Fleischgericht dazu?\n\nGewürze!\n\nEin Gewürz übertrifft alle anderen in Geschmack, Textur und Seltenheit, und es gibt es hier auf den Inseln. Leider kann es nur bei Elementaren gefunden werden, die in den Tiefen der Obsidianfeste leben. Das Gebiet wird gerade von den Djaradin kontrolliert.\n\nVielleicht könnt Ihr mehr von diesem seltsamen Troll erfahren, den ich auf dem Weg hierher getroffen habe. Ich glaube sein Name war... Gaunah.', '', '', '', '', '', '', 47187),
(70931, 'deDE', 'Flüsternde Fragmente', 'Sammelt $1oa flüsternde Fragmente von den Splitterflammen.', 'Ich glaube, Valthrux versucht, durch den Splitter, den wir geborgen haben, mit uns zu kommunizieren.\n\nWir können das zu unserem Vorteil nutzen, solange wir unseren Verstand vor dem Einfluss des Artefakts schützen.\n\nIch habe mich hinsichtlich der Splitterflammen geirrt. Sie haben leider schon mehrere Splitterfragmente gefunden.\n\nValthrux\' Flüstern behauptet, sie sind kurz davor, den Standort zu lokalisieren.\n\nNehmt den Splitterflammen die Splitter ab, bevor sie das Artefakt finden!', '', '', '', '', '', '', 47187),
(70930, 'deDE', 'Teetrinken und abwarten', 'Sprecht mit Lilial Dämmerbruch im Schaudernetztal.', 'Heute ist ein Fest des Tees: gebraut, gekühlt oder ganz anders! Es gibt auch extravagante kleine Kuchen und Kekse.\n\nAber es gibt eine seltene Zutat auf den Inseln, von der ich glaube, dass sie eine ganz neue Geschmacksdimension entfalten könnte! Tief im insektenverseuchten Reich des Schaudernetztals wächst ein Busch mit dem wunderbarsten, erhebenden Laub: der Kaltbisspfeilblattbusch.\n\nDie Drachenschuppenexpedition hat die Gegend vor Kurzem erforscht, vielleicht kann einer von ihnen Euch helfen?', '', '', '', '', '', '', 47187),
