(70919, 'deDE', 'Quaken und Heilen', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', '<Das Entchen ist schon so lange in der Blase, dass es fest eingeschlafen ist. Es quakt leise, während es schnarcht.>\n\n<Vielleicht wissen die Ökologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', 47187),
(70918, 'deDE', 'Quak um dein Leben', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', '<Das Entchen quakt verzweifelt. Wenn ihm nicht jemand hilft, werden die Gorlocs sicherlich ärgerlich!>\n\n<Vielleicht wissen die Ökologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', 47187),
(70917, 'deDE', 'Eine Schulter zum Anquaken', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', '<Das Entchen ist voller nervöser Energie. Es scheint unbedingt aus seiner misslichen Lage entkommen zu wollen.>\n\n<Vielleicht wissen die Ökologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', 47187),
