(70893, 'deDE', 'Gemeinschaftliches Festmahl', 'Führt $1oa Aufgaben beim gemeinschaftlichen Festmahl aus', 'Unser gemeinschaftliches Festmahl findet GENAU JETZT statt! Dabei trägt jeder etwas bei und wir machen die beste Suppe, die wir kochen können.\n\nIhr könntet mitmachen!', '', '', '', '', '', '', 47187),
