(70887, 'deDE', 'Ein Gefühl der Freiheit', '', '', '', '', '', '', '', '', 47187),
(70886, 'deDE', 'DAS nenne ich Drachenrennen!', '', '', '', '', '', '', '', '', 47187),
(70885, 'deDE', 'Ruhmvorräte', '', '', '', '', '', '', '', '', 47187),
(70884, 'deDE', 'Rückeroberung', '', '', '', '', '', '', '', '', 47187),
(70883, 'deDE', 'Grüner Daumen', 'Sucht Gryrmpech in den Gärten der Einigkeit auf.', 'Grüße, $gSterblicher:Sterbliche;, ich habe etwas von unserem Chefgärtner Gryrmpech gehört. Und zwar, dass die Gärten im Chaos versinken, aber ich weiß nicht, ob das nicht normal ist.\n\nEr hat mir versichert, dass er alles im Griff hat, also eigentlich hat er gesagt, er hätte alles \"auf der Schaufel\", deswegen bin ich mir nicht sicher, was er genau meint, aber ich glaube, er wird es Euch verraten. Sucht ihn bitte auf, dann kann er Euch über die Situation aufklären.', '', '', '', '', '', '', 47187),
(70882, 'deDE', 'Ruhmvorräte', '', '', '', '', '', '', '', '', 47187),
(70880, 'deDE', 'Kochen mit Finesse', '', '', '', '', '', '', '', '', 47187),
(70879, 'deDE', 'Bericht über die Rebellen', 'Trefft Hauptmann Drine im obersten Stockwerk des Sitzes der Aspekte.', 'Ich bin beeindruckt, was wir heute geschafft haben. Findet Ihr nicht auch, $n?\n\nWir haben die niederträchtigen Machenschaften dieser mit den Primalisten verbündeten Rebellen erfolgreich beendet. Zumindest für den Moment. Wir werden in Zukunft die Augen nach Dissidenten offen halten müssen.\n\nKehrt zu Hauptmann Drine zurück, sobald Ihr könnt. Sie wird unseren Bericht hören wollen.', '', '', '', '', '', '', 47187),
(70878, 'deDE', 'Feuerring', 'Beschützt Maldra Flammenzunge, während sie das Portal der Primalisten schließt.', 'Die Primalisten haben in den tiefsten Abzweigungen der Glutschieferhöhle ein feuriges Portal errichtet, aus dem sie Elementare entfesseln.\n\nIch kann es schließen, aber meine Handlungen werden zweifellos den Zorn von dem wecken, was auch immer auf der anderen Seite wartet. Einschließlich dem Wiedergänger Magmaticus, dem die Primalisten helfen.\n\nIch werde Euren Schutz brauchen, wenn wir sie aufhalten wollen.', '', 'Dieser wütende Wiedergänger der Flammen muss eliminiert werden, bevor die Primalisten ihn auf die Dracheninseln loslassen können.', 'Magmaticus', '', '', '', 47187),
(70877, 'deDE', 'Quaken in der Zeit', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', '<Das Entchen ist verzweifelt und quakt leise vor sich hin, während seine Augen ängstlich umherblicken.>\n\n<Vielleicht wissen die Ökologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', 47187),
(70876, 'deDE', 'Fragmentierte Fokusse', 'Zerstört $1oa Primalistenfokusse in der Glutschieferhöhle.', 'Wenn Maldra die Wahrheit sagt, stellen die Rebellen die Runensteine in der Glutschieferhöhle her.\n\nAußerdem wissen wir, von der Natur dieser Geräte ausgehend, dass Fokusse der Primalisten involviert sind.\n\nZerstört die Fokusse. Ihr werdet sie erkennen, wenn Ihr sie seht.\n\nDie Rebellen dürfen nicht noch mehr Waffen der Zerstörung herstellen.', '', '', '', '', '', '', 47187),
(70875, 'deDE', 'Schlimmer geht\'s nicht', 'Tötet $1oa Rebellen und $2oa Elementare in der Glutschieferhöhle.', 'Die Rebellen in der Glutschieferhöhle sind unerschütterlich loyal gegenüber den Primalisten und stellen daher die größte Gefahr für Valdrakken dar.\n\nEliminiert sie und alle Elementare, die sie entfesselt haben.', '', '', '', '', '', '', 47187),
(70874, 'deDE', 'Eine Feuerwand durchbrechen', 'Erhaltet Maldras elementaren Segen.', 'Die Rebellen in der Höhle wurden mit einem elementaren Segen erfüllt, der es ihnen erlaubt, die Flammenwand sicher zu durchschreiten. Ich kann Euch denselben Segen gewähren.\n\nKeine Sorge, ich habe diesen Vorgang oft genug beobachtet. Ich sollte ihn problemlos imitieren können.', '', '', '', '', '', '', 47187),
(70873, 'deDE', 'Wasserfällen auf der Spur', 'Sammelt $1oa Wasserfallpartikel.', 'Die wahre Bedrohung liegt in der Glutschieferhöhle. Dort werden diese Runensteine gemeißelt und mit Urfeuer erfüllt.\n\nIhr habt zweifellos die lodernde Flammenwand entdeckt, die den Eingang versperrt. Ich kann sie nicht entzaubern, aber vielleicht kann ich auf andere Weise helfen. Ich glaube, dass wir mit der richtigen Anwendung von Wasserfall unversehrt hindurchgehen können.\n\nSammelt Wasserpartikel von den Elementaren in der Nähe.', '', '', '', '', '', '', 47187),
(70871, 'deDE', 'Fischernetz von Iskaara', 'Bringt Tavio Materialien und lasst sie ein Fischernetz von Iskaara herstellen.', 'Ich sehe, Ihr versteht Euch gut mit den Dorfbewohnern.\n\nIhr wollt mehr darüber lernen, wie wir angeln, sagt Ihr? Gut, zuerst einmal angelt niemand mit bloßen Händen. Ich kann Euch ein gutes, starkes Netz herstellen, das eines Tuskarrs der Iskaara würdig ist.', '', '', '', '', '', '', 47187),
(70867, 'deDE', 'Bannschuppenfeste', '', '', '', '', '', '', '', '', 47187),
(70859, 'deDE', 'Was der Wächter weiß', 'Beschafft den flüsternden Splitter von Edavix, dem verderbten Wächter.', 'Ich begrüße Eure Hilfe, $C. Ich war die Magierin der Kirin Tor, die dieses Artefakt, Valthrux, und die Pläne der Splitterflammen als Erste gefunden hat.\n\nDie Wiederbeschaffung und das Studium dieses angeblich empfindungsfähigen und mächtigen Artefakts ist von oberster Dringlichkeit. Und ich schwöre, ich werde diejenige sein, die es tut.\n\nDie Splitterflammen müssen raten, wo es sein könnte, aber ich habe mit Magie einen Weg für uns gefunden.\n\nEs gibt einen verderbten Wächter in der Nähe, der einen magischen Splitter besitzt, der mit Valthrux verbunden ist. Ich kann ihn nutzen, um den Rest des Artefakts zu finden.', '', 'Ein Wächter, verderbt durch die Macht von Valthrux. Er hält den Schlüssel zum Fundort des Artefakts.', 'Edavix', '', '', '', 47187),
(70858, 'deDE', 'Zurück ins Getümmel!', 'Wendet das eiskalte Gegengift auf Alia Segelstrahl an.', 'Na gut, das Gegengift ist fertig. Ich werde Alia stützen, Ihr gebt den Inhalt der Phiole in ihren Mund.\n\nHoffentlich überlebt sie... Wir brauchen ihre Magie, um dieses Artefakt zu finden.', '', '', '', '', '', 'Sprecht mit Alia Segelstrahl.', 47187),
(70856, 'deDE', 'Tötet sie mit Feuer', 'Vernichtet $1oa infizierte Leichen mit der Flammenwerferfackel.', 'Diese ekligen Spinnen legen ihre Eier in Leichen ab.\n\nUnd manchmal in Lebendigen.\n\nWir haben einige Leichen der Splitterflammen gesehen, die ihnen zum Opfer fielen.\n\nWenn wir hier überleben und die Splitterflammen besiegen wollen, dürfen wir nicht zulassen, dass die Eier schlüpfen.\n\nNehmt diese Fackel. Sie ist mit der Macht von Luft und Feuer verzaubert. Richtet sie auf alles, was Ihr verbrennen wollt, und sie erledigt den Rest.\n\nDie Tuskarr machen keine halben Sachen mit Spinnen. Ich bin immer vorbereitet.', '', '', '', '', '', '', 47187),
(70854, 'deDE', 'Wie ist es gelaufen?', 'Kehrt zu Jyhanna in der Welpenkrippe in Valdrakken zurück.', 'Das habt Ihr toll gemacht, $n. Lubbins geht es schon viel besser und er ist bei bester Laune.\n\nJyhanna wird das wissen wollen, also geht schon zurück und überbringt ihr die tollen Neuigkeiten!', '', '', '', '', '', '', 47187),
(70853, 'deDE', 'Ein Freund für Lubbins', 'Fangt eine Scheulibelle im Wildreservat an der Küste des Erwachens.', 'Wie wir bereits besprochen haben, braucht Lubbins zwei Dinge: einen Kumpel und einen Kampf.\n\nIch glaube, dass wir ihm beides auf einen Schlag besorgen können.\n\nDiese Gegend ist ein erstklassiges Paarungsgebiet für Scheulibellen. Ihr solltet hier im Gebiet viele davon finden können, wenn Ihr Euch ein wenig umschaut.\n\nAber denkt dran, Ihr müsst sie erst schwächen, bevor Ihr sie mit Eurer Falle fangen könnt.\n\nKommt zurück, wenn Ihr eine habt. Nach dem Kampf wird sie vermutlich etwas angeschlagen sein, aber ich habe ein paar Kampfübungssteine, die ihr direkt wieder auf die Beine helfen werden!', '', '', '', '', '', '', 47187),
(70851, 'deDE', 'Extreme Wildheit im Blut', 'Erfahrt, was Lubbins von Haniko braucht.', 'Es gibt vieles, was Ihr wissen müsst. Lasst uns reden, dann können wir entscheiden, was das Beste für Lubbins ist.', '', '', '', '', '', '', 47187),
(70850, 'deDE', 'Maldra steht das Wasser bis zum Hals', 'Rettet Maldra vor Orian Dunkelwasser.', 'Ausgezeichnete Arbeit. Während Ihr für Unruhe gesorgt habt, habe ich das Lager ausgekundschaftet. Ich hätte nicht erwartet, meine alte Freundin Maldra Flammenzunge hier zu finden.\n\nIch wusste, dass sie vermisst wird, aber den Gerüchten zufolge hieß es, sie hätte sich den Rebellen angeschlossen. Soweit ich sehe, ist sie aber ihre Gefangene!\n\nWir können sie hier nicht zurücklassen. Rettet sie vor der Drachenbrut, die sie gefangen hält!', '', 'Dieser Rebellenanführer hat seine Gefangene, Maldra Flammenzunge, mit Ketten aus Urwasser gefesselt.', 'Orian Dunkelwasser', '', '', '', 47187),
(70849, 'deDE', 'Das schreit nach einem Spezialisten', 'Sprecht mit Haniko im Wildreservat an der Küste des Erwachens.', 'Lubbins geht es schon viel besser, aber ich glaube, er braucht noch mehr Hilfe.\n\nVor einer Weile habe ich eine super kluge Forscherin der Drachenschuppenexpedition namens Haniko getroffen, die ständig mit Protodrachen arbeitet. Sie ist auch eine Kampfhaustiertrainerin. Ich wette, sie kann Lubbins besser helfen!\n\nich glaube, sie wollte zur Küste des Erwachens. Wenn Ihr dort hingeht, werdet Ihr sie sicher finden.\n\nIch bin so froh, dass ich Euch helfen konnte!\n\n<Sie winkt fröhlich.>\n\nLebt wohl! Viel Glück, Lubbins!', '', '', '', '', '', '', 47187),
(70848, 'deDE', 'Vergessenes Drachenwappen', 'Bringt den Gegenstand zu Exadria.', '<Exadria könnte das haben wollen.>', '', '', '', '', '', '', 47187),
(70847, 'deDE', 'Uralter Obsidiananhänger', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Krallenpirscherin Kavia könnte das haben wollen.>', '', '', '', '', '', '', 47187),
(70845, 'deDE', 'In Tyrs Fußstapfen', 'Findet die erste Herausforderung von Tyr im Azurblauen Gebirge.', 'Hüter Tyr hat alle Eventualitäten bedacht. Er vermutete, dass die Handwerker des Reiches eines Tages ermächtigt werden müssen, und so erschuf er die Innovationsmaschine. Sie verfügt über die Fähigkeit, ein einzigartiges Handwerksmaterial herzustellen, das einem Gegenstand Wissen verleiht, das jenseits der Fähigkeiten des sterblichen Verstands liegt.\n\nUm sicherzugehen, dass seine Maschine nicht in die falschen Hände gerät, erschuf er mich, um zu überwachen, wer ihre Macht sucht. Nur, wer ihr würdig ist, wird das volle Potenzial der Maschine erwecken können.\n\nSeid Ihr der Herausforderung gewachsen?', '', '', '', '', '', 'Findet die erste Herausforderung von Tyr im Azurblauen Gebirge.', 47187),
(70843, 'deDE', 'Runensteine ruinieren', 'Zerstört die Lager mit flammenden Runensteinen.', '<Dieser Runenstein ist dem anderen, den die Rebellen in Valdrakken platzieren wollten, erstaunlich ähnlich.\n\nDieser Stein ist noch nicht fertig, aber Ihr entdeckt ganze Lager von vollendeten Runensteinen in einiger Entfernung.\n\nWenn Ihr diese Lager zerstört, können die Rebellen die Runensteine nicht zum Einsatz bringen.>', '', '', '', '', '', '', 47187),
(70842, 'deDE', 'Sprengorte', 'Sammelt Karten des Nebligen Tals.', 'Ich bin sicher, dass die Rebellen ihre Pläne für zukünftige Angriffe irgendwo dokumentieren. Wir müssen herausfinden, was sie vorhaben, bevor es zu spät ist.\n\nDurchsucht ihr Lager nach markierten Karten wie der, die wir in Valdrakken gefunden haben.', '', '', '', '', '', '', 47187),
(70841, 'deDE', 'Mehr Relikte der Titanen', '', '', '', '', '', '', '', '', 47187),
(70840, 'deDE', 'Ein Relikt der Titanen', '', '', '', '', '', '', '', '', 47187),
(70839, 'deDE', 'Die Suche nach Titanenrelikten', '', '', '', '', '', '', '', '', 47187),
(70838, 'deDE', 'Rebellensache', 'Tötet $1oa Rebellen und Primalisten.', 'Der Sammelort der Rebellen... genau der Ort, den wir gesucht haben. Wie gut, dass der Leichtsinn ihres Saboteurs uns hierhergeführt hat.\n\nIch kann nicht fassen, dass meine Brüder sich dazu herabgelassen haben, mit den Primalisten gemeinsame Sache zu machen. Das können wir so nicht stehen lassen. Schaltet die Rebellen und ihre Primalistenfreunde aus, bevor sie weiteren Schaden anrichten können.', '', '', '', '', '', '', 47187),
(70837, 'deDE', 'Verfolgung der Spur', 'Trefft Ermittler Erima beim Nebligen Tal.', '<Ermittler Erima betrachtet die Karte.>\n\nEs ist klar, was das X über dem Sitz der Aspekte bedeutet.\n\nAber es ist auch ein Kreis um das Neblige Tal herum gezeichnet. Vielleicht ist das das nächste Ziel der Rebellen? Oder eine Operationsbasis.\n\nEs gibt nur einen Weg, es herauszufinden. Trefft mich im Tal.', '', '', '', '', '', '', 47187),
