(70781, 'deDE', 'Aus heiterem Himmel', 'Findet Harleen Hohnzirper an den Blaufederklippen.', 'Habt Ihr das gesehen?!\n\nDiese geflügelte Kreatur fiel gerade vom Himmel! Ich weiß nicht, was für ein Geschöpf das ist, aber es ist sicher nicht auf den Inseln heimisch.\n\nWartet... Ich erinnere mich an eine schlagkräftige kleine Goblinfrau, die an den Blaufederklippen über uns nach dem Weg gefragt hat. Glaubt Ihr, sie weiß irgendetwas darüber?', '', '', '', '', '', '', 47187),
(70780, 'deDE', 'Banner von Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70779, 'deDE', 'Tarjins Geschichten', 'Sammelt $1oa beeindruckende Drachenschädel von mächtigen Drachen und Protodrachen der Dracheninseln.', '<Tarjin blickt weiterhin auf die Insel in der Ferne, während er mit Euch spricht.>\n\nHaltet Ihr Euch der unglaublichen Legenden und Geschichten der Djaradin für würdig?\n\nIhr seid ja kaum so groß wie eine unserer Waffen. Pfft.\n\nIch bezweifle, dass Ihr den Mut habt, das Erbe meines Volkes anzutreten.\n\nÜberzeugt mich vom Gegenteil, wenn Ihr könnt. Sucht nach den Drachen, den einzigen würdigen Rivalen auf diesen Inseln.\n\nBringt mir Trophäen Eures Sieges über die Stärksten von ihnen.', '', '', '', '', '', '', 47187),
(70763, 'deDE', 'Weltenschnitzer A\'tir', '', '', '', '', '', '', '', '', 47187),
(70754, 'deDE', 'Die Feuerprimalisten löschen', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hände zu bekommen.', '', '', '', '', '', '', 47187),
(70753, 'deDE', 'Die Luftprimalisten verwehen', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hände zu bekommen.', '', '', '', '', '', '', 47187),
(70752, 'deDE', 'Die Wasserprimalisten verdampfen', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hände zu bekommen.', '', '', '', '', '', '', 47187),
(70751, 'deDE', 'Terillod der Andächtige', '', '', '', '', '', '', '', '', 47187),
(70750, 'deDE', 'Unterstützt das Abkommen', 'Führt Eure Bemühungen fort, dem Valdrakkenabkommen und seinen Verbündeten auf den ganzen Dracheninseln zu helfen.', 'Ihr da! Ja, ich spreche mit Euch. Oder seht Ihr noch jemand anderen hier?\n\n<Therazal wirft einen kurzen Blick auf einige Passanten.>\n\nIgnoriert sie. Sie sind nicht Teil dieses Auftrags. Von Euch habe ich gehört und mit Euch wünsche ich zu sprechen!\n\nDas Valdrakkenabkommen hat mich damit beauftragt, diejenigen ausfindig zu machen, die sich auf den Inseln einen Namen gemacht haben und die danach streben, dass unsere Verbündeten und deren Sicherheit weiterhin oberste Priorität bleiben.\n\nTut, was Ihr am besten könnt, $gKamerad:Kameradin;. Ihr sollt großzügig belohnt werden.', '', '', '', '', '', '', 47187),
(70748, 'deDE', 'Nur für blaue Augen', 'Durchsucht die Azurarchive nach Malygos\' Notizen.', 'Kein Wunder, dass Eure Gefährten noch nichts gefunden haben.\n\nDiese Bücher waren nur für Augen der Blauen gedacht.\n\nDoch meine Gegenwart sollte ausreichen, damit wir die Geheimnisse einiger wichtiger Bände entdecken können.', '', '', '', '', '', '', 47187),
(70747, 'deDE', 'Der azurblaue Zauberer', 'Sprecht mit Erzmagier Khadgar im Lager Antonidas.', 'Ich habe keine Zeit, um mich mit Zauberern herumzuärgern.\n\nBitte kümmert Ihr Euch um diesen \"Erzmagier\", $p. Bringt in Erfahrung, was Ihr könnt, und nehmt Euch stets in Acht. Wir wissen noch nicht, ob wir es mit Freund oder Feind zu tun haben...\n\nUnseren Berichten zufolge liegt südlich von hier ein großer Archivkomplex.\n\nDorthin mache ich mich auf.', '', '', '', '', '', '', 47187),
(70746, 'deDE', 'Blau ist nicht gleich blau', 'Begleitet Glutthal und Telash zum Lager Antonidas.', 'Hey, $p!\nGut, in diesen Gefilden ein bekanntes Gesicht zu sehen. Telash und ich haben uns gerade über Berichte zu... Neuankömmlingen in der Umgebung unterhalten.\n\n<Glutthal senkt ihre Stimme.>\n\nBlaue Drachen.\n\nIn Anbetracht unserer... Vergangenheit mit den Blauen halten Telash und ich es für notwendig, die Situation selbst unter die Lupe zu nehmen.\n\nBitte, schließt Euch uns an.', '', '', '', '', '', '', 47187),
(70745, 'deDE', 'Erzwungene Entspannung', 'Tötet die Elementarbeschwörerin.', 'Diese Primalisten, die Ihr gesehen habt, sehen meiner Ansicht nach nicht nach Anführern aus. Wer würde sich schon vor einem kleinen Hund fürchten?\n\nAlso, falls sie Vadne erwähnt haben, hört sich das nach ihrer Anführerin an. Sie muss diejenige sein, die diese Elementare hereinbringt. Wir müssen die Beschwörerin ausschalten. Um solch einen Ärger verursachen zu können, muss sie sich ganz in der Nähe aufhalten. Überprüft die Höhle direkt unter uns. Ich weiß, dass die weniger gewissenhaften Angestellten dort gerne eine längere Pause einlegen.', '', 'Als Beschwörerin von Dampf und Flamme zieht diese Primalistin es vor, ihre Gegner bei lebendigem Leibe zu kochen.', 'Vadne Herzschinder', '', '', '', 47187),
(70744, 'deDE', 'Schaut Euch die Knochen an!', 'Macht $1oa Sauereien sauber.', '<Der Badmanager würde es bestimmt zu schätzen wissen, wenn hier nicht überall Blut wäre...>', '', '', '', '', '', '', 47187),
(70743, 'deDE', 'Armes Baby', 'Findet Elzaras Baby.', 'Ihr da, $PR! Seid Ihr halbwegs begabt?\n\nBehaltet Ihr Eure Prioritäten im Auge?\n\nGut!\n\nMein armes Baby ist verschwunden. Rettet es, so schnell wie möglich. Es kommt in diesen schrecklichen Umständen nicht alleine zurecht.', '', '', '', '', '', '', 47187),
(70742, 'deDE', 'Liegt in der Familie', 'Durchsucht das Obsidianobservatorium nach Hinweisen auf die Vergangenheit der Dracthyr.', 'Aus der Luft habe ich eines der Artefakte, die Edress am Eingang der Ruinen gefunden hatte, gesehen. Drinnen gibt es zweifelsohne noch mehr.\n\nSie sind irgendwie durch Magie geschützt, aber ich muss näher herangehen, bevor ich sie untersuchen kann. Die Magie hier ist sehr alt.\n\nDas Gelände scheint verlassen zu sein. Aber ich würde nicht darauf vertrauen, dass das lange so bleibt, wenn wir erst einmal tätig werden. Haltet die Augen offen. Wir werden alles aufdecken, was wir können.', '', '', '', '', '', '', 47187),
(70741, 'deDE', 'Ein paar liebste Dinge', 'Sammelt $1oa verlorene Habseligkeiten.', '<So wie es aussieht, ist die Yougaklasse unterbrochen worden, und die Habseligkeiten der Studenten liegen überall verteilt.\n\nDiese Gegenstände einzusammeln, wird dem Bad der Ruhigen Träume sicher helfen.>', '', '', '', '', '', '', 47187),
(70740, 'deDE', 'Dampfreinigung', 'Tötet $1oa Elementare im unteren Bad.', 'Xijan scheint zu glauben, dass die Elementarinvasion auf unser schönes Bad nur ein kleines Problem ist, aber diese Flut aus Flammen und Dampf muss sofort unter Kontrolle gebracht werden.\n\nWir hatten Musikgruppen engagiert, die im unteren Bad spielen sollten, aber die Elementare haben ihre Ausrüstung zerstört. Da wir in dieser Gegend noch nie ein solches Ausmaß an elementarer Zerstörung hatten, vermute ich, dass Primalisten dahinterstecken.\n\nFalls Ihr Euch nützlich machen wollt, beseitigt die Elementare auf der Ostseite des unteren Bads. Dort planen wir die ersten Auftritte.', '', '', '', '', '', '', 47187),
(70739, 'deDE', 'Blutlinien, Süßigkeiten und Teerai', 'Helft Jäger Narman, einen traditionellen Segen für seinen Heiratsantrag zu erhalten.', 'Ich habe mit Khanen gejagt, die schnellsten Bakar eingeholt und einen voll ausgewachsenen Brüffelchbullen mit bloßen Händen niedergerungen. Als Jäger habe ich nichts weiter zu beweisen.\n\nAls Partner hingegen habe ich noch viel zu lernen.\n\nWindweiser Dawa von Klan Ohn\'ir ist mein Herz und Glück. Ich möchte mich nur als seiner Liebe würdig erweisen, doch ich weiß nichts von Traditionen und Ritualen. Ich benötige die Weisheit der Ältesten in Maruukai.', '', '', '', '', '', 'Sprecht mit Jäger Narman auf der Anhöhe der Shikaar in Maruukai.', 47187),
(70738, 'deDE', 'Die Yougaklasse', 'Findet die Lehrerin und $1oa Yougaschüler.', 'Alles lief sehr gut, aber jetzt? Elementare sorgen für einige... ähm... kleine Herausforderungen.\n\nUnsere Gäste genossen die Einrichtungen, als plötzlich all diese Elementare erschienen! Diese widerwärtigen Bestien haben alles gestört. Vermutlich sogar die neue Yougalehrerin.\n\nOh ja, Youga sind neuartige Dehnungsübungen, bei denen Ihr gleichzeitig meditiert. Ich bin mir sicher, dass Lehrerin und Schüler beide so entspannt sind, dass sie die Elementare nicht einmal bemerken.\n\nDennoch, es ist besser auf Nummer sicher zu gehen. Bitte, seht nach ihnen.', '', '', '', '', '', '', 47187),
(70732, 'deDE', 'Übungskampf', 'Besiegt Gwosh im Haustierkampf.', 'Also gut! Nachdem Ihr den Stein auf Lubbins angewendet habt, sollten wir eine Proberunde veranstalten, um seine Fertigkeiten zu testen!\n\nEs gibt einen großen, alten Flunker namens Gwosh, der an der Küste nördlich von hier lebt. Gwosh liebt das Kämpfen! Naja, eher das Spielen. Er kommt auch super mit anderen Haustieren aus!\n\nDas wird der perfekte Spaß... ich meine Kampf... für Lubbins.', '', '', '', '', '', '', 47187),
(70730, 'deDE', 'Geber der Shikaar', 'Helft dem Windweisen Dawa bei der Vorbereitung des perfekten Antrags.', 'Oh, $p.\n\nFühlt Ihr Euch wohl unter der Sonne? Fühlt Ihr Euch sicher in ihrer hellen Umarmung? Bedeutet jeder neue Tag Hoffnung für die Zukunft und eine Chance, Euer Leben so zu leben, wie Ihr es Euch schon immer erträumt habt?\n\nDann kennt Ihr die Liebe so wie ich.\n\nNarman vom Klan Shikaar ist meine Sonne. Er ist meine Wärme. Er ist mein Licht. Er ist meine Hoffnung.\n\nEin solcher Mann verdient einen Antrag, der seiner würdig ist.\n\nWir müssen uns von den Ohn den Weg weisen lassen.', '', '', '', '', '', '', 47187),
(70723, 'deDE', 'Die Erdprimalisten zerschmettern', 'Bringt den Urkern zu Rethelshi.', 'Rethelshi in Valdrakken wird dankbar sein, dies zur Erforschung der Primalisten in die Hände zu bekommen.', '', '', '', '', '', '', 47187),
(70722, 'deDE', 'Was Lubbins braucht', 'Sprecht mit Flicki in Iskaara.', 'Ich glaube, ich weiß jetzt, was wir tun müssen, $n.\n\nAber lasst uns zuerst darüber reden!\n\nIch habe sogar ein Geschenk für Euch, wenn wir fertig sind. Toll, oder?', '', '', '', '', '', '', 47187),
(70721, 'deDE', 'So schön, ich fall in Ohn\'macht...', 'Helft dem Windweisen Dawa und Jäger Narman bei ihren Anträgen.', 'Es gibt einen kleinen Teich beim Spiegel des Himmels, wo Narman und ich uns während meiner Initiandenausbildung zum ersten Mal begegnet sind.\n\nInitianden reisen an diesen Ort, um Ohn\'ahra näher zu sein und so den Wind zu spüren. Zuerst sah ich ihn in der Spiegelung des Wassers, als meine Augen plötzlich durch eine Brise geöffnet wurden. Es gibt auf den Ebenen keinen schöneren Anblick.\n\nDer Teich bildet den perfekten Ort für unseren Antrag.', '', '', '', '', '', '', 47187),
(70720, 'deDE', 'Die gibt\'s nicht', '', '', '', '', '', '', '', '', 47187),
