(70713, 'deDE', 'Hochlandfischen', '', '', '', '', '', '', '', '', 47187),
(70711, 'deDE', 'Stromschnellenstrecke - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70710, 'deDE', 'Stromschnellenstrecke', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70708, 'deDE', 'Grotte', 'Trinkt etwas mit Kolgar.', 'Fühlt sich an, als wären es Jahre gewesen. Aber auch irgendwie nur nach Minuten.\n\nIch könnte jemanden zum Reden brauchen, wenn Ihr Zeit hättet.\n\nWollt Ihr uns etwas zu trinken holen? Holt einfach, was Ihr wollt. Geht auf mich.', '', '', '', '', '', '', 47187),
(70706, 'deDE', 'Portal: Schattenzuflucht', 'Findet das inaktive Portal bei der Schattenzuflucht auf den Ebenen von Ohn\'ahra.', 'Unsere Expedition berichtet von einem inaktiven Stein bei den üppigen Hängen im Südwesten. Es ist ein gutes Stück entfernt, aber es lohnt sich, jemanden mit Eurer Kenntnis für die Untersuchung dort hinzuschicken.', '', '', '', '', '', '', 47187),
(70703, 'deDE', 'Das Vermächtnis von Tyrhold', 'Untersucht mit Koranos die Silberschuppe in Tyrhold.', 'Hüter Tyr liebte seine Rätsel. In dem Geschenk, das er uns gegeben hat, liegt sicherlich eine tiefere Bedeutung. Da er diese Schuppe höchstwahrscheinlich in der ehemaligen Zitadelle geschmiedet hat, ist sie vielleicht der Schlüssel, der uns dabei hilft, ihre Geheimnisse zu enthüllen.\n\nGeht mit Koranos nach Tyrhold, $n. Ich bin mir sicher, dass er als vertrauenswürdiger Berater und Hüter dieses Lands Einsicht in diese Angelegenheit erhalten wird.', '', '', '', '', '', 'Sprecht mit Koranos in Tyrhold.', 47187),
(70702, 'deDE', 'Fortgesetzte Portalerkundung', 'Trefft Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Der laute, kreischende Ruf des kleinen Boten erregt Eure Aufmerksamkeit. Er drückt Euch eine Notiz in die Hand und rennt davon.\n\nAuf dem Zettel ist eine Nachricht von Thaelin Schwarzamboss, der Eure Hilfe benötigt.>', '', '', '', '', '', '', 47187),
(70701, 'deDE', 'Bakar träumen von verirrten Riesenwildschafen', 'Bringt die verirrten Riesenwildschafe zurück zum Klan Aylaag.', 'Einige Riesenwildschafe des Klans sind mal wieder von der Herde weggewandert.\n\nDer Grat um uns ist für unsere Schäfer zu gefährlich, um nach ihnen zu suchen. Es wäre ein großer Segen für uns, wenn Ihr einen unserer Bakars nehmen und die Riesenwildschafe zurückbringen könntet. Unsere Schäfer können Euch die richtige Richtung weisen.', '', '', '', '', '', '', 47187),
(70698, 'deDE', 'Forscherin Schleichflügel', '', '', '', '', '', '', '', '', 47187),
(70697, 'deDE', 'Eine Expertenmeinung', 'Sprecht mit Flicki im Azurblauen Gebirge.', 'Lubbins Wunden sind verheilt, aber ich fürchte, sein Selbstvertrauen hat stark gelitten. Ich glaube, es ist an der Zeit, andere um Hilfe zu bitten.\n\nWeit im Südwesten in einer entlegenen Region des Azurblauen Gebirges gibt es eine Kampfhaustiertrainerin namens Flicki. Sie gehört zu den weltbesten Experten in dieser Sache.\n\nStattet ihr bitte einen Besuch ab. Ich bin sicher sie kann Lubbins helfen!', '', '', '', '', '', '', 47187),
(70662, 'deDE', 'Knochenarbeit', '', '', '', '', '', '', '', '', 47187),
(70659, 'deDE', 'Katalogisieren der Ebenen von Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70653, 'deDE', 'Eiskalte Wissenschaft', '', '', '', '', '', '', '', '', 47187),
(70652, 'deDE', 'Einer nach dem anderen', '', '', '', '', '', '', '', '', 47187),
(70648, 'deDE', 'Firava der Entzünder', '', '', '', '', '', '', '', '', 47187),
(70647, 'deDE', 'Wo nur, wo könnte er bloß sein?', 'Rettet Lubbins und bringt ihn zu Jyhanna bei der Krippe \"Kleinschuppe\" in Valdrakken zurück.', '$n, Ich bin so froh, Euch zu sehen! Ich bin ganz krank vor Sorge und könnte Eure Hilfe brauchen.\n\nIch habe vor Kurzem einen verlassenen Protodrachenwelpen gerettet und Lubbins getauft, weil er so liebenswert ist! Ich habe ihn hierhergebracht, um mich um ihn zu kümmern und vielleicht ein gutes Zuhause als Haustier für ihn zu finden.\n\nAber jetzt ist er verschwunden und ich habe Angst, dass er sich verirrt hat oder gar verletzt ist. Ich muss mich um die anderen Kleinen hier kümmern, sonst würde ich ihn ja selbst suchen gehen. Wärt Ihr wohl so gut, nach ihm zu suchen?', '', '', '', '', '', '', 47187),
(70644, 'deDE', 'Die Zähmung der Wildziege', '', '', '', '', '', '', '', '', 47187),
(70643, 'deDE', 'Arkaner Sprengstoff', '', '', '', '', '', '', '', '', 47187),
(70641, 'deDE', 'Ein augenöffnender Schwur', 'Sprecht mit Mitgliedern des roten Drachenschwarms am Rubinlebensschrein.', 'Einen Moment noch, $p. Ich möchte mich persönlich bei Euch für Eure Hilfe bei der Wiederherstellung des Schwursteins bedanken.\n\nIch wusste nichts von den Dracthyr, bevor Ihr auf der Verbotenen Insel erwacht seid. Es war nicht klar, was Eure Ankunft für uns bedeutet. Ob Eure Art ein Segen für die Verteidigung des Leben hier sein würde... oder ein Fluch.\n\nIch möchte Euch ermutigen, mehr über den Schwurstein herauszufinden. Sprecht mit Mitgliedern meines Schwarms hier beim Rubinlebensschrein. Vielleicht werdet Ihr Bekanntes in unseren Sagen und Geschichten erkennen.', '', '', '', '', '', '', 47187),
(70640, 'deDE', 'GESUCHT: Boss', 'Tötet Frigellus in der Nähe von Lager Antonidas.', '<Die Schrift der Seite leuchtet in einem sanften blauen Licht.>\n\nDer Elementar Frigellus, einst ein geliebtes Spielzeug von Malygos, litt unter der Vernachlässigung durch seinen Herrn.\n\nWährend dieses einst glückliche Dorf immer weiter zerfiel, wurde das neckische und verspielte Wesen von den Übeln, die dieses Land plagen, entstellt und verdreht.\n\nBitte neutralisiert dieses Wesen.\n\nTeilt Euren Erfolg anschließend dem Hüter Cynegos mit.', '', '', 'Frigellus', '', '', '', 47187),
(70638, 'deDE', 'Windbrecher', '', '', '', '', '', '', '', '', 47187),
(70634, 'deDE', 'Ausgepeitscht', '', '', '', '', '', '', '', '', 47187),
(70633, 'deDE', 'Die Maschine auf Touren bringen', 'Benutzt die abgefüllte Essenz, um die Innovationsmaschine mit Energie zu versorgen.', 'Ihr habt gute Arbeite geleistet und die erste Herausforderung bestanden, die Hüter Tyr hinterlassen hat. Obwohl es nur der erste Schritt auf Eurer Reise ist, glaube ich daran, dass Ihr Euch gut schlagen werdet. Ihr habt Euch die Gelegenheit verdient, die Geheimnisse der Schmiede aufzudecken.\n\nGebt die abgefüllte Essenz in die Innovationsmaschine, und wartet ab, was passiert.', '', '', '', '', '', '', 47187),
(70627, 'deDE', 'Was ist mit dem Winterpelzklan?', 'Trefft Sonova Schneeweh bei Therons Wacht.', 'Wir könnten einem anderen Klan beitreten... wenn wir wüssten, dass es sicher ist.\n\nIch befürchte, dass die Primalisten auch andere Klans so wie unseren in Versuchung gebracht haben.\n\nLaut dieser \"Drachenschuppenexpedition\" haben sie eine Klauenfeste nahe des Winterpelzklans.\n\nVielleicht sind sie auch schon verdorben. Oder sie hören unsere Warnung an. So oder so, sie brauchen uns.\n\nIn Therons Wacht gibt es einen \"Furbolgexperten\", Sonova Schneeweh. Bitte sucht ihn auf und bringt in Erfahrung, was er weiß.', '', '', '', '', '', '', 47187),
(70620, 'deDE', 'Wie Schuppen von den Augen', 'Sammelt $1oa Adamantschuppen für Ralathor den Zerfurchten in Valdrakken.', 'Viele Leute fragen mich, wie ich so gut im Häuten geworden bin. Denen kann ich nur sagen: Es kommt alles von den Schuppen!\n\nWollt Ihr mehr darüber erfahren? Bringt mir Schuppen, dann zeige ich Euch, was ich meine.', '', '', '', '', '', '', 47187),
(70618, 'deDE', 'Der Ruf der Schmiede', 'Sammelt $1oa Sereviterz für Sekita den Wühler in Valdrakken.', 'Die Schmiede... sie ruft nach mir. Und sie bittet um Serevit. Ihr da! Bringt mir Serevit! Ja, Unmengen an Serevit! <Sekita lacht manisch.>', '', '', '', '', '', '', 47187),
(70617, 'deDE', 'Alles meins, meins, meins', 'Sammelt $1oa Drakoniumerz für Sekita den Wühler in Valdrakken.', 'Nichts ist so nützlich wie Drakoniumerz. Man kann so viel damit machen! Es ist einfach das perfekte Erz, in jeder Hinsicht rein.\n\nBringt mir Drakonium. Ich muss es haben. Ihr seid doch $gBergarbeiter:Bergarbeiterin;, oder? Dann an die Arbeit!', '', '', '', '', '', '', 47187),
(70613, 'deDE', 'Gebt eine Runde Rinde aus', 'Sammelt $1oa Krümmrinde für Agrikus in Valdrakken.', '$p, Ihr seid doch $gein fähiger Kräuterkundiger:eine fähige Kräuterkundige;, nicht wahr? Ständig kommen Alchemisten händeringend an meine Tür... wenn ich eine Tür hätte... und flehen mich um Krümmrinde an. Wir sind fast ausverkauft!\n\nHelft Ihr mir, noch welche zu sammeln? Ich fürchte, wenn die Alchemisten ihre Tränke nicht brauen können, fangen sie an, mit meinem Besitz zu experimentieren.', '', '', '', '', '', '', 47187),
(70595, 'deDE', 'Schneiderei ist gefragt', 'Erfüllt Schneidereiaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70594, 'deDE', 'Lederverarbeitung ist gefragt', 'Erfüllt Lederverarbeitungsaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70593, 'deDE', 'Juwelierskünste sind gefragt', 'Erfüllt Juwelierskunstaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70592, 'deDE', 'Inschriftenkunde ist gefragt', 'Erfüllt Inschriftenkundeaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70591, 'deDE', 'Ingenieurskünste sind gefragt', 'Erfüllt Ingenieurskunstaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70589, 'deDE', 'Schmiedekünste sind gefragt', 'Erfüllt Schmiedekunstaufträge für das Handwerkerkonsortium.', 'Ha, ha, hallo, $p! Die Handwerksaufträge kommen am laufenden Band!\n\nWenn Ihr Arbeit sucht, hat das Handwerkerkonsortium immer genug Aufträge zu erfüllen!\n\nIhr könnt einen Blick auf unser schwarzes Brett werfen, oder, falls Ihr bereits ein eigenes Kundennetzwerk habt, persönliche oder Gildenbestellungen abarbeiten! Seid immer fleißig, fleißig, fleißig!', '', '', '', '', '', '', 47187),
(70586, 'deDE', 'Zu viele Köche', 'Stellt $1oa Wildstoffkochmützen für Fulafong in Valdrakken her.', 'Wenn ich eines in meinen Jahren als Schneiderin gelernt habe, $p, dann, dass zu viele Köche alles verderben.\n\nIn diesem Fall wollte ich gerade was trinken gehen, als im letzten Moment eine Bestellung für einen ganzen Kleiderschrank voll Kochuniformen reinkam.\n\nWenn Ihr die Mützen nähen könntet, würde ich mich um alles andere kümmern.', '', '', '', '', '', '', 47187),
(70582, 'deDE', 'Alleine besser weben', 'Stellt $1oa Wildstoffballen für Fulafong in Valdrakken her.', 'Wenn ich eines in meinen Jahren als Schneiderin gelernt habe, $p, dann, wie wichtig regelmäßige Übung ist.\n\nÜbt Euch stets in Eurem Handwerk, auch wenn Ihr glaubt, Ihr habt bereits alles gemeistert. Ihr sollt in der Lage sein, auch ohne meine Aufsicht exzellente Stoffe zu weben.\n\nÜbt doch diese Woche ein wenig. Stellt ein paar Wildstoffballen der höchsten Qualität her.', '', '', '', '', '', '', 47187),
(70571, 'deDE', 'Trommelwirbel!', 'Stellt $1oa Wildbalgtrommeln für Balgformer Koruz in Valdrakken her.', 'Unsere Trommeln sind weit und breit bekannt. Die Zentauren haben sich diese Fähigkeiten über Generationen erarbeitet. Das heißt aber leider, dass unsere Trommeln derzeit Mangelware sind.\n\nWie ich sehe, könnt Ihr durchaus auch etwas. Mögt Ihr mir vielleicht helfen, einige Trommeln für unsere Lager herzustellen?', '', '', '', '', '', '', 47187),
(70569, 'deDE', 'Ein Korb für Trorb', 'Stellt $1oa Blumenkörbe des Kräuterkundigen für Balgformer Koruz in Valdrakken her.', 'Ich habe viele geschätzte Kunden, aber Trorb ist einer meiner Lieblinge. Zuletzt kam er zu mir, weil sein Kräuterbeutel zerschlissen war.\n\nIch habe ihm angeboten, ihm eine Auswahl an Körben als Ersatz für seinen Beutel anzufertigen.\n\nWürdet Ihr mich bei dieser Aufgabe unterstützen, $p? Trorb würde Euch danken.', '', '', '', '', '', '', 47187),
(70567, 'deDE', 'Wenn man einem Bakar einen Knochen zuwirft', 'Stellt $1oa knochengefertigte Armbrüste für Balgformer Koruz in Valdrakken her.', 'Ich hatte so schöne knochengefertigte Bogen, aber unsere Bakar haben sie sich geschnappt, bevor sie jemand nutzen konnte. Bakar kauen nun einmal gern auf Knochen herum, Bogen hin oder her. Jetzt sind sie ruiniert!\n\nKönnt Ihr mir dabei helfen, Ersatz anzufertigen?', '', '', '', '', '', '', 47187),
(70565, 'deDE', 'Besonderheit durch Sättigung', 'Stellt $1oa Anhänger der bevorstehenden Gefahren für Tuluradormi in Valdrakken her.', 'Oh, $gJuwelier:Juwelierin;, gefällt Euch meine Halskette?\n\nNatürlich tut sie das. Aber ich kann sie nicht angemessen ausstellen, wenn sie nicht heraussticht.\n\nIch hab\'s! Warum stellt Ihr nicht einige einfache Anhänger her, mit denen wir den Markt fluten können. Wenn erst jeder Euren Schmuck trägt, wird der funkelnde Schliff meiner Halskette alle anderen überstrahlen!', '', '', '', '', '', '', 47187),
(70564, 'deDE', 'Brillant', 'Stellt $1oa Kopflupen aus gesplittertem Onyx für Tuluradormi in Valdrakken her.', '$gJuwelier:Juwelierin;, eine Ausstellung steht an, aber ich befürchte, dass die Besucher die wahre Schönheit der einzelnen Schliffe ohne die richtigen Linsen nicht erkennen können.\n\nSie müssen nichts Besonderes sein. Stellt nur ein paar Kopflupen her, damit unsere Kunden gut sehen können.', '', '', '', '', '', '', 47187),
(70560, 'deDE', 'Das mächtigste Werkzeug: Gute Dokumentation', 'Stellt $1oa Kompendien des Kernforschers für Talendara in Valdrakken her.', 'Mein Inschriftenlehrling, seid Ihr heute in der Stimmung, zu schreiben? Die Drachenschuppenexpedition hat unzählige Notizen von ihren Abenteuern mitgebracht und uns gebeten, ihre Zettelwirtschaft zu einem ordentlichen Kompendium zusammenzufassen, in dem sie unterwegs nachschlagen können. Ach, aber meine Hand ist heute einfach nicht für diese Aufgabe gemacht. Darf ich mich noch einmal an Euch wenden?', '', '', '', '', '', '', 47187),
(70559, 'deDE', 'Federleichte Hilfe', 'Stellt $1oa befestigte Federkiele des Schreibers für Talendara in Valdrakken her.', 'Mein Inschriftenlehrling, ich freue mich, Euch zu sehen.\n\nHeute Morgen habe ich einige Novizen gebeten, sich an der Inschriftenkunde zu versuchen. Aber sie haben alle mit viel zu viel Druck geschrieben und die Spitzen ihrer Federkiele abgebrochen!\n\nIch frage nur ungern, aber könntet Ihr einige Federkiele herstellen, um das Lager zu füllen?', '', '', '', '', '', '', 47187),
(70557, 'deDE', 'Fernrohre fern', 'Stellt $1oa bronzene Feuerflieger für Klickiklack Schmetterschlag in Valdrakken her.', 'Großartige Geräte, Fünkchen, heute habe ich was großes für Euch!\n\nScheinbar ist unter den Jägern ein Feuerwerkstrend ausgebrochen. Sie versuchen, die Enten damit in die Luft aufzuscheuchen. Ich wette, die Enten sind zu klug für sowas, aber das hindert uns ja nicht daran, Profit aus der Sache zu schlagen! Seid Ihr dabei?', '', '', '', '', '', '', 47187),
(70550, 'deDE', 'Willkommen im Konvent', 'Sprecht mit Xavin im Kobaltkonvent, um zu sehen, welche Möglichkeiten die Umgebung zu bieten hat.', 'Wir könnten Eure Hilfe brauchen.\n\nDie Splitterflammen haben die Kontrolle über den Großteil des Kobaltkonvents erlangt.\n\nBitte, helft uns im Kampf gegen sie. Wir sind zwar nicht viele, aber auch wir können das eine oder andere tun, um Euch zu helfen.', '', '', '', '', '', '', 47187),
(70542, 'deDE', 'Rennen des Azurblauen Gebirges', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70541, 'deDE', 'Jagdtaktiken: Begleiter', 'Wählt, ob Ihr auf der großen Jagd an der Seite eines Bakars oder Ohunas kämpfen möchtet.', 'Euer Ruhm bei den Maruuk wächst. Ihr könnt nun an der Seite eines zähen Bakars oder flinken Ohunas kämpfen.', '', '', '', '', '', '', 47187),
(70540, 'deDE', 'Der beste Freund des Ingenieurs', 'Stellt $1oa Mehrzweckwerkzeuge für Klickiklack Schmetterschlag in Valdrakken her.', 'He, Fünkchen, Habt Ihr mein...\n\nÄhm... gebt mir doch das...\n\nDas ist es! Ich glaube, es ist an der Zeit, dass wir ein paar mehr Werkzeuge in diesem Laden haben, Ihr wisst, was ich sagen will?', '', '', '', '', '', '', 47187),
(70533, 'deDE', 'Trunk, neu geölt', 'Stellt $1oa Schauderfeueröle für Conflago in Valdrakken her.', 'Wusstet Ihr, dass Schauderfeueröl ein ausgezeichnetes Reagenz ist, um Tränke zu veredeln? Ich schon. Und jetzt habe ich keines mehr. Ich kann nicht ohne einen guten Vorrat an Ölen arbeiten. Bitte, $p, helft mir, die Vorräte in meinem Labor aufzustocken.', '', '', '', '', '', '', 47187),
(70532, 'deDE', 'Hilfe für die Plünderer', 'Stellt $1oa erfrischende Heiltränke für Conflago in Valdrakken her.', 'Oh, $p, ich bin so froh, Euch zu sehen. Mehrere Champions wurden beim letzten Angriff auf die Primalisten verletzt. Wir brauchen dringend Heiltränke. $gEin Abenteurer:Eine Abenteurerin; wie Ihr hat sicherlich einige griffbereit. Wir brauchen eine ganze Menge.', '', '', '', '', '', '', 47187),
(70526, 'deDE', 'Rennen der Ebenen von Ohn\'ahra', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70501, 'deDE', 'Jagdschein', 'Schließt die Übungsaufgabe für die Große Jagd ab.', 'Ah, seid Ihr endlich bereit, Euch als $gJäger:Jägerin; zu beweisen? Denkt daran, dass es nicht einfach darum geht, umherzurennen und alles zu erlegen, was sich bewegt. Die Shikaar jagen bewusst. Wir jagen, um den Klan zu nähren und einzukleiden, um unsere Stärke gegen mächtige Feinde zu beweisen und um die Natur im Gleichgewicht zu halten.\n\nWir jagen das Land nicht leer, wir säen währenddessen die Saat für künftige Große Jagden. Zeigt uns, dass Ihr imstande seid, diese Anweisungen zu befolgen, dann dürft Ihr $geiner:eine; von uns werden.\n\nIch habe jedoch wenig Vertrauen, dass Eure Begleitung dort Erfolg hat.', '', '', '', '', '', '', 47187),
(70450, 'deDE', 'Otterabwehr', 'Vertreibt die lästigen Ottuks.', 'Hallo, $gmein Freund:meine Liebe;. Diese garstigen Ottuks hier klauen mir ständig meinen Fang!\n\nIch persönlich würde sie einfach in die Luft jagen, aber unsere Tuskarrfreunde sind von der Idee wenig angetan. Ich habe deshalb diese Ottukabwehrapparatur MK-H4I entwickelt, aber... leider bin ich kein besonders guter Schwimmer.\n\nIhr scheint mir eher fürs kühle Nass gemacht zu sein. Also seid doch so gut, aktiviert das Gerät und schwimmt ein paar Runden, um sie zu vertreiben, hm?', '', '', '', '', '', '', 47187),
(70446, 'deDE', 'Eine persönliche Geschichte', 'Trefft Glutthal am Obsidianobservatorium.', 'Beim Erforschen der Archive habe ich Verweise gefunden, die darauf hindeuten, dass es sich beim Obsidianobservatorium um einen Ort von persönlicher Bedeutung für den Erdwächter handelt. Ich kann nur vermuten, welches Wissen sich dort über die Geschichte unseres Schwarms verbirgt.\n\nIm Anbetracht von Glutthals Interesse an diesem Thema habe ich sie von meiner Entdeckung in Kenntnis gesetzt. Ich bete nur, dass das kein Fehler war.\n\nSie ist voraus, um etwas Aufklärung zu betreiben. Bitte behaltet sie im Auge. Sie ist eine kompetente Soldatin, aber dieses Thema ist ziemlich... beängstigend. Wer weiß, worauf Ihr stoßt.', '', '', '', '', '', '', 47187),
(70444, 'deDE', 'Die Felder der Wildheit', 'Trefft Gurgthock an den Feldern der Wildheit.', 'Auf die mutigsten Shikaar!\n\nVersammelt Eure besten Kämpfer und geht zu den Feldern der Wildheit. Vielleicht werdet Ihr zum mächtigsten von allen gekrönt!\n\nBeweist Eure Kraft. Zeigt uns Eure Kampfeskünste!\n\nEs gelten die Teilnahmebedingungen.', '', '', '', '', '', '', 47187),
(70439, 'deDE', 'Wildes Arkana', '', '', '', '', '', '', '', '', 47187),
(70438, 'deDE', 'Fliegende Fische', 'Sammelt Fische, um das Angelloch zu bestücken, und besteigt Euren Drachen, um sie von oben abzuwerfen.', 'Die Fische könnten etwas besser beißen, meint Ihr nicht?\n\nDa kommt mir eine Idee. Der Legende nach waren diese Seen und Flüsse nicht immer voller Fische. Angeblich wurden diese Wasserlöcher mit Fischen bestückt, als die Drachen darüber segelten und sie fallen ließen! Könnt Ihr das glauben?\n\nVielleicht könntet Ihr es mit Eurem Drachen mal versuchen?', '', '', '', '', '', '', 47187),
(70437, 'deDE', 'Auf nach Tyrhold', 'Trefft Alexstrasza beim Sitz der Aspekte.', 'Jahrhunderte sind vergangen, seit die Schwärme zuletzt Tyrhold besucht haben.\n\nDennoch müssen wir dorthinreisen und herausfinden, ob der Mutterschwurstein noch genutzt werden kann.\n\nSprecht am Sitz der Aspekte mit mir. Wir müssen in Erfahrung bringen, welche Gefahren uns bei Tyrs ehemaliger Festung erwarten.', '', '', '', '', '', 'Trefft Euch mit Alexstrasza bei Tyrhold.', 47187),
(70434, 'deDE', 'Drachenreiterrennen - Akademieaufstieg', '', '', '', '', '', '', '', '', 47187),
(70433, 'deDE', 'Drachenreiterrennen - Klippenrundstrecke', '', '', '', '', '', '', '', '', 47187),
(70428, 'deDE', 'Drachenreiterrennen - Iskaara-Tour', '', '', '', '', '', '', '', '', 47187),
(70421, 'deDE', 'Drachenreiterrennen - Schluchtflusslauf', '', '', '', '', '', '', '', '', 47187),
(70417, 'deDE', 'Drachenreiterrennen - Schwingenrastkreisel', '', '', '', '', '', '', '', '', 47187),
(70414, 'deDE', 'Wankender Boden', 'Platziert die zerschmetternden Totems, um die gefangenen Höhlensteine zu befreien.', 'Im Namen von Khaz\'goroth, was geht hier vor?\n\nDieses Magma hat wirklich seinen eigenen Willen und verzehrt die elementaren Höhlensteine von unten. Hier ist nicht bloß Meister Zufall am Werke... Ich werde dahinterkommen!\n\nPlatziert diese zerschmetternden Totems neben jedem der gefangenen Elementare, um sie zu befreien!', '', '', '', '', '', '', 47187),
(70410, 'deDE', 'Drachenreiterrennen - Blitzfrost-Überflug', '', '', '', '', '', '', '', '', 47187),
(70390, 'deDE', '(DNT) Chloe\'s Onboarding Kill Quest', 'Kill %1oa CREATURE NAME in POI NAME.', 'Bitte tötet diese Kreaturen, die noch nicht geschaffen wurden, und helft mir beim Lernen!', '', '', '', '', '', '', 47187),
(70377, 'deDE', 'Heruntergekommene Mode', 'Findet den Besitzer der Sonnenbrille.', '<Eine abscheuliche Sonnenbrille tropft nur so von Schleim, aber sie sieht sehr teuer aus.\n\nJemand vermisst sie sicherlich. Dieser Stil ist gerade heiß begehrt.>', '', '', '', '', '', '', 47187),
(70376, 'deDE', 'Zweite Herausforderung von Tyr: Macht', 'Schließt die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra ab.', '<Als Ihr Euch nähert, strahlt die Inschrift auf der Statue ein sanftes Leuchten aus.>\n\n\"Führt die Macht des Hüters und zeigt die unerschrockene Entschlossenheit der Standhaften.\"', '', '', '', '', '', '', 47187),
(70374, 'deDE', 'Himia die Gesegnete', 'Besiegt die Elemente.', 'Die Elemente beanspruchen dieses Land für sich und begrüßen Euer Eindringen nicht.\n\nOh, Elemente, habt Ihr unseren Beschützer vergessen...? Luft! Unsichtbar, doch allgegenwärtig und lebenswichtig für jegliche Existenz. So leicht vergessen, wie man sie einatmet. Nachdem Ihr mir gegenübergestanden habt, werdet Ihr es nie wieder vergessen.', '', '', '', '', '', 'Kehrt zur ältesten Nazuun in Teerakai zurück.', 47187),
(70373, 'deDE', 'Todesschwingengurlugull!', 'Steigt in den Springer ein und besiegt Todesschwingengurlugull!', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tögrbrrl!!\n\nBrrruuummm blürglg!!\n\n<Ihr braucht keinen Dolmetscher, um zu verstehen, dass ihr die Murlocversion von Todesschwinge zur Strecke bringen sollt. Bevor Ihr zustimmen oder ablehnen könnt, hört Ihr schon das Brüllen eines Maschinenmotors auf Euch zukommen!>', '', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tögrbrrl!!', 'Todesschwingengurlugull', '', '', '', 47187),
(70371, 'deDE', 'Todesschwingengurlugull!', 'Steigt in den Springer ein und besiegt Todesschwingengurlugull!', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tögrbrrl!!\n\nBrrruuummm blürglg!!\n\n<Ihr braucht keinen Dolmetscher, um zu verstehen, dass ihr die Murlocversion von Todesschwinge zur Strecke bringen sollt. Bevor Ihr zustimmen oder ablehnen könnt, hört Ihr schon das Brüllen eines Maschinenmotors auf Euch zukommen!>', '', 'Todesschwingengurlugull! Todesschwingengurlugull! Todesschwingengurlugull tögrbrrl!!', 'Todesschwingengurlugull', '', '', '', 47187),
(70370, 'deDE', 'Berufsexamen', 'Macht Haephestas Persönlichkeitstest, um herauszufinden, welcher Beruf am besten zu Euch passt.', 'Hallo! Hättet Ihr Interesse daran, mit dem Handwerkerkonsortium zusammenzuarbeiten, um reichlich Gewinn zu machen und Kunden in ganz Azeroth mit wertvollen Gütern und Dienstleistungen zu versorgen?\n\nAusgezeichnet! Welche beiden Berufe habt Ihr gelernt?\n\n... Hmm? Ich habt nur einen Beruf? Was für eine verpasste Gelegenheit!\n\n<Haephesta denkt kurz nach.>\n\nIch weiß! Ich stelle Euch eine Reihe von Fragen über Eure Persönlichkeit und schon finden wir heraus, welcher weitere Beruf am besten zu Eurem bisherigen Beruf passt! Was sagt Ihr?', '', '', '', '', '', '', 47187),
(70368, 'deDE', 'Berufsexamen', 'Macht Haephestas Persönlichkeitstest, um herauszufinden, welcher Beruf am besten zu Euch passt.', 'Hallo! Hättet Ihr Interesse daran, mit dem Handwerkerkonsortium zusammenzuarbeiten, um reichlich Gewinn zu machen und Kunden in ganz Azeroth mit wertvollen Gütern und Dienstleistungen zu versorgen?\n\n... Hmm? Ihr habt keinen Beruf? Was für eine verpasste Gelegenheit!\n\n<Haephesta denkt kurz nach.>\n\nIch weiß! Ich stelle Euch eine Reihe von Fragen über Eure Persönlichkeit und schon finden wir heraus, welcher Beruf am besten zu Euch passt! Was sagt Ihr?', '', '', '', '', '', '', 47187),
