(70352, 'deDE', 'Wie Schuppen von den Augen', 'Tötet Flunker und territoriale Protodrachen mit Toluiqi.', 'Ihr da, Fremdling! Ihr habt schon mal Protodrachen getötet, nicht wahr?\n\nDann möchte ich meinen, dass wir mit Eurer Erfahrung und meinen Jagdkünsten zusammen eine ganze Reihe von ihnen zur Strecke bringen könnten. Hier in der Nähe liegen Quellen, die drakonische Bestien anlocken.\n\nHelft mir, meiner törichten besseren Hälfte zu beweisen, dass ich die bessere Jägerin bin.', '', '', '', '', '', '', 47187),
(70351, 'deDE', 'Gartenfest', 'Sprecht mit Akora bei den Rubinlebensbecken.', 'Ich habe mich seit Jahren um diesen Garten gekümmert und mich auf den Tag vorbereitet, an dem ich endlich meine Lebensaufgabe annehme. Und nun ist dieser Tag gekommen!\n\nIch liebe alle Bäume und Blumen und Pflanzen... und selbst die Krabbeltiere, die sich dazwischen verstecken. Ich kann den Geist der Natur, den großen Drachengeist, spüren, wenn ich mich um den Garten kümmere.\n\nEs gibt nur noch eines zu tun. Ich werde den großen Drachengeist beschwören, genau wie in den Legenden.\n\n<Akoras Lächeln strahlt vor Freude.>\n\nTrefft mich unten im Garten bei dem Becken, wo ihre Knochen ruhen. Ich erkläre Euch den Rest dort.', '', '', '', '', '', '', 47187),
(70341, 'deDE', 'Wohlverdienter Sieg', 'Kehrt zur Innovationsmaschine in Valdrakken zurück.', 'Die kleinsten Dinge können die größten Schätze enthalten.\n\nBringt die Essenz zur Innovationsmaschine.', '', '', '', '', '', '', 47187),
(70339, 'deDE', 'In Tyrs Fußstapfen: Die Ebenen von Ohn\'ahra', 'Findet die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra.', 'Obwohl Ihr Eure erste Herausforderung gut gemeistert habt, solltet Ihr nicht glauben, dass Euch alles so leicht gelingt. Hüter Tyr wollte, dass die Innovationsmaschine nur von denen genutzt wird, die würdig sind, sie weise einzusetzen.\n\nWenn Ihr Euch nicht abschrecken lasst, werdet Ihr die zweite Herausforderung auf den Ebenen von Ohn\'ahra finden. Ich freue mich darauf, Eure Fähigkeiten zu prüfen, $gAbenteurer:Abenteurerin;.', '', '', '', '', '', 'Findet die zweite Herausforderung von Tyr auf den Ebenen von Ohn\'ahra.', 47187),
(70338, 'deDE', 'Denkt niemand an die Kinder?!', 'Rettet die Jungen.', 'Wenn Sylvie verstört ist, dann muss das bedeuten, dass ihre Jungen da drinnen sind!\n\nDie Riesen müssen ihre Jungen entführt haben, während sie infiziert und zu schwach war, sie zu retten.\n\nDie Jungtiere sind in einem ziemlich lebhaften Alter, hoffentlich waren sie bisher flink genug, den Riesen zu entkommen...\n\nHier, benutzt mein Unsichtbarkeitsamulett... Schnell, Ihr müsst sie retten, bevor sie gefressen werden!', '', '', '', '', '', '', 47187),
(70337, 'deDE', 'Glutwacht', 'Bringt das Windspiel der Ohn\'ir nach Glutwacht.', 'Seid gegrüßt, Fremdling.\n\nDie Winde brachten Kunde von einer Gruppe, die Zuflucht in den Ruinen von Glutwacht gesucht hat. Sie scheinen sich nur für die Vergangenheit zu interessieren, während wir Zentauren für die Gegenwart unter dem Segen Ohn\'ahras leben.\n\nNichtsdestoweniger sind sie Gäste unserer Heimstatt. Ich habe dieses Windspiel für sie angefertigt, damit sie Ohn\'ahras Gegenwart wahrnehmen können. Möge es ihnen Freude und Behaglichkeit bereiten.', '', '', '', '', '', '', 47187),
(70335, 'deDE', 'Einfache Ausgrabungswerkzeuge', '', '', '', '', '', '', '', '', 47187),
(70319, 'deDE', 'Nergazurai', 'Bringt ein Ottukherz, einen Felszahnoberschenkelknochen, eine Hornschreiterschuppe und einen Geiermuskelmagen zu Muqur dem Regenberührten am Baumschrittaußenposten.', 'Mein Onkel erzählte mir viele Geschichten von seinem Kampf gegen einen Hornschreiter namens Nergazurai. Er berichtete von den fuchsienfarbigen Schuppen, die durch die Ebenen sausen, wenn Nergazurai auf der Suche nach Beute ist, von seinen messerscharfen Klauen und seinem giftigen Biss.\n\nIch war gerade auf der Jagd, als ich seine Silhouette erspähte, aber es war zu spät: Er verpasste mir eine üble Bisswunde an der Schulter. Er war so furchtbar, wie mein Onkel beschrieben hatte, aber irgendwie kam ich mit dem Leben davon.\n\nIch muss aber die Infektion von der Bisswunde reinigen. Bitte, sammelt die Reagenzien, die ich brauche. Mir bleibt nicht mehr viel Zeit.', '', '', '', '', '', '', 47187),
(70279, 'deDE', 'Blut von Drachen', 'Tötet Karkidan.', 'Wie Ihr sicher schon gesehen habt, gibt es in diesem Land Kreaturen, die über ihre normale Größe hinauswachsen.\n\nWir betrachten diese Bestien als von den wilden Göttern gesegnet. Sie werden von Jägern oft als ehrenvolle Ziele angesehen, denn so beweisen sie ihre Stärke. Eine dieser Bestien, die wir Karkidan nennen, befindet sich in der Nähe. Ich wäre sehr beeindruckt, wenn Ihr es schaffen würdet, Karkidan zu erlegen.', '', '', '', '', '', '', 47187),
(70268, 'deDE', 'Wiederbelebte Erinnerungen', 'Gebt Veritistrasz das Tagebuch.', 'Ihr habt ein teilweise zerstörtes Tagebuch gefunden. Es scheint aus der Sicht einer jungen schwarzen Drachenfrau aus der Zeit vor der Verderbnis geschrieben zu sein.\n\nZwar ist der hintere Teil unleserlich, aber beim Überfliegen des ersten Teils kristallisiert sich ein Name heraus. Veritistrasz.', '', '', '', '', '', 'Gebt Veritistrasz das Tagebuch im Rubinsanktum.', 47187),
(70244, 'deDE', 'Den Nokhud an den Kragen', 'Betretet das Dorf mit Khanam Matra Sarest und erobert es von den Nokhud zurück.', 'Seit Tausenden von Jahren haben die Teerai das Horn von Drusahl, unsere heiligstes Relikt, bewacht. Mit der Plünderung dieses Dorfes hat Balakar alles verraten, was es bedeutet, Maruuk zu sein. Für ihn kann es keine Erlösung mehr geben.\n\nWir müssen das Horn zurückerobern, bevor Balakar es zerstören kann, und alle noch lebenden Teerai retten. Ich werde Euch begleiten, um diesen falschen Khan persönlich zu richten. Die Nokhud werden den Zorn der Khanam Matra zu spüren bekommen!', '', '', '', '', '', '', 47187),
(70242, 'deDE', 'Leben um Leben', 'Sammelt ein inaktives Gefäß bei Trellain im Rubinlebensschrein ein.', 'Ich spüre, dass sein Freund eine tiefe Narbe in sich trug. Etwas an diesem Ort hat sie wieder geöffnet... vielleicht damit sie diesmal vollständig heilen kann.\n\nJetzt muss Kolgar ebenfalls heilen.\n\nAuf der Terrasse über uns findet Ihr meinen Freund Trellain. Er arbeitet mit den Verzauberern. Sagt ihm, dass ich eines der Gefäße benötige, die er auf der Arbeit verwendet. Er wird Euch bereitwillig eins überlassen.', '', '', '', '', '', '', 47187),
(70241, 'deDE', 'Bis zum bitteren Ende', 'Schafft Badoras zu Duroz und Kolgar.', 'Es ist gerade passiert. Ich... Er hat geschlafen und ich hab nur kurz nicht hingesehen und... Wir sind jeden Tag hierhergekommen, er wollte nur bei den Welpen sitzen. Ich wusste nicht, dass er...\n\n<Kolgars Gesicht ist tränenverschmiert. Er reibt sich mit dem Handrücken über die Augen.>\n\nNein, ich wusste es. Ich wusste es. Aber ich weiß nicht, was ich jetzt tun soll. Was mache ich nur mit ihm?\n\nWürdet Ihr... Würdet Ihr bitte Badoras suchen?', '', '', '', '', '', '', 47187),
(70240, 'deDE', 'Schmerzbehandlung', 'Sammelt $1oa milchweiße Knallblumen, $2oa blühende Schattenlilien und eine gefüllte Lebensbeckenphiole.', 'Ihr habt ihn gerade rechtzeitig hergebracht. Ich kann erkennen, dass er starke Schmerzen hat, auch wenn er sie gut erträgt. Das müssen wir alle, wenn die Zeit kommt.\n\nIch fürchte, es ist das Alter, das ihn quält, und keine Krankheit, aber vielleicht kann ich sein Leid ein wenig lindern.\n\nWürde es Euch etwas ausmachen, ein paar Knallblumen, Seichtwasserlilien und reines Wasser aus dem Garten in der Nähe zu holen? Wenn Ihr genug davon findet, kann ich daraus ein Schmerzmittel herstellen.', '', '', '', '', '', '', 47187),
(70239, 'deDE', 'Unausgesprochene Reue', 'Geht ein Stück mit Duroz und Kolgar, um nach Hilfe zu suchen.', 'Duroz ist alt, krank und stur wie ein Kodo. Nichts konnte ihn davon abhalten, mit dem Luftschiff hierherzufliegen. Alles, was ich machen konnte, war, ihm als Gehstock zu dienen.\n\nIch habe ihn oft genug auf dem Schlachtfeld beobachtet, um zu wissen, wann er Schmerzen verheimlicht. Es geht ihm hier draußen jeden Tag schlechter. Könnt Ihr mir helfen, ihn zu den Tränkebrauern zu bringen? Bier reicht ihm nicht mehr.\n\nWenn Ihr unsere Waffen tragen könnt, kann ich ihm beim Gehen helfen.', '', '', '', '', '', '', 47187),
(70236, 'deDE', 'Ausgelöstes Drachenauge', 'Bringt den Gegenstand zu Emilia Bellersen.', '<Das könnte etwas sein, wonach Emilia Bellersen sucht.>', '', '', '', '', '', '', 47187),
(70235, 'deDE', 'Reparaturrechnung', 'Stellt $1oa Serevitreparaturhämmer für Stahlformerin Kuroko in Valdrakken her.', 'Die Dracheninseln haben seit Jahrtausenden keinen Konflikt wie diesen gesehen. Unsere Arbeit steht außer Frage, aber unter der ständigen Nutzung leidet jede gute Rüstung. Ich habe eine große Bestellung an Serevitreparaturhämmern und brauche alle, die ich bekommen kann, um sie zu erfüllen. Wenn Ihr aushelft, gebe ich Euch gerne mehr Informationen, um Eure Schmiedekunst der Dracheninseln zu verbessern.', '', '', '', '', '', '', 47187),
(70229, 'deDE', 'Boku der Mystiker', 'Findet Boku in Teerakai.', 'Die Mystiker wurden vor ein paar Tagen zur Gratwasserzuflucht gerufen, aber ein Mystiker ist geblieben. Sein Name ist Boku. Er befindet sich oben auf dem Hügel am Schrein von Ohn\'ahra.\n\nEr ist noch ein Initiand, aber es sollte ihm möglich sein, mit Ohn\'ahra Zwiesprache zu halten und ihren Segen zu erhalten. Mit Ohn\'ahra an unserer Seite gewinnen wir vielleicht den Krieg, bevor er beginnt.', '', '', '', '', '', 'Findet Boku in Teerakai.', 47187),
(70221, 'deDE', 'Zeigt Euren Eifer', '', '', '', '', '', '', '', 'Erhaltet den Eifer des Handwerkers von Thomas Heller.', 47187),
(70220, 'deDE', 'Schattenzuflucht', 'Sprecht mit Wachhauptmann Alowen, Sariosa, Sidra der Heilerin und Viranikus.', 'Wir müssen den Rest des grünen Drachenschwarms informieren, dass die Barriere vor dem Uralten Zweig bedroht ist. Gerithus und ich haben eine Menge zu besprechen.\n\n$n, ich werde Euch mit meinem Mal versehen. Die anderen Drachen, die es erkennen, werden wissen, dass Ihr $gmein vertrauenswürdiger Bote:meine vertrauenswürdige Botin; seid.\n\nGeht und versammelt meinen Schwarm. Er muss davon erfahren und sich auf den Kampf vorbereiten.', '', '', '', '', '', '', 47187),
(70215, 'deDE', 'Neugier ist der Schlüssel', 'Sprecht mit Warpwirkerin Delandra im Lager Antonidas.', 'Mein Zögern, über diese Symbole zu sprechen, lag nicht daran, dass ich Euch nicht vertraut habe, sondern an der unergründlichen Natur dieser Symbole und auch der Steine, auf denen sie stehen.\n\nJa, Steine. Und zwar mehrere, verteilt über die ganzen Inseln.\n\n<Warpwirkerin Delandra wirft Euch einen Blick zu. Ein Hauch von Neugierde und Aufregung sind in ihren Augen zu erkennen.>\n\nIhr wusstet das nicht.\n\nNun gut. Eure Beharrlichkeit und Eure Bereitschaft, mich aufzusuchen, zeigen mir, dass Ihr Eure jüngste Entdeckung unbedingt verstehen wollt. Vielleicht ist es Zeit, dass wir das im Detail besprechen.', '', '', '', '', '', '', 47187),
(70213, 'deDE', 'Harkyn Grymmstein', '', '', '', '', '', '', '', '', 47187),
(70212, 'deDE', 'Penumbrus', '', '', '', '', '', '', '', '', 47187),
(70210, 'deDE', 'Nicht vergessene Tradition', 'Platziert Räucherwerk und beseitigt geisterhafte Bestien an den Ewigen Kurganen.', 'Es ist Tradition bei den Aylaag, dass wir, wenn wir in diesem Lager kampieren, zu den Ewigen Kurganen pilgern, und um sichere Reisen bitten und darum, von dem verschont zu bleiben, das unsere Vorfahren heimgesucht hat. Die Anwesenheit der Nokhud macht diese Pilgerreise gefährlich.\n\nWenn es Euch nichts ausmacht, würde ich Euch bitten, diese Tradition für uns weiterzuführen.', '', '', '', '', '', '', 47187),
(70209, 'deDE', 'Quaken und angreifen', '', '', '', '', '', '', '', '', 47187),
