(70198, 'deDE', 'Der Ruf zu den Inseln', 'Trefft Naleidea Flussglanz in Durotar.', 'Unsere Verbündeten versammeln sich in Durotar. Dies ist eine sehr aufregende Zeit!\n\nSchließt Euch uns an, $n! Zeit, zu den Dracheninseln aufzubrechen!', '', '', '', '', '', '', 47187),
(70197, 'deDE', 'Der Ruf zu den Inseln', 'Trefft Toddy Schnurrbart im Hafen von Sturmwind.', 'Seid Ihr bereit für das Abenteuer Eures Lebens? Ich bin es auf jeden Fall!\n\nUnsere Verbündeten haben sich versammelt und alle Vorräte sind verladen. Worauf wartet Ihr also noch?\n\nTrefft mich bei den Docks von Sturmwind. Zeit, zu den Dracheninseln aufzubrechen!', '', '', '', '', '', '', 47187),
(70196, 'deDE', 'Reservatreinigung', '', '', '', '', '', '', '', '', 47187),
(70195, 'deDE', 'Im Sturm erobert', 'Rettet Altan und sucht nach Hinweisen zum Fremdling.', 'Berichten zufolge wurden die Nokhud von einem Fremdling begleitet, der noch nie zuvor gesehene Magie wirkt. Dieser Fremdling ist durch unsere Reihen gepflügt wie ein Sturm.\n\nWenn die Nokhud Verbündete haben, die so viel Chaos anrichten können, müssen wir so viel wie möglich über sie herausfinden.\n\nIch habe meinen Ohuna, Altan, entsandt, um den Fremdling ausfindig zu machen. Er ist bisher nicht zurück und deshalb mache ich mir Sorgen. $n, könnt Ihr nach Hinweisen zu diesem Fremdling suchen und herausfinden, was Altan zugestoßen ist?', '', '', '', '', '', '', 47187),
