(70185, 'deDE', 'Mysteriöse Bestie', 'Findet und tötet die Bestie und bringt etwas als Beweis zu Späherin Tomul.', '<Ihr erkennt einen großen Pfotenabdruck in der Erde. Ihr seht Euch um und stellt fest, dass keine der Kreaturen in der Nähe Pfoten hat, geschweige denn so große.\n\nVielleicht lassen sich die Zentauren beeindrucken, wenn Ihr diese riesige Bestie erlegt.>', '', '', '', '', '', 'Bringt den Pelz von Konkhular zu Späherin Tomul.', 47187),
(70184, 'deDE', 'Geheimnisse der Spezialisierung: Schmiedekunst', '', '', '', '', '', '', '', '', 47187),
(70183, 'deDE', 'Geheimnisse der Spezialisierung: Alchemie', '', '', '', '', '', '', '', '', 47187),
(70182, 'deDE', 'Der süße Geschmack des Sieges', 'Kehrt zur Innovationsmaschine in Valdrakken zurück.', 'Auch kleine Dinge können großes Potenzial besitzen. Die abgefüllte Essenz mag sich leicht wie eine Feder anfühlen, aber sie besitzt immense Macht.\n\nBringt sie zur Innovationsmaschine.', '', '', '', '', '', '', 47187),
(70181, 'deDE', 'Erste Herausforderung von Tyr: Finesse', 'Schließt die erste Herausforderung von Tyr im Azurblauen Gebirge ab.', '<Als Ihr Euch nähert, strahlt die Inschrift auf der Statue ein sanftes Leuchten aus.>\n\n\"Führt die Macht des Hüters und tragt ihr Licht in eine bessere Zukunft für uns alle.\"', '', '', '', '', '', '', 47187),
(70180, 'deDE', 'Starthilfe? Kommt sofort!', 'Helft Greyzik, das mysteriöse Gerät mit Energie zu versorgen.', 'Einige Leute in der Stadt behaupten, dieses Gerät wäre von dem legendären Titanenhüter Tyr erschaffen worden.\n\nDas Problem ist, dass wir es nicht zum Laufen bekommen! Wir haben alle üblichen Tricks probiert, Auseinanderbauen, Gyroskopie, sanfte Elektroschocks. Bis auf die Elektroschocks hat nichts funktioniert. Moment... ich hatte gerade eine tolle Idee.\n\nSeht Ihr den Gyrokopter dort drüben? Springt rein und seht, ob Ihr diesem Titanending etwas mehr... Saft geben könnt.', '', '', '', '', '', '', 47187),
(70179, 'deDE', 'Doppelter Dienst', 'Beschafft Baumaterialien von Erdelementaren.', 'Seid gegrüßt! Ihr seht ganz stark aus, könnt Ihr mir vielleicht aushelfen?\n\nAzkra und ich sind damit beauftragt, auf diesen Turm aufzupassen. Er befindet sich in einem, wie soll ich sagen, \"bemerkenswerten vorsanierten Zustand\". Als wir mit den Reparaturen begannen, wurden wir von Erdelementaren angegriffen!\n\nAlso dachte ich mir: \"Zefren, warum kümmerst du dich nicht um die Erdelementare und besorgst gleichzeitig ein paar Baumaterialien?\" Und genau da kommt Ihr ins Spiel! Könnt Ihr mir helfen?', '', '', '', '', '', '', 47187),
(70178, 'deDE', 'Expeditionsversorgungspaket', 'Untersucht die neuen Werkzeuge, die durch das Expeditionsversorgungspaket im Drachenschuppenbasislager erhältlich sind.', '$gForscher:Forscherin;, Eure Entdeckungen sind von unschätzbarem Wert.\n\nDa draußen gibt es noch vieles mehr, das es zu entdecken gilt, und wir haben genau die richtigen Werkzeuge, um Euch dabei zu helfen.\n\nKommt zurück zum Drachenschuppenbasislager und rüstet Euch mit dem Expeditionsversorgungspaket aus.', '', '', '', '', '', '', 47187),
(70175, 'deDE', 'Abgebrochene Leiste', 'Bringt den Gegenstand zu Emilia Bellersen.', '<Das könnte etwas sein, wonach Emilia Bellersen sucht.>', '', '', '', '', '', '', 47187),
(70174, 'deDE', 'Die Shikaar', 'Trefft Sansok Khan.', 'Sansok Khan ist die fähigste Jägerin unseres Klans. Obwohl sie nicht hören kann, hat sie ihre Fähigkeiten als Jägerin und Anführerin immer wieder bewiesen.\n\nFür uns alle ist sie Mentorin, eine vertrauenswürdige Anführerin und erbitterte Verteidigerin der Maruuk.\n\nEs ist eine Ehre, mit ihr zu sprechen.', '', '', '', '', '', '', 47187),
(70172, 'deDE', 'Berggeheimnisse', '', '', '', '', '', '', '', '', 47187),
(70171, 'deDE', 'Glückliche kleine Zufälle', 'Findet Hudsons letztes Werk.', '<Ranpiatas Augen werden feucht.>\n\nBin ich es? Bin ich der Grund, dass er den Funken verloren hat?\n\nEr sagt, er liebt mich, aber... Ihr habt gehört, wie es ihm geht, wenn er nicht malt.\n\nIch will nur das Beste für ihn. Wenn es das Beste für ihn ist, dann... werde ich gehen.\n\nEs gibt ein letztes Werk, das er weggeworfen hat. Das letzte Werk, an dem er sich versucht hat, bevor er aufgegeben hat.\n\nIch konnte nicht zusehen, wie er es wegwirft, also habe ich es in unserem Haus versteckt. Bitte... bringt es zu ihm... als Erinnerung.', '', '', '', '', '', '', 47187),
(70170, 'deDE', 'Die Dämonen austreiben', 'Besorgt Hudsons verlorene Gemälde von den finalen Dungeonbossen der Hallen der Infusion, der Akademie von Algeth\'ar, des Azurblauen Gewölbes und von Neltharus.', 'Ich fürchte, er kann sehr stur sein.\n\nAber ich kann ihn nicht einfach aufgeben. Wir werden es einfach noch einmal versuchen müssen!\n\nEs gibt noch mehr Gemälde da draußen, die er rausgeworfen hat. Und zwar an noch gefährlicheren Orten. Ich hoffe wirklich, dass Ihr der Herausforderung gewachsen seid!', '', '', '', '', '', '', 47187),
(70169, 'deDE', 'Selbst Bäume brauchen Freunde', 'Sprecht mit Rauvros.', 'Ich weiß, dass Ihr und Ran nur versucht, mir zu helfen.\n\nAber ich glaube nicht, dass mir zu helfen ist. Der Funke in mir... mein Wille zu malen... ist einfach... weg.\n\nAber Ran hat recht. Ich bin Euch schuldig, es zumindest zu versuchen.\n\nBringt Euren aufstrebenden Künstlerfreund zu mir.', '', '', '', '', '', '', 47187),
(70168, 'deDE', 'Traurige kleine Zufälle', 'Besorgt Hudsons verlorene Gemälde von den finalen Dungeonbossen der Rubinlebensbecken, des Angriffs der Nokhud und der Brackenfellhöhle.', 'Ihr habt den ganzen Weg auf Euch genommen... Es tut mir leid.\n\nMein Hudson hat es früher geliebt, zu malen. Es war sein Leben! Ich weiß nicht, woher diese Blockade kommt.\n\nVor ein paar Wochen hat er auf dem Rückweg von einem Malausflug all seine unvollendeten Gemälde genommen und sie in einem Wutanfall weggeworfen.\n\nIch bitte Euch... könntet Ihr sie ausfindig machen? Vielleicht ist das der Funke, den er braucht.\n\nHudson scheut sich auf der Suche nach den besten Ausblicken nicht vor gefährlichen Orten. Ich hoffe, Ihr seid darauf vorbereitet.', '', '', '', '', '', '', 47187),
(70166, 'deDE', 'Die Freuden der Malerei', 'Bringt Rauvros\' Gemälde der Vorstellung zu Hudson.', 'Gefällt Euch meine Sammlung? Das sind alles Werke des größten Malers aller Zeiten, Hudson.\n\nSie sind selten und möglicherweise wertvoll: Er ist ein Einsiedler und hat seit einer Weile nichts Neues gemalt. Oh, wie gerne ich ihn doch mal treffen... oder von ihm lernen würde!\n\nIhr... wirkt recht verwegen. Würdet Ihr ihn für mich aufspüren? H-hier! Nehmt ein paar meiner Werke mit. Vielleicht findet er sie ja beeindruckend!\n\nOder er findet sie schrecklich... oje.', '', '', '', '', '', '', 47187),
(70164, 'deDE', 'Eine ausgetüftelte Gelegenheit', 'Sprecht mit Chronomant Phosildral und Sibrit Klackerpapp in den Ruinen des Lebensgewölbes.', 'Hättet Ihr wohl einen Moment Zeit, $p? Ich stehe kurz vor einem Durchbruch!\n\nNach dem Einsturz des Horts habe ich mehr als nur meine Kampfeskraft eingebüßt. Ich habe meine Identität als Dracthyr verloren. Vielleicht könnt Ihr das verstehen.\n\nEs hat mir immer große Freude bereitet, Dinge auseinanderzunehmen und wieder zusammenzusetzen. Deshalb dachte ich, die Expedition wäre genau das Richtige für mich. Aber dieses Artefakt bereitet mir Kopfzerbrechen.\n\nKönntet Ihr Phosildral und Sibrit bitten, meine Notizen durchzusehen? Ich will mich als formidable Denkerin beweisen... ihnen, aber auch mir selbst gegenüber.', '', '', '', '', '', '', 47187),
(70163, 'deDE', 'Kreuz und quer durch die Höhlen - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70161, 'deDE', 'Kreuz und quer durch die Höhlen', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70159, 'deDE', 'Ein Geschmack von Heimat', 'Fragt bei Hordenmitgliedern im Drachenschuppenbasislager, ob jemand Euch die notwendigen Zutaten leihen kann.', 'Na endlich! Noch ein Dracthyr, der uns zur Hand geht.\n\nMein Bruder und ich wollten ein paar Essensrationen zubereiten, aber...\n\n<Scaralesh deutet auf seine Umgebung.>\n\nHier ist alles so anders. Man findet hier kaum die Zutaten, die wir früher zum Kochen genommen haben.\n\nAber wir können uns anpassen. Fragt die Horde, ob sie etwas als Ersatz für Gemüse, Proteine und emulgierende Flüssigkeit haben. Dann können wir endlich wieder richtig kochen.', '', '', '', '', '', '', 47187),
(70158, 'deDE', 'Gartenpromenade - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70157, 'deDE', 'Gartenpromenade', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70156, 'deDE', 'Ein uraltes Erwachen', 'Ermächtigt das Portal.', 'Das Portal liegt direkt hinter mir. Schwer zu sagen, wie viel Zeit noch bleibt, bis die schwindende Verzauberung des Gefäßes komplett versiegt oder, schlimmer noch, bricht.\n\nDie dann freigesetzte instabile Energie kann katastrophale Folgen haben.\n\nWollen wir fortfahren?', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(70155, 'deDE', 'Schauen, zuhören, atmen', 'Angelt mit Threshrak.', 'Seid gegrüßt, $R. Nicht viele halten an, um hallo zu sagen. Und schon gar nicht, um hier etwas zu verweilen. Die meisten haben es auf dem Weg zu ihrem nächsten Reiseziel etwas eiliger.\n\nWürdet Ihr gerne mit mir angeln?', '', '', '', '', '', '', 47187),
(70154, 'deDE', 'Ein Tor nach Irgendwo', 'Folgt Warpwirkerin Delandra zum Portal.', 'Die Verzauberung wird uns vor der instabilen Energie im Inneren beschützen.\n\nIch öffne den Weg zum nächsten Stein.\n\nSobald Ihr durchgegangen seid, bleibt in der Nähe. Wenn wir ankommen, werde ich Eure Hilfe brauchen, um das Gerät mit Energie zu versorgen.', '', '', '', '', '', '', 47187),
(70148, 'deDE', 'Ohne Zweck', 'Sucht nach Kralle Ethrethi in der Botschaft von Schwingenrast.', 'Hättet Ihr kurz Zeit für mich?\n\nIch mache mir um einen Dracthyr Sorgen, der hier durchgekommen ist. Er hat meinen Partnern und mir allerlei Fragen gestellt, schien mit unseren Antworten allerdings... unzufrieden.\n\nEr nannte sich \"Kralle Ethrethi\". Ich glaube, das macht ihn zu einem ziemlichen Neuling in Euren Rängen, oder?\n\nIch hatte das Gefühl, dass er etwas Hilfe brauchen könnte. Würdet Ihr mir dabei helfen, den Frieden zu wahren?\n\nIch hab ihn drüben mit Kholmar reden sehen.', '', '', '', '', '', '', 47187),
(70146, 'deDE', 'Hochlandgegenschlag', '', '', '', '', '', '', '', '', 47187),
(70139, 'deDE', 'Wo ein Schutz ist, ist auch ein Weg', 'Ermittelt den Schaden an den Schutzsteinen im Tyrholdreservoir.', 'Dieses Reservoir wurde einst von drei Schutzsteinen beschützt, die Tyr hier platziert hat.\n\nSie waren dazu gedacht, die auf den Dracheninseln vorherrschende Elementarenergie zu stabilisieren.\n\nAls Ihr mich geweckt habt, konnte ich Schaden am westlichen Schutz spüren. Ich fürchte, dass die Primalisten sich auch an den anderen Schutzen vergangen haben.\n\nSo oder so, wir müssen zunächst den Schaden ermitteln, um herauszufinden, was wir als Nächstes tun.', '', '', '', '', '', '', 47187),
(70136, 'deDE', 'Keine Zeit für Schmerzen', 'Holt den Zeitwandererstab und die Zeitwanderernotizen und erlegt den wahnsinnigen Alpha im Wallenden Wald in Thaldraszus.', 'Uff... Einen Moment...\n\nMein erster Auftrag... Instabile Temporalenergie sickert in den Wald... Beeinträchtigt die Wildtiere... Muss die Auswirkungen feststellen und die Magie für die Zeitwanderer sammeln...\n\n<Zera schüttelt ihren Kopf für einen Moment.>\n\nIch hatte gerade ein Rudel Vorquin beobachtet, als ein von Zeitmagie überquellender wildgewordener Bär mich angegriffen hat. Er hat mich überrascht. Ich bin gerade so entkommen.\n\nKönntet Ihr meine fehlende Ausrüstung für mich finden, $C? Äh, vielleicht müsst Ihr Euch auch um diesen Bären kümmern.', '', '', '', '', '', '', 47187),
(70135, 'deDE', 'Eindringende Elementare', 'Tötet $1oa Urelementare in der Botschaft von Schwingenrast.', 'Die Handwerker und Forscher der Drachenschuppenexpedition sind ungeeignet für die Härte der Schlacht.\n\nAber wir beide nicht, $p.\n\nLasst uns hier auf den Dracheninseln diese Kraft nutzen, um jene zu schützen, die sich nicht selbst schützen können.\n\nBeseitigt die Elementare, die vom Norden eindringen, sodass die Expedition sich auf ihre höheren Ziele konzentrieren kann.', '', '', '', '', '', '', 47187),
(70134, 'deDE', 'Erinnerungen', 'Holt Veritistrasz\' Zeitkapsel.', 'Danke, dass Ihr mir zugehört habt, Jungspund. Es gibt einen Gefallen, um den ich Euch bitten möchte.\n\nKeine Sorge, keine weiteren Geschichten.\n\nAls wir diesen Ort verlassen haben, habe ich eine Art... Zeitkapsel hinterlassen. Könntet Ihr... Könntet Ihr sie mir bringen? Wir haben die Kapsel hinter einer der Säulen am Fuße des Rubinlebensschreins versteckt.\n\nIch habe sie mit einem Siegel versteckt. Wenn Ihr es aktiviert, solltet Ihr die Kapsel sehen können.', '', '', '', '', '', '', 47187),
(70132, 'deDE', 'Ein Weilchen bleiben', 'Setzt Euch eine Weile und betrachtet die Landschaft.', '<Der alte Zwerg reagiert nicht auf Euch, als Ihr Euch nähert, sondern blickt mit gerunzelter Stirn über die Landschaft. Es ist ein wohltuender Ausblick, vielleicht solltet Ihr ebenfalls eine Pause einlegen und die Landschaft betrachten.>', '', '', '', '', '', '', 47187),
(70129, 'deDE', 'Zehenmatsch der Schreckliche', 'Helft Rowie, Zehenmatsch den Schrecklichen zu erlegen.', 'Ihr habt recht, ich bin nicht stark genug, um es mit diesem Yeti aufzunehmen... zumindest nicht alleine!\n\nDoch Ihr seid hier!\n\nDer Bau des bösen Yetis, Zehenmatsch des Schrecklichen, liegt vor uns. Diese Höhle ist... groß. Aber nicht gruselig! Okay, vielleicht ein bisschen gruselig.\n\nKönntet Ihr reingehen und ihn schon mal etwas mürbe machen? Ich... Ich bin direkt hinter Euch!', '', '', '', '', '', '', 47187),
(70126, 'deDE', 'Der letzte Schliff', 'Überzeugt Miguels Kunden, sich bei künftigen Handwerksaufträgen an ihn zu wenden.', 'Ah, $p, schön, Euch zu sehen.\n\nIhr wart eine herausragende Hilfe für das Handwerkerkonsortium und für Thomas und mich persönlich. Vielen Dank.\n\nEs gibt noch eine Sache, die Ihr als Handwerker wissen solltet, und zwar, wie man Beziehungen mit Kunden pflegt.\n\nIch habe heute einen Handwerksauftrag für einen Kunden erledigt. Könntet Ihr in meinem Namen mit ihm reden? Versucht, ihn dazu zu überreden, in Zukunft mit seinen Handwerksbedürfnissen zu mir zu kommen. Erinnert ihn daran, dass er zu mir persönlich kommen muss, wenn er hochwertige Waren haben möchte.', '', '', '', '', '', '', 47187),
(70125, 'deDE', 'Wo ist Furorion?', 'Fragt Sendrax, wann die Drachen ankommen sollten.', 'Hm, ich frage mich, wo Furorion bleibt.\n\nEr sagte, er würde hier auf uns warten, zusammen mit einem Botschafter von Alexstrasza der Lebensbinderin, Königin der Drachen.\n\nEs sieht einem Drachen nicht ähnlich, ein Versprechen nicht zu halten.\n\nNun denn! Wenigstens ist diese eifrige, kleine Drakonide hier, um uns zu empfangen. Fragt sie doch einmal, wann die anderen ankommen.', '', '', '', '', '', '', 47187),
(70124, 'deDE', 'Übungsmaterialien', 'Sammelt $1oa Urprotowelpenschuppen.', 'Die Protodrachen hier unterscheiden sich von allem, was ich bisher gesehen habe.\n\nIhre Schuppen scheinen von Natur aus feuerfest zu sein, stärker als Stahl, und sie büßen dabei nicht an Flexibilität ein. Unglaublich.\n\nDie Handwerker wollen unbedingt einige davon in die Hände bekommen, um damit zu arbeiten.\n\nBeginnt mit den Welpen. Ihre kleineren Schuppen sollten biegsamer sein und uns dabei helfen, unsere Techniken zu verbessern.', '', '', '', '', '', 'Trefft Thaelin Schwarzamboss in der Botschaft von Schwingenrast.', 47187),
(70123, 'deDE', 'Urgeziefer', 'Tötet $1oa Urprotodrachen an der Wilden Küste.', '<Azurathel wirft einen misstrauischen Blick auf die Protodrachen, die hinter ihm auf dem Gebirgskamm lauern.>\n\nIch könnte schwören, dass diese Protodrachen jedes Mal, wenn ich ihnen den Rücken zuwende, näher an das Lager herankommen...\n\nDas sind nicht die Drachen, die Furorion uns hier vorstellen wollte.\n\nDie Protodrachen sind skrupellose Raubtiere, mit denen man nicht verhandeln kann. Wir müssen ebenso skrupellos sein.\n\nDezimiert sie, um sie unter Kontrolle zu halten, oder diese Expedition ist zu Ende, bevor sie begonnen hat.', '', '', '', '', '', 'Trefft Schuppenkommandant Azurathel in der Botschaft von Schwingenrast.', 47187),
(70122, 'deDE', 'Forscher in Not', 'Rettet 3 Mitglieder der Drachenschuppenexpedition an der Wilden Küste.', 'Missversteht das wissenschaftliche Vorgehen der Expedition nicht als Zaghaftigkeit, $p.\n\nWir sind keine Einsiedler, die in weit entfernten Türmen ihre Bücher studieren.\n\nWir sind Abenteurer, die in jedem Winkel Azeroths nach Wissen aus erster Hand suchen!\n\nDiese Leidenschaft für Abenteuer bringt uns oftmals in Gefahr, und einige Expeditionsmitglieder haben sich ein bisschen mehr vorgenommen, als sie bewältigen konnten...\n\nAber hey, die Gefahr macht es nur spaßiger!', '', '', '', '', '', 'Trefft Toddy Schnurrbart in der Botschaft von Schwingenrast.', 47187),
(70112, 'deDE', 'Furbolgbedrohung', '', '', '', '', '', '', '', '', 47187),
(70100, 'deDE', 'Katalogisieren des Azurblauen Gebirges', '', '', '', '', '', '', '', '', 47187),
(70079, 'deDE', 'Die Ebenen von Ohn\'ahra katalogisieren', '', '', '', '', '', '', '', '', 47187),
(70070, 'deDE', 'Aber... ich bin der Held der Enten', 'Findet Knallentchen und stellt sicher, dass er zu Gracus zurückkehrt.', 'Einen Moment... Irgendetwas ist doch...\n\n<Gracus sieht sich um.>\n\nKnallentchen! Der Racker muss wieder flussabwärts sein! Egal, wie oft ich es ihm sage, ständig versucht er, mit den Flunkern zu spielen!\n\nIhr müsst für mich nach ihm sehen. Hoffentlich wurde er nicht wieder verschluckt.', '', '', '', '', '', 'Sprecht mit Gracus über das, was Ihr gesehen habt.', 47187),
(70069, 'deDE', 'Andere nennen mich Entenhüter', 'Füttert $1oa Entchen und kehrt zu Gracus zurück.', 'Meine Tage werden kürzer... doch meine Pflichten sind noch nicht erfüllt.\n\nDie Brut sollte am Fluss sein. Ich habe sie in der Hoffnung dort gelassen, dass es sie selbstständiger macht. Bald werden sie sich selbst verteidigen müssen.\n\nHeute verlassen sie sich noch auf Euch. Bringt ihnen bitte das Essen, das Ihr gefangen habt, und die Entchen dann zu mir. Passt auf Pilot auf, sie springt ständig von irgendetwas runter.', '', '', '', '', '', '', 47187),
(70068, 'deDE', 'Kobaltkatastrophe', '', '', '', '', '', '', '', '', 47187),
(70067, 'deDE', 'Eine Botschaft an die Nokhud', '', '', '', '', '', '', '', '', 47187),
(70064, 'deDE', 'Für Imbu!', '', '', '', '', '', '', '', '', 47187),
(70062, 'deDE', 'Einige nennen mich Käferfänger', 'Sammelt $1oa Flugbrutkäferstücke.', 'Ah, $gjunger:junge:r; $R, ich könnte Eure Hilfe brauchen. Ich habe hier Generationen von Leben großgezogen.\n\nAm liebsten habe ich die Entchen. Aber mein Körper ist alt und schwach geworden... doch das hält den Kreislauf nicht auf.\n\nIch brauche Euch, um Nahrung für meine Brut zu fangen.', '', '', '', '', '', '', 47187),
(70061, 'deDE', 'Übungsflügel', 'Weist einen Welpen dazu an, $2oa aufgebrachte Unkrautlinge, $3oa aufdringliche Welpenstecher und $4oa unerbittliche Windstöße zu erledigen.', 'Die Drachen waren recht lange weg von den Inseln, $p. Um ehrlich zu sein, sind einige unserer Fähigkeiten verkümmert, während sie von Generation zu Generation weitergegeben wurden.\n\nDiese Welpen sollten einfach zu unterrichten sein, doch wir haben ein paar Probleme, sie im Zaum zu halten.\n\nSagt...\n\nIch habe gesehen, dass selbst Majordomus Selistra bei den wichtigsten Aufgaben auf Euch vertraut. Würdet Ihr uns Eure Unterstützung gewähren und einem unserer Kinder helfen?', '', '', '', '', '', '', 47187),
(70060, 'deDE', 'Akademieaufstieg - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70059, 'deDE', 'Akademieaufstieg', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70058, 'deDE', 'Freund zu reparieren', 'Sammelt $1oa weiche Rubinfedern, $2oa Stofffetzen und $3oa Glasperle in der Nähe des Rubinlebensschreins, um Glücksente zu reparieren.', 'Glücksente wurde verletzt, während wir rumgeflogen sind... Es ging ihr so gut und dann bin ich... Ich bin gegen einen Baum gestoßen!\n\n<Lillistrasza deutet traurig auf die beschädigte Stoffente auf ihrem Kopf.>\n\nIhre Füllung fällt raus! Ihre Federn sind ganz verbogen! Eines ihrer Augen ist verschwunden! Neiiiiin!\n\nIhr könnt doch helfen, Glücksente zu reparieren, oder?', '', '', '', '', '', '', 47187),
(70055, 'deDE', 'Siegel der Stürme', 'Bringt das Siegel der Stürme zu Sturmjäger William in Sturmwind.', '<Jemand mit großem magischen Wissen würde so etwas sicherlich gerne studieren wollen.>', '', '', '', '', '', 'Bringt das Siegel der Stürme zu Sturmjäger William in Sturmwind.', 47187),
(70052, 'deDE', 'Klippenrundstrecke - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70051, 'deDE', 'Klippenrundstrecke', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(70050, 'deDE', 'Sturmjagd', 'Sprecht mit Sturmjäger William am Hafen von Sturmwind.', 'Die hübschen Leutchen schicken Euch also auf ein kleines Abenteuer, wie?\n\nKeine Sorge. Bis jemand diese Elementarstürme in den Griff bekommt, können wir eh nicht losschippern.\n\nSprecht mit Sturmjäger William. Er ist in der Expedition für die Untersuchung der Stürme verantwortlich und kann Euch sicher mit der nötigen Ausrüstung versorgen.\n\nIch koordiniere von hier den Rest der Vorbereitungen, während Ihr da draußen Spaß habt.\n\nDafür seid Ihr mir aber was schuldig, klar?', '', '', '', '', '', 'Sprecht mit Sturmjäger William am Hafen von Sturmwind.', 47187),
(70049, 'deDE', 'Die Stürme beruhigen', 'Sammelt $1oa Partikel urtümlicher Energie von Gegnern an Orten aktiver Urstürme in Kalimdor und den Östlichen Königreichen.', 'Diese Primalisten sind erbarmungslos und entfesseln elementare Verwüstung in den Östlichen Königreichen und Kalimdor.\n\nIhr müsst genau so viel Entschlossenheit zeigen, $n. Das ist der einzige Weg, sie aufzuhalten.\n\nFindet heraus, wo sie als Nächstes eindringen, entfernt die Gegner im Gebiet des Ursturms, bevor es zu spät ist, und macht ihre Pläne zunichte.\n\nWir müssen Azeroth beschützen!', '', '', '', '', '', '', 47187),
(70048, 'deDE', 'Eine Urbedrohung', 'Sammelt $1oa Partikel urtümlicher Energie von Gegnern an Orten aktiver Urstürme in Kalimdor und den Östlichen Königreichen.', 'Raszageth hat keine Zeit verschwendet, ihre Primalistenstreitkräfte auszubauen.\n\nDie Kirin Tor haben massive Stürme entdeckt, die an Schlüsselpunkten in Kalimdor und den Östlichen Königreichen freigesetzt werden.\n\nDie Primalisten entfesseln die Elemente, um ihre Macht zu stärken. Es scheint, als hätten sie nicht nur auf den Dracheninseln, sondern auch in den Ländern der Allianz und der Horde vor, Chaos zu stiften.\n\nSucht den Feind auf und studiert seine Methoden. Wir müssen ihn aufhalten, bevor es zu spät ist.', '', '', '', '', '', '', 47187),
(70047, 'deDE', 'Eisige Gefängnisse', '', '', '', '', '', '', '', '', 47187),
(70042, 'deDE', 'Jede Menge Möglichkeiten', 'Besorgt mehrere Gegenstände für Wisch den Schleicher.', 'Ihr habt mir einen Schrecken eingejagt, ich dachte schon, ich wäre erwischt worden!\n\nSchaut Euch die ganzen mutigen Forscher an, bereit die Dracheninseln zu erobern... Taschen voller Werkzeuge und Ausrüstung.\n\nWir könnten hier reich werden!\n\nSeht Euch um, ob Ihr einige Gegenstände in die Finger bekommt, und ich teile den Profit mit Euch.', '', '', '', '', '', '', 47187),
(70041, 'deDE', 'Der Zorn der Sturmfresserin', 'Nutzt Khadgars Flugscheibe und haltet die Primalistenarmee auf.', 'Raszageth versucht, alle Arkanmagie aus dem Turm zu ziehen, sodass sie ihn zerstören kann!\n\nKalecgos tut, was er kann, um sie aufzuhalten, und ich versuche, mit meiner Magie die Leyenergie wiederherzustellen.\n\nIch fürchte, wir halten nicht mehr viel länger durch. Genau in diesem Moment befinden sich weitere Primalisten auf dem Weg hier hoch, um uns zu überwältigen!\n\nNehmt meine modifizierte Arkanscheibe. Haltet die eintreffenden Primalisten auf... und lasst uns auf ein Wunder hoffen.', '', '', '', '', '', 'Sprecht mit Kalecgos am Fuß des Vakthros.', 47187),
(70040, 'deDE', 'Sturz durch die Zeit', 'Versammelt Eure Verbündeten und sprecht anschließend mit Nozdormu.', 'Als die Magie der Bronzenen mit der der Ewigen kollidierte, beförderte sie Chronormu und Eternus in einen unkontrollierten Sturz durch die Zeit.\n\nWährend sie fallen, zerreißen sie das Gewebe der Zeit selbst und senden zahllose Wellen durch Raum und Zeit. Wir müssen sie aufspüren und zurückholen. Nur so können wir weitere Schäden vermeiden. Ich sehe, dass Ihr Chronormus Fall beenden werdet.\n\nIch würde Euch bitten, die Verbündeten zu versammeln, die Ihr braucht, um Chronormu zu retten. Ich werde mich unterdessen auf ihre Magie konzentrieren.', '', '', '', '', '', 'Versammelt Eure Verbündeten und sprecht anschließend mit Nozdormu.', 47187),
(70035, 'deDE', 'Ruriqs Stromschnellenritt', '', '', '', '', '', '', '', '', 47187),
(70034, 'deDE', 'Handwerkerversorgung: Salamantherschuppe', 'Liefert eine Salamantherschuppe an Haephesta beim Rubinlebensschrein.', 'Braucht Ihr Arbeit, $gKürschner:Kürschnerin;? Ich soll für die Kunden des Handwerkerkonsortiums die Schuppe eines Salamanthers sammeln.\n\nIch mag Handwerkerin sein, aber die Botengänge können sie allein unternehmen!\n\nAber... ach, vielleicht könnt Ihr ja eine auftreiben?', '', '', '', '', '', 'Liefert eine Salamantherschuppe an Haephesta beim Rubinlebensschrein.', 47187),
(70033, 'deDE', 'Handwerkerversorgung: Lederstiefel des Pioniers', 'Liefert Lederstiefel des Pioniers an Haephesta beim Rubinlebensschrein.', 'Auf der Suche nach Arbeit, $gLederverarbeiter:Lederverarbeiterin;? Das Handwerkerkonsortium will ein Paar Stiefel für seine Kundschaft von mir.\n\nDie wissen anscheinend nicht, wie gefragt ich bin. Wisst Ihr, wie viele Forschersleute allein heute mit löchrigem Schuhwerk vorbeigekommen sind?\n\nNehmt diese Maße, falls Ihr Zeit habt. Vielleicht kann man mit diesem Konsortium ja gut Geschäfte machen.', '', '', '', '', '', 'Liefert Lederstiefel des Pioniers an Haephesta beim Rubinlebensschrein.', 47187),
(70032, 'deDE', 'Handwerkerversorgung: Juweliersbrille', 'Liefert Kopflupen aus gesplittertem Onyx an Haephesta beim Rubinlebensschrein.', 'Sucht Ihr Arbeit, $gJuwelenschleifer:Juwelenschleiferin;? Das Handwerkerkonsortium hat mich gebeten, eine Brille für deren Kunden herzustellen.\n\nMich! Als ob ich Zeit für diesen Nonsens hätte.\n\nIhr könnt das doch übernehmen, oder?', '', '', '', '', '', 'Liefert Kopflupen aus gesplittertem Onyx an Haephesta beim Rubinlebensschrein.', 47187),
(70031, 'deDE', 'Handwerkerversorgung: Glattes Nudelholz des Kochs', 'Liefert ein glattes Nudelholz des Kochs an Haephesta beim Rubinlebensschrein.', 'Seid Ihr auf der Suche nach einer bezahlten Beschäftigung, $gInschriftenkundiger:Inschriftenkundige;?\n\nEine Gesellschaft namens Handwerkerkonsortium ist mit einem Auftrag an mich herangetreten.\n\nDieser könnte für einen Lehrling wie Euch genau das Richtige sein.', '', '', '', '', '', 'Liefert ein glattes Nudelholz des Kochs an Haephesta beim Rubinlebensschrein.', 47187),
(70030, 'deDE', 'Handwerkerversorgung: Qualitätsgesichertes Optikmodul', 'Liefert ein qualitätsgesichertes Optikmodul an Haephesta beim Rubinlebensschrein.', 'Ah, $gein Ingenieur:eine Ingenieurin;, und grade zur rechten Zeit!\n\nIch muss ein paar Baupläne überarbeiten, aber eine große Frau ist vorbeigeschneit und wollte ein Optikmodul haben.\n\nIhr kennt Euch doch mit so was aus, oder?\n\nBringt es zum Rubinlebensschrein, wenn Ihr es fertighabt. Sie hat irgendwas vom Handwerkerkonsortium erzählt.', '', '', '', '', '', 'Liefert ein qualitätsgesichertes Optikmodul an Haephesta beim Rubinlebensschrein.', 47187),
(70029, 'deDE', 'Handwerkerversorgung: Runenverzierte Serevitruten', 'Liefert $1oa runenverzierte Serevitruten an Haephesta beim Rubinlebensschrein.', 'Ihr scheint ein magisches Händchen zu haben, $gVerzauberer:Verzauberin;. Könntet Ihr mir bei einem Auftrag helfen?\n\nDas Handwerkerkonsortium hat für einen Kunden mehrere Ruten aus Serevit angefordert, aber das Verzaubern von Ruten ist nicht gerade mein Spezialgebiet.\n\nWenn Ihr Euch darum kümmern wollt, wird Euch Haephesta beim Rubinlebensschrein für Eure Mühe entlohnen!', '', '', '', '', '', '', 47187),
(70028, 'deDE', 'Handwerkerversorgung: Salzvorkommen', 'Liefert $1oa Salzvorkommen an Haephesta beim Rubinlebensschrein.', 'Lust auf Arbeit, $gBergarbeiter:Bergarbeiterin;?\n\nIch hab mich mit Haephesta unterhalten und die meinte, das Handwerkerkonsortium braucht Salz für seine Kunden.\n\nIch würde ja selbst was schürfen, aber, na ja, mir fehlt die Motivation.\n\nSeid doch so nett und besorgt ihnen welches!', '', '', '', '', '', 'Liefert $1oa Salzvorkommen an Haephesta beim Rubinlebensschrein.', 47187),
(70027, 'deDE', 'Handwerkerversorgung: Stoffbänder des Inspektors', 'Liefert Stoffbänder des Inspektors an Haephesta beim Rubinlebensschrein.', 'Sucht Ihr Arbeit, $gSchneider:Schneiderin;? Das Handwerkerkonsortium hat mich gebeten, Gelenkbänder für deren Kunden zu fertigen.\n\nIch weiß zu schätzen, dass die Forschersleute auf unsere Webarbeiten neugierig sind, doch mir fehlt die Zeit.\n\nHättet Ihr möglicherweise Interesse?', '', '', '', '', '', 'Liefert Stoffbänder des Inspektors an Haephesta beim Rubinlebensschrein.', 47187),
(70026, 'deDE', 'Handwerkerversorgung: Lavakäfer', 'Liefert $1oa Lavakäfer an Haephesta beim Rubinlebensschrein.', 'Seid Ihr auf der Suche nach Arbeit, $gKräuterkundiger:Kräuterkundige;? Ich soll für die Kunden des Handwerkerkonsortiums ein paar Käfer sammeln.\n\nDas Land wimmelt zwar nur so vor Lebewesen, doch auch dieser Auftrag erfordert Zeit.\n\nKönntet Ihr ein paar Käfer mitbringen, wenn Ihr draußen umherstreift?', '', '', '', '', '', 'Liefert $1oa Lavakäfer an Haephesta beim Rubinlebensschrein.', 47187),
(70025, 'deDE', 'Handwerkerversorgung: Drakoniumsichel', 'Liefert eine Drakoniumsichel an Haephesta beim Rubinlebensschrein.', 'Ihr wirkt, als hättet Ihr nicht viel zu tun. Wie sieht\'s aus mit ein bisschen Arbeit?\n\nDas Handwerkerkonsortium hat bei mir eine Drakoniumsichel in Auftrag gegeben. Natürlich könnte ich die im Handumdrehen schmieden, aber in meinen Augen ist das eher was für Lehrlinge.\n\nFertigt die Sichel und bringt sie zum Rubinlebensschrein. Eine Draenei namens Haephesta wird Euch entlohnen.', '', '', '', '', '', 'Liefert eine Drakoniumsichel an Haephesta beim Rubinlebensschrein.', 47187),
(70016, 'deDE', 'Das Land beruhigen', '', '', '', '', '', '', '', '', 47187),
(69994, 'deDE', 'Das Feld der Wildheit, die Zweite: Elementare Rache!', '', '', '', '', '', '', '', '', 47187),
(69993, 'deDE', 'Das Feld der Wildheit, die Zweite: Verloren im Traum!', '', '', '', '', '', '', '', '', 47187),
(69992, 'deDE', 'Siegel der Stürme', 'Bringt das Siegel der Stürme zu Sturmjägerin Suhrakka in Durotar.', '<Jemand mit großem magischen Wissen würde so etwas sicherlich gerne studieren wollen.>', '', '', '', '', '', 'Bringt das Siegel der Stürme zu Sturmjägerin Suhrakka in Durotar.', 47187),
(69984, 'deDE', 'Goldgefasster Drachenzahn', 'Bringt den Gegenstand zu Exadria.', '<Ihr seid auf den Überrest eines gefallenen Drachen gestoßen. Exadria wird ihn sicher sehen wollen.>', '', '', '', '', '', '', 47187),
(69983, 'deDE', 'Flammengeschnitzter Knochen', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Geheimnisvolle Djaradinrunen, die in einen Knochen geschnitzt wurden. Krallenpirscherin Kavia würde sich das bestimmt ansehen wollen.>', '', '', '', '', '', '', 47187),
(69981, 'deDE', 'Kundenzufriedenheit', 'Fragt die Kunden des Handwerkerkonsortiums, ob sie mit ihren Umfertigungen zufrieden sind.', 'Hey, $C, habt Ihr kurz Zeit, bei etwas zu helfen?\n\nEinige unserer Stammkunden haben Umfertigungen beim Handwerkerkonsortium in Auftrag gegeben, aber wir haben schon seit einer Weile nichts mehr von ihnen gehört.\n\nWenn Ihr ihnen über den Weg lauft, dann stellt doch bitte fest, ob sie mit ihren Einkäufen zufrieden sind, ja? Man muss die Kunden glücklich, glücklich, glücklich machen!', '', '', '', '', '', 'Liefert die Ausrüstung an Mahra Baumbieger bei der Flussgabelkreuzung.', 47187),
(69980, 'deDE', 'Seeranke: Angler Tinnaks Geschenk', 'Bringt das Seil aus Seeranken zu Nunvuq in Iskaara.', '<Ihr seht, wie die Spektralhand des armen Fischers immer noch einen Faden hält, der aus sehr starkem und doch leichtem Tang gewoben wurde. Nunvuq in Iskaara könnte ihn vielleicht brauchen.>', '', '', '', '', '', '', 47187),
(69979, 'deDE', 'Jagd der Würde', 'Erlegt den Bullenälteste Tausendmeilen.', 'Man erhält nicht einfach Weisheit, man erarbeitet sie sich. Wenn Ihr wünscht, Euch als würdig zu beweisen, dann werdet Ihr das auf die gleiche Art wie der Rest meines Volkes machen und es in der Praxis lernen.\n\nFindet und erlegt den Bullenältesten Tausendmeilen, der sich unserer Jagd schon seit Generationen entzieht.\n\nDas wird Euch die Weisheit verleihen, nach der Ihr sucht.', '', 'Der Bullenälteste Tausendmeilen ist bereits Generationen von Jägern entkommen. Vielleicht gelingt es Euch ja, dieses Wildtier endlich zu fangen.', 'Tausendmeilen', '', '', '', 47187),
