(69965, 'deDE', 'Qualitätssicherung', 'Testet Haephestas Werkzeuge an Geoden in der Nähe für das Handwerkerkonsortium.', 'Sucht Ihr nach Arbeit, $C?\n\nIch vertrete eine neues Handelsunternehmen, das Handwerkerkonsortium, das Handwerker und deren Kunden über unser Netzwerk von Handwerksaufträgen verbindet.\n\nDie Drachenschuppenexpedition hat eine Bestellung für einige verzauberte Bergbauwerkzeuge aufgegeben. Die Werkzeuge sind fertig, aber wir würden sie gerne testen, bevor wir die Bestellung abschließen.\n\nWir werden Euch natürlich für Eure Dienste bezahlen.', '', '', '', '', '', '', 47187),
