(69946, 'deDE', 'Eine Meisterin ihres Fachs', 'Sucht Meisterin Khadin auf und befragt sie zu ihrer beruflichen Weisheit.', 'Als ich diese Ebenen bereiste, traf ich eine alte Zentaurin in einer Höhle im Norden, die ihr Handwerk offensichtlich gemeistert und weise Ratschläge parat hatte.\n\nSie hat mir geholfen, das Erlernte von den Dracheninseln besser zu verstehen.\n\nWenn Ihr Euch in Eurem Beruf spezialisieren möchtet, sucht diese Meisterin des Wissens auf. Sie hieß Khadin und gehörte zum Klan Teerai.', '', '', '', '', '', 'Sprecht mit Khadin in Khadins Höhle.', 47187),
(69944, 'deDE', 'Sturmjagd', 'Sprecht mit Sturmjägerin Suhrakka am Zeppelinturm.', 'Nun, der Zauberer weiß auf jeden Fall, wie man einen gewaltigen Auftritt hinlegt, nicht wahr?\n\nWir können nicht in See stechen, bis jemand diese Elementarstürme in den Griff bekommt.\n\nWendet Euch an Sturmjägerin Suhrakka. Sie ist im Rahmen der Expedition für die Erforschung der Stürme verantwortlich und kann Euch sicher mit der nötigen Ausrüstung ausstatten.\n\nIch koordiniere derweil die übrigen Vorbereitungen. So kann ich wenigstens ein paar Bände zur Drachengeschichte studieren, bevor wir aufbrechen.', '', '', '', '', '', 'Sprecht mit Sturmjägerin Suhrakka am Zeppelinturm.', 47187),
(69939, 'deDE', 'Sylvanbeistand', 'Beschafft Schnee im Hörnchen und gebt ihn dem erschöpften Otter.', 'Ah, $n, da seid Ihr ja! Ich suche Euch schon überall.\n\nSchon wieder hat eins unserer hiesigen Kleintiere in letzter Zeit keine Leckerlis bekommen. Zieht doch mal los und findet was Süßes zum Anbeißen, was meint Ihr?', '', '', '', '', '', '', 47187),
(69938, 'deDE', 'Angelwahnsinn!', '', '', '', '', '', '', '', '', 47187),
(69936, 'deDE', 'Obervandale Zambul', 'Bezwingt Aufseher Zambul.', 'Gute Arbeit. Diese Schänder können meine Ahnen nicht mehr dazu zwingen, für sie zu kämpfen. Wir müssen uns aber noch um den Wüstling kümmern, der ihnen Befehle zuruft.\n\nDas ist ihr Aufseher, Zambul. Er muss aufgehalten werden.\n\nErledigt ihn.', '', '', 'Aufseher Zambul', '', '', '', 47187),
(69934, 'deDE', 'Blutende Herzen', 'Überbringt die medizinischen Vorräte.', 'Die Tränke sind fertig, jetzt müssen sie nur noch geliefert werden.\n\nBringt eine Kiste zu einer kleinen Höhle in der Schlucht unter uns. Es wird niemand da sein, um sie entgegenzunehmen, aber seid Euch sicher, dass sie dort guten Nutzen findet.\n\nBringt die nächste Kiste zum Lazarett im Posten der Gelikyr. Ein alter Freund kümmert sich dort um die Patienten.\n\nIch... weiß, dass das nicht Eure Aufgabe ist. Und die meine ist es auch nicht wirklich. Aber Ihr wart erstaunlich hilfreich, und diese Medizin könnte Leben retten.', '', '', '', '', '', '', 47187),
(69933, 'deDE', 'Der Preis der Neugier', 'Nehmt einen Ableger von der robusten Ranke.', 'Schaut über die Schlucht, $R. Primalisten haben vor Tagen den Posten der Gelikyr angegriffen, und der Kampf hat noch kein Ende gefunden.\n\nDie Leute brauchen Salben und müssen genäht werden. Ich kann alles Nötige herstellen, aber langsam gehen mir die Zutaten aus. Da Ihr Euch dazu entschlossen habt, in mein Heim einzudringen, betrachtet Euch als $gFreiwilliger:Freiwillige;.\n\nGeht zu meinem Garten und schnappt Euch die größte Ranke, die Ihr finden könnt. Brecht sie an der Wurzel ab und bringt sie dann zu mir.', '', '', '', '', '', '', 47187),
(69932, 'deDE', 'Jedes Leben zählt', 'Sammelt Zutaten, um den Verband des kleinen Strahlstroms zu ersetzen.', 'Tränke für Gelikyr herzustellen, bedeutet, dass ich keine Zeit für meine anderen Pflichten habe.\n\nIn meinem Garten ist eine Ente mit einer gebrochenen Rippe gelandet. Ich habe ihre Wunde behandelt, aber der Verband müsste gewechselt werden. Und da Ihr so erpicht darauf seid, zu helfen...\n\n<Szareth drückt Euch eine Liste mit Zutaten in die Hand.>\n\nDies werdet Ihr brauchen. Bringt den Rest bitte zu mir.', '', '', '', '', '', '', 47187),
(69930, 'deDE', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'deDE', 'Die Stürme beruhigen', 'Sammelt $1oa Partikel urtümlicher Energie von Gegnern an Orten aktiver Urstürme in Kalimdor und den Östlichen Königreichen.', 'Diese Primalisten sind erbarmungslos und entfesseln elementare Verwüstung in den Östlichen Königreichen und Kalimdor.\n\nIhr müsst genau so viel Entschlossenheit zeigen, $n. Das ist der einzige Weg, sie aufzuhalten.\n\nFindet heraus, wo sie als Nächstes eindringen, entfernt die Gegner im Gebiet des Ursturms, bevor es zu spät ist, und macht ihre Pläne zunichte.\n\nWir müssen Azeroth beschützen!', '', '', '', '', '', '', 47187),
(69923, 'deDE', 'Eine Urbedrohung', 'Sammelt $1oa Partikel urtümlicher Energie von Gegnern an Orten aktiver Urstürme in Kalimdor und den Östlichen Königreichen.', 'Raszageth hat keine Zeit verschwendet, ihre Primalistenstreitkräfte auszubauen.\n\nDie Kirin Tor haben massive Stürme entdeckt, die an Schlüsselpunkten in Kalimdor und den Östlichen Königreichen freigesetzt werden.\n\nDie Primalisten entfesseln die Elemente, um ihre Macht zu stärken. Es scheint, als hätten sie nicht nur auf den Dracheninseln, sondern auch in den Ländern der Allianz und der Horde vor, Chaos zu stiften.\n\nSucht den Feind auf und studiert seine Methoden. Wir müssen ihn aufhalten, bevor es zu spät ist.', '', '', '', '', '', '', 47187),
(69919, 'deDE', 'Ein Handwerk in Not', 'Sprecht mit Azley und erfahrt mehr über das Erfüllen von Handwerksaufträgen.', 'Ihr scheint mir geschickt im Handwerken zu sein. Möchtet Ihr vielleicht ein paar Handwerksaufträge für andere Abenteurer übernehmen und reich, reich, reich werden?\n\nDie Regeln des Handwerkerkonsortiums sind schnell erklärt und dann könnt Ihr an allen Handwerksstationen auf den Dracheninseln Aufträge annehmen!', '', '', '', '', '', '', 47187),
(69918, 'deDE', 'Erschütterung unserer Fundamente', 'Tötet Steinbrecherin Tokara, Molka die Schleiferin und die Elementare, die sie entfesselt haben.', 'Steinbinder der Djaradin drohen damit, die Fundamente dieses Gebäudes zu zerstören! Wir müssen sie aufhalten!\n\nWir hatten noch nicht einmal die Gelegenheit, die Zitadelle zurückzuerobern, und jetzt steht sie kurz davor, unter unseren Füßen wegzubrechen.\n\nTut, was Ihr könnt, $n...und damit meine ich: Legt sie um!', '', 'Ebenso wie Steinbrecherin Tokara ist Molka eine geschickte Bearbeiterin des harten Obsidiansteins unter der Zitadelle.', 'Molka die Schleiferin', '', '', '', 47187),
(69915, 'deDE', 'Gezielte Werbung', 'Holt Flugblätter von den Flussgabelziegen und den störenden Ziegen zurück.', 'Hi, hi, hi! Seid Ihr auf der Suche nach Aufträgen?\n\nWir veranstalten einen RIESIGEN Eröffnungsverkauf für unseren neuen Handwerksauftragsservice und müssen dafür ordentlich Aufmerksamkeit auf uns ziehen! ...Doch der Wind hat meine Flugblätter davongeweht und ich glaube, ein paar der örtlichen Ziegen sind mit ihnen davongerannt.\n\nKönntet Ihr meine Handzettel zurückbringen?', '', '', '', '', '', '', 47187),
(69914, 'deDE', 'Die Djaradin sind erwacht', 'Erhaltet Eure Befehle von Majordomus Selistra.', 'Ich wünschte, wir hätten mehr Zeit für standesgemäße Begrüßungen, aber wir können nicht alle Chronormu sein, stimmt\'s?\n\nIch bin Selistra, Majordomus von Alexstrasza der Lebensbinderin, Königin der Drachen.\n\nKönigin Alexstrasza hat mich gebeten, ihre besten Grüße zu überbringen und Euch zu ihr bei den Lebensbecken zu eskortieren.\n\nAber ich fürchte, bevor wir zu ihr aufbrechen können, muss ich Euch um Eure Hilfe bitten.\n\nUnsere uralten Rivalen, die Djaradin, sind von ihrem Schlummer unter der Erde erwacht und haben bereits einen nahegelegenen Außenposten überfallen!', '', '', '', '', '', 'Trefft Euch mit Sendrax in der Botschaft von Schwingenrast.', 47187),
(69912, 'deDE', 'Mein erster echter Notfall!', 'Überredet Sendrax, ihr Notsignal abzufeuern, um die Drachen über Eure Ankunft zu unterrichten.', '<Sendrax wirkt verwirrt.>\n\nIch habe nie erlebt, dass Majordomus Selistra zu irgendetwas zu spät kommt, schon gleich gar nicht SO viel zu spät zu SO etwas Wichtigem.\n\nSehr ungewöhnlich...\n\n<Sendrax kommt ein Gedanke.>\n\nIch könnte mein Notsignalfeuer nutzen, um Selistra über Eure Ankunft zu unterrichten. Dann wird man Euch sicherlich sofort begrüßen!\n\nAllerdings habe ich mein Notsignal noch nie abgefeuert...', '', '', '', '', '', 'Trefft Euch mit Furorion in der Botschaft von Schwingenrast.', 47187),
(69911, 'deDE', 'Entschuldigt das Chaos', 'Helft Botschafter Fastrasz, die Botschaft wieder aufzubauen.', 'Ich wünschte, ich könnte Euch besser auf den Dracheninseln begrüßen, aber ich bin nur der Wachposten.\n\n<Sendrax deutet auf den Turm hinter sich.>\n\nIhr könntet versuchen, mit Botschafter Fastrasz im Besucherzentrum zu sprechen. Er kann vielleicht einige Eurer Fragen beantworten, bis die Drachen hier sind.\n\nPasst auf, wo Ihr hintretet. Er hat vor Kurzem Schutt weggeräumt.', '', '', '', '', '', '', 47187),
(69910, 'deDE', 'Wo ist Furorion?', 'Fragt Sendrax, wann die Drachen ankommen sollten.', 'Wie ungewöhnlich.\n\nEbyssian hat gesagt, Furorion würde hier unsere Ankunft erwarten, zusammen mit einem Botschafter von Alexstrasza der Lebensbinderin, Königin der Drachen.\n\nEs sieht einem Drachen nicht ähnlich, ein Versprechen nicht zu halten.\n\nWenigstens ist diese eifrige Drakonide hier, um uns zu empfangen. Würdet Ihr bitte herausfinden, wann die anderen ankommen?', '', '', '', '', '', '', 47187),
(69904, 'deDE', 'Verdächtig ruhig', 'Findet Norikos Lehrlinge im Lager Antonidas.', 'Habt Ihr einen Augenblick Zeit, $p? Ich habe von meinen beiden Lehrlingen, Stiebitz und Tucki, schon eine Weile nichts mehr gehört.\n\nIch mache mir Sorgen.\n\nSie sollten Vorräte für das Gasthaus besorgen. Allzu weit dürften sie nicht gekommen sein...\n\nBitte findet sie, aber seid gewarnt. Sie sind... ziemlich anstrengend.', '', '', '', '', '', '', 47187),
(69902, 'deDE', 'Theorie in Praxis', 'Helft Tyrgon, die Kreatur zu heilen.', '$n, ich benötige Eure Unterstützung...\n\nEs erwartet doch hoffentlich niemand, dass ich hier bastele, den Welpen beruhige, heile und gleichzeitig die Kinder unterrichte! Alles gleichzeitig zu machen, wird wahrlich überschätzt.\n\nNun, Ihr könnt damit anfangen, indem Ihr diese Blumen benutzt. Ich werde einige Minuten Vorbereitungszeit benötigen, um den Protowelpen zu heilen.\n\nHoffentlich ist das dann für die Kinder auch noch... lehrreich.', '', '', '', '', '', '', 47187),
(69901, 'deDE', 'Einbeziehen eines Experten', 'Sammelt $1oa Sonnenlichtblumen.', 'Hat Iyali gesagt, wie lange dieses Wesen schon leidet? Wenn es wegen der Schmerzen nicht mehr essen kann, müssen wir es schnell behandeln.\n\nNormalerweise würde es in einem Lager der Drachenschuppenexpedition die notwendigen Vorräte dafür geben, doch im Grenzland der Dracheninseln kommt man nicht so leicht an Ressourcen. Es gab spürbare Verzögerungen auf den Versorgungsrouten.\n\nAber keine Bange. Das Land wird uns schon versorgen! Wenn Ihr mir Sonnenlichtblumen bringt, kann ich eine Salbe mischen, die den Drachen beruhigt, damit ich ihn besser behandeln kann.', '', '', '', '', '', '', 47187),
(69900, 'deDE', 'Die Quelle identifizieren', 'Tötet den experimentierenden Primalisten im Wildreservat.', 'Nach dem, was die Kinder gesagt haben, könnte es sein, dass sich ein Primalist im Wildreservat herumtreibt.\n\nDies erfordert eine sofortige Untersuchung.\n\nAndere Forscher haben festgestellt, dass die Primalisten immer wieder Eier und Welpen stehlen, um ihnen Macht einzuflößen und sie zu verderben. Diejenigen, die diesem Prozess nicht standhalten, erleiden einen langsamen Tod... Aber das interessiert die Primalisten nicht sonderlich...\n\nSie müssen raus aus dem Reservat. Kümmert Ihr Euch darum. Ich werde derweil versuchen, die Kinder abzulenken. Sie dürfen nichts davon erfahren.', '', '', '', '', '', '', 47187),
(69899, 'deDE', 'Geheime Forschung', 'Helft Iyali und ihren Freunden.', 'Ich weiß, dass ich mich komisch verhalte. Tut mir leid!\n\nIhr habt Euch vermutlich schon gedacht, dass ich nicht die ganze Wahrheit sage.\n\nIch kann Euch von meinem Geheimnis erzählen... wenn Ihr wollt. Aber Ihr müsst versprechen, den Erwachsenen nichts zu verraten.', '', '', '', '', '', '', 47187),
(69898, 'deDE', 'Fleisch mit einer Portion Wissenschaft', 'Sammelt $1oa Stücke extraleckeres Flussbestienfleisch.', 'Äh, ja, also ich, ich habe noch mehr Hausaufgaben... Professor Tyrgons Stunden sind echt schwer! Jetzt soll ich rausfinden, was Protowelpen, äh, fressen! Jawohl...\n\nWartet, ich kenne die Antwort darauf. Sie fressen Flussbestien!\n\nKönnt Ihr mir ein Stück Flussbestienfleisch bringen? Es wäre perfekt, zu \"Anschauungszwecken\" etwas Flussbestienfleisch für mein Projekt zu haben.\n\nEs muss aber ein WIRKLICH gutes Stück sein, okay? Ich meine... wie von den dicklichen Flussbestien. So eins, was ein Mamaprotodrache anschleppen würde, um die Protowelpen richtig stark zu machen, weil... äh... es Herr Tyrgon so glücklich macht.', '', '', '', '', '', '', 47187),
(69897, 'deDE', 'Verhaltensanalyse-\"Hausaufgaben\"', 'Streichelt $4oa schlafende Welpen und meldet Euch dann wieder bei Iyali.', 'Ich muss mit jemandem sprechen, der sich mit Protowelpen auskennt. Wie die, die im Wildreservat leben!\n\nSind die so wütend wie die Großen? Beißen die oder spucken sie Feuer auf einen?\n\nWas wäre, wenn ich... äh... IHR einen Protowelpen streicheln würdet? Würden sie wissen, dass Ihr nett seid und ihnen zu helfen versucht?\n\nIch frage für die Wissenschaft, natürlich. Tyrgon sagt uns immer, dass wir unsere Hypa.. nein... Hippo... hmpf! Hippothresen... hnn! THEORIEN auf die Probe stellen sollen!\n\nIch glaube, dass sie gerne gestreichelt werden wollen und dass sie sich dann besser fühlen würden. Könntet Ihr das für mich untersuchen?', '', '', '', '', '', '', 47187),
(69896, 'deDE', 'Unglücklicher Umweg', 'Trefft Elementaristin Taiyang in den Ruinen des Lebensgewölbes.', 'Ich wusste, dass ich mich in Gefahr begeben würde, wenn ich der Drachenschuppenexpedition beitrete. Aber ich hatte nicht damit gerechnet, gegen Elementare kämpfen zu müssen!\n\nAn unserer Ausgrabung, den Ruinen des Lebensgewölbes, herrscht das pure Chaos! Steinerne Monstrositäten steigen aus dem Boden empor! Wir haben eine Elementaristin zu unserer Beratung angefordert, aber ich glaube, sie wird jede Hilfe brauchen, die sie bekommen kann.\n\nVielleicht könntet Ihr das übernehmen? Unser Lager liegt gleich jenseits des Flusses.', '', '', '', '', '', '', 47187),
