(69870, 'deDE', 'Bilder mit Bedeutung', 'Trefft Akunda die Katalogisiererin und Kanonierin Fren in der Nähe der Überlaufenden Stromschnellen.', 'Bilder bringen die Leute zusammen, $p.\n\nUnsere Katalogisierer rücken zur Sicherheit nur im Doppelpack aus und es war schön zu sehen, wie Mitglieder verschiedener Fraktionen und Hintergründe auf diesen unglaublichen Inseln auf der Suche nach Wissen zusammengearbeitet haben.\n\nEines dieser eifrigen Duos kartografiert gerade einen der zentralen Flüsse der Küste des Erwachens.\n\nWenn Ihr unserer Sache behilflich sein wollt, stoßt zu ihnen und helft ihnen dabei, die hiesige Fauna zu katalogisieren.', '', '', '', '', '', 'Trefft Akunda die Katalogisiererin und Kanonierin Fren in der Nähe der Überlaufenden Stromschnellen.', 47187),
(69869, 'deDE', 'Ein Paradies für Katalogisierer', 'Sprecht mit Katalogisiererin Coralie im Drachenschuppenbasislager.', '<Dok Charly ist außer Atem, als er Euch einen Brief überreicht, der Euch für weiteres Training zurück ins Basislager der Drachenschuppenexpedition einlädt. Er versucht, das Anliegen eifrig zu erklären.>\n\nNetter Elf. Stolzer, winziger Mann. Viele Kameras. Ja?\n\n<Dok Charly nickt aufgeregt, während er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Katalogisiererin Coralie im Drachenschuppenbasislager.', 47187),
