(69862, 'deDE', 'Slyvernrettung', 'Findet heraus, weswegen Sylvie so aufgeregt ist.', 'Jetzt, wo sie geheilt ist, will Sylvie uns, glaube ich, etwas zeigen.\n\nUnsere Arbeit ist noch nicht getan, $n! Sehen wir mal nach, weswegen sie so aufgeregt ist.', '', '', '', '', '', '', 47187),
