(69855, 'deDE', 'Die Berufung zum Klettern', 'Sprecht mit Pfadfinder Jeb im Drachenschuppenbasislager.', '<Dok Charly ist außer Atem, als er Euch einen Brief überreicht, der Euch für weiteres Training zurück ins Basislager der Drachenschuppenexpedition einlädt. Er versucht, das Anliegen eifrig zu erklären.>\n\nVon großer Jeb. Guter Freund. Jetzt klettern. Ja?\n\n<Dok Charly nickt aufgeregt, während er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Pfadfinder Jeb im Drachenschuppenbasislager.', 47187),
