(69097, 'deDE', 'Eine unversiegelte Kammer', 'Sprecht mit Katalogisiererin Jakes im Drachenschuppenbasislager.', '<Dok Charly ist außer Atem, als er Euch einen Brief überreicht, der Euch zurück ins Basislager der Drachenschuppenexpedition einlädt. Er versucht, das Anliegen eifrig zu erklären.>\n\nLauter Zwerg. Ernster Elf. Bereit für Euch. Ja?\n\n<Dok Charly nickt aufgeregt, während er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Katalogisiererin Jakes im Drachenschuppenbasislager.', 47187),
(69096, 'deDE', 'Taivans Bestimmung', 'Versucht, die Zentaurenwaise Chimei zu trösten.', 'Seht Ihr das Zentaurenkind, das ganz alleine da drüben am Bachufer sitzt?\n\n<Sie deutet nach Nordosten, wo Ihr ein Zentaurenkind aufs Wasser starren seht.>\n\nChimei hat während des Angriffs der Nokhud beide Eltern verloren. Alle körperlichen Wunden konnte ich heilen, doch ich habe Chimei bisher noch nicht essen sehen oder sprechen hören. Sitzen und starren, den ganzen Tag.\n\nDas übersteigt meine Fähigkeiten und ich weiß nicht, was ich tun soll. Könntet Ihr versuchen, mit Chimei zu sprechen, $n?', '', '', '', '', '', '', 47187),
(69095, 'deDE', 'Heimwärts mit Hund', 'Reitet mit Taivan zurück nach Maruukai.', 'Dank Euch und Taivan sind alle stabilisiert, doch viele der Dorfbewohner müssen noch etwas in Maruukai bleiben, um sich zu erholen.\n\nWarum führt Ihr beiden nicht gemeinsam den Zug zurück? Ihr seid schließlich die Helden der Stunde!', '', '', '', '', '', '', 47187),
(69094, 'deDE', 'Zentauren retten', 'Rettet verwundete Zentauren in Daruukhan.', 'Die Heimtücke der Nokhud kennt keine Grenzen! Lediglich Handwerker leben in Daruukhan. Sie hatten absolut keine Chance gegen die Räuber.\n\nWir brauchen dringend Eure Hilfe, $n. Die Nokhud sind noch in der Nähe, und wir müssen die Verwundeten versorgen!\n\nDurchsucht das Dorf und bringt die Überlebenden zu mir. Wir kümmern uns dann um sie und stabilisieren sie, so gut es geht!', '', '', '', '', '', '', 47187),
(69093, 'deDE', 'Ein neues Mysterium', 'Sprecht mit Naleidea Flussglanz im Drachenschuppenbasislager.', '<Dok Charly ist außer Atem, als er Euch einen Brief überreicht, der Euch zurück ins Basislager der Drachenschuppenexpedition einlädt. Er versucht, das Anliegen eifrig zu erklären.>\n\nVersiegelte Tür. Titanengeheimnisse. Ja?\n\n<Dok Charly nickt aufgeregt, während er auf Eure Antwort wartet.>', '', '', '', '', '', 'Sprecht mit Naleidea Flussglanz im Drachenschuppenbasislager.', 47187),
(68799, 'deDE', 'Rückkehr zum Rubinlebensschrein', 'Kehrt zum Rubinlebensschrein zurück.', 'Und dies ist nur der Anfang Eurer Reise auf dem Rücken eines Drachen!\n\nHaltet die Augen stets nach neuen Abenteuern und Erfahrungen offen und besucht uns in unseren Außenposten, die überall auf den Dracheninseln verteilt sind.\n\nDoch kehrt nun fürs Erste zu Alexstrasza zurück und setzt Eure Erkundungen dieser Lande fort.', '', '', '', '', '', 'Kehrt zu Alexstrasza beim Rubinlebensschrein zurück.', 47187),
(68798, 'deDE', 'Drachenglyphen für Anfänger', 'Sammelt die Drachenglyphe am Himmelhochobservatorium und sprecht dann mit Lithragosa, um Euer Talent einzusetzen.', 'Natürlich sind nicht nur Glensera und ich an diesen Abenteurern interessiert. Lithragosa freut sich auch darauf, Euer Geschick im Drachenreiten zu verbessern und ihr habt glücklicherweise Celormu bereits getroffen.\n\nAuf den Dracheninseln befinden sich außerdem Glyphen, die Euch helfen, mehr Tricks und Fähigkeiten fürs Drachenreiten zu erlernen. Eine befindet sich sogar gleich hier im Himmelhochobservatorium.\n\nSobald Ihr sie gefunden habt, kann Lithragosa Euch zeigen, wie Ihr sie einsetzt!', '', 'Diese Glyphen, die man auf den Dracheninseln vorfindet, werden Euch helfen, mehr Tricks und Fähigkeiten für das Drachenreiten zu erlernen.', 'Drachenglyphe', '', '', '', 47187),
(68797, 'deDE', 'Ein neues Paar Hörner', 'Trefft Glensera und verwendet das Podium der Transformation, um das Aussehen Eures Drachen zu verändern.', 'Wie auch den Sterblichen ist den Drachen ihr Äußeres sehr wichtig. Euer Drache kann sein Aussehen ebenfalls verändern, je nachdem, was Ihr findet und erlebt.\n\nSprecht mit Glensera am Podium der Transformation und seht selbst!', '', '', '', '', '', '', 47187),
(68796, 'deDE', 'Das Himmelhochobservatorium', 'Reist zum Himmelhochobservatorium an der Küste des Erwachens.', 'Das sind die Grundlagen im Drachenreiten! Ihr macht das ziemlich gut.\n\nJetzt würde ich Euch gerne den anderen vorstellen, die auch in dieses Abenteuer verwickelt sind. Wir haben uns drüben im Himmelhochobservatorium eingerichtet.\n\nCelormu kann Euch dorthin führen. Sprecht mit ihm, wenn Ihr Euch für den Flug bereit fühlt!\n\nWir sehen uns dann dort!', '', '', '', '', '', 'Trefft Lord Andestrasz im Himmelhochobservatorium.', 47187),
(68795, 'deDE', 'Drachenreiten', 'Sprecht mit Lord Andestrasz im Rubinlebensschrein.', 'Euch ist vermutlich bereits aufgefallen, dass die Dracheninseln sehr weitläufig sind.\n\nEinige der Drachen haben ein flammendes Interesse daran, in diesem erneuerten Land jede Ecke zu erkunden und jedes Geheimnis aufzudecken, auch wenn man es nicht vom Boden aus erreichen kann. Sie freuen sich über ein zweites Paar Augen, das ihnen auf ihrer Reise hilft und werden im Tausch gerne einen Reiter über das Land tragen.\n\nSprecht mit Lord Andestrasz hier im Rubinlebensschrein. Er wird Euch erklären, was sie vorhaben.', '', '', '', '', '', 'Sprecht mit Lord Andestrasz im Rubinlebensschrein.', 47187),
(68794, 'deDE', 'Drachenbund', 'Sprecht mit Alexstrasza am Sitz der Aspekte in Valdrakken.', 'Dass Ihr den Dracheninseln geholfen habt, ist nicht unbemerkt geblieben, $n.\n\nDie Lebensbinderin höchstpersönlich möchte Euch als Belohnung für die Dienste, die Ihr den Drachen erwiesen habt, etwas zeigen.\n\nBesteigt die Turmspitze und sprecht mit ihr. Alle Aspekte erwarten Euch.', '', '', '', '', '', 'Sprecht mit Alexstrasza am Sitz der Aspekte in Valdrakken.', 47187),
(68644, 'deDE', 'Süß wie Zucker', 'Helft bei der Behandlung von Sylvie.', 'Na bitte! Jetzt habe ich alles, was ich für Sylvie brauche!\n\nUnd genau zur richtigen Zeit. Ich bezweifle, dass sie noch viel länger durchgehalten hätte.\n\nAllerdings... brauche ich jemanden, der mir hilft. Ich würde ja Calli fragen, aber... würdet Ihr mir vielleicht noch mal helfen?\n\nGebt mir Bescheid, sobald Ihr bereit seid, $n.', '', '', '', '', '', '', 47187),
(68643, 'deDE', 'Vitamine und Mineralien', 'Sammelt $1oa mineralerfüllte Wasserphiolen.', 'Ich hätte eigentlich damit rechnen können, dass es Steria nicht gefallen würde, wenn ich Euch darum bitte, Tiere zu bekämpfen...\n\nSelbstverständlich gibt es alternative Forschungsmethoden.\n\nNehmt diese Phiolen und sammelt etwas Wasser von den Eiskristallen in der Nähe.\n\nMeine Theorie ist, dass sie Mineralien beinhalten, die mit der Energie von Leykristallen angereichert sind... was wiederum die Ursache für den Ausbruch hier sein könnte.', '', '', '', '', '', '', 47187),
(68642, 'deDE', 'Arbeit nadelt', 'Sammelt $1oa arkanerfüllte Federkiele.', 'Ich will Sylvie helfen, aber ich will Calli auch nicht länger warten lassen.\n\nUm Sylvie die Medizin zu verabreichen, brauche ich arkanerfüllte Federkiele von den Kristallrücken. Die werden sicherlich nichts dagegen haben, wenn Ihr ihnen ein paar davon ausrupft.\n\nUnd passt auf die Bakar auf! Sie fressen Kristallrücken und werden es nicht gerne sehen, wenn ihr sie anfasst. Wenn es also hart auf hart kommt und Ihr Euch verteidigen müsst, lässt sich bei ihnen auch der ein oder andere Federkiel finden.\n\nAber... versucht es bitte nicht, darauf ankommen zu lassen.', '', '', '', '', '', '', 47187),
(68641, 'deDE', 'Ohne Moos nix los', 'Sammelt $1oa Drakmoosklumpen.', 'Armes Kleines...\n\nSie muss krank geworden sein, nachdem sie etwas Verunreinigtes gegessen hat.\n\nZum Glück war mein Großvater Druide und hat mir beigebracht, wie man arkan hervorgerufene Krankheiten behandelt.\n\nIch habe nicht alles Nötige bei mir, doch in der Umgebung sollte sich was finden lassen.\n\nZuerst brauche ich etwas Drakmoos. Das ist eine seltene Flechtenart, die nur auf Drachenknochen wächst.', '', '', '', '', '', '', 47187),
(68639, 'deDE', 'Eisbären auf der Jagd', 'Tötet $1oa infizierte Kaltpelze.', 'Die Spezies, die wir untersuchen sollen, sind die Kaltpelze.\n\nIhr Jagdrevier wurde von den Leylinien verunreinigt. Arkane Energie breitet sich im Wasser und in den Pflanzen aus... und in Beutetieren wie den Slyvern.\n\nDoch im Gegensatz zu anderen Organismen, überleben die Kaltpelze den Prozess und schöpfen daraus sogar Kraft.\n\nAllerdings werden sie dadurch auch aggressiv... was wiederum ein Problem darstellt. Legt Euch mit ein paar von ihnen an, damit ich Aufzeichnungen zu ihrer Stärke und Aggressivität machen kann.\n\nMein Bericht wird den Kirin Tor bei der Entscheidung helfen, wie mit ihnen weiter vorzugehen ist.', '', '', '', '', '', '', 47187),
(68087, 'deDE', 'Gefahr in Daruukhan', 'Sprecht mit dem Boten der Teerai, um von Selbekhs dringender Bitte zu erfahren.', 'Ich fürchte, ich kann nichts weiter tun, als Euch und Taivan nach Maruukai zurückzuschicken.\n\nWartet... Wer kommt da? Hoffentlich nicht noch ein Fremder mit einem riesigen Bakar!', '', '', '', '', '', '', 47187),
(68085, 'deDE', 'Werdegang eines Hirten', 'Bringt Taivan im Mallakh bei, Riesenwildschafe zu hüten.', 'Ihr wollt, dass ich Euren Bakar im Schafehüten ausbilde? Das ist es jedenfalls, was wir hier tun, doch ich habe noch nie einen Bakar von solcher STATUR ausgebildet...\n\nDie Riesenwildschafe scheinen sich immerhin nicht an seiner Anwesenheit zu stören und sie besitzen ein gutes Gespür für den Charakter, das könnt Ihr mir glauben.\n\nIch bin bereit, ihm einen Versuch zu geben, aber ein Hütebakar muss nicht nur sanft sein, sondern auch klug. Wenn er nicht die Kontrolle über die Herde gewinnen kann, werden die Riesenwildschafe ihm auch nicht gehorchen. Es ist schwieriger, als es aussieht! Los, versucht es, ich werde zusehen.', '', '', '', '', '', '', 47187),
(68084, 'deDE', 'Der ruhige Riese', 'Bringt Taivan zu Schäfer Tevatei im Mallakh, um dort ausgebildet zu werden.', 'Wenn Taivan wirklich so \"handzahm\" ist, wie Jadar sagt, ist er vielleicht besser als Hütebakar geeignet!\n\nDie Aylaag sind meisterhafte Riesenwildschäfer und nicht so stolz, dass sie überschwängliche Geschenke brauchen, um einem anderen Klan zu helfen.\n\nBringt Taivan bitte zu Schäfer Tevatei im Mallakh, einem Ort zwischen zwei Hügeln im Südwesten, wo sie ihre Bakar ausbilden.\n\nOhn\'ahra, bitte macht, dass das funktioniert. Sonst weiß ich nicht mehr weiter.', '', '', '', '', '', '', 47187),
(68083, 'deDE', 'Nächster Versuch, Taivan!', 'Kehrt zu Heilerin Selbekh in Maruukai zurück und überbringt ihr die schlechte Nachricht.', 'Kehrt zu den Teerai zurück und sagt ihnen, dass nicht einmal ich Taivan zu einem Jagdbakar ausbilden kann. Er ist einfach nicht dafür gemacht.\n\nEr ist das handzahmste Tier, das ich je gesehen habe. Ich wette, er würde sogar noch versuchen, sich mit dem Jagdwild anzufreunden, wenn man ihn ließe. Ha!', '', '', '', '', '', 'Kehrt zu Heilerin Selbekh in Maruukai zurück.', 47187),
(67921, 'deDE', 'Der Jagdhund', 'Jagt gefährliche Wildtiere mit Taivan, um zu beweisen, dass er würdig ist, ausgebildet zu werden.', 'Geht und jagt in der Nähe Tiere mit Eurem riesigen Bakar. Je größer, umso besser. Ich werde Euch von hier aus beobachten und entscheiden, ob er einer Shikaarausbildung würdig ist.\n\nSeid gewarnt, ich akzeptiere nur die Besten.', '', '', '', '', '', '', 47187),
(67772, 'deDE', 'Das Problem mit Taivan', 'Helft Heilerin Selbekh, Taivan für die Ausbildung vorzubereiten.', 'Hallo, willkommen zurück in Maruukai. Ich bin Selbekh, Heilerin des Klans Teerai.\n\nHabt Ihr ein Händchen für Tiere, $n? Vielleicht ist der Einfluss eines Neulings genau das, was ich brauche.\n\nTaivan hier, wenn auch ein besonders guter Begleiter, ist zu einer Art Last für meinen Klan geworden. Ich fürchte, dass ich ihn wegschicken muss, wenn wir keinen guten Nutzen für ihn finden. Würdet Ihr mir helfen?', '', '', '', '', '', '', 47187),
(67744, 'deDE', 'Shezra', '', '', '', '', '', '', '', '', 47187),
(67742, 'deDE', 'Archivring - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67741, 'deDE', 'Archivring', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67724, 'deDE', 'Schützende Flammen', 'Sammelt $1oa Stücke Schaudernetzseide.', 'Kattigat und ich sind hierhergekommen, um uns zu beweisen, indem wir die Splitterflammen aufhalten und Valthrux sichern.\n\nUnd jetzt müssen wir auf diese Elfe aufpassen, nachdem sie ein paar Eisspinnenbisse abbekommen hat. Wir haben noch nicht einmal gegen die Splitterflammen gekämpft, und die Spinnen könnten uns erledigen, bevor es überhaupt dazu kommt!\n\nWir müssen sie in Schach halten.\n\nGlücklicherweise gibt es eine natürliche Methode, die Spinnen zu vertreiben. Wenn man die Seide ihrer Kokons verbrennt, entsteht ein Geruch, der sie abschreckt.\n\nGreift Euch etwas Seide und ich werfe sie dann ins Feuer. Das wird sie abhalten!', '', '', '', '', '', '', 47187),
(67717, 'deDE', 'Gespinstkönigin Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'deDE', 'Zu den Dracheninseln!', 'Nehmt die Abgewetzte Drachenschuppe vom Hafen von Sturmwind zu den Dracheninseln.', 'Großartige Neuigkeiten, $p! Unsere erste Expedition ist auf den Dracheninseln gelandet.\n\nDank Eurer Bemühungen und denen der anderen Mitglieder der Drachenschuppenexpedition haben wir einen geschützten Landeplatz eingerichtet und Kontakt mit der Botschaft des Drachenschwarms aufgenommen.\n\nWollt Ihr uns auf unserer nächsten Reise zu den Dracheninseln begleiten?', '', '', '', '', '', 'Trefft Toddy Schnurrbart an der Küste der Dracheninseln.', 47187),
(67606, 'deDE', 'Dryadenhausmittel', 'Beschafft einen schmackhaften Schlüpflingschmaus und gebt ihn dem verzweifelten Entchen.', 'Während Ihr fort wart, habe ich von einem Traumhasen gehört, dass eines der hiesigen Entchen sich nicht wohl fühlt. Zum Glück weiß ich genau, was man dagegen tun kann!\n\nWann immer ich schlecht gelaunt bin, nasche ich etwas Süßes! Als Expertin für niedliche, liebenswürdige Kreaturen weiß ich, dass das in diesem Fall auch funktionieren wird.\n\nDieses besondere Entchen hat eine Vorliebe für ein Dessert namens schmackhafter Schlüpflingschmaus. Würdet Ihr bitte eines finden und dem armen Schätzchen bringen? Immerhin ist das die dryadische Art!', '', '', '', '', '', '', 47187),
(67605, 'deDE', 'Donnernde Ebenen', 'Erringt Ayangas Horn.', 'Auf dem Grat wandert eine große Sturmbestie. Viele Jäger der Shikaar haben versucht, sie zu erlegen, nur um vor seiner Wildheit zu fallen.\n\nWenn es Euch nach Jagdruhm dürstet, könnt Ihr gern versuchen, die Bestie zu erschlagen. Bringt uns ihr Horn als Tribut.', '', 'Eine garstige Donnerechse, die dazu neigt, Zentaurenlager zu zerstören.', 'Ayanga', '', '', '', 47187),
(67566, 'deDE', 'Frostland-Überflug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67565, 'deDE', 'Frostland-Überflug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67564, 'deDE', 'Handwerkerpost', 'Händigt die Rechnung des Handwerkerkonsortiums an Thomas Heller aus.', '$gAbenteurer:Abenteurerin;, seid Ihr auf dem Weg zum Lebensschrein?\n\nWürde es Euch etwas ausmachen, Thomas Heller diese Rechnung vorbeizubringen? Er hat ein paar handgefertigte Flaschen bestellt und unser Glasbläser hat endlich die Kosten für die benötigten Materialien.\n\nIhr solltet ihn den Weg hier weiter runter finden. Wahrscheinlich sülzt er gerade irgendeine arme Seele damit voll, wie toll sein Gatte ist...\n\nIch bin mir sicher, dass er Euch für Eure Zeit entlohnen wird.', '', '', '', '', '', 'Händigt die Rechnung des Handwerkerkonsortiums an Thomas Heller beim Rubinlebensschrein aus.', 47187),
(67299, 'deDE', 'Weg mit den Drachen', 'Nutzt einen Arkanstrahler, um $1oa Protodrachen zu töten.', 'Die Primalisten haben unser Lager ohne Unterlass mit ihren Drachen angegriffen!\n\nWir konnten sie dank unserer Schilde zurückhalten, aber wir könnten etwas Hilfe dabei brauchen, sie aus der Luft zu holen.\n\nNutzt einen unserer Strahler, um die Drachen auszuschalten!', '', '', '', '', '', '', 47187),
(67298, 'deDE', 'Die Wunder der Welt', 'Findet heraus, wie Thomas seine handwerklichen Einsichten erhält.', 'Mein Mann Thomas hat durch seine Erkundungen dieses urzeitlichen Landes viele Einsichten gewonnen.\n\nVielleicht würdet Ihr eine ähnliche Inspiration erfahren, wenn Ihr in seine Fußstapfen tretet?', '', '', '', '', '', '', 47187),
(67297, 'deDE', 'Iskaara-Tour - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67296, 'deDE', 'Iskaara-Tour', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67295, 'deDE', 'Das ist meine Spezialität', 'Sprecht mit Miguel Heller über eine Berufsspezialisierung.', 'So so, Ihr habt Euch also einer Spezialisierung gewidmet, ja? Wunderbare Sache das, wenn man sich eine exklusive Fertigkeit angeeignet hat.\n\nAls Mitglied des Handwerkerkonsortiums wäre es mir eine Ehre, Euch dabei zu helfen, Eure Künste zu verfeinern.\n\nVielleicht habt Ihr ja einen Moment Zeit, um Euch mein Wissen anzuhören oder etwas zu lernen, das Euch auf Euren Abenteuern hilft?', '', '', '', '', '', '', 47187),
(67222, 'deDE', 'Verdunkelte Wolken', 'Vertreibt die Primalisten von der Windspielanhöhe.', 'Die Primalisten haben die Windspielanhöhe mit ihren unsinnigen Lehren infiziert. Unsere Verwandten dort sind närrisch, diese Ideen zu dulden.\n\nWenn wir dabei helfen, diesen heiligen Boden von ihrer Anwesenheit zu befreien, werden die anderen Klans uns vielleicht unterstützen, wenn es nötig wird. Glaubt Ihr, Ihr könntet helfen?', '', '', '', '', '', '', 47187),
(67221, 'deDE', 'Ein Köpfchen für Metall', 'Sammelt $1oa Stücke kristallisiertes Drakonium in der Aschenscherbenspalte.', 'Um das Potenzial der Schmiede des Erdwächters voll auszuschöpfen, müsst Ihr die Grundlagen zur Herstellung obsidianversengter Legierung erlernen. Nur dann könnt Ihr in die Fußstapfen von Neltharions größten Schmieden treten.\n\nBringt mir ein Stück kristallisiertes Drakonium, das sich tief in der Aschenscherbenspalte finden lässt. Im Gegenzug werde ich Euch das Wissen vermitteln, nach dem Ihr sucht.', '', 'Gefährlich belebt durch die Macht des innewohnenden Drakoniums.', 'Kristallisierter Stahlsplitter', '', '', '', 47187),
(67220, 'deDE', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'deDE', 'Weiße Augen, blauer Drache', 'Helft Yumodormu, Setogosa zu besiegen', 'Könntet Ihr sicherstellen, dass die Partie so fair wie möglich verläuft, $PC?\n\nSetogosa ist bekannt dafür, die Regeln so zu biegen und brechen, wie es ihr passt.\n\nIch würde nur ungern sehen, dass Yumadormu verliert, nur weil sie betrügt.', '', '', '', '', '', '', 47187),
(67177, 'deDE', 'GESUCHT: Verschlinger', 'Tötet den Verschlinger und besorgt seine Hörner.', 'Wenn Ihr Euch in den Reihen der Tuskarr aufhalten wollt, solltet Ihr Euch nützlich machen!\n\nIn letzter Zeit hat sich in der Nähe ein wildes Tier eingenistet, das wir Verschlinger nennen.\n\nNoch mehr seiner Art scheinen in diese Gegend zu migrieren. Das können wir zu unserem Vorteil nutzen.\n\nTötet den Verschlinger und bringt mir seine Hörner. Wir werden sie nutzen, um unseren Außenposten zu erweitern.', '', 'Eine gewaltige Bestie fernab ihrer üblichen Jagdgründe.', 'Verschlinger', '', '', '', 47187),
(67175, 'deDE', 'Wie man ein Spielzeugboot vom Explodieren abhält', 'Sprecht mit Toolks Mutter und holt dann das Spielzeugboot.', 'Ich bringe ein Kind nur ungern um sein Spielzeug, aber es würde sich für die Kirin Tor als äußerst wertvoll erweisen, zu untersuchen, wie es so viel Arkana absorbieren konnte.\n\nAndererseits möchte ich unsere neuen Verbündeten von den Tuskarr auch nicht kränken. Ich besitze einen Zauberstab, der die Magie entfernen könnte...\n\nSprechen wir zuerst mit Toolks Mutter und entscheiden dann über das weitere Vorgehen.', '', '', '', '', '', '', 47187),
(67174, 'deDE', 'Arkane Aufdeckung', 'Untersucht Tuskarrobjekte bei Khuris Angelplatz auf Anzeichen für arkane Magie.', 'Seid gegrüßt! Ich bin Miva Sternauge und ich leite die arkanen Untersuchungen in diesem Gebiet.\n\nDas azurblaue Gebirge ist überall von Magie erfüllt. Teile davon sind harmlos... während andere wiederum recht gefährlich sein können.\n\nMir wurde aufgetragen, sicherzustellen, dass in den Besitztümern der Tuskarr keine arkane Energie zurückbleibt.\n\nWir hatten schon einen Vorfall im Lager Antonidas, bei dem eine Angelkiste spontan in Flammen aufgegangen ist!\n\nKönntet Ihr meinen Detektor nehmen und einige Objekte hier untersuchen? Ich muss noch etwas mit Julk dort drüben besprechen.', '', '', '', '', '', '', 47187),
(67173, 'deDE', 'Diebische Gnolle', '', '', '', '', '', '', '', '', 47187),
(67167, 'deDE', 'Zeit für ein Duell!', 'Fordert $1oa Dracthyr zu einem Hearthstone-Spiel heraus.', 'Jetzt, wo ich meine Karten zurückhabe, kann ich mich darauf konzentrieren, neue Mitglieder für meinen Club zu rekrutieren! Ich habe daran gedacht, die Dracthyr zu fragen... \n\nOh, da gibt es noch etwas, bei dem Ihr mir helfen könnt, $n!\n\nIch werde ein bisschen damit beschäftigt sein, andere Drachen zum Mitmachen zu bewegen, und ich möchte unbedingt die Dracthyr dabeihaben.\n\nWürde es Euch etwas ausmachen, für mich mit ihnen zu sprechen? Aber seid gewarnt: Viele von ihnen haben noch nie gespielt.', '', '', '', '', '', '', 47187),
(67154, 'deDE', 'Entropische Überreste', 'Sammelt $1oa Stücke verglasten Sand von Kreaturen in den Wandernden Sanden.', 'Wenn Entitäten die Zeitlinien passieren, kann es passieren, dass sich die Sande der Zeit an ihren Körpern ansammeln.\n\nNormalerweise löst sich der Sand recht schnell wieder, aber manchmal sorgen die entropischen Fluktuationen der Zeitreisen dafür, dass der Sand zu Glas wird. In solchen Fällen lässt er sich nur schwer entfernen. So habe ich mir schon mehrere Paar neue Schuhe ruiniert.\n\nVerglaster Sand hat sich als äußerst wertvoll für unsere Zwecke herausgestellt. Es wäre in unserem besten Interesse, so viel wie möglich davon zu gewinnen.', '', '', '', '', '', '', 47187),
(67143, 'deDE', 'Jemandem sein Herz schenken', 'Stellt ein Herz in der Flasche |A:Professions-Icon-Quality-Tier3-Small:20:20|a mit einem beliebigen Handwerksberuf her.', 'Denkt Ihr, Ihr könntet die gesammelten Elementaressenzen in diese Flasche geben?\n\nDas Rezept ist ganz einfach, Ihr könnt es genau so verwenden wie jedes andere Rezept.\n\nFalls Euch die hochqualitativen Reagenzien abhandengekommen sind oder Ihr sie aufgebraucht habt, könnt Ihr jederzeit neue von den Elementaren bei der Flunkerhöhle bekommen.', '', '', '', '', '', 'Bringt das Geschenk zu Miguel Heller beim Rubinlebensschrein.', 47187),
(67142, 'deDE', 'Wyrmfutter', 'Sammelt lavaverkohltes Fleisch von den Krustenlauerern im Glutstrom.', 'Für die Obsidianzitadelle zu kämpfen und sie zu beschützen, macht ganz schön hungrig... und wir Drachen können eine ganze Menge essen. Wir müssen unsere Vorräte auffüllen.\n\nUnter der gehärteten Lava lauern einige sehr schmackhafte Würmer, die sich durch das Magma winden! Ihr werdet ihnen vermutlich nicht viel abgewinnen können, doch für einen hungernden Drachen ist das die reinste Delikatesse.\n\nNehmt unseren Diener Gulchak mit und richtet seinen Zeiger auf Unregelmäßigkeiten in der Lava. Er wird die Würmer anlocken, dann müsst Ihr sie nur noch einfangen.', '', '', '', '', '', '', 47187),
(67137, 'deDE', 'Professionelle Ausrüstung', 'Sprecht mit Mahra Baumbieger.', 'Sagt, ich habe von Haephesta gehört, dass Ihr ebenfalls $gein arbeitender Handwerker:eine arbeitende Handwerkerin; seid.\n\nWir würden Euch gerne kostenlos mit einer Profiausrüstung ausstatten. Dafür sind Geschäftspartner doch da, nicht wahr?\n\nSprecht mit unserer Schneiderin, Mahra Baumbieger, um Maß nehmen zu lassen.', '', '', '', '', '', 'Sprecht mit Mahra Baumbieger beim Rubinlebensschrein.', 47187),
(67111, 'deDE', 'Der kummergeplagte Lehrling', 'Sammelt $1oa gefrorene Giftdrüsen.', 'Diese Mission war von Anfang an ein Fehler. Alia Segelstrahl bat uns um Hilfe, um zu verhindern, dass die Splitterflammen in den Besitz eines gefährlichen Artefakts kommen. Wir hatten es in diesen Ruinen ausfindig gemacht.\n\nAber die Splitterflammen haben uns hier besiegt und die Gegend wurde von Eisspinnen überrannt. Alia wurde schwer vergiftet, und ich fürchte, dass sie ohne das Gegenmittel nicht lange überleben wird.\n\nIch kann es herstellen, aber ich brauche dazu Giftdrüsen von den Spinnen in der Nähe. Ich habe Angst, Alia hier zurückzulassen. Könntet Ihr welche für mich finden?', '', '', '', '', '', '', 47187),
(67100, 'deDE', 'Ein Geschenk für Miguel', 'Sprecht mit Thomas über Qualität und sammelt anschließend $2oa feurige Geister in der Nähe der Flunkerhöhle für Miguels Geschenk.', '$p, könntet Ihr mir einen Gefallen tun?\n\nIch möchte ein Geschenk für Miguel, meinen Mann, besorgen.\n\nEr bedeutet mir so viel, aber ich war in letzter Zeit so beschäftigt, dass ich keine Zeit hatte, ihm etwas zu machen.\n\nKönntet Ihr mir helfen, etwas Hochwertiges für ihn herzustellen?', '', '', '', '', '', '', 47187),
(67099, 'deDE', 'Drachenaugen', 'Sprecht mit Myridian, Zepharion und Evorian in den umliegenden Gebieten.', 'Wir wissen, dass die Djaradin uns direkt angreifen werden, aber es gibt noch andere Gefahren da draußen, die mir Sorgen bereiten. Gefahren, die nicht ganz so offensichtlich sind.\n\nIch habe drei Drachen losgeschickt, welche die Umgebung erkunden und potenzielle Gefahren lokalisieren sollen.\n\nTrefft Euch mit ihnen und sammelt ihre Berichte ein. Kehrt anschließend zu mir zurück, damit wir uns auf das, was die Djaradin geplant haben, bestmöglich vorbereiten können.', '', '', '', '', '', '', 47187),
(67096, 'deDE', 'Flug des Wallenden Walds - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67095, 'deDE', 'Flug des Wallenden Walds', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67094, 'deDE', 'Als Dryade hat man immer zu tun', 'Helft Thalendra, die vielen kleinen Tiere von Valdrakken zu füttern.', 'Es ist wunderbar, Valdrakken wieder so lebendig zu sehen. Aber es gibt so viele Dinge, die unter den Tausenden von Jahren der Vernachlässigung gelitten haben, nicht zuletzt all die entzückenden kleinen Tiere in der Stadt! Leider haben wir nicht genug Dryaden, um uns um sie alle zu kümmern.\n\nSagt mal, wie würde es Euch gefallen, zur Ehrendryade von Valdrakken ernannt zu werden? Einige der entzückenden kleinen Freunde der Stadt mussten schon viel zu lange ohne ihre Lieblingsleckerlis auskommen. Wollt Ihr mir nicht helfen, sie zu versorgen?', '', '', '', '', '', '', 47187),
(67093, 'deDE', 'Ein anomaler Schrein', 'Findet einen Weg, das verborgene Relikt im Sandverlorenen Sanktum einzusammeln, und kehrt dann zu Nozdormu beim Sitz der Aspekte in Valdrakken zurück.', 'Mein Forschungsteam hat ganz in der Nähe ein seltsames Sanktum entdeckt. An dessen Außenseite haben wir Schriftzeichen ausgemacht, Titanenrunen, um genau zu sein. Wir glauben, dass sie auf Aman\'thul den Hochvater verweisen, den Anführer der Titanen.\n\nWir wollten das Sanktum genauer untersuchen, haben dabei aber dessen Verteidigung ausgelöst. Ein riesiges Sandamalgam hat uns den Weg versperrt, und wir sind nur ganz knapp mit dem Leben entkommen.\n\nWir sind uns nicht ganz sicher, was es beschützt, aber es muss etwas Wichtiges sein. Könnt Ihr der Sache nachgehen?', '', '', '', '', '', 'Kehrt zu Nozdormu in Valdrakken zurück.', 47187),
(67084, 'deDE', 'Die silberne Bestimmung', 'Platziert die uralten Titanenstahlbarren in der Schmiede und beendet die Aufgabe, die Tyr Euch aufgetragen hat.', '<Das Echo von Tyr wird durch Eure Anwesenheit aktiviert.>\n\nEure nächste Aufgabe steht nun bevor, meine Freunde.\n\nVertraut die Barren dem Feuer an und aktiviert die Schmiede. Ich habe die nötigen Abläufe bereits für Euch vorbereitet.\n\nDie Silberschuppe enthält den Bauplan. Sein Nutzen wird sich Euch offenbaren.', '', '', '', '', '', 'Sprecht mit Alexstrasza in Tyrhold.', 47187),
(67081, 'deDE', 'Eine Infusion der Materialien', 'Beschafft Euch $1oa uralte Titanenstahlbarren und bezwingt den urtümlichen Tsunami in den Hallen der Infusion.', '<Das Abbild von Tyr spricht erneut.>\n\nIhr habt die Schmiede reaktiviert. Die nächste Aufgabe wird nicht so einfach sein.\n\nIn der Schuppe sind Baupläne geritzt für etwas, das Ihr für mich schmieden sollt. Irideus, einem meiner treuen Hüter, habe ich die nötigen Materialien für diese Aufgabe anvertraut. Es gibt nur noch sehr wenige von ihnen und sie sind unter besonderen Umständen entstanden.\n\nSucht nach Irideus in den Hallen der Infusion. Ich hoffe, dass die Anlage unter seinen wachsamen Augen weiterhin ordnungsgemäß ihrem Betrieb nachgeht.', '', '', '', '', '', '', 47187),
(67080, 'deDE', 'Handwerkerversorgung: Alchemistische Lösung des Drachen', 'Verwendet das Rezept \'Gemischressourcen zurückgewinnen\' und stellt $1oa Flaschen einer alchemistischen Lösung des Drachen für Haephesta beim Rubinlebensschrein her.', 'Seid Ihr auf der Suche nach Arbeit, $gAlchemist:Alchemistin;?\n\nDas Handwerkerkonsortium ist mit einem \"Handwerksauftrag\" an mich herangetreten. Es besteht Interesse an meinen alchemistischen Lösungen. Diese Geschäftspraktiken klingen zwar interessant, doch ich habe einfach zu viel um die Ohren.\n\nVielleicht ist dies eine Gelegenheit für Euch, Lehrling. Stellt eine alchemistische Lösung her, indem Ihr Eure vorherigen Gemischressourcen zurückgewinnt, und bringt sie zu Haephesta, die sich etwas weiter den Pfad entlang befindet.', '', '', '', '', '', '', 47187),
(67079, 'deDE', 'Schlüsselmomente', 'Beschafft Euch die primäre und die sekundäre Sicherheitsscheibe in Tyrhold.', 'Die Sicherheitsvorkehrungen in der Schmiede sind strenger als in jedem anderen Bereich Tyrholds. Das wird eine ziemliche Herausforderung, $C.\n\nNur bestimmte Einheiten der Zitadelle können die Sicherheitsmaßnahmen umgehen, und um einer Sicherheitsverletzung vorzubeugen, verlangen die Protokolle stets mehr als einen Code.\n\nDiese Einheiten werden Ihre Überbrückungsscheiben nicht freiwillig hergeben, Ihr werdet sie ihnen mit Gewalt abnehmen müssen. Seid vorsichtig, $n.', '', '', '', '', '', '', 47187),
(67078, 'deDE', 'Anweisungen zum Abschied', 'Platziert die Silberschuppe in der Schmiede von Tyrhold.', '<Das Echo spricht mit uralter Stimme.>\n\nAn meine lieben Freunde, ich entschuldige mich für meine plötzliche Abreise.\n\nAber ich verspreche, dass Ihr nicht ohne meine Hilfe seid. Ich weiß, dass für Euch die Zeit großer Not gekommen ist, aber um sicherzustellen, dass dieses Geschenk nicht missbraucht wird, muss ich von Euch verlangen, eine Reihe an Aufgaben auszuführen.\n\nDie erste ist einfach: Reaktiviert die Schmiede innerhalb von Tyrhold. Die Silberschuppe ist der Schlüssel.', '', '', '', '', '', 'Sprecht mit Koranos in Tyrhold.', 47187),
(67077, 'deDE', 'Erinnerungen an die Vergangenheit', 'Sprecht mit Nozdormu und seht die Erinnerung an die Vergangenheit.', 'An diesem Ort sahen wir unseren Freund Tyr zum letzten Mal.\n\nWir verstanden die Beweggründe nicht, warum er uns verlassen musste, außer, dass es wichtig war.\n\nAuch wenn dies unseren Herzen unerträgliches Leid bereitet, denke ich, dass dieser Funke uns gerufen hat, um diesem Zeitpunkt noch einmal beizuwohnen. Mit Nozdormus Hilfe können wir vielleicht diesen Moment erneut durchleben und nachsehen, ob es einen anderen Hinweis gibt, den Tyr uns hinterlassen hat.', '', '', '', '', '', '', 47187),
(67076, 'deDE', 'Ein Funken der Entdeckung', 'Untersucht den Titanenfunken in Tyrhold.', 'Obwohl dieser Funke eigenartig ist, spüre ich, dass er mir bekannt ist. Ich bin mir nicht sicher, was sein Nutzen ist, aber ich glaube, er führt uns einen Schritt näher zur Lösung dieses Rätsels.\n\nFolgt ihm, um herauszufinden, ob Ihr seinen Zweck aufdecken könnt, während ich in der Zwischenzeit versuche, mehr herauszufinden.', '', '', '', '', '', 'Sprecht mit Kalecgos in Tyrhold.', 47187),
(67075, 'deDE', 'Die innere Magie', 'Zieht verborgene Magie aus den Konsolen in Tyrhold, um das Geheimnis der Silberschuppe zu enthüllen.', 'Faszinierend. Es gibt so viele Rätsel in dieser Zitadelle, die niemand, außer Hüter Tyr selbst, versteht. Falls wir das weiter erschließen möchten, müssen wir Tyrhold weiter erkunden.\n\nIch glaube, dass die Schuppe weitere Geheimnisse zutage fördern wird, die an diesem Ort aufbewahrt liegen.\n\nWobei es ein Problem gibt. Die Wächter Tyrholds sind immer noch... instabil. Es ist möglich, dass sie durch Eure Erkundungen gestört werden und versuchen einzuschreiten. Nehmt diese Leitung. Sie wird Euch helfen, falls die Wächter sich als Ärgernis erweisen sollten.', '', '', '', '', '', '', 47187),
(67074, 'deDE', 'Das Geschenk aus Silber', 'Sprecht mit Alexstrasza, um Tyrs Geschenk zu enthüllen.', 'Kurz vor seinem Tod gab Hüter Tyr uns eine Drachenschuppe aus reinstem Silber. Wir haben sie während unserer Abwesenheit in den Gewölben von Valdrakken gelagert, aber ich glaube, es ist an der Zeit, sie wieder zu teilen.\n\nWir wissen zwar nicht, was ihr Zweck ist, aber sie war schon immer ein Symbol der Einheit und der Freundschaft. Als $gwahrer Verbündeter:wahre Verbündete; der Drachen möchten wir sie mit Euch teilen. Sprecht mit mir, wenn Ihr bereit seid, $n.', '', '', '', '', '', '', 47187),
(67073, 'deDE', 'Rote Dämmerung', 'Findet Alexstrasza.', 'Wir sind so kurz davor, unsere Kräfte wiederzuerlangen... Sollte Razageth erfolgreich sein, bevor unsere Kräfte zurückkehren, dann droht Azeroth eine dunkle Zukunft.\n\nDas dürfen wir nicht zulassen, $n!\n\nSchnell, Ihr müsst Alexstrasza finden und ihr helfen, bevor alles verloren ist!', '', '', '', '', '', '', 47187),
(67067, 'deDE', 'Verloren im Springmaislabyrinth', 'Sammelt $1oa Stängel von wildem Springmais.', 'Es gibt eine Drachenköchin in Valdrakken? Wirklich? Ich muss sie bitten, meine Bogenlichtsuppe zu probieren! Es ist ein altes Familienrezept.\n\nIch kenne die Pflanze, von der Ihr sprecht. Sie wächst bei den Flüssen hier in der Gegend, aber sie hat einige Probleme verursacht.\n\nDie Stängel von Springmais scheinen die Nahrungsgrundlage vieler Käfer und kleiner Salamanther zu sein, die wiederum die natürliche Beute von Flunkern sind. Das ist nicht so schlimm, wenn man sie von Weitem sehen kann, aber einige von ihnen sind richtig verstohlen.\n\nIch an Eurer Stelle würde die Augen offen halten.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67066, 'deDE', 'Köstlichkeiten zum Abtauchen', 'Fangt einen pikanten Deviantbandfisch.', 'Rumi und Schnabuli?\n\nGrundgütiger, das ist so lange her. Mit einem Kochduo aus Drache und Ente Fisch zu essen, klingt wie der Anfang einer Geschichte, die die Älteste Poa den Kindern erzählt. So ein Ereignis lässt sich nur schwer vergessen!\n\nDer Fisch war ein pikanter Deviantbandfisch, ein Topfavorit der Tuskarr! Sie sind selten, aber es gibt sie gleich hier vor der Küste.\n\nDoch ich warne Euch: Die Azurzähne sind in der Balz. Diese blutdurstigen Biester beißen Euch glatt ein Stück ab, wenn Ihr Euch an ihrer liebsten Knabberei zu schaffen macht.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67065, 'deDE', 'Futurist-frische Fungi', 'Fangt 7 zeitversengte Trüffler in der Zukunft der Primalisten.', 'Ein köstlicher Pilz? Alternative Zukunftslinien sind keine Vorratsschränke, die man mal eben für einen Vormittagssnack plündert.\n\nDennoch... Ich würde lügen, wenn ich sage, ich hätte nie davon geträumt, Rumis und Schnabulis Kochkünste noch einmal zu kosten.\n\nAlso gut! Ihr habt meine Erlaubnis, das Portal zu durchschreiten, doch ich würde Euch raten, nicht allein zu gehen.\n\nMeine Wächter haben bereits von diesen dunklen Pilzen gesprochen. Anscheinend bleiben sie nie lange am selben Ort. Was auch immer das heißen mag.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67064, 'deDE', 'Wandernde Delikatesse', 'Sammelt $1oa glimmende Wandertangknollen.', 'Oh, Rumiastrasza! Ich hatte einen wunderbaren Abend mit den Dryadenschwestern Celina und Felina, als wir für sie gekocht haben.\n\nDer Tang, den wir gegessen haben, ist eine einzigartige Art, glimmender Wandertang genannt. Feschfischschwärme entlang der ganzen Küste ernähren sich davon. Ich wäre nicht überrascht, wenn sie Euch angreifen, während Ihr versucht, ihre Nahrungsquelle am Meeresboden zu pflücken.\n\nRichtet den Köchen meine besten Grüße aus, wenn Ihr sie seht. Sie sind hier in unserer Zuflucht stets willkommen.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67063, 'deDE', '10.000 Jahre des Bratens', 'Sammelt $1oa würzige Lavagewürze.', 'Gewürze? Oh! Ihr müsst zu der großen alten Drachenköchin gehör\'n. Die mit dem kleinen Entenkoch auf dem Kopf.\n\nDie Djaradin sammeln Pulver, würzige Lavagewürze, von den feurigen Elementaren da unt\'n.\n\nSchaut mich nich\' so an! So nennen die Djaradin die nun mal, nich\' ich!\n\nViel Glück da unten. Ich würd nich\' allein geh\'n, wenn ich Ihr wär.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67053, 'deDE', 'Dem Frieden eine Chance', 'Stellt Euch den Vertretern der Horde vor.', 'Das Licht sei mit Euch, $p.\n\nDiese Expedition steht unter dem Schutz der Horde wie der Allianz. Unsere Befehle sind klar: die Mitglieder der Expedition unterstützen, ganz gleich, wem sie sonst die Treue geschworen haben.\n\nDie Vertreter der Horde, Kriegsherrin Grimmaxt und ihre Tochter Shuja, stehen auf der anderen Seite des Lagers Wache.\n\nIch habe mit Kriegsherrin Grimmaxt gegen die Geißel gekämpft. Sie ist eine erhabene Streiterin und wird dieser Expedition äußerst dienlich sein.\n\nBietet ihr Eure Unterstützung an. Beweist ihr, dass die Allianz ihren Verpflichtungen nachkommt.', '', '', '', '', '', 'Sprecht mit Kriegsherrin Breka Grimmaxt in der Botschaft von Schwingenrast.', 47187),
(67050, 'deDE', 'Frostbeulen: Ursachen und Symptome', 'Platziert die Totems und befreit die gefangenen Tuskarrjäger im Azurblauen Gebirge.', 'In den Totems Elemente leben, $R. Lasst frei und brecht Eis. Befreit Tuskarrfreunde!', '', '', '', '', '', '', 47187),
(67047, 'deDE', 'Wärme gegen das Frösteln', 'Sammelt $1oa Kaltbisspfeilblätter.', 'Ich glaube, die Pflanze, die Ihr sucht, hat einen schmalen Stängel und rote Blätter.\n\nIhr werdet es jedoch schwer haben, nicht auf diese garstigen Krabbeltiere zu stoßen, während Ihr Pflanzen sammelt. Ich würde Euch raten, ihnen aus dem Weg zu gehen, so gut Ihr könnt, oder immer ein scharfes Schwert zur Hand zu haben, wenn das nicht geht.\n\nUnd lasst Eure Drachenfreundin wissen, dass sie mich zur Wiedergutmachung auf eine oder zwei Tassen von dem Zeug einladen kann, wenn ich wieder in der Stadt bin.', '', '', '', '', '', 'Kehrt zu Rumiastrasza beim Rubinfestmahl in Valdrakken zurück.', 47187),
(67044, 'deDE', 'Eine Heldensage: Yanikk', 'Lauscht der Geschichte von Yanikk.', 'Lasst mich Euch die Geschichte von Yanikk erzählen.', '', '', '', '', '', '', 47187),
(67039, 'deDE', 'Eine erstaunliche Reise', 'Findet die verschwundenen Tiere.', 'Einige Haustiere des Klans sind auf der letzten Reise zwischen den Lagern verschollen. Sie sind keine Jagdtiere, deswegen bezweifle ich, dass sie da draußen alleine zurechtkommen!\n\nKönntet Ihr vielleicht nach ihnen suchen? Sie sind vielleicht keine Jagdpartner, aber sie sind dennoch wichtige Klanmitglieder!', '', '', '', '', '', '', 47187),
(67036, 'deDE', 'Der Zorn der Kirin Tor', 'Verwendet den Arkanstrahler, um Khadgar im Kampf gegen die Primalisten zu unterstützen.', 'Ich habe die Teile des Geräts zusammengesetzt, die Ihr geborgen habt.\n\nPlatziert es in der Nähe von Khadgar und nutzt es, um die Primalisten zurückzuschlagen!\n\nWir müssen nur noch etwas länger durchhalten, bis Kalecgos kommt.', '', '', '', '', '', '', 47187),
(67035, 'deDE', 'Wahrung des Wissens', 'Findet $1oa uralte Folianten in der Nähe des Lagers Antonidas.', 'Grüße, $R. Ich bin Althanus. Ich wünschte, wir hätten uns in einer weniger... chaotischen Zeit kennengelernt.\n\nWir haben den Kirin Tor geholfen, die Geschichte dieses Ortes zu studieren, als plötzlich die Primalisten angriffen.\n\nIch fürchte, dass noch einige Folianten da draußen sind und Gefahr laufen, bei diesem entsetzlichen Überfall zerstört zu werden.\n\nIch bitte Euch, diese Folianten zu bergen! Wenn sie zerstört wurden, ist die Geschichte dieses Ortes verloren.', '', '', '', '', '', '', 47187),
(67034, 'deDE', 'Von Wind und Wasser', 'Sammelt Reagenzien von den Tosende Drachenquellen.', 'Im Osten gibt es eine großartige Drachenquelle, die als Nistgrund für wilde Adler dient. Die Federn, die sie verlieren, behalten ihre Magie für eine ganze Weile und werden in vielen Ritualen genutzt.\n\nDie Gegend beheimatet auch wilde Elementargeister, und ihre Kerne sind ebenfalls nützlich.\n\nBringt mit eine Handvoll von beidem... und denkt daran, dass die Adler heilig sind. Ich werde keine Federn annehmen, für die sie verletzt wurden.', '', '', '', '', '', '', 47187),
(67033, 'deDE', 'Verteidigung zusammensetzen', 'Findet $1oa Teile des Arkanstrahlers.', 'Die Primalisten waren hinter den Kirin Tor her, seit wir im Azurblauen Gebirge angekommen sind. Sie verabscheuen unseren Umgang mit der Arkanmagie.\n\nIch werde Kalecgos mitteilen, dass er aus den Azurarchiven zurückkehren soll. Bis dahin müssen wir sie aufhalten.\n\nAnscheinend wurde eines unserer arkanen Hauptverteidigungssysteme während des Angriffs zerstört. Bringt mir die Teile, dann kann ich es wieder zusammensetzen.', '', '', '', '', '', '', 47187),
(67032, 'deDE', 'Vakthrosaufstieg - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67031, 'deDE', 'Vakthrosaufstieg', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67027, 'deDE', 'Schatten des Todes', '', '', '', '', '', '', '', '', 47187),
(67015, 'deDE', 'Antworten zurechtbiegen', '', '', '', '', '', '', '', '', 47187),
(67012, 'deDE', 'Wenn Flussbestien fliegen', '', '', '', '', '', '', '', '', 47187),
(67007, 'deDE', 'Archivassistenz', 'Sprecht mit Kemora bei den Archiven in Valdrakken.', '<Die klare, saubere und mit elegantem Strich geschriebene Schrift verblasst schnell vor der feuchten, verschmierten Tinte des Pergaments und einem Geruch, der an ein verschüttetes, vergorenes Getränk erinnert.>\n\nABENTEUERSUCHER, ARCHIVIERUNGSLIEBHABER\n\nDie Archive wenden sich an alle, die Antworten suchen, sich nach Entdeckungen sehnen und die Geheimnisse der Vergangenheit und vielleicht sogar der Zukunft lüften wollen!\n\nDieser Aufruf ist nichts für zaghafte oder wankelmütige Personen.\n\nNur wissbegierige und mutige Abenteurer dürfen sich bewerben.\n\n- Kemora', '', '', '', '', '', '', 47187),
(67006, 'deDE', 'Löschen der Flamme', '', '', '', '', '', '', '', '', 47187),
(67005, 'deDE', 'Protodrachenzähmen leicht gemacht', '', '', '', '', '', '', '', '', 47187),
(67004, 'deDE', 'Gute Dinge in großen Kisten', 'Findet einen Tresor des Erdwächters für mich und bringt ihn her, damit wir uns den Inhalt teilen können.', 'Durch unsere Bemühungen haben wir alles, was wir brauchen, um einen Tresor des Erdwächters zu öffnen. Unter der Zitadelle gibt es mehrere Tresore. Findet einen und ich werde Euch belohnen.\n\nIch habe Ketten geschmiedet, um ihn zu transportieren. Wenn Ihr ihn herkriegt, können wir uns die Reichtümer teilen.\n\nDer Tresor könnte schon transportiert werden. Ich habe auch andere ausgesandt, um ihn zu suchen.', '', '', '', '', '', 'Kehrt zu Einheizer Volrax zurück, mit oder ohne den Tresor des Erdwächters.', 47187),
(67003, 'deDE', 'Slalom des Azurblauen Gebirges - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(67002, 'deDE', 'Slalom des Azurblauen Gebirges', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66998, 'deDE', 'Feuer mit... Wasser bekämpfen', 'Tötet Lavaelementare in der Ausbrechenden Höhle.', 'In all den Jahren, in denen ich mich um die Lavaelementare gekümmert habe, habe ich sie nie in diesem Zustand gesehen! Wir können sie kaum in ihrer Höhle halten.\n\nHabt Ihr einen Moment Zeit? Wir sichern den Ausgang, während Ihr ihre Reihen drinnen ausdünnt.\n\nHier, nehmt diese Wasserelementarflasche mit.\n\nIch habe immer ein paar Wasserelementarflaschen dabei, wenn ich mich der Lavaelementare annehme. Natürliche Feinde sind immer eine gute Ablenkung!', '', '', '', '', '', '', 47187),
(66997, 'deDE', 'Krippenspiel', 'Trefft Euch mit Vaeros im Garten der Rubinlebensbecken.', 'Ich bin so dankbar, dass Lasztak die Berufung eines Welpenhüters angenommen hat! Insbesondere, da gerade so viele dieser kleinen Schätzchen ihre Zähne kriegen.\n\nDarüber hinaus stehen den Krippengärten noch andere Herausforderungen bevor. Die Welpen sind gestresst und die Hüter sind... nun, noch gestresster als sonst.\n\nBitte, wenn Ihr mal einen Moment entbehren könnt, dann besucht mich unten in den Gärten. Wir könnten Eure Hilfe auch brauchen!', '', '', '', '', '', '', 47187),
(66987, 'deDE', '[DNT] 10.0 Explorers - Ch2 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66972, 'deDE', 'Alter Steinhauer', 'Erlegt den alten Steinhauer beim Lager Antonidas.', 'Ich habe eine finstere Aufgabe für Euch, $p. Nicht jeder Tod ist ein Zeichen von Können. Manche sind ein Akt der Gnade.\n\nIm Wald östlich des Lagers Antonidas wandert ein alter Mammutbulle umher. Ich habe ihn vor einer Weile aus der Ferne gesehen und ich kann sein trauriges Trompeten immer wieder hören. Er hat eindeutig große Schmerzen.\n\nEr hat damit angefangen, blindlings durch das Dickicht zu stampfen, und ich mache mir Sorgen, dass er zu einer Gefahr für andere werden könnte.\n\nEs würde mein altes Herz erleichtern, wenn Ihr eine ebenso müde Seele zur Ruhe betten würdet. Bringt mir seinen Stoßzahn, damit wir ihm die letzte Ehre erweisen können.', '', 'Ein uralter Mammutbulle, der sich und andere gefährdet.', 'Alter Steinhauer', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66971, 'deDE', 'Das Gesicht des Todes', 'Erlegt Frostrachen nördlich der Winterpelzhöhle.', 'Sagt mir, $gmein Freund:meine Liebe;, habt Ihr je dem Tod ins Gesicht geblickt?\n\n<Nesingwary macht eine dramatische Pause.>\n\nWas rede ich denn da? Natürlich habt Ihr das.\n\nSchließlich hat der Tod viele Gesichter.\n\nDie Tuskarr von Imbu sagen, eines dieser Gesichter lebt in diesen Hügeln. Seinen Namen nur auszusprechen, bedeutet, einen gewaltsamen, eisigen Tod heraufzubeschwören:\n\nFrostrachen.\n\n<Nesingwary sieht sich argwöhnisch um.>\n\nNun, jetzt müsst Ihr ihn jagen, allein schon mir zuliebe!', '', 'Ein legendäres Omen für den Tod auf dem Eis.', 'Frostrachen', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66970, 'deDE', 'Ty\'foon der Aufgestiegene', '', '', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66969, 'deDE', 'Klans der Ebenen', 'Meldet Euch bei Sansok Khan in Maruukai.', 'Während Ihr auf die Ankunft der Botschafterin wartet, würde Sansok Khan gerne hören, wie Euer Treffen mit den Klans verlief. Sie hat mich geschickt, um Euch zu finden und zu bitten, sie im Zentrum von Maruukai für ein Gespräch zu treffen.', '', '', '', '', '', '', 47187),
(66968, 'deDE', 'Die Meute eindämmen', 'Erlegt Yetor nahe Rhonins Schild.', '<Nesingwary deutet neben den Pfad.>\n\nSeht Ihr diese Abdrücke im Schnee? \n\nYetispuren.\n\nIrgendwas muss sie aufgescheucht haben, wenn sie so nahe an der Straße jagen. Versucht, ihren Rudelführer ausfindig zu machen. Wir wollen nicht, dass sie anfangen, Reisende zu überfallen!\n\nWenn er eine besonders fiese Bestie ist, nehmt seinen Kopf mit. Das sollte die anderen abschrecken.', '', 'Was ist schlimmer als ein großer Yeti? Ein großer Yeti mit Freunden.', 'Yetor', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66964, 'deDE', 'Artefakte in den falschen Händen', 'Findet Alia Segelstrahl in den Verlorenen Ruinen im Azurblauen Gebirge.', 'Wir haben hier Myriaden, nein, eine unüberschaubare Menge an Problemen!\n\nWo soll ich nur anfangen?!\n\nDie Kirin Tor haben eine Verschwörung der Splitterflammen aufgedeckt. Sie sind hinter einem Artefakt namens \"Valthrux\" her.\n\nEs verfügt über immense Kraft und könnte sogar... empfindsam sein?! Das ist ein exponentielles Wachstum an Gefahr, falls Ihr aufgepasst habt.\n\nAlia Segelstrahl ist mit ein paar Tuskarr nach Süden aufgebrochen, um die Splitterflammen zu untersuchen. Sie hätte schon längst zurück sein sollen.\n\nBitte findet sie und haltet die Splitterflammen davon ab, dieses Artefakt in die Finger zu bekommen!', '', '', '', '', '', '', 47187),
(66963, 'deDE', 'Lieferschwierigkeiten', 'Berichtet Katalogisierer Wulferd im nahe gelegenen Basislager, dass seine Lieferung nicht so bald eintreffen wird.', 'Ich habe versucht, Vevesi klarzumachen, dass ich den Karren aus dem Schlamm bekomme.\n\nAber nein, er musste ja darauf bestehen, Magie zu benutzen... Und da seht Ihr, was er damit angerichtet hat.\n\n<Schlepperin Bennet seufzt.>\n\nIch versuche, Vevesi zur Einsicht zu bringen. Könntet Ihr währenddessen den Hügel zum Basislager hinauflaufen und Katalogisierer Wulferd erklären, dass er möglicherweise eine neue Kiste Kamerazubehör aus Boralus kommen lassen muss?', '', '', '', '', '', 'Überbringt Katalogisierer Wulferd im Drachenschuppenbasislager die schlechten Neuigkeiten.', 47187),
(66962, 'deDE', '[DNT] 10.0 Explorers - Ch1 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66961, 'deDE', 'Der Jagd beitreten', '', '', '', '', '', '', '', '', 47187),
(66960, 'deDE', 'Kluzicc der Aufgestiegene', '', '', '', '', '', '', '', '', 47187),
(66958, 'deDE', 'Schützen und geleiten', 'Erlegt Bluthorn östlich von Iskaara.', 'Ich habe kürzlich mit einigen Jägern aus Iskaara gesprochen und sie haben mir ein grausiges Bild beschrieben.\n\nOffenbar hat ein besonders mordlustiges Rhinozeros, Bluthorn, alle kleineren Brüffelche zu Brei verarbeitet.\n\nDie Brüffelche haben schon genug Konkurrenz im Azurblauen Gebirge, ohne dass sie sich darum sorgen müssen, dass ihre Herden von einem brutalen Eindringling ausgedünnt werden!\n\nBringt mir sein Horn. Ich würde gerne einen guten Eindruck bei unseren Tuskarrfreunden hinterlassen!', '', 'Ein fieses Wildtier, das die örtliche Brüffelchpopulation dezimiert.', 'Bluthorn', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66957, 'deDE', 'Ein Schatten im Eis', 'Untersucht den Gipfel des Gletschers, der Lager Antonidas überragt.', 'Als ich das Lager Antonidas passiert habe, habe ich einige beunruhigende Gerüchte aufgeschnappt. Angeblich wurden überall in den Froststeppen verwundete Tiere gefunden. Von manchen blieben nicht mehr als Blutspritzer zurück.\n\nWas immer dahintersteckt, hat den Magiern ordentlich Angst eingejagt, und Tiere gibt es in der Gegend auch kaum noch.\n\nSeht Euch am Gipfel des Gletschers um. Ich würde meine Zwergenaxt darauf verwetten, dass ein Eliteraubtier sich dort herumtreibt.\n\nBringt mir eine Trophäe von ihm zurück, damit wir die Kirin Tor beruhigen können.', '', 'Ein boshafter Riese, der gerne mit seiner Beute spielt.', 'Frostfaust', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66956, 'deDE', 'Drachenjäger Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'deDE', 'Der Gnolle teure Kleider', 'Sammelt 20 Gnollstoffe von den Gnollen der Dracheninseln für Dothenos vom Valdrakkenabkommen.', 'Die Gnolle sind eine ständige Bedrohung durch ihre blutigen Überfälle und Angriffe auf die Expeditionen und die Bewohner der Dracheninseln. Wie also bleiben ihre Kleider so sauber?\n\nNachdem Ihr diese Plünderer bekämpft habt, würdet Ihr einige Proben ihrer getragenen Kleidung zur Analyse für mich sammeln?', '', '', '', '', '', '', 47187),
(66950, 'deDE', 'Herz eines Riesen', 'Sammelt 5 Riesenkerne von den Berg-, Eis- oder geschmolzenen Riesen der Dracheninseln für Temnaayu von den Tuskarr von Iskaara.', 'Auf den Dracheninseln treiben sich verschiedene Riesen herum. Angeblich befinden sich in ihrem Kern wunderschöne Edelsteine. Normalerweise jagen wir die Kreaturen auf den Inseln nicht wegen ihrer Schätze, aber diese Riesen haben mächtig Unfrieden gestiftet.\n\nWenn wir die zerstörerischen Riesen sowieso aus dem Weg räumen, können wir dabei auch diese Juwelen einheimsen.', '', '', '', '', '', '', 47187),
(66948, 'deDE', 'Ankunft der Botschafterin', 'Erfahrt mehr über die Lage in den Smaragdgärten.', 'Ich gebe zu, dass ich die Smaragdgärten mein Leben lang nicht verlassen habe, daher habe ich auch nie einen Zentauren getroffen und schon gleich gar keinen Sterblichen vom Festland.\n\nDennoch bin ich nicht auf einen freundschaftlichen Besuch hier, sondern vielmehr, um die Hilfe der Zentauren bei der Bergung unseres Schwursteins und dem Schutz der uns Anvertrauten zu erbitten.\n\nIch bin froh zu sehen, dass Ihr ebenfalls gekommen seid, um zu helfen. Es gibt viel zu besprechen.', '', '', '', '', '', '', 47187),
(66947, 'deDE', 'Sprint des Azurblauen Gebirges - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66946, 'deDE', 'Sprint des Azurblauen Gebirges', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66944, 'deDE', 'Pfauenpigmente', 'Sammelt 8 Pfauenfedern von den Pfauen der Dracheninseln für Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Die Pfaue der Dracheninseln haben so hübsche bunte Federn! Ich bin mir sicher, wir können daraus Pigmente gewinnen, die unsere Schreiber als Tinte verwenden können.', '', '', '', '', '', '', 47187),
(66943, 'deDE', 'Schreibholz', 'Sammelt 15 Rindenpergamente von den verrottenden Treants der Dracheninseln für Dothenos vom Valdrakkenabkommen.', 'Wir haben bei unseren Studien auf den Dracheninseln ungewöhnliche Informationen herausgefunden. Beispielsweise verhält sich die Rinde der Treants, die von Verfallmagie betroffen sind, ähnlich wie Pergament aus Tierhäuten.\n\nDieses Rindenpergament ist merkwürdigerweise in der Lage, die Magie noch mächtigerer Inschriften zu binden. Wie nützlich! Könnt Ihr uns helfen, welches zu beschaffen?', '', '', '', '', '', '', 47187),
(66940, 'deDE', 'Elixierexperiment', 'Sammelt 15 Einheiten Gorlocschleim von den Gorlocs der Dracheninseln für Dhurrel von den Zentauren der Maruuk.', 'Unsere Alchemisten haben kürzlich eine Reihe neuer Zutaten für ihre Experimente ausprobiert. Ihr neuestes Interesse ist... interessant... um es vorsichtig auszudrücken.\n\nWie es scheint, weist Gorlocschleim einige Eigenschaften auf, die in bestimmten Elixieren sehr nützlich sind.', '', '', '', '', '', '', 47187),
(66939, 'deDE', 'Die Jagd auf den Meisterjäger', 'Macht Jagd auf Meisterjäger Krakle nahe Imbus Schild.', 'Ich hörte von einer der Wachen im Lager im Nirgendwo, dass irgendein schändlicher Unhold die örtliche Tierwelt verstümmelt. Nennt sich selbst \"Meisterjäger\".\n\nJagen ist das eine, aber wenn jemand Lebewesen derart quält, kann ich nicht untätig bleiben. \n\nUnd außerdem, mein Wagen könnte einen Glücksbringer brauchen.\n\n<Nesingwary spuckt zur Seite.>\n\nBringt mir seine Pranken zurück.', '', 'Ein boshafter Gnoll, dem es gefällt, unschuldige Tiere zu quälen.', 'Meisterjäger Krakle', '', '', 'Sprecht mit Hemet Nesingwary Jr. im Lager im Nirgendwo.', 47187),
(66934, 'deDE', 'Den Brecher brechen', '', '', '', '', '', '', '', '', 47187),
(66933, 'deDE', 'Spurt zum Spiegel des Himmels', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66931, 'deDE', 'Wer macht hier Krach?', 'Findet die Ursache für die Unruhe im Rubinlebensschrein.', 'Das war kein gewöhnliches Erdbeben.', '', '', '', '', '', '', 47187),
(66929, 'deDE', 'Schnappt sie Euch alle', 'Holt Yumadormus Kartenset zurück.', 'Könntet Ihr mir vielleicht helfen, meine Karten zurückzubekommen, $PC? \n\nIch habe Setogosa gesagt, dass ich sie brauche, um anderen Schülern zu zeigen, wie man Hearthstone spielt. Ich möchte einen Club gründen, aber sie gibt sie nicht zurück!\n\nSie war schon immer unfreundlich zu mir, aber jetzt geht sie noch ein bisschen weiter als sonst.', '', '', '', '', '', '', 47187),
