(66903, 'deDE', 'Aufräumen des Gewölbes', '', '', '', '', '', '', '', '', 47187),
(66901, 'deDE', 'Die Welt zerbrechen', '', '', '', '', '', '', '', '', 47187),
(66897, 'deDE', 'Brennstoff für die Schmiede', 'Sammelt 10 Magmakerne von den Lavakreaturen der Dracheninseln für Dhurrel von den Zentauren der Maruuk.', 'Um die besten Klingen herzustellen, braucht man eine Hitze, die nur ein Magmakern liefern kann. Wir versuchen, immer einige als Brennstoff für unsere Schmieden auf Lager zu haben. In letzter Zeit gehen uns aber die Kerne aus und wir könnten etwas Nachschub brauchen.\n\nMagmakerne lassen sich von den meisten Lavakreaturen auf den Dracheninseln erbeuten.', '', '', '', '', '', '', 47187),
(66895, 'deDE', 'So wie der alte Boss', 'Eliminiert Vyzos die Prophetin.', 'Die Weltenbrecherdrachkin sind ein vertrauensvoller Haufen. Über die Jahre hinweg sind wir vielen Anführern gefolgt, in der Hoffnung, dass sie uns zur Stunde des Zwielichts führen und die Rückkehr von Todesschwinge einläuten.\n\nAber Todesschwinge ist nicht zurückgekehrt und die Stunde des Zwielichts ist nie eingetreten.\n\nEs ist Zeit für einen neuen Anführer. Ihr könnt helfen, diesen Wechsel zu vollziehen.', '', 'Der aktuelle Anführer nach einer langen Reihe an Anführern.', 'Vyzos die Ausbeute', '', '', '', 47187),
(66893, 'deDE', 'Schnabelhafte Rückgewinnung', 'Heilt $1oa verletzte Hornschreiter bei den Überlaufenden Stromschnellen.', 'Über Wasserelementare weiß ich zwar nichts, aber mit Hornschreitern kenne ich mich aus!\n\nIch habe eine Salbe zusammengestellt, die die Schreiter gesund und kampfbereit hält. Ich hatte noch nie die Gelegenheit, sie einem echten Hornschreiter zu verabreichen, aber ich habe so viel geübt, wie ich nur konnte.\n\nEs wird Zeit, unseren ganzen Mut zusammenzunehmen und unsere Freunde damit einzuschmieren!', '', '', '', '', '', '', 47187),
(66892, 'deDE', 'Wasserwahnsinn', 'Tötet $1oa Wasserelementare bei den Überlaufenden Stromschnellen.', 'Elementare töten die Hornschreiter! Ich weiß, wie man große Kreaturen in den Griff bekommt, doch ich hätte nie gedacht, es mit einem Elementar aufnehmen zu müssen! Die sind nicht mit Donnerechsenjungen zu vergleichen...\n\n<Dazakros seufzt betrübt auf.>\n\nTut mir bitte einen Gefallen und erledigt ein paar dieser Elementare. Hornschreiter haben mehr Verstand, als wir ihnen zutrauen. Sie werden sie sich schon wehren, wenn sie können!', '', '', '', '', '', '', 47187),
(66891, 'deDE', 'Explosive Asche', 'Sammelt 20 Teile explosiver Asche von den Phönixen auf den Dracheninseln für Gnoklin Quirkspule von der Drachenschuppenexpedition.', 'Die geschmolzenen Phönixe der Dracheninseln hinterlassen eine ungewöhnliche Aschesubstanz, wenn sie sterben. Man könnte sie nutzen, um einige Materialverstärkungen für komplexe, lebensverändernde Maschinen herzustellen. Obwohl ich sie wahrscheinlich eher für Sprengstoff nutzen würde.', '', '', '', '', '', '', 47187),
(66890, 'deDE', 'Gestohlene Werkzeuge', 'Sammelt 20 gestohlene Werkzeuge von den Gnollen der Dracheninseln für Dothenos vom Valdrakkenabkommen.', 'Wir werden von Gnollen geplagt, die unsere Versorgungskarawanen angreifen. Sie scheinen von den Ingenieurswerkzeugen, die damit transportiert werden, regelrecht besessen zu sein. Wir können nicht riskieren, dass gewalttätige Plünderer unsere spezialisierten Werkzeuge verstehen lernen! Außerdem haben die Diebstähle unserem Produktionsfortschritt mehr geschadet, als ich zugeben möchte.\n\nWenn Ihr einige der gestohlenen Ingenieurskunstwerkzeuge zurückerlangen könntet, wären wir wieder im Zeitplan.', '', '', '', '', '', '', 47187),
(66886, 'deDE', 'Smaragdgartenaufstieg - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66885, 'deDE', 'Smaragdgartenaufstieg', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66884, 'deDE', 'Feuerfeste Ausrüstung', 'Sammelt 10 feuerfeste Ausrüstungsgegenstände von den Djaradin der Dracheninseln für Temnaayu von den Tuskarr von Iskaara.', 'Die Rüstung der Djaradin kann sogar tosenden Flammen standhalten. So etwas wäre für uns sehr nützlich, wenn wir sie bekämpfen wollen!\n\nSeht, was Ihr von den Djaradin beschaffen könnt. Dann können wir die Teile untersuchen und dieselben Verzauberungen auf unsere eigenen Rüstungen anwenden.', '', '', '', '', '', '', 47187),
(66883, 'deDE', 'Uralter Hornring', 'Bringt den Gegenstand zu Exadria.', '<Exadria könnte das haben wollen.>', '', '', '', '', '', '', 47187),
(66882, 'deDE', 'Verlorenes Gefechtspaket', 'Bringt den Gegenstand zu Krallenpirscherin Kavia.', '<Krallenpirscherin Kavia könnte das haben wollen.>', '', '', '', '', '', '', 47187),
(66881, 'deDE', 'Schluchtflusslauf - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66880, 'deDE', 'Schluchtflusslauf', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66879, 'deDE', 'Hornschreiterchaos', 'Trefft Dazakros bei den Überlaufenden Stromschnellen.', 'Hornschreiter! Sie haben Schnäbel, mit denen sie Knochen knacken, schnelle Beine, mit denen sie Gefahren entkommen, und Mägen, die so ziemlich alles auf den Inseln vertragen.\n\nDas ist die mit Abstand einfachste Berufung! Nur ich zusammen mit meinen liebsten großen Vögeln. Und sollte doch mal was sein, weiß ich, wie man alle Kreaturen der Inseln wieder in den Griff bekommt.\n\nWürde es Euch etwas ausmachen, mich zu den Plateaus der Hornschreiter im Norden zu begleiten? Ich könnte ein zusätzliches Paar Hände brauchen, während ich mich einrichte.', '', '', '', '', '', '', 47187),
(66878, 'deDE', 'Moor-Durchflug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66877, 'deDE', 'Moor-Durchflug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66875, 'deDE', 'Die Vergangenheit bewahren: Akademie von Algeth\'ar', 'Beschafft den Traumirrwisch der verworrenen Erinnerungen von der Direktorin in der Akademie von Algeth\'ar.', 'Wie wundervoll! Die Akademie von Algeth\'ar ist wieder geöffnet. Direktorin Doragosa ist sicher froh, wieder in ihren Hallen der Lehre zu sein.\n\nEs ist schon ein Weilchen her, dass ich die Gelegenheit hatte, mit meiner lieben alten Freundin zu sprechen. Vielleicht könntet Ihr hingehen und sehen, ob sie Euch zum Tee empfängt. Dann hättet Ihr auch die Möglichkeit, Euch an der Akademie einzuschreiben, denn ich hörte, dass sie jetzt für alle Studenten offen sei.\n\nIch dachte, das könnte Euch interessieren, so oft, wie Ihr mich und diese Archive besucht.', '', '', '', '', '', '', 47187),
(66874, 'deDE', 'Die Vergangenheit bewahren: Hallen der Infusion', 'Beschafft den holografischen Verteiler vom urtümlichen Tsunami in den Hallen der Infusion.', 'Wusstet Ihr, dass es tief unter Tyrhold eine riesige Anlage gibt... die Hallen der Infusion? So geheimnisvoll! So fesselnd! So voller Möglichkeiten!\n\nHüter Tyr hat dort viele seiner Geheimnisse aufbewahrt. Ich frage mich, welche das sein mögen? Er war wirklich der genialste aller Hüter.\n\n<Kemora blickt verträumt.>\n\nAber die Primalisten richten gerade ein riesiges Chaos an. Sie werden wohl alle Wunder Hüter Tyrs zerstören, wenn sie nicht aufgehalten werden. Bitte, beseitigt sie, bevor sie zu viel Schaden anrichten.', '', '', '', '', '', '', 47187),
(66868, 'deDE', 'Die Vergangenheit bewahren: Vermächtnis von Tyr', 'Erbeutet die zeitverlorene Kuriosität von Chronolord Deios in Uldaman.', 'Ich habe die Archive nach Informationen über Hüter Tyr durchsucht und war überrascht, dass sämtliche Hinweise auf Uldaman entfernt wurden. Nur auf einer halben Seite stand noch etwas über ein dort verborgenes Geheimnis.\n\nFaszinierend, oder? Ich wette, er hat dort auch noch andere Geheimnisse versteckt. Vielleicht könntet Ihr ja mal mit ein paar Freunden zusammen nachsehen. Ich wäre äußerst dankbar für alles, was Ihr mir bringen könnt.', '', '', '', '', '', '', 47187),
(66864, 'deDE', 'Reliktwiederbeschaffung: Brackenfellhöhle', 'Besorgt den Fetisch der Faultriarchin von Faultriarchin Zornauge in der Brackenfellhöhle.', 'Ah! Ihr könnt mir helfen. Die Gnolle der Brackenfellhöhle sollen angeblich Verfall einsetzen, ein mächtiges Werkzeug in den richtigen Händen. Gnolle haben nicht die richtigen Hände.\n\nWir sollten gebührende Nachforschungen in dieser dringenden Angelegenheit anstellen. Geht in die Höhle und bringt etwas von ihrer Magie mit, damit ich... damit wir sehen, welche Mächte sie sich zunutze gemacht haben.\n\nAber seid vorsichtig und geht nicht allein. Die Brackenfellgnolle können Eure Knochen zu Staub zerfallen lassen.\n\nDas wäre jammerschade.', '', '', '', '', '', '', 47187),
(66860, 'deDE', 'Reliktwiederbeschaffung: Vermächtnis von Tyr', 'Erbeutet das Stundenglas der Wandernden Sande von Chronolord Deios in Uldaman.', 'Kemora hat mich nach sämtlichen Hinweisen auf Hüter Tyr und Uldaman suchen lassen. Meine Papierschnitte haben eigene Papierschnitte von all den Büchern, dich ich für sie durchwühlt habe.\n\nFast alle Erwähnungen wurden herausgerissen oder vernichtet. Mit Ausnahme von der hier, die ich... ihr später zeigen will. Anscheinend wurde in Uldaman etwas Wertvolles versteckt. Es würde mich sehr freuen, wenn Ihr mir das bringen könntet.\n\nNatürlich nur, damit ich Kemora bei ihrer Forschung helfen kann.', '', '', '', '', '', '', 47187),
(66848, 'deDE', 'Zeichen im Wind', 'Helft Ohn Seshteng bei ihrem Ritual.', 'Ohn\'ahra spricht nicht in einer Sprache, wie wir es tun. Der Wind trägt ihre Stimme. Wir Mystiker haben uns darin geübt, ihre Präsenz zu erspüren, ihrem Ruf zu folgen und ihre Nachrichten zu deuten.\n\nIch habe die Materialien, die Ihr gesammelt habt, genutzt, um Totems an diesen besonderen Ruf zu binden. Helft mir mit dem Ritual, ihre Stimme zu konzentrieren. Dann werde ich ihr Lied deuten.', '', '', '', '', '', '', 47187),
(66847, 'deDE', 'Gewölbe der Inkarnationen: Zorn der Sturmfresserin', 'Betretet das Gewölbe der Inkarnationen und besiegt Raszageth.', 'Nein! Wir haben die Inkarnationen eingeschlossen, um diese Welt zu retten, und nun will Raszageth sie befreien!\n\nDas darf ihr nicht gelingen, $n. Alles Leben auf Azeroth schwebt in großer Gefahr, wenn Ihr sie nicht aufhaltet!\n\nIch muss zu Nozdormu im Sitz der Aspekte zurückkehren und mich auf das vorzubereiten, was da kommt. Doch sorgt Euch nicht, ich werde Euch nicht ohne Unterstützung zurücklassen. Kalecgos und Khadgar werden zu Euch aufschließen, wenn Ihr das Gewölbe betretet.\n\nViel Glück, Champion.', '', '', '', '', '', 'Sprecht mit Kalecgos beim Sitz der Aspekte in Valdrakken.', 47187),
(66846, 'deDE', 'Karte des Herzens', 'Helft der Erscheinung, eine neue Karte herzustellen.', 'Der Tag, an dem die Dracheninseln in ihren Schlummer verfielen, war auch der Tag meines letzten Spiels. Das Schicksal war grausam: Ich verlor meine stärkste Karte, bevor ich antreten konnte.\n\nIhr müsst wissen, dass Guo-Hees Karte früher meine war. Ich weiß nicht, wie ihre Vorfahren in den Besitz dieser Karte gekommen sind.\n\nUnd leider kann ich sie jetzt nicht zurückfordern, nachdem sie seit Generationen in ihrem Familienbesitz war. Das war wirklich dumm von mir.\n\nVielleicht könnten wir beide zusammen eine Karte herstellen. Eine wirklich einzigartige Karte. Ja! Werdet Ihr mir helfen?\n\nGebt mir Bescheid, wenn Ihr bereit dafür seid.', '', '', '', '', '', '', 47187),
(66845, 'deDE', 'Eine wahre Rarität', 'Findet den Geist des Drakoniden und nehmt ihm die legendäre Karte ab.', 'Letzte Nacht, als ich unter meiner Decke lag und versuchte, in den Schlaf zu finden, füllte plötzlich eine unnatürliche Kälte das Gasthaus.\n\nDann erschien aus dem Nichts der Geist eines Drakoniden! Er hat mein Gepäck durchsucht und sich danach in Luft aufgelöst!\n\nAls ich heute Morgen erwachte, war das Erschreckendste daran aber, dass der Geist meine Lieblingskarte gestohlen hatte!\n\nWärt Ihr so lieb, den Geist für mich aufzuspüren und mir meine Karte zurückzubringen? Sie ist mein wertvollster Besitz.', '', 'Egal, welche Gründe es auch geben mag, es gibt immer bessere und weisere Möglichkeiten, als zu stehlen.', 'Mysteriöse Erscheinung', '', '', '', 47187),
(66844, 'deDE', 'Der große Shokhari', 'Tötet Himmelsfüchsin Shokhari.', 'Von allen Tieren, die ich hier geseh\'n hab, war keins so stolz, wie die große Himmelsfüchsin Shokhari.\n\nZu schade, dass sie \'nen Gnollschamanen gefress\'n hat, weil sie jetz\' vom Verfall verrückt geword\'n ist. Als ich geseh\'n hab, wie sie eins ihrer Jungen gefress\'n hat, da wusst ich, dass was nicht stimmt.\n\nIch hab ihr die Jungen weggenommen, wollte sie herbring\'n. Aber Shokhari hat mich angegriff\'n und mich gut erwischt. Hätt\'s fast nicht überlebt.\n\nShokhari muss von ihrem Leid befreit werd\'n. Wenn der Verfall noch mehr von ihrem Verstand befällt, hat sie\'s bald auf uns abgeseh\'n.', '', 'Diese einst so majestätische Slyvern, die über diese Wälder geherrscht hat, ist dem Verfall anheimgefallen.', 'Himmelsfüchsin Shokhari', '', '', '', 47187),
(66843, 'deDE', 'Wo ist Lukh?', 'Findet Lukh.', 'Ach! Habt Ihr meinen Assistenten, Lukh, gesehen?\n\nDer Junge wollte sich kurz umsehen, aber er ist seit einer Stunde verschwunden!\n\nIch habe ihm gesagt, es ist hier nicht sicher genug für einen Spaziergang, aber der Junge ist so dickköpfig wie ein Widder.\n\nIch kann es ihm nicht übel nehmen. Es ist schön hier draußen, und er liebt Blumen.\n\nKönntet Ihr mir helfen, ihn zu finden? Mein Wagen und ich werden am Dreifällerundblick gebraucht!', '', '', '', '', '', '', 47187),
(66841, 'deDE', 'Ein Fragment der Vergangenheit', 'Bergt das Artefakt und bringt es zu Thanessa Silberblüh.', 'Ich hab Euch im Lager rumrennen und den Leuten helfen gesehen. Meint Ihr, Ihr könntet auch dem alten Gannar helfen?\n\nIch hab ein Gebiet untersucht und da ist mir was ins Auge gefallen. Ich glaube, es ist eine antike Tonscherbe oder ein Krug oder so, gleich südlich von hier am Rand des Wasserfalls.\n\nJetzt bin ich kein großer Schwimmer, aber ich würde Euch ein paar Münzen geben und Ihr bringt Euren Fund zu Thanessa Silberblüh.', '', '', '', '', '', 'Bringt das Artefakt zu Thanessa Silberblüh.', 47187),
(66840, 'deDE', 'Wassersicherheit', 'Bringt drei Wasserproben zu Manny Lies.', 'Meine wichtigste Pflicht ist sicherzugehen, dass für alle frisches Trinkwasser bereitsteht.\n\nMit den Gnollen im Osten und deren Verfall muss ich dafür sorgen, dass das Lager sicher ist.\n\nIch will niemanden verunsichern, indem ich Proben nehme, aber ich halte einen Test für notwendig.\n\nBringt mir Proben von den drei Wasserfällen in der Nähe. Ich werde Euch großzügig entlohnen.', '', '', '', '', '', '', 47187),
(66839, 'deDE', 'Brauzeit!', 'Sammelt Blutbeeren, Bronzehornbeeren und Drachenblattblüten.', 'Wir Kumpel hatten ein wenig Freizeit und Lust auf ein Bier, also sind wir zum Gasthaus gelaufen.\n\nAber, ach, kaum zu fassen! Die hatten nichts zum Trinken! Was ist das für ein Saftladen? Einer von den Läden der Steinangels, so einer!\n\nAlso nehmen wir\'s selber in die Hand! Im Wald östlich von hier gibt es ein paar Blumen und Kräuter, aus denen wir einen süßen Met brauen könnten. Wollt Ihr mir helfen und ein paar Blumen pflücken? Es wird sich lohnen!', '', '', '', '', '', '', 47187),
(66838, 'deDE', 'Es ist kalt hier oben', 'Sammelt dicke Bärenpelze von Dichtmähnenbären.', 'Eine gute Wirtin muss die Wünsche der Gäste vorhersehen können. Leider war ich nicht darauf vorbereitet, wie kalt die Nächte hier draußen werden können. Hoppla?\n\nMeine Gäste werden Decken brauchen... gute, dicke Decken. Vielleicht Bärenpelze?\n\nIn den Wäldern östlich von hier leben einige große Bären. Wenn Ihr mir einige ihrer Pelze bringt, werde ich Euch gut bezahlen!\n\nBitte? Denkt doch nur an die Abenteurer und ihre kalten, kalten Füße...', '', '', '', '', '', '', 47187),
(66837, 'deDE', 'Nichts zum Frühstück', 'Sammelt Fleisch von den Vorquinschreitern und gestreiften Brüffelchen südlich des Dreifällerundblicks.', 'Mein Bruder Valdo hätte eigentlich Vorräte bestellen sollen. Aber es ist eine Woche vergangen und keine Lieferung ist angekommen.\n\nIch bin nicht überrascht. Der faule Sack hat stattdessen wahrscheinlich ein Nickerchen gemacht! Jetzt gehen uns die Lebensmittel aus und ich bin zu beschäftigt mit meinen... und Valdos Aufgaben, um auch noch auf die Jagd zu gehen!\n\nWürdet Ihr für uns auf die Jagd gehen? Das Fleisch der Vorquinschreiter und gestreiften Brüffelche südlich von hier würde die Küche gut aufstocken, bis ich wieder Vorräte bestellen kann.', '', '', '', '', '', '', 47187),
(66836, 'deDE', 'Sonnentüpfelhainstrecke - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66835, 'deDE', 'Sonnentüpfelhainstrecke', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66834, 'deDE', 'Rellen der Gelehrte', 'Bietet Eure Opfergaben in der Opferhöhle dar und erfahrt jede von Rellens Lehren.', 'Bringt Eure Opfergaben in die zentrale Höhle. Hier könnt Ihr die Legende von Rellen dem Gelehrten miterleben, der den Zentauren die Lebensgrundlage gab, wie wir sie heute kennen.', '', '', '', '', '', '', 47187),
(66833, 'deDE', 'Marmoni in Bedrängnis', '', '', '', '', '', '', '', '', 47187),
(66831, 'deDE', 'Zuhause ist, wo die Frösche sind', 'Trefft Keshki bei den Lebensbecken, um die geretteten Frösche freizulassen.', 'Wir haben alle Frösche beisammen, $n! Ich schätze, wir bringen die Frösche so oder so zu Akora. Bei den Lebensbecken werden sie sicher sein, bis die Flunker das Interesse verlieren und weiterziehen.\n\nÄhm, nun ja, jetzt haben wir wohl nichts gefunden, um Akora aufzumuntern. Ich hoffe, dass sie das versteht...', '', '', '', '', '', '', 47187),
(66830, 'deDE', 'Verflunkert nochmal!', 'Verwendet Keshkis Glühwürmchenkrug um $1oa schikanierte Frösche in Sicherheit zu bringen.', 'Oh, diese Flunker machen mich so wütend!\n\n<Keshki stampft so wütend mit dem Fuß auf, dass ihre Brille verrutscht.>\n\nGroße, gierige Fieslinge! Nur weil die Höhle nach ihnen benannt ist, heißt das nicht, dass sie überall rumspringen und alles fressen dürfen, was kleiner als sie ist!\n\nHier, nehmt meinen Krug mit Glühwürmchen... Das ist der beste Freund eines jeden Froschenthusiasten. Es beruhigt die Frösche so sehr, dass Ihr sie einsammeln und außer Gefahr bringen könnt.\n\nUnd wenn Euch ein paar Flunker in die Quere kommen, dann scheut Euch nicht davor, es ihnen heimzuzahlen!', '', '', '', '', '', '', 47187),
(66828, 'deDE', 'Wirren in der Höhle', 'Trefft Keshki bei der Flunkerhöhle.', 'Ich habe Akora noch nie so aufgebracht erlebt. Normalerweise ist ihr Gemüt so sonnig wie ihre Blumen, aber diese Legende bedeutet ihr sehr viel. Sie spricht die ganze Zeit darüber. Hm...\n\n<Keshki richtet sich die Brille.>\n\nIch weiß nicht viel über Pflanzen. Und ich glaube nicht, dass sich jemand außer mir über Frösche freuen würde...\n\nAber nördlich von hier gibt es einen ruhigen Ort, an den ich gerne zum Nachdenken gehe, die Flunkerhöhle. Vielleicht finden wir da etwas, das sie aufheitert... oder zumindest einen Plan, wie wir ihr helfen können.', '', '', '', '', '', '', 47187),
(66827, 'deDE', 'Die Blumen unserer Arbeit', 'Sammelt $1oa gereifte Drachenfrüchte, $1oa duftende Drachenblumen und $1oa üppige Samenkapseln im Garten, um sie dem Drachengeist darzubieten.', 'Den Legenden zufolge singt die Stimme nur für diejenigen, die ihre Hingabe für das Leben beweisen.\n\nIch habe mich jahrelang um diesen Garten gekümmert. Und ich glaube, dass meine Pflanzen und ich endlich bereit sind.\n\nIch bereite hier beim Teich schon mal alles vor. Ihr könnt mir währenddessen bei der Ernte helfen!\n\nSammelt Samenkapseln von den Büschen, Drachenblumen auf den sonnigen Feldern und Drachenfrüchte hoch oben in den Bäumen. Für Letztere könnt Ihr Euch gerne meine alte Harke leihen. Und passt auf! Die Blätter können recht angriffslustig sein!', '', '', '', '', '', '', 47187),
(66825, 'deDE', 'Eine rubinrote Lebensberufung', 'Nehmt an der lebensberufenden Zeremonie beim Rubinlebensschrein teil.', '$p! Wie schön, dass Ihr da seid! Wir fangen gleich mit einer lebensberufenden Zeremonie an, und es wäre uns eine Ehre, wenn Ihr uns dabei unterstützen könntet.\n\nDie Berufung einer Drachenbrut ist von großer Bedeutung. Manche werden meisterhafte Gärtner, andere kümmern sich um bestimmte Wildtiere.\n\nDiese Angehörigen der Drachenbrut haben ihre Ausbildung abgeschlossen und sind nun bereit für ihre ersten Berufungen. Sie wären sicherlich ganz entzückt, wenn Ihr daran teilhaben würdet. Präsentiert ihnen bitte, sobald Ihr bereit seid, jeden der Gegenstände auf dem Tisch.', '', '', '', '', '', '', 47187),
(66805, 'deDE', 'Schlüssel der Loyalität', 'Sammelt $1oa große Obsidianschlüssel.', '', '', '', '', '', '', 'Bringt den zusammengesetzten Schlüssel zu Sabellian in der Obsidianzitadelle.', 47187),
(66788, 'deDE', 'BegEIstert von der Zukunft', 'Helft Mutter Elion, das Gebiet wiederherzustellen.', 'Ich kann es kaum glauben! Eier des schwarzen Drachenschwarms! Nach all der Zeit!\n\nAber seht nur, in welchem Zustand sich dieser Ort befindet! Das darf auf keinen Fall so bleiben! Für diese Eier ist nur das Beste gut genug.\n\nAllerdings haben diese beiden Wichtigtuer, die wie Kleinkinder um die Gunst der Lebensbinderin zanken, sicherlich keinen Gedanken an uns verschwendet! Ihr hingegen werdet eine alte Eierhüterin doch nicht im Stich lassen, nicht wahr?', '', '', '', '', '', '', 47187),
(66787, 'deDE', 'Schwingenrastkreisel - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66786, 'deDE', 'Schwingenrastkreisel', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66785, 'deDE', 'Die letzte Eierhüterin', 'Sprecht mit Mutter Elion.', 'Ich kann Eure Sorge nachvollziehen, $C, aber alles wird bald richtiggestellt werden, da es aussieht, als ob wir bald Besuch bekommen.\n\nBleibt, wenn Ihr möchtet, und beobachtet, was passiert. Es sollte recht reinigend wirken.\n\nDoch sprecht mit unserer Eierhüterin, wenn Ihr einen Moment Zeit habt. Sie könnte Eure Unterstützung brauchen.', '', '', '', '', '', 'Sprecht mit Mutter Elion.', 47187),
(66784, 'deDE', 'Den Sturm aushungern', 'Tötet alle Sturmbeschwörer der Primalisten, um das Sturmkorridorportal zu schließen.', 'Ihr schlagt Euch nicht schlecht, wenn man bedenkt, dass Euch nur zwei Beine zur Verfügung stehen!\n\nEs spielt keine Rolle, wie gut wir uns schlagen, solange die Primalisten weiterhin Verstärkung erhalten. Wir müssen dieses Portal schließen, den Sturmkorridor!\n\nSchlagt Euch zu der nahe gelegenen Höhle durch und tötet die Sturmbeschwörer der Primalisten, die das Portal geöffnet halten. Ich werde Euch beistehen, wenn ich kann.', '', '', '', '', '', '', 47187),
(66783, 'deDE', 'Erneuerung der Gelübde', 'Helft Sansok Khan, Tigari Khan, Khanam Matra Sarest und Merithra, Gaben auszutauschen.', 'Vor Jahrhunderten habe ich einen Schwur der Freundschaft und Zusammenarbeit mit den ersten Zentauren geschlossen. Obwohl sich seitdem viel geändert hat, finde ich, dass es an der Zeit für uns ist, diesen Schwur zu erneuern.\n\nEs wurde eine Rezitation verfasst, um zukünftigen Zentaurengenerationen zu helfen, sich an ihren Bund mit dem grünen Drachenschwarm zu erinnern. Jeder Vers muss mit einer Opfergabe der Khane beantwortet werden. Ich hoffe, die Zentauren erinnern sich noch an ihre ursprünglichen Bedeutungen.\n\nDie Wahl der Gabe ist entscheidend. Wählt die richtige Opfergabe und unser Bündnis ist geschlossen.', '', '', '', '', '', '', 47187),
(66781, 'deDE', 'Eine Frage des Geschmacks', 'Findet einen Stein, an dem Mordigan Eisenkiefer lecken kann, in Walfängerwinkel.', 'So viel Respektlosigkeit hier!\n\nEin paar stinkende Gorlocs klauen Teile unserer Ausrüstung und schon müssen wir alles stehen und liegen lassen... Ha! Ich hab schon Steine geleckt, da habt Ihr noch in die Windeln gemacht! Dazu brauch ich keine gnomischen Spielereien.\n\nBringt mir einen Stein und ich werd\'s Euch beweisen!', '', '', '', '', '', 'Kehrt zu Mordigan Eisenkiefer zurück.', 47187),
(66780, 'deDE', 'Thronanwärter', 'Sprecht mit Furorions Anhängern.', 'Ich habe mich immer wieder der Aufgabe gewidmet, Azeroth vor der Zerstörung zu bewahren, und dieser Narr glaubt, er könne einfach herabschießen und den Titel des Aspekts für sich beanspruchen? Ha.\n\nSprecht mit meinem Schwarm, $n. Hört Euch an, was er über mich zu sagen hat und was ich für diese Welt getan habe.', '', '', '', '', '', '', 47187),
(66779, 'deDE', 'Ersichtlicher Erbe', 'Sprecht mit den Anhängern von Sabellian.', 'Als Erbe Neltharions und Anführer des einzig überlebenden Schwarms der schwarzen Drachen hatte ich nicht erwartet, mein Geburtsrecht verteidigen zu müssen. Und schon gar nicht gegen einen selbstherrlichen Welpen, der jünger ist als Ihr, $gSterblicher:Sterbliche;.\n\nDessen ungeachtet braucht Ihr mir nicht aufs Wort zu glauben und könnt gerne mit den Mitgliedern meines Schwarms sprechen, wenn Euch diese offensichtlichen Fakten nicht genügen.', '', '', '', '', '', '', 47187),
(66778, 'deDE', 'Uktuluter Küstenachter - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66777, 'deDE', 'Uktuluter Küstenachter', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66737, 'deDE', 'Ein guter Anfang', 'Pflanzt Samen in $1oa Felder mit fruchtbarer Erde und lasst sie aufwachsen.', 'Vaeros ist gewissenhaft, doch Welpen haben ein angeborenes Talent für Ärger. Meine stellen natürlich eine Ausnahme dar... doch nicht alle Drachen ziehen ihre Gelege auf und können die Bedeutung dieser Station nachvollziehen.\n\nEs widerstrebt mir zutiefst, Außenaktivitäten Vorzug gegenüber dem Studium zu geben, doch ich werde Euch helfen, den Garten effektiver zu schützen. Nehmt diese Samenkörner und pflanzt sie in der Nähe ein. Sobald sie erblüht sind, vertreibt ihr Duft die meisten Insekten.\n\nDie Gärtner können Euch helfen... und vielleicht auch meine bronzenen Brüder und Schwestern, wenn Ihr Euch benehmt.', '', '', '', '', '', '', 47187),
(66735, 'deDE', 'Schnippschnapp', 'Schneidet $1oa überwuchernde Sträucher zurück.', 'Dass die Bienen die Welpen verschrecken, ist nicht das einzige Problem. Während die Bestäubung normalerweise eine gute Sache ist, hat der jüngste Schwarm die Flora außer Kontrolle geraten lassen.\n\nKönntet Ihr bitte meine Gartenschere nehmen und die Sträucher zurückschneiden? Einige haben bereits begonnen, gefährliche Wucherungen auszubilden, aber ich hoffe, wir können weitere davon abhalten, dies zu tun. Vorsicht ist ja bekanntlich besser als Nachsicht.\n\nUnd ich könnte gerade... wirklich eine ordentliche Portion Vorsicht brauchen, $n.', '', '', '', '', '', '', 47187),
(66734, 'deDE', 'Gute Biene zum bösen Spiel', 'Beruhigt mit dem Rauchdiffusor $2oa lästige Bienen, sammelt sie ein und lasst sie in der Nähe des Sees frei.', 'Oh, gepriesen sei die Lebensbinderin! Jemand mit einem Paar freier Hände!\n\nDiese Gärten sind üblicherweise ein wundervoller Spielplatz für unsere Welpen, aber seitdem hier alles aufblüht, vermehren sich die Bienen unkontrolliert. Die Blumen vermehren sich geradezu prächtig, und damit auch die Bienen. Die Welpen sind verängstigt, die Drachen sind genervt und gestern erst wurde einer von ihnen gestochen...\n\n<Vaeros atmet tief durch, um sich zu beruhigen, und sieht Euch dann flehend an.>\n\nKönntet Ihr bitte die Bienen einfangen und sie an den See umsiedeln? Nehmt diesen Rauchdiffusor, damit könnt Ihr sie beruhigen.', '', '', '', '', '', '', 47187),
(66733, 'deDE', 'Flusslauf des Hohen Blätterdachs - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66732, 'deDE', 'Flusslauf des Hohen Blätterdachs', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66730, 'deDE', 'Wahre Überlebende', 'Findet den alten Grimmhauer am gefrorenen See im Azurblauen Gebirge und sprecht mit ihm.', 'Ich weiß, dass wir ziemlich angeschlagen sind, doch wir dürfen nicht vergessen, warum wir hier sind. Unser Volk zählt auf uns, und ich habe nicht vor, es im Stich zu lassen. Wir müssen in dieser wilden Gegend einen vorübergehenden Platz für uns finden und ich weiß auch schon genau den richtigen Ort.\n\nUnd jetzt Schluss mit den Klagen und BEWEGUNG!', '', '', '', '', '', 'Findet den Alten Grimmhauer am gefrorenen See im Azurblauen Gebirge und sprecht mit ihm.', 47187),
(66728, 'deDE', 'Glutstrom-Flug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66727, 'deDE', 'Glutstrom-Flug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66726, 'deDE', 'Wildreservat-Parcours - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66725, 'deDE', 'Wildreservat-Parcours', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66724, 'deDE', 'Die Leuchtfischerin', 'Besorgt $1oa Leuchtfische und platziert sie im Gabenkorb.', 'Es tut mir leid, dass Ihr in diese Angelegenheit verwickelt worden seid, $gReisender:Reisende;.\n\nMein Bruder neigt dazu, zu... übertreiben. Dies ist nur die neueste seiner Narreteien, doch diese könnte ihn das Leben kosten.\n\nEr hört nicht auf mich. Er wird vermutlich auch nicht auf Euch hören.\n\nDoch es gibt jemanden, auf den er vielleicht hören würde: unsere Vorfahrin, Kauriq die Leuchtfischerin.\n\nBitte fangt ein paar Leuchtfische und bringt sie her. Mit ihnen werde ich versuchen, mit dem Geist von Kauriq zu sprechen, der in diesem Stein wohnt.', '', '', '', '', '', '', 47187),
(66722, 'deDE', 'Wildreservat-Slalom - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66721, 'deDE', 'Wildreservat-Slalom', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66719, 'deDE', 'Einen Schritt zurück', 'Schützt Euch vor dem Ruf.', '$gMein Freund:Meine Liebe;, mit großem Bedauern muss ich gestehen, dass ich mit der Plage vertraut bin, die Eure Art in diesen Ruinen heimsucht. Wenn Ihr weiter vordringt, werdet Ihr gewiss ihrem Wahnsinn anheimfallen.\n\nSei es durch Eure Erziehung oder Eure Natur... der Ruf, den Ihr vernehmt, ist psychologischer Art. Ihr verspürt ein Verlangen, das gestillt werden muss.\n\nEs beschämt mich zu sagen, dass ich die Mittel besitze, diese Verwünschung zu nähren. Es wird nicht dasselbe sein, aber Ihr werdet handlungsfähig bleiben... für den Moment.', '', '', '', '', '', '', 47187),
(66718, 'deDE', 'Gnolle müssen sterben', '', '', '', '', '', '', '', '', 47187),
(66715, 'deDE', 'Die Extraktion', 'Rettet Tuskarr aus dem Schneebalglager im Azurblauen Gebirge.', 'Am wichtigsten ist es jetzt, meine Leute zurückzubringen. Vorzugsweise unverletzt.\n\nUnd so schwer es mir auch fällt, dies zuzugeben: Ich bin nicht in der Lage, allein zu kämpfen.\n\nWerdet Ihr uns helfen?', '', '', '', '', '', 'Sprecht mit Frostbiss, um mehr über die Tuskarrjäger zu erfahren.', 47187),
(66714, 'deDE', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66713, 'deDE', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66712, 'deDE', 'Blitzfrost-Überflug - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66711, 'deDE', 'Delikate Dunkelheit', 'Sammelt $1oa Flussschnecken für Hadari.', 'Aufgrund der Lebensweise unseres Klans sind manche Ressourcen knapp. Wir haben nicht die nötige Zeit, um dem Land seine Metallressourcen zu entreißen.\n\nDie verstorbene Khan hat viele Handelsverbindungen zu einer Reihe von Leuten aufgebaut, und ich habe vor, ihre Dienste auch weiterhin in Anspruch zu nehmen.\n\nIn der Bucht in der Nähe finden sich Eimer, in denen wir Flussschnecken fangen. Sie gelten bei einigen unserer Nachbarn als Delikatesse. Bringt mir welche davon, damit ich damit handeln kann.', '', '', '', '', '', '', 47187),
(66710, 'deDE', 'Blitzfrost-Überflug', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66709, 'deDE', 'Das Einmaleins der Feldsanitäter', 'Helft dem Alten Grimmhauer, sich von seinen Wunden zu erholen.', '<Schwer zu sagen, wie lange dieser verwundete Tuskarr schon alleine hier im Wald liegt, doch ohne Hilfe wird er nicht mehr lange durchhalten.>', '', '', '', '', '', '', 47187),
(66708, 'deDE', 'Reiter im Schnee', 'Findet die vermissten Jäger der Tuskarr im Azurblauen Gebirge.', 'Seid gegrüßt, $C. Diese magische Kuppel ist wahrlich beeindruckend, nicht wahr? Doch obwohl sie uns vor der klirrenden Kälte und den Gefahren der Wildnis schützt, können wir uns nicht ewig auf die Kirin Tor verlassen.\n\nVor einigen Tagen sind einige unserer erfahrensten Jäger in die Wälder aufgebrochen, um nach Essen und Vorräten zu suchen, aber sie sind nicht zurückgekehrt. Ich weiß, ihr Anführer, der Alte Grimmhauer, ist ein erfahrener Wanderer und Jäger, aber wir können unsere Sorge um ihn und seinen Jagdtrupp nur schwer abstellen.\n\nKönnt Ihr sie für mich aufspüren?', '', '', '', '', '', 'Findet die vermissten Jäger der Tuskarr im Azurblauen Gebirge.', 47187),
(66706, 'deDE', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66704, 'deDE', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Ihr seid Euch nicht sicher, was genau er Euch sagen will, aber er gestikuliert wild, als würde er auf jemanden oder etwas einstechen. Dieser Murloc will wohl, dass Ihr etwas tötet.>', '', '', '', '', '', '', 47187),
(66703, 'deDE', 'Schneeballeffekt', 'Holt $1oa Schneebalgtotems von den Schneebalgschamanen im Azurblauen Gebirge.', 'Schneebalggnolle klug. Wissen, wenn Essen auf Eis machen, Essen länger haltbar. Aber nicht gewöhnliches Eis, nein. Magisches Eis viel besser!\n\nIst Werk von Schamanen. Und sie Frostbiss hiergelassen haben, um neben köstlichem Tuskarrfleisch zu verhungern.\n\nWenn $R Tuskarr helfen will, nicht viel Zeit bleiben.\n\nAber Frostbiss weiß, wie Zauber brechen.\n\nWarum Frostbiss helfen? Mag Schamanen auch nicht.', '', '', '', '', '', '', 47187),
(66700, 'deDE', 'Der schwarze Locus', 'Bringt den schwarzen Locus zu Telemantin Aerilyn.', 'Er ist wirklich sehr faszinierend, nicht wahr? Der Locus war zu viel für die Splitterflammen. Aber er passt genau in meine Hände. Schon seltsam.\n\n<Adenedal schüttelt den Kopf.>\n\nVielleicht nicht. Nicht heute. Nicht mehr. Nehmt ihn mir ab. Er ist nicht meine Bürde.\n\nAuf Wiedersehen, $gmein lieber Freund:meine liebe Freundin;.', '', '', '', '', '', '', 47187),
(66699, 'deDE', 'Befragung der Einheimischen', 'Sprecht mit den Tuskarr im Lager Antonidas.', 'Kalecgos ist weise, den Rat der Tuskarr einzuholen. Sie haben Generationen an Erfahrung mit diesem Gebiet.\n\nViele rasten hier auf ihrem Weg zu den verschiedenen Lagern entlang des Gebirges.\n\nFragt herum! Einer von ihnen muss etwas über lokale Leylinien wissen.', '', '', '', '', '', '', 47187),
(66698, 'deDE', 'Riesenwildschafe zählen', 'Sprecht mit dem Hirten der Aylaag und führt die verlorenen Schafe zurück zum Klan.', 'Eine unserer wichtigsten Ressourcen sind unsere Riesenwildschafe. Jeder Verlust wirkt sich deutlich auf die Stärke unseres Klans aus.\n\nEin paar der Riesenwildschafe sind davongelaufen und haben den Anschluss an die Herde verloren. Unsere Schäfer könnten bei der Rückführung der verlorenen Schafe Eure Hilfe brauchen.', '', '', '', '', '', '', 47187),
(66692, 'deDE', 'Rubinlebensschrein-Schleife - Fortgeschritten', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66691, 'deDE', 'Waking Shores - Race 01 - Intermediate', 'Gleitet durch die Ringe.', 'Der Kurs hat einen ähnlichen Aufbau wie der vorherige, nur mit mehr Varianz bei der Platzierung der Kontrollpunkte.\n\nFalls Ihr steckenbleibt, betätigt die Pfeife, dann setze ich Euch zurück.', '', '', '', '', '', '', 47187),
(66690, 'deDE', 'Angriff der Nokhud: Der letzte Ahne', 'Besiegt Balakar Khan und erbeutet das Medaillon der Ahnen beim Angriff der Nokhud.', 'Ihr habt bewiesen, dass Ihr uns $gein Verbündeter:eine Verbündete; seid und aufrichtiges Interesse an unseren Werten und unserer Lebensweise habt. Es gibt noch einen Vorfahren, von dem ich Euch gerne erzählen würde, aber es ist gefährlich.\n\nTötet den verräterischen Balakar, Anführer der Nokhud, niemandes Sohn. Sein wertvolles Medaillon legt er niemals ab. Bringt es mir und ich werde ewig in Eurer Schuld stehen.', '', '', '', '', '', '', 47187),
(66689, 'deDE', 'Mehr als ein Stein', 'Zeigt die sturmberührten Splitter Watu.', '<Die Splitter fühlen sich glatt und warm an. In ihrem Kern blitzt es.>\n\n<Vielleicht wissen Watu oder Olekk mehr darüber.>\n\n<Beim Gedanken daran, den Splitter aus der Hand zu geben, presst Ihr ihn instinktiv an Eure Brust. Ihr wollt ihn nie wieder loslassen.>', '', '', '', '', '', 'Kehrt zu Watu im Nadelholzposten zurück.', 47187),
(66688, 'deDE', 'Zeichen des Windes', 'Sammelt Windgaben und legt sie in das Opfergefäß in der Nähe des singenden Steines.', 'Als die Elemente, die wahren Urwesen dieser Welt, die Zentauren herausforderten, trat Himia dem Geschenk entgegen, das wir erhalten hatten: mit dem Wind.\n\nEin singender Stein ragt auf den Ebenen auf. Dort könnt Ihr Eure Gaben dem Wind darbieten, um ihre Erinnerung zu erwecken. Solche Gaben können überall um uns herum gefunden werden: eine Vogelfeder, ein Pflanzensamen, Flussschilf.', '', '', '', '', '', '', 47187),
(66687, 'deDE', 'Land der Eliten', 'Sammelt $1oa Schattenspinnernetze, $2oa Slyvernkrallen und $3oa Donnerrückgratschuppen.', 'Ihr solltet von Rellen dem Gelehrten wissen, der den Zentauren die Mittel gab, in einem gnadenlosen Land zu überleben. Seine Erinnerung erfordert Opfergaben von würdigen Tieren.\n\nGebt Acht, $gReisender:Reisende;, sie sind nicht so gefährlich, wie sie vor Äonen waren, doch sie sind immer noch die Eliteraubtiere dieser Ebenen.', '', '', '', '', '', '', 47187),
(66684, 'deDE', 'Sturmjäger', 'Vernichtet die Primalisten und ihre Quelle der Sturmmagie.', '<Watu reißt den Splitter raus und schnappt nach Luft.>\n\nIch... habe komplett die Kontrolle verloren. Olekk hatte recht. Diese schreckliche Magie muss das Werk der Primalisten sein. Haltet sie bitte auf!\n\nIch muss meinen Bruder zurück ins Lager bringen.', '', '', '', '', '', '', 47187),
(66683, 'deDE', 'Verzweifelte Analyse', 'Stellt Nachforschungen über die sturmberührten Splitter im Nadelholzposten an.', '<Watu murmelt mit geschlossenen Augen und verschränkten Armen vor sich hin.>\n\nNatürlich muss es ausgerechnet ein Hirsch sein, der mich aufspießt. Jetzt bin ich nur eine weitere Person, die Hilfe braucht. Mein Bruder heimst den ganzen Ruhm ein, und zu Hause wird das niemanden überraschen.\n\n<Watu blickt auf.> Was? Was habt Ihr da? Leuchtende Steine? Ja, ich kann mir einen davon anschauen, aber bringt den Rest zu jemand anderem. Ich bin Jäger, kein Archäologe. <Watu schnaubt und starrt auf sein Bein.> Vielleicht ist es ja Zeit für einen Karrierewechsel. Na los, Ihr habt Euch als nützlicher erwiesen als ich.', '', '', '', '', '', '', 47187),
(66681, 'deDE', 'Gewitter ziehen auf', 'Tötet $1oa sturmberührte Tiere im Weisenkronenpinienwald.', 'Wenn Ihr in den Pinienwald geht, dann erlegt doch bitte alle sturmberührten Tiere. Es fällt mir nicht leicht, Euch darum zu bitten, aber ihnen kann nicht geholfen werden. Sie leiden und verbreiten Aggressivität.\n\nIch schätze, dass es sich dabei um das Werk der Primalisten handelt. Das muss von ihrem Außenposten in der Nähe kommen. Ich habe dort einen seltsamen magischen Altar gesehen.\n\nIch werde mir das noch mal anschauen. Wenn ich nicht zurück sein sollte, wenn Ihr wieder da seid, kann Späher Watu Euch über ein paar weitere Aufgaben informieren. Wir sind für jede Hilfe dankbar.', '', '', '', '', '', '', 47187),
(66680, 'deDE', 'Riesenwildschäfchen zählen', 'Freundet Euch mit Wunsch mithilfe von Essen an und benutzt Wunsches Pfeife, um $3oa verirrte Riesenwildschafe im Weisenkronenpinienwald zu retten.', 'Wie frustrierend. Das stammt von einem tollwütigem Hirsch, dem mein Bruder Olekk und ich während unseres letzten Erkundungsgangs begegnet sind.\n\n<Watu deutet auf sein blutiges Bein und zuckt zusammen.>\n\nSeid Ihr hier, um zu helfen? Nach dem Angriff der Primalisten ist unsere Riesenwildschafherde in den Pinienwald geflüchtet. Dort sind die Tiere nun verstreut. Hier im Lager sind wir auf ihre Wolle und Milch angewiesen.\n\nNehmt diese Pfeife. Sie ist das Signal für Wunsch, die Riesenwildschafe zurückzubringen. Sondo der Metzger hat auch noch besondere Leckerlis, falls Wunsch etwas motiviert werden muss.', '', '', '', '', '', '', 47187),
(66679, 'deDE', 'Rubinlebensschrein-Schleife', 'Gleitet durch die Ringe.', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66676, 'deDE', 'Reinschleichen', 'Kehrt zu Radiya an den Quellen von Ohn\'iri zurück.', 'Das ist Lizi... Sie ist meine geheime Freundin. Ich kümmere mich um sie, seit sie von ihrer Mutter verstoßen wurde.\n\nDas sieht nicht gut aus. Was auch immer sie ihr angetan haben, übersteigt mein Wissen. Ich muss sie nach Hause bringen. Meine Ohn mag mich für den Rest der Zeit festsetzen, aber Lizi muss Hilfe erhalten. Ich bin Euch unendlich dankbar, $p. Es tut mir leid, dass dies mehr Schwierigkeiten bereitet als gedacht.\n\nWenn Ihr nichts gegen ein weiteres Abenteuer habt... würdet Ihr Euch dann mit mir dem Zorn meiner Ohn stellen? Wir treffen uns an den Quellen!', '', '', '', '', '', 'Kehrt zu Radiya an den Quellen von Ohn\'iri zurück.', 47187),
(66675, 'deDE', 'Aspektmacht', 'Helft Alexstrasza am Mutterschwurstein.', 'Der Mutterschwurstein ist ein uraltes Geschenk der Titanen an unsere Schwärme. Wenn unsere Informationen stimmen, können wir ihn reaktivieren und so unsere Aspektkräfte wiederherstellen.\n\nDer Erfolg mag ungewiss sein, aber wenn es auch nur eine kleine Chance gibt, muss ich es versuchen.\n\n$n, ich würde mich freuen, wenn Ihr mir helfen würdet.', '', '', '', '', '', '', 47187),
(66671, 'deDE', 'Pfad ins Nirgendwo', 'Trefft Maddi Streuschuss im Lager im Nirgendwo im Azurblauen Gebirge.', 'Ihr seht wie $gein gewillter und fähiger Abenteurer:eine gewillte und fähige Abenteurerin; aus! Wie würde es Euch gefallen, der Drachenschuppenexpedition auszuhelfen?\n\nWir haben ein nettes kleines Lager mitten in der Wildnis errichtet.\n\nEs gäbe dort einiges für Euch zu tun, vorausgesetzt, Ihr wollt den Weg dorthin auf Euch nehmen.\n\nSprecht mit meiner Schwester Maddi, wenn Ihr dort ankommt. Sie wird Euch einführen.', '', '', '', '', '', 'Trefft Maddi Streuschuss im Lager im Nirgendwo im Azurblauen Gebirge.', 47187),
(66660, 'deDE', 'Auf die Plätze, fertig...', 'Schließt Euch Andantenormu und Siaszerathel in der Vergangenheit an.', '<Nozdormus sieht sich mit unstetem Blick um.>\n\nJe tiefer sie fallen, desto schneller bewegen sie sich. Sie reißen Löcher in das Gewebe der Zeit und schlagen große Wellen. Ihr werdet schnell sein müssen, um sie zu fassen.\n\n<Nozdormus Fokus wird schärfer und richtet sich auf Euch.>\n\nIch werde meine Zeitwanderer entsenden, um Euch dabei zu helfen, über die Pfade der Zeit zu navigieren und Eure Bemühungen zu beschleunigen. Vermeidet es, Euch mit den temporalen Einheimischen abzugeben, und hört nicht auf, bis Ihr Chronormu gefunden habt!\n\nGeht. Uns bleibt nicht viel Zeit.', '', '', '', '', '', '', 47187),
(66658, 'deDE', 'Der Angriff der Nokhud: Wiederholen ist gestohlen', 'Begebt Euch zum Angriff der Nokhud, besiegt Teera und Maruuk und platziert ihre Waffen im Kurgan von Teerakai.', 'Die Waffen von Teera und Maruuk wurden entwendet, bevor wir Grabrufer Arban aufgehalten haben. Unsere größten Vorfahren könnten erneut auf diesen Ebenen kämpfen... für die Nokhud.\n\nBegebt Euch zum Angriff der Nokhud. Findet Maruuk und Teera. Wenn Ihr sie bezwungen habt, bringt ihre Waffen zum Grabhügel von Teerakai zurück. Wir werden sie an einem Ort, der sich leichter schützen lässt, mit der ihnen gebührenden Ehre wieder zur Ruhe betten.', '', '', '', '', '', '', 47187),
(66657, 'deDE', 'Und bleibt tot!', 'Betretet das größte Hügelgrab und bezwingt Grabrufer Arban.', 'Grabrufer Arban hat sich im größten Grabhügel verschanzt. Dort ruhen die ersten Vorfahren der Maruuk. Verhindert, dass er Maruuk und Teera erweckt!', '', '', '', '', '', '', 47187),
(66656, 'deDE', 'Definitiv letzte Ruhe', 'Besiegt jeden der ruhmreichen Zentaurengeister und benutzt dann Zorigs Totem der Erholung, um sie zu befreien.', 'Die Ahnen sind von dieser dunklen Magie gepackt. Sie werden kämpfen, statt zu folgen. Die Ukhel haben unsere stärksten Krieger und Jäger erweckt. Es wird nicht leicht, sie aufzuhalten.\n\nIch komme mit und helfe Euch. Es wird Zeit, den Speer meiner Mutter wieder in die Schlacht zu führen.\n\nIch habe ein Totem hergestellt, das den unterworfenen Geistern dabei hilft, zurück in ihre Kurgane zu finden. Verwendet es, sobald Ihr sie bezwungen habt.', '', '', '', '', '', '', 47187),
(66655, 'deDE', 'Reagenzien zur Ent-Nekromantierung', 'Sammelt $1oa intakte Schädel von auferstandenen Gefährten und $2oa Klumpen heiliger Erde.', 'Ich fürchte, die Geister werden ihre Gräber nicht wiederfinden, selbst wenn wir sie aus den Klauen der Ukhel befreien.\n\nDie Ukhel zwingen selbst deren Tierbegleiter, die sie ihr Leben lang begleitet und beschützt haben, zurück ins Leben.\n\nBringt mir die Schädel dieser Tiere und die heilige Erde, die von diesen Ungeheuern entweiht wurde. Zusammen sollten diese Reagenzien dafür sorgen, dass unsere Vorfahren endlich Frieden finden.', '', '', '', '', '', 'Trefft Euch mit Zorig tiefer in den Ewigen Kurganen.', 47187),
(66654, 'deDE', 'Schändervernichtung', 'Tötet Schänder der Nokhud und Grabstörer der Ukhel und erobert die Ahnenwaffen zurück, die sie gestohlen haben.', 'Meine Mutter war eine Heldin. Sie verdient Frieden und Ruhe, nicht diese... Versklavung! Das verdient keiner unserer Helden.\n\nSie müssen dafür bezahlen. Und unsere Vorfahren müssen wieder mit ihren Waffen ruhen, ehrenvoll. Holt die Waffen von diesen Grabschändern zurück!', '', '', '', '', '', 'Trefft Euch mit Zorig tiefer in den Ewigen Kurganen.', 47187),
(66652, 'deDE', 'Zurück an den Heiler', 'Untersucht das Ritual der Ukhel auf dem Grabhügel in der Nähe.', 'Ich erkenne von hier aus nicht, was sie tun, aber ich fürchte, sie entweihen die Kurgane.\n\nBitte begebt Euch zum nächsten Grab und versucht, ihr Ritual zu vereiteln.\n\nUnd wenn Ihr irgendwas findet, das erklärt, warum sie es durchführen, so bringt es mir bitte.', '', '', '', '', '', 'Bringt den Speer zurück zu Zorig.', 47187),
(66651, 'deDE', 'Verdächtige Klangeschäfte', 'Trefft Initiand Zorig in den Ewigen Kurganen.', 'Die Klans Nokhud und Ukhel haben die Ewigen Kurgane eingenommen. Dahinter kann nur eine boshafte Absicht stecken. Unsere ehrwürdigen Vorfahren ruhen dort.\n\nIch habe unseren Initianden Zorig zu Nachforschungszwecken entsandt. Er ist bisher nicht zurückgekehrt.\n\nEs mangelt ihm an Selbstvertrauen, auch wenn er fähig ist. Bitte helft ihm, diesem unheilvollen Treiben ein Ende zu setzen!', '', '', '', '', '', '', 47187),
(66650, 'deDE', 'Finale des Schicksals', 'Besiegt $1oa verschiedene Bosse schicksalhafter Schlachtzüge.', '<Ihr seid ganz ruhig. Die Natur dieser Erfahrung bleibt unergründlich, aber sie fühlt sich nicht mehr ungewohnt an. Ihr beherrscht jetzt diese Herausforderungen, und die Klarheit ist Eure letzte Belohnung.>\n\n<Mit klarem Verstand und ruhiger Hand schreitet Ihr ein letztes Mal voran. Gestaltet Euer eigenes Schicksal und seht, wie es sich vor Euch entfaltet.>', '', '', '', '', '', '', 47187),
(66647, 'deDE', 'Wenn Elementare den Fokus verlieren', 'Holt den Elementarfokus zurück.', 'Kalecgos und ich sind in den Lüften über dem Berg unter schwerem Beschuss. Die Primalisten sind unerbittlich und ihre Armee ist endlos.\n\nSchon bald könnten Kalecgos und ich von ihren Truppen überrannt werden.\n\nAber ich habe einen Plan.\n\nAm Fuß des Berges befindet sich eine Orcin namens Ruvin Steinzermalmer. Die Kirin Tor haben sie schon unzählige Male bekämpft.\n\nSie hat ein Gerät, das elementare Energien absorbieren und umlenken kann.\n\nNehmt es ihr ab und trefft mich anschließend weiter drinnen.', '', 'Ruvin besitzt den mächtigen Elementarfokus.', 'Ruvin Steinzermalmer', '', '', 'Trefft Khadgars Projektion tiefer in der Bergkette von Vakthros.', 47187),
(66646, 'deDE', 'Kausalitäten unter Kontrolle bringen', 'Tötet die Zeitelementare.', 'Die Ewigen haben die Zeitenergien zur Aggressivität gezwungen. Das ist nicht gut.\n\nBitte tötet alle Zeitelementare, die Ihr seht, während Ihr Botschafterin Chronormu helft. Ich bleibe hier und helfe ihr dabei, Eternus zu halten.', '', '', '', '', '', '', 47187),
(66633, 'deDE', 'Eindruck machen', 'Rammt ein Banner der schwarzen Drachen in die Leichname von $1oa Djaradin.', 'Diese Djaradin glauben, dass der schwarze Drachenschwarm erledigt ist. Sie fürchten oder respektieren Furorions Autorität nicht.\n\nWir müssen eine Ansage machen, um sie daran zu erinnern, dass der Obsidianschwarm zurück und stärker als je zuvor ist.\n\nTötet die Djaradin und markiert jeden Leichnam, damit sie auch ja nicht vergessen, wer hier regiert.', '', '', '', '', '', '', 47187),
(66622, 'deDE', 'Entlaufene Werkzeuge', 'Rettet $1oa entlaufene Werkzeuge.', 'Das ist ja furchtbar! Meine *hicks* Werkzeuge sind scheinbar weggerannt, als ich nicht aufgepasst habe. Ich will gar *hicks* nicht daran denken, dass sie ganz allein da draußen sind, total *hicks* verängstigt!\n\nKönntet Ihr sie für mich einsammeln? Seid einfach geduldig und *hicks* versucht, sie zu beruhigen, dann werden sie sich für *hicks* Euch bestimmt erwärmen!', '', '', '', '', '', '', 47187),
(66612, 'deDE', 'Dilemma der Krabbenhüterin', 'Tötet $1oa Gorlocs im Klippensturzlager.', 'Die Krabben sind in Gefahr!\n\nUnd diese hier hatten eine wirklich harte Zeit. Ihr vorheriger Lebensraum wurde von den Primalisten überrannt und ich führte sie an diesen Ort, wo sie von Gorlocs angegriffen werden!\n\nIch dachte, dass sie hier sicher sein würden, aber die Gorlocs nähren nur die Aggressivität der Krabben und bescheren ihnen so ein frühzeitiges Ableben.\n\nBitte beseitigt einige Gorlocs und helft den Krabben bei der Flucht!', '', '', '', '', '', '', 47187),
(66611, 'deDE', 'Saubere Luft', 'Tötet $1oa Insekten.', 'Könnt Ihr das hören? Insekten! Überall. Und einige von denen sind ziemlich groß.\n\nWarum nutzt Ihr und Euer gleitender Freund nicht den thermischen Aufwind hinter mir, um etwas dagegen zu unternehmen?', '', '', '', '', '', '', 47187),
(66598, 'deDE', 'Fachwissen der Nachtgeborenen', 'Findet Warpwirkerin Delandra im Lager Antonidas im Azurblauen Gebirge.', 'Uralte Symbole sind nicht wirklich mein Ding. Aber...\n\n<Thaelin durchsucht seine Taschen und holt schließlich eine Karte hervor. Am Anfang des Pergaments steht der Name Antonidas in großer, schlampiger Schrift.>\n\nAha! Hier ist es!\n\nEin kleiner Marsch, aber einige dieser alten Magienutzer findet Ihr... hier.\n\n<Er deutet auf einen Punkt auf der Karte.>\n\nVielleicht haben die Euch was anzubieten.', '', '', '', '', '', '', 47187),
(66597, 'deDE', 'Der alte Stein', 'Untersucht den gravierten uralten Monolithen.', 'Dieser Stein hinter mir ist nur ein Teil von... wie nennt Ihr das... uralter Technologie, über die wir hier auf den Inseln gestolpert sind.\n\nAber wir sind noch nicht ganz sicher, was genau es ist. Wirklich verblüffend.\n\nWir haben einigen Freunden eine Nachricht geschickt, ob sie vielleicht helfen können. In der Zwischenzeit könnt Ihr vielleicht rausfinden, wie man das benutzt?', '', '', '', '', '', '', 47187),
(66596, 'deDE', 'Flüstern in den Winden', 'Sprecht mit Erzmagier Khadgar in Sturmwind.', 'Hallo, $p. Es ist lange her und ich wünschte, wir hätten mehr Zeit zum Plaudern.\n\nAber ich hatte gerade eine recht erhellende... nein, eher unheilvolle... ja, eine unheilvolle Unterhaltung mit einem alten Freund.\n\nManchmal kann eine Enthüllung immerhin beides sein.\n\nIch muss Euch berichten, was ich erfahren habe.', '', '', '', '', '', '', 47187),
(66595, 'deDE', 'Schlummernde Entdeckung', 'Bringt die Nachricht zu Thaelin Schwarzamboss im Außenposten der Rubinschuppen an der Küste des Erwachens.', '<Fragt Euch nicht, wie dieses merkwürdige Pergament in Eurer Tasche gelandet ist. Wichtig ist der Inhalt der Nachricht.>\n\nMitglieder der Drachenschuppenexpedition:\n\nEure Unterstützung ist gefragt! Meldet Euch sofort beim Außenposten der Rubinschuppen!\n\n<Bevor die Unterschrift erkennbar wird, verschwindet die magische Schrift der Notiz auch schon wieder in einer Wolke weiß-bläulichen Staubs und hinterlässt dabei ein leeres Papier und einen angenehm blumigen Duft.>', '', '', '', '', '', '', 47187),
(66589, 'deDE', 'Expeditionskoordination', 'Rekrutiert Forscher, Handwerker und Gelehrte in ganz Sturmwind für die Expedition zu den Dracheninseln.', 'Mein Name ist Toddy. Ich trommle unseren Trupp von fröhlichen Abenteurern unter dem Banner der Drachenschuppenexpedition zusammen. Wir reden später über die Details. Im Moment sollten wir uns darauf konzentrieren, die Mannschaft zu versammeln.\n\nJede Expedition, die was auf sich hält, hat abwechslungsreiche Mitglieder. Wir brauchen Gelehrte, Handwerker und natürlich Forscher.\n\nAlso? Was steht Ihr hier noch rum? Stellt die Mannschaft zusammen!', '', '', '', '', '', 'Überbringt die Nachricht von Eurem Erfolg Toddy Schnurrbart am Hafen von Sturmwind.', 47187),
(66586, 'deDE', 'Vermächtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman im Ödland. Macht den Grund für die Erschütterungen ausfindig.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, müssen wir die Macht der Aspekte wiederherstellen.\n\nDoch das wird nicht einfach werden. Die Titanen schweigen und Hüter Tyr ist schon lange tot.\n\nKönigin Alexstrasza hat jedoch einen Plan. Im Ödland liegt eine Titanenanlage namens Uldaman. Sie glaubt, Tyrs Gefährten hätten eine Scheibe mit seinen Erinnerungen in den Tiefen der Anlage verborgen.\n\nBegebt Euch mit Euren Verbündeten nach Uldaman und findet die Scheibe für die Drachenkönigin. Wollen wir hoffen, dass wir den Aspekten mit Tyrs Wissen erneut zu Macht verhelfen können.', '', '', '', '', '', '', 47187),
(66582, 'deDE', 'Energiegewinnung', 'Sammelt Energie in dem Gefäß für Warpwirkerin Delandra im Lager Antonidas.', 'Normalerweise ist das Sammeln von Energie unproblematisch. Doch die Energie, die wir benötigen, ist gewaltig und instabil. Dieses verzauberte Gefäß sollte als sicheres Transportmittel dienen.\n\nIm Südwesten gibt es ein Gebiet, in dem es vor energiegeladenen Kreaturen nur so wimmelt. Die anomale Energie dieser Kreaturen ist mächtig, aber instabil.\n\nSammelt ihre Energie und kehrt zu mir zurück. Dann brechen wir gemeinsam zur restlichen Reise auf.', '', '', '', '', '', '', 47187),
(66578, 'deDE', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'deDE', 'Einladung der Aspekte', 'Sprecht mit Furorion, um etwas über die Ratsversammlung zu erfahren.', 'Ah, $p. Ihr kommt gerade rechtzeitig.\n\nIch habe mich gerade mit Lordkommandant Turalyon und seinen Verbündeten getroffen, und sie haben die Einladung der Aspekte auf die Dracheninseln angenommen.\n\nIhr werdet doch sicher mitkommen? Es wäre nicht dasselbe ohne Euch!\n\nIch schätze, Euch sind die unbekannten Gesichter aufgefallen, die hier versammelt sind. Die Geflügelten nennen sich Dracthyr. Sie kennen mich erst seit Kurzem, sind aber schon große Bewunderer.\n\nAch, wo sind meine Manieren! Wir sollten uns unterhalten.', '', '', '', '', '', '', 47187),
(66575, 'deDE', 'Gegenstand als Auftragsgeber: Phiole', 'Bringt den Gegenstand zu Wegbehüterin Alvi.', '<Diese merkwürdige Phiole, die zwischen dem Kleinkram im Tarasekversteck lag, scheint mit einer dickflüssigen, blubbernden Flüssigkeit gefüllt zu sein.>\n\n<Es wäre klug, sie Alvi zu zeigen.>', '', '', '', '', '', '', 47187),
(66559, 'deDE', 'Zurück zum Lager', 'Kehrt zu Prüfer Rowe in Walfängerwinkel zurück.', 'Ich habe Mordigan wie einen besessenen Zwerg da rausrennen sehen. Ich gehe ihm hinterher und stelle sicher, dass er in einem Stück zurückkommt.\n\nWenn Ihr entlang der Klippe geht und die Wasserfälle hinunterspringt, solltet Ihr es vermeiden können, noch mehr Gorlocs aufzuscheuchen.\n\nWir sehen uns im Lager.', '', '', '', '', '', '', 47187),
(66558, 'deDE', 'Rowie', 'Findet Rowie.', 'Ihr wart es doch, $gder:die; mit den anderen aus Brackenfell zurückgekehrt ist, nicht wahr? Dann wisst Ihr vermutlich, was mit Kaqiata passiert ist...\n\nIhr Sohn Rowie ist völlig verstört, seit Brena und die anderen ohne sie zurückgekehrt sind. Ich bleibe hier, falls er zurückkehrt, aber könntet Ihr vielleicht nach ihm suchen?\n\nIch glaube, dass er in Richtung Osten zur Eishöhle fortgelaufen ist. Er hat etwas davon erzählt, dass er da drin einen Yeti bekämpfen will!', '', '', '', '', '', '', 47187),
(66557, 'deDE', 'Akademische Bekanntschaften', 'Findet einen weiteren Experten in Furbolgsprachen im Lager im Nirgendwo.', 'Aye, diese Winterpelzvariante der Furbolgsprache stellt sich als ziemlich harte Nuss heraus, selbst für mich.\n\nIch hab ein paar Kollegen im Lager im Nirgendwo, die vielleicht helfen können. Ich hab gehört, dass es noch andere Furbolgstämme in der Umgebung gibt. Vielleicht hilft es, unsere Aufzeichnungen zu den verschiedenen Dialekten miteinander zu vergleichen.', '', '', '', '', '', '', 47187),
(66556, 'deDE', 'Eishöhle in Sicht', 'Untersucht die Höhle.', 'Nun, Euer Akzent ist fürchterlich und zehntausend Jahre der Isolation und der linguistischen Drift helfen da auch nicht... aber ich glaube, zumindest einen groben Eindruck bekommen zu haben.\n\nDer gemeinsame Nenner dessen, was sie versucht haben zu sagen, war etwas über einen \"schlechten Höhlenwind\" oder eine \"böse Sturmhöhle\". Entweder das, oder ihre Wäsche war zu Donnerstag?\n\nNun, das ist nicht so, als würde man Gnomisch lernen. Es wird einige Stolpersteine geben. Bei dem Teil mit der Höhle bin ich mir allerdings ziemlich sicher, also lasst uns dort anfangen.', '', '', '', '', '', '', 47187),
(66555, 'deDE', 'Ein Moment der Geduld', 'Helft bei Sonovas Übersetzung.', 'Aye, klingt nach einem echten Chaos da oben. Als wäre da ein Sturm durch, der alles auseinandergenommen hat. Ich kann schon verstehen, warum sie so aufgebracht sind, aber warum greifen sie deshalb uns an?\n\nEs wäre deutlich einfacher, wenn wir das einfach ausdiskutieren könnten, aber die Winterpelze sind besonders schweigsam und sprechen anscheinend kein gewöhnliches Furbolgisch. Furbolgianisch? Ach, Ihr wisst schon.\n\nIch vermute mal, dass Ihr es nicht geschafft habt, Euch während Eures Besuchs mit einem von denen zu unterhalten, oder?', '', '', '', '', '', '', 47187),
(66554, 'deDE', 'Aggressive Selbstverteidigung', 'Tötet $1oa Winterpelzfurbolgs.', 'Bei dem Aufruhr, in dem die Winterpelze sich befinden, wird es ihnen wahrscheinlich nicht besonders gefallen, wenn Ihr Euch da oben ein wenig umseht.\n\nScheut nicht davor zurück, Euch zu verteidigen, wenn sie es darauf anlegen. Eine entschiedene Erinnerung, dass Ihr für so etwas nicht zu haben seid, könnte ihnen vielleicht wieder etwas Vernunft einbläuen.\n\nVersucht aber, niemanden zu töten, okay? Ich weiß, wie das manchmal mit Euch Abenteurern so ist.', '', '', '', '', '', '', 47187),
(66553, 'deDE', 'Aushöhlung', 'Findet $1oa Hinweise in der Winterpelzhöhle.', 'Die Winterpelze sind ganze besondere Furbolgs.\n\nIch würde sie als ein bisschen \"eigenbrötlerisch\" einstufen. Sie sind wie Geister aus dem Untergrund, ihre Pelze lassen sich im Schnee kaum ausmachen.\n\nFrüher blieben sie unter sich, aber jetzt sind sie so richtig aggressiv. Sie haben unser Lager ohne jede Provokation angegriffen!\n\nIrgendwas stimmt nicht, sonst hätten sie das nicht getan. Ich kann sie ja nicht fragen, was los ist... noch nicht, aber vielleicht könnt Ihr in ihrem Dorf nach Hinweisen suchen?', '', '', '', '', '', '', 47187),
(66550, 'deDE', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'deDE', 'Rennen der Küste des Erwachens', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66534, 'deDE', 'Ausflug auf festem Boden', 'Erkundet Orgrimmar.', 'Wie es scheint, wurde unsere Ankunft doch bemerkt. Vielleicht gibt es noch Hoffnung für diese Leute.\n\nIch wende mich an Ebyssian und die Anführer der Horde, um die Sache ausbügeln. Seht Ihr Euch derweil um.\n\nSchaut mal, was dieser Ort zu bieten hat. Schließlich werden wir hier wohl einiges an Zeit verbringen.\n\nKommt anschließend zu uns. Hoffentlich haben wir bis dahin all das langweilige Zeug geklärt.', '', '', '', '', '', '', 47187),
(66529, 'deDE', 'Eintausend Worte', 'Fotografiert Derwischian neben dem Protodrachenskelett.', 'Nach allem, was wir hier erfahren haben, kann ich mir kaum vorstellen, ohne ein Andenken weiterzuziehen.\n\nWärt Ihr so freundlich, ein Bild von mir und diesen Protodrachenfossilien zu machen?', '', '', '', '', '', '', 47187),
(66528, 'deDE', 'König ohne Krone', 'Untersucht das Protodrachenskelett.', 'Dieser uralte Protodrache muss zu Lebzeiten eine atemberaubende Kreatur gewesen sein. Vielleicht die größte, die das Wildreservat je gesehen hat.\n\nAber das hat wohl nicht ausgereicht. Untersucht das Skelett genauer, damit wir vielleicht etwas über seine letzten Momente erfahren.', '', '', '', '', '', '', 47187),
(66527, 'deDE', 'Professionelle Fotografie', 'Nutzt die vertikale Verstärkungsapparatur und fotografiert den schlummernden Protodrachen.', 'Ihr seid $gder beste Fotograf, den:die beste Fotografin, die; ich je ausgebildet habe... zumindest von denen, die noch leben. Es ist ein gefährlicher Beruf.\n\nWo wir grade von Gefahren sprechen. Unser letztes Motiv ist ein großer Protodrache, von dem wir glauben, er könnte eins der nächsten Eliteraubtiere dieses Reservats werden. Geht auf Tuchfühlung und macht ein Foto!', '', '', '', '', '', '', 47187),
(66526, 'deDE', 'Die Wildnis erhalten', 'Befreit 5 gefangene Protowelpen oder gefangene Protodrachen.', 'Das Wildreservat ist eines der wenigen Gebieten, in denen Protodrachen florieren. Aber die Primalisten stören ihre Nistgründe, indem sie Protowelpen und Protodrachen einfangen und Experimente an ihnen durchführen.\n\nZeigt ihnen keine Gnade. Macht diese Primalistenwilderer ausfindig, löscht sie aus und befreit ihre Gefangenen. Das Überleben der Protodrachen hängt davon ab!', '', '', '', '', '', '', 47187),
(66525, 'deDE', 'Wettbewebsfotografie', 'Fotografiert ein energieerfülltes Protodrachenei und einen energieerfüllten Protodrachen.', 'Nachdem Ihr nun die ersten eigenen Erfahrungen mit einigen Anfängermotiven gesammelt habt, wie wäre es, wenn wir etwas Gewagteres versuchen?\n\nIch habe einen wunderschönen Protodrachen in der Gegend hinter uns fliegen sehen. Wunderschöne Hörner, Schuppen, die vor Elektrizität knistern... Vielleicht ist es das Werk der Primalisten, aber es ist zweifellos Kunst!\n\nSeht, ob Ihr ein Bild vom Protodrachen und von einigen seiner Eier schießen könnt. Vielleicht müsst Ihr ein wenig klettern, um einen guten Winkel zu bekommen!', '', '', '', '', '', '', 47187),
(66524, 'deDE', 'Fotografie für Anfänger', 'Macht Bilder von den Protodrachen.', 'Ihr wollt also $gein berühmter Katalogisierer:eine berühmte Katalogisiererin; werden, so wie ich? Dann seid Ihr bei mir genau richtig!\n\nDas Wildreservat strotzt nur so vor Wissen, das archiviert werden will! Und wie ich das mache, wollt Ihr wissen? Natürlich mit meinem praktischen Katalogisierer 3000 Dracheninseledition, jetzt mit verbessertem Bewegungssensor!\n\nUm Erfahrung damit zu sammeln, solltet Ihr ein Protodrachenei, einen Welpen, der das Fliegen lernt, und einen jagenden Protodrachen fotografieren. Trefft mich beim uralten Protodrachenskelett westlich von hier, dann werde ich Eure Fotos bewerten.', '', '', '', '', '', '', 47187),
(66523, 'deDE', 'Die Esse schüren', 'Sammelt Reagenzien für die Schmiede, indem Ihr Flunkerfelle, inaktive Glutkegel und kalbende Kerne im Bereich um das Lager Antonidas sammelt.', 'Falls Ihr nach einem Ausbilder sucht, muss ich Euch leider sagen, dass ich... äh, Ihr kein Lehrling seid! Mein Beileid. Erlaubt mir, mich vorzustellen.\n\nIch bin Hüterin Vernagos und gehöre zu den Verwaltern dieser Ruinen. Um genau zu sein, ist die Aufgabe, diesen Arbeitsplatz zu alter Pracht zu verhelfen, auf meine doch sehr müden Schultern gefallen.\n\nKönntet Ihr mir etwas zur Hand gehen? Alle Reagenzien, die ich benötige, lassen sich in der Nähe finden: Eiselementarkerne, Glutkegel, Flunkerleder...\n\nGängige und einfach zu sammelnde Materialien. Was sagt Ihr?', '', '', '', '', '', 'Kehrt zu Hüterin Vernagos im Lager Antonidas zurück.', 47187),
(66517, 'deDE', 'Eine neue Quelle für Waffen', 'Sammelt 25 intakte Dracthyrwaffen von den Splitterflammen auf den Dracheninseln für Dhurrel von den Zentauren der Maruuk.', 'Diese Splitterflammen sind eine große Bedrohung für unsere Grenzen. Ihre Waffen machen mir Sorge. Sammelt so viele davon, wie Ihr könnt, dann können wir sie auf Schwächen untersuchen oder sie sogar für unsere Verteidigung nutzen.\n\nIch vertraue auf Euch. Und wenn Ihr diese Aufgabe für uns erledigt, werde ich Euch in unsere Schmiedekunst einweisen.', '', '', '', '', '', '', 47187),
(66516, 'deDE', 'Banale Edelsteine, wohl kaum!', 'Sammelt 25 \"banale\" Edelsteine von den Djaradin auf den Dracheninseln für Gnoklin Quirkspule bei der Drachenschuppenexpedition.', 'Was für eine Verschwendung. Die Djaradin dieses Landes nutzen mächtige Edelsteine als banale Dekorationen, nur als Schmuck! Und das, obwohl es so viele Verwendungszwecke für Edelsteine gibt: Teleskope, Spiegel, Fokussierungspointer. Und dass unzählige Edelsteine magische Eigenschaften haben, brauche ich gar nicht erst zu erwähnen.\n\nWir müssen etwas dagegen tun. Erleichtert die Djaradin um ihre Edelsteine und bringt sie mir. Ich sorge dann dafür, dass sie eine bessere Verwendung finden. Aber passt auf Euch auf, denn die Djaradin sind erbitterte Krieger.', '', '', '', '', '', '', 47187),
(66513, 'deDE', 'Ausflug auf festem Boden', 'Erkundet Sturmwind.', 'Vielleicht sollten wir uns ein Bild von dieser Stadt machen, wenn das unsere neue Heimat werden soll. Eine Aufklärungsmission sozusagen.\n\nGeht. Schaut, was dieser Ort zu bieten hat. Ich werde Furorion folgen und versuchen, zu helfen, wo ich kann.\n\nVersucht allerdings, die Einheimischen so wenig wie möglich aufzuscheuchen. Ich bezweifle, dass viele von ihnen an den Anblick von Drachen unter ihnen gewöhnt sind.\n\nTrefft Euch mit uns, sobald Ihr das Gebiet ausgekundschaftet habt.', '', '', '', '', '', '', 47187),
(66511, 'deDE', 'Angesehen bei den Tuskarr von Iskaara', 'Sprecht mit Murik in Iskaara.', 'Ihr beweist immer wieder, dass Ihr ein integrales Mitglied unserer Gemeinschaft seid.\n\nUm das zu würdigen, habe ich einen Vorratsbeutel für Euch vorbereitet. Trefft mich in Iskaara.', '', '', '', '', '', '', 47187),
(66509, 'deDE', 'Paranoid 1', '', 'Agura hat mich hierhergeschickt, um Blumen gegen meine Ängstlichkeit zu pflücken. Aber da sind lauter Kreaturen, die mir schreckliche Angst einjagen.', '', '', '', '', '', '', 47187),
(66504, 'deDE', 'Ein Splitter kristallisierten Manas', 'Bringt den Kristall zu Lathos.', '<Der kleine, blaue Kristall vibriert leicht bei Berührung und gibt dann einen tiefen Ton von sich, der wie ein entferntes Lied klingt. Die Worte hallen wie eine sanfte Melodie in Eurem Kopf.>\n\nLathos wird das interessant finden.', '', '', '', '', '', 'Bringt den Kristall zu Lathos.', 47187),
(66503, 'deDE', 'Aus Nächstenliebe', 'Untersucht die Spitze des verfallenen Turms im Lager Antonidas.', 'Ah, wie ich sehe, haben Euch meine Lehrlinge in ihre kleinen Spiele verwickelt.\n\n<Noriko kichert.>\n\nEs scheint, als wären sie... und auch Ihr... da auf etwas gestoßen. Das Geheimnis dieser Ruinen gibt sich uns langsam zu erkennen. Und es steckt mehr dahinter als nur verblasste Abbildungen und Lieder...\n\nEtwas ruft von diesem Turm.\n\nIch sehe die Faszination in Euren Augen. Geht. Ihr habt meine Erlaubnis.\n\nIch bin gespannt, was Ihr findet.', '', '', '', '', '', 'Kehrt zu Noriko im Lager Antonidas zurück.', 47187),
(66500, 'deDE', 'Wege des Sehens', 'Deckt antike Abbildungen im Lager Antonidas auf.', 'Wir machen gar nichts! Wir machen rein gar nichts!\n\nEinen Moment...\n\nIhr seht ziemlich wichtig aus, $R... Möchtet Ihr ein Geheimnis wissen?\n\nWie sich herausstellt, sind diese Ruinen voller magischer Kunst! Und wir können sie sehen!\n\n<Stiebitz streckt stolz die Brust raus.>\n\nIch kann Euch zeigen, wie Ihr sie auch sehen könnt! Aber... erzählt Noriko bitte noch nichts davon.', '', '', '', '', '', '', 47187),
(66493, 'deDE', 'Ab dafür!', 'Werft Pakete zu den Lehrlingen der Kirin Tor im Lager Antonidas.', '<Ihr hört gedämpfte Stimmen vom anderen Ende des Portals.>\n\nHey! Hey, Ihr da!\n\nIch habe Post für unsere Auszubildenden im Außeneinsatz: Hilfspakete, Geschenke, Dinge, die sie per magischen Kurier bestellt haben...\n\nNormale Standardzustellung.\n\nWürdet Ihr mir den Gefallen tun und sie austeilen?', '', '', '', '', '', '', 47187),
(66489, 'deDE', 'Die Verteidigung aufstellen', 'Ermächtigt Azurblaue Verteidiger in Lager Antonidas.', 'Der Hüter Cynegos und ich hatten gerade über die Auswirkungen des Angriffs der Primalisten auf die Pläne zum Angriff auf den Kobaltkonvent gesprochen, und ich hatte eine Idee.\n\n<Celeste holt aus den Tiefen ihres Gewandes einen Zauberstab hervor.>\n\nNehmt meinen Stab und ermächtigt ihre Waffen!\n\nEin bisschen Feuer sollte genau das Richtige sein...', '', '', '', '', '', '', 47187),
(66488, 'deDE', 'GESUCHT: Frigellus', 'Tötet Frigellus in der Nähe von Lager Antonidas.', '<Die Schrift der Seite leuchtet in einem sanften blauen Licht.>\n\nDer Elementar Frigellus, einst ein geliebtes Spielzeug von Malygos, litt unter der Vernachlässigung durch seinen Herrn.\n\nWährend dieses einst glückliche Dorf immer weiter zerfiel, wurde das neckische und verspielte Wesen von den Übeln, die dieses Land plagen, entstellt und verdreht.\n\nBitte neutralisiert dieses Wesen.\n\nTeilt Euren Erfolg anschließend dem Hüter Cynegos mit.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'deDE', 'Kennt Euren Feind: Protodrachen', 'Jagt ein paar Protodrachen im Gebiet um das Hohe Blätterdach.', 'Das Gebiet ist voll von diesen mächtigen Bestien! Glücklicherweise hat das Untersuchungsfernrohr Euch ermöglicht, einige Schwachstellen zwischen ihren harten Schuppen zu finden. Ihr könnt Euch auch ein paar Tricks einfallen lassen, um ihren scharfen Klauen und Zähnen auszuweichen.', '', '', '', '', '', '', 47187),
(66482, 'deDE', 'Trophäenjagd: Erdschlund', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Erdschlund', '', '', '', 47187),
(66473, 'deDE', 'Das Land erwacht', 'Besiegt den urzeitlichen Zorn und den urzeitlichen Hagel am Rundblick der Gelikyr.', 'Die Scheusale in dieser Höhle waren zu viel für mich.\n\n<Sharnax hustet schwer.>\n\nIch habe gesehen, wozu Ihr imstande seid.\n\nIhr müsst diese Elementare für mich töten, bevor sie ihr volles Potenzial entfalten. Wir dürfen nicht zulassen, dass die Primalisten die Kontrolle über Tyrhold erlangen!', '', '', '', '', '', '', 47187),
(66472, 'deDE', 'Prima Listen', 'Liefert das Bündel mit Primalistenbefehlen an Kommandant Thadezus auf der Brücke am Rundblick der Gelikyr.', 'Die Portale sind geschlossen, die Elementare getötet und die Primalisten aufgehalten... vorerst.\n\n<Sharnax lacht.>\n\nGibt es irgendetwas, das wir nicht können, $C? Ich schätze, die Zeit wird es uns zeigen.\n\nBringt die Pläne zum Kommandanten. Er wird sicherlich erfreut sein, zu hören, dass wir erfolgreich waren.', '', '', '', '', '', 'Sprecht mit Kommandant Thadezus bei der Brücke am Rundblick der Gelikyr.', 47187),
(66471, 'deDE', 'Prima Planung', 'Sammelt $1oa Befehle der Primalisten von Primalisten in der Nähe auf der oberen Terrasse des Rundblicks der Gelikyr.', 'Der Kommandant hat mich dazu beordert, einen Vorposten zu errichten und dabei jeglichen Widerstand auszumerzen. Es war allerdings erst im Nachhinein, nachdem ich sie alle erledigt hatte, dass mir etwas bewusst wurde.\n\n<Sharnax stößt einen langen Seufzer aus.>\n\nDie Primalisten haben über Tyrhold geredet.\n\nIch bezweifle, dass Ihr aus denen noch ein Wort rausbekommt. Ihr müsst dennoch für mich herausfinden, wie ihre Pläne aussehen.', '', '', '', '', '', 'Trefft Sharnax vor der Höhle am Rundblick der Gelikyr.', 47187),
(66470, 'deDE', 'Der Vorstoß', 'Erhaltet nebelberührte, irdene und eisgeschmiedete Portalsteine und schließt die $7oa Elementarportale.', '<Sharnax kratzt sich am Kinn.>\n\nDer Kommandant hatte recht. Die Primalisten rufen Verstärkungen aus den Elementarebenen.\n\n<Sharnax lächelt.>\n\nEs wäre eine Schande, wenn ihren Portalen etwas zustoßen würde, $C.', '', '', '', '', '', 'Trefft Sharnax vor der Höhle am Rundblick der Gelikyr.', 47187),
(66468, 'deDE', 'Was einst Unser war', 'Besiegt die Primalisten, die den Rundblick der Gelikyr besetzt haben.', '<Thadezus spottet über Euren Ansatz.>\n\nSeid Ihr $gein Sterblicher, der:eine Sterbliche, die; auch was tut? Sonst geht uns besser aus dem Weg, $C!\n\nIch habe eine Menge guter Soldaten an diese Primalisten verloren.\n\nWir haben eine Idee, was sie vorhaben, doch zunächst müssen wir den Feind in die Flucht schlagen und jene retten, die unter meinem Kommando stehen.', '', '', '', '', '', 'Sprecht mit Sharnax am Rundblick der Gelikyr.', 47187),
(66467, 'deDE', 'Kunst imitiert das Leben', 'Erlegt den großen Giftspross.', 'Als ich das letzte Mal in dieser Höhle war, habe ich eine riesige Blume gezeichnet, die einen ekelhaften, dickflüssigen Saft absonderte. Das ist eine meiner besten Zeichnungen, das würde ich nie vergessen.\n\nWas an diesen Tarasekspeeren haftet, ist der Saft eben jener Blume, da bin ich mir sicher. Sie müssen angefangen haben, ihn als Gift für ihre Waffen zu verwenden.\n\nEs ist eine wunderschöne Blume und sie töten zu müssen, ist eine wahre Schande. Aber uns bleibt keine Wahl, wir müssen die Tarasek daran hindern, das Gift für ihre Waffen zu verwenden. $n, ich bitte Euch, merzt diese Blume aus und setzt all dem ein Ende.', '', '', 'Großer Giftspross', '', '', '', 47187),
(66465, 'deDE', 'Kurz geschnappt', 'Zerstört $1oa Giftspeervorräte.', 'Selbst nach dem Tod ihres Anführers werden die Tarasek nicht aufhören, ihre vergifteten Speere zu nutzen, und wenn wir sie noch so höflich bitten. Ich kann nicht riskieren, dass auch nur eine dieser Waffen gegen einen ahnungslosen Reisenden eingesetzt wird.\n\nSie müssen alle vernichtet werden. Wenn Ihr keine Lager bei den Becken gesehen habt, dann bewahren die Glutzähne ihre Speere wohl näher an der Quelle auf.\n\nEs wird nicht noch einmal jemand wegen meiner Achtlosigkeit verletzt werden. Sucht die Höhle auf und zerstört alle Waffenlager, die Ihr finden könnt.', '', '', '', '', '', '', 47187),
(66464, 'deDE', 'Das Feld der Wildheit: Meister der Jagd!', 'Besiegt Jagdmeisterin Amaa.', 'Jetzt ist es also so weit. Ihr und Eure Crew habt das große Los gezogen. Ein Kampf gegen den Champion, Jagdmeisterin Amaa selbst. Klopft Euch aber noch nicht auf die Schulter. Sie ist unbarmherzig. Es war schön, Euch gekannt zu haben.\n\nWenn sie Euch erledigt hat, kann ich dann Eure Sachen haben?', '', '', '', '', '', '', 47187),
(66463, 'deDE', 'Das Feld der Wildheit: Elementare Rache!', 'Besiegt den Champion der Primalisten.', 'Eine Änderung der Aufstellung in letzter Minute! Irgendein Primalistenangeber will dem Wettkampf beitreten, um Euch gegenüberzutreten. Und ich sage nicht nein zu einem wütenden Elementardrachen.\n\nIch bin sicher, Ihr schafft das. Und wenn nicht... Dafür habt Ihr ja die Verzichtserklärung unterzeichnet, oder?', '', '', '', '', '', '', 47187),
(66462, 'deDE', 'Das Feld der Wildheit: Verloren im Traum!', 'Besiegt Sherath und Taresh.', 'Wisst Ihr, für die Dracheninseln sieht man hier ganz schön wenige Drachen. Aber wir haben ein Drachkinduo, das angefragt hat, sich zusammen für den Wettkampf eintragen zu dürfen.\n\nSie wirken begierig, sich zu beweisen, also viel Glück!', '', '', '', '', '', '', 47187),
(66461, 'deDE', 'Das Feld der Wildheit: Gegner aus dem Vulkan!', 'Besiegt Ceeqa den Friedensstörer.', 'Einer der ersten Freiwilligen für diesen Wettkampf kam von der Küste des Erwachens. Ein großer Djaradin, deutlich weniger wütend als seine Verwandten.\n\nEr scheint den Kampf als Sport zu genießen. Hey, mir soll\'s recht sein.', '', '', '', '', '', '', 47187),
(66460, 'deDE', 'Das Feld der Wildheit: Fürst des Verfalls!', 'Besiegt Nachtfaul.', 'Ich habe versucht, einen dieser garstigen Gnolle für diesen Spießrutenlauf zu bekommen. Leider weiß keiner meiner Kollegen, wie man mit ihnen spricht.\n\nWir konnten aber eine ihrer merkwürdigen Schöpfungen fangen. Die sollte als angemessener Gegner herhalten! Gebt Bescheid, wenn Ihr bereit seid, mit der zweiten Runde zu beginnen!', '', '', '', '', '', '', 47187),
(66459, 'deDE', 'Das Feld der Wildheit: Schrecken des Sumpfes!', 'Besiegt Maneet.', 'Willkommen, alle zusammen, auf den Feldern der Wildheit!\n\nDieses Feld wird gewöhnlich für traditionelle Anlässe genutzt, aber die Zentauren haben mir großzügigerweise erlaubt, während der Nebensaison hier meinen Laden aufzubauen. Sie meinen, damit würde ich ihre Stärke auf die Probe stellen und ihnen Ehre bringen.\n\nWollt Ihr den Titel des Champions gewinnen? Lasst mich wissen, wenn Ihr bereit seid, dann könnt Ihr die Einführungsherausforderung annehmen.', '', '', '', '', '', '', 47187),
(66458, 'deDE', 'Vermächtnis von Tyr: Geheimnisse der Vergangenheit', 'Geht nach Uldaman: Vermächtnis von Tyr im Ödland und besorgt die Scheibe.', 'Damit Raszageth die anderen Inkarnationen nicht befreien kann, müssen wir die Macht der Aspekte wiederherstellen.\n\nUnglücklicherweise sind die Titanen mit anderen Dingen beschäftigt und Hüter Tyr ist schon lange tot.\n\nKönigin Alexstrasza hat jedoch einen Plan vorgebracht. In den Tiefen des Ödlands liegt eine Titanenanlage namens Uldaman. Anscheinend haben Verbündete Tyrs dort eine Scheibe mit seinen Erinnerungen versteckt.\n\nJedoch wurde diese Anlage angeblich von Troggs überrannt. Sammelt Eure Verbündeten und begebt Euch nach Uldaman. Beschlagnahmt die Scheibe im Namen der Drachenkönigin!', '', '', '', '', '', '', 47187),
(66457, 'deDE', 'Schluss mit der blauen Periode', 'Tötet Blauschuppe.', 'Die Glutzähne folgen alle einem übergroßen Koloss, den ich Blauschuppe nenne. Er war schon immer von der aggressiveren Sorte, aber bisher hat er seinen Haufen von Plünderern von den Hauptstraßen ferngehalten. Sicher, sie waren territorial, aber nicht feindselig. Bis jetzt zumindest.\n\nBlauschuppe muss für diese plötzliche Eskalation verantwortlich sein. Findet ihn und streckt ihn nieder.', '', 'Anführer der Glutzähne. Nicht sehr für Verhandlungen.', 'Blauschuppe', '', '', '', 47187),
(66456, 'deDE', 'Eine giftige Palette', 'Sammelt 8 vergiftete Speere.', 'Ich bin vielleicht nicht besonders gut bei meiner Arbeit, aber wenigstens habe ich aufgepasst, als ich gelernt habe, wie man sie macht. Jede Wegbehüterin, die etwas auf sich hält, weiß, wie man ein ordentliches Gegengift braut. Ich brauche nur genug Gift für die richtige Mischung.\n\nNori hat gesagt, die Speere der Tarasek, die sie angegriffen haben, wären damit bedeckt gewesen. Findet sie und bringt mir ihre Speere. Wenn mein Gefühl stimmt, werde ich aus den Rückständen an den Speerspitzen ein Gegengift herstellen können.\n\nIch hoffe nur, wir haben genug Zeit.', '', '', '', '', '', '', 47187),
(66449, 'deDE', 'Elementare Machenschaften', 'Rettet $1oa gefährdete Welpen und eliminiert $2oa Sengklauenphönixe sowie Aschebinderin Tornecha.', 'Staubbinder der Qalashi wollen unsere Welpen gefangen nehmen. Offenbar plant ihr Anführer, sie für finstere Machenschaften einzusetzen. Das dürfen wir nicht zulassen!\n\nDoch die Djaradin sind nicht der einzige Gegner. Unsere Welpen werden auch von Phönixen verfolgt, die noch gefährlicher sind.\n\nIhr müsst die Welpen beschützen und die Gegner ausschalten. Osoria hilft Euch.', '', 'Eine gefährliche Gegnerin, die die Manipulation von Asche und Ruß beherrscht.', 'Aschebinderin Tornecha', '', '', '', 47187),
(66448, 'deDE', 'Wegbehüter auf Abwegen', 'Findet Wegbehüterin Alvi.', 'Die Wegbehüter sorgen auf den Straßen von Thaldraszus für Sicherheit, so lange ich zurückdenken kann. Es ist eine Pflicht, die meine Familie seit Generationen ehrenhaft erfüllt.\n\nLeider scheint sich meine Schwester Alvi in letzter Zeit nicht sonderlich für diese Ehre zu interessieren. Eigentlich sollte sie mir hier jeden Morgen Bericht erstatten, aber ich habe seit über einem Tag nichts mehr von ihr gehört.\n\nWenn Ihr östlich von hier eine bronzene Drakonide beim Tagträumen und Faulenzen antrefft, habt Ihr meine Schwester gefunden. In dem Fall würde ich Euch bitten, sie zu mir zu schicken. Ansonsten müsste ich sie wohl oder übel selbst aufsuchen.', '', '', '', '', '', '', 47187),
(66447, 'deDE', 'Jenseits der Barriere', 'Untersucht das Lebensgewölbe in den Ruinen des Lebensgewölbes.', 'Die Barriere ist weg! Schauen wir uns das Gewölbe an!', '', '', '', '', '', '', 47187),
(66445, 'deDE', 'Ehre den Gefallenen', 'Holt die folgenden Gegenstände von den Djaradin zurück.', 'Die Djaradin haben keinen Respekt vor der Heiligkeit der Zitadelle und den toten Körpern unserer Art! Sie brechen ihnen die Knochen und berauben sie ihrer persönlichen Gegenstände, um sie als Trophäen zu behalten.\n\nSolch eine Respektlosigkeit nagt am Herz eines jeden stolzen schwarzen Drachen. Sie haben es verdient, mit Ehre behandelt zu werden.\n\nErkämpft Euch die Gegenstände zurück, die die Djaradin von den Leichen unserer Gefallenen gestohlen haben.', '', '', '', '', '', '', 47187),
(66442, 'deDE', 'Geistige Betätigung', 'Helft, die Kugeln an der Titanenbarriere in den Ruinen des Lebensgewölbes auszuprobieren.', 'Wir haben jetzt vier Kugeln der Elemente! Lasst uns sehen, welche Hypothese sich als richtig erweist!', '', '', '', '', '', '', 47187),
(66441, 'deDE', 'Destillierte Anstrengungen', 'Tötet Assquian in der Höhle östlich der Ruinen des Lebensgewölbes.', 'Die Kugel des Ursteins ist ein glücklicher Fund, aber Acadia und Tae\'shara haben widersprüchliche Thesen, was die Barriere betrifft.\n\nIch habe meine eigene Vermutung. Vielleicht kommen wir der Antwort mit weiteren Kugeln der Elemente näher.\n\nEiner der Forscher hat einen übergroßen Wasserelementar in einer nahe gelegenen Höhle entdeckt. Besiegt den Elementar, vielleicht findet Ihr bei ihm eine weitere Kugel.', '', 'Späher berichten, dass dieser Elementar schnell an Größe gewinnt.', 'Assquian', '', '', '', 47187),
(66439, 'deDE', 'Schnellfeuerpläne', 'Sammelt Urflammenfragmente von Streitkräften der Primalisten in der Flunkerhöhle.', 'Elementarkugeln, hm? Wenn es Erde gibt, gibt\'s auch Feuer!\n\nDie Primalisten drüben bei den Flunkernestern formen das Land mit Lava. Wenn irgendjemand Interesse an einer Kugel der Urflammen hat, dann sind sie es.\n\nSchaltet sie aus und seht, ob sie etwas Nützliches haben!', '', '', '', '', '', '', 47187),
(66438, 'deDE', 'Abgehobene Ziele', 'Findet Späherin Ri\'tal in der Flunkerhöhle.', 'Luft ist ein mächtiges Element. Es schneidet durch Fels und bläht die Segel, um uns an unser Ziel zu bringen.\n\nMeine Hypothese ist, dass die Luft besonders effektiv sein wird, wenn wir diese Barriere durchbrechen wollen. Es ist wirklich ganz einfach.\n\nMeine Späher haben die Kugel der Urstürme aufgespürt. Späherin Ri\'tal kann Euch zu ihr führen. Ihr findet sie in der Nähe der Flunkerhöhle. Schnell!', '', '', '', '', '', '', 47187),
(66437, 'deDE', 'Ein Schlüsselelement', 'Bringt die Kugel des Ursteins zu Elementaristin Taiyang in den Ruinen des Lebensgewölbes.', '<Diese Erdkugel pulsiert vor Energie>\n\n<Elementaristin Taiyang weiß vielleicht etwas damit anzufangen.>', '', '', '', '', '', '', 47187),
(66436, 'deDE', 'Ausgegrabene Unruhestifter', 'Tötet $1oa Erdelementare in den Ruinen des Lebensgewölbes.', 'Die Erdelementare versuchen nicht nur, uns zurückzuschlagen, sie zerstören sogar zurückgelassene Artefakte und Ausrüstung! Es ist, als hätte man sie programmiert, alles Titanische zu zerstören...\n\nSolange wir uns gegen sie verteidigen müssen, können wir diese Stätte nicht weiter studieren. Bitte helft uns, sie zu vertreiben!', '', '', '', '', '', '', 47187),
(66435, 'deDE', 'Bergungsunternehmung', 'Rettet $1oa bedrängte Forscher aus den Ruinen des Lebensgewölbes.', 'Als Schamanin habe ich schon mit vielen Elementaren gearbeitet, aber ich habe noch nie solch aggressive Exemplare gesehen!\n\nDie Expedition hat ein Gewölbe der Titanen entdeckt, aber eine Barriere verschließt die innere Kammer. Als wir versucht haben, sie aufzulösen, haben wir wohl einen Sicherheitsmechanismus aktiviert... plötzlich waren wir von wütenden Elementaren umgeben!\n\nAls die Elementare angriffen, waren noch viele unserer Forscher bei den Ausgrabungen. Viele von ihnen sitzen dort fest und KEINER unter ihnen ist ein Kämpfer. \n\nBitte geht dort hinunter und unterstützt ihren Rückzug!', '', '', '', '', '', '', 47187),
(66429, 'deDE', 'In ewiger Erinnerung', 'Trefft Rannan beim Lager im Nirgendwo.', 'Bitte... Ich brauche einen Moment.\n\nKehrt ins Lager im Nirgendwo zurück, $p. Ich treffe Euch dort.', '', '', '', '', '', '', 47187),
(66428, 'deDE', 'Freundschaft gesichert', 'Verwendet die I.R.R.E.S.T., um die arkane Barriere zu entfernen.', 'Perfekt! Die I.R.R.E.S.T. ist kalibriert und bereit für den Einsatz! Durch Euch!\n\nWarum ich sie nicht benutze? Ganz einfach!\n\nMan muss alle Eventualitäten in Betracht ziehen.\n\nNehmen wir an, sie würde explodieren. Wer würde sie reparieren, wenn ich verletzt, bewusstlos oder tot bin? Könnt Ihr Euch das vorstellen?\n\nUnd jetzt geht und bannt die Barriere, damit wir ins Lager zurückkehren und Lathos versorgen können. Ich werde... mich im Hintergrund halten.', '', '', '', '', '', '', 47187),
(66427, 'deDE', 'Eine lauernde Bedrohung', 'Tötet Tharohn.', 'Die arkanen Wunden, die ich erlitten habe, können auf dem Schlachtfeld nicht geheilt werden. Ich fürchte, sie sind zu schwer, als dass ich kämpfen könnte.\n\nIch muss Euch schon wieder um Hilfe bitten, $n.\n\nIhr müsst Tharohn finden und sie daran hindern, weitere Konsolen zu überladen.\n\nDadurch verschafft Ihr Rannan ein paar wertvolle Augenblicke, um die I.R.R.E. zu kalibrieren... I.R.R.E.R. Wie auch immer er es gerade nennt.\n\nVielleicht können wir die Machenschaften der Splitterflammen dann vereiteln.', '', 'Ein Anführer der Splitterflammen, der um jeden Preis die Macht der Ruinen von Karnthar an sich reißen will.', 'Arkane Manipulatorin Tharohn', '', '', '', 47187),
(66426, 'deDE', 'Die Zeit läuft davon', 'Erreicht den Ostturm.', 'Ich kann spüren, wie die arkane Woge genau jetzt anschwillt.\n\nIch vermute, es bleibt nicht mehr viel Zeit, bis die Ruinen Rannans S.P.A.M. wie einen weit entfernten Stern am Nachthimmel aussehen lassen.\n\nWir müssen dort hingelangen und es aufhalten.\n\nBitte seid vorsichtig, $p.\n\nTrefft uns am östlichen Turm. Dort werden wir die Situation besprechen.', '', '', '', '', '', 'Trefft Rannan und Lathos beim östlichen Turm.', 47187),
(66425, 'deDE', 'Arkane Überladung', 'Helft Rannan, die arkanen Blasen zu entfernen.', 'Na bitte, fertig!\n\nHier ist die I.R.R.E.R.!\n\nTA TA TAAAA!\n\nIch habe sie auf die Frequenz der Energie um die Drachenkonsolen herum kalibriert und mit einer Glyphe der Bannmagie versehen.\n\nDie I.R.R.E.R wird die Arkanenergie bannen und die Drachenkonsole ausschalten, aber die Glyphe wird mit jeder Nutzung schwächer.\n\nZiemlich praktisch, nicht wahr?\n\nIch habe vier dieser Konsolen in unserer Nähe entdeckt. Schaltet sie ab!', '', '', '', '', '', '', 47187),
(66423, 'deDE', 'Sorgen und Bestätigungen', 'Findet Hinweise auf den Ursprung der Ruinen.', 'Die Tode dieser Splitterflammen verdeutlichen, wie gefährlich die Ruinen von Karnthar sind.\n\nAber Rannan glaubt, dass die I.R.R.E. mit einigen Modifikationen dennoch die Energien dort zu bändigen vermag.\n\nWieder einmal behandeln wir nur die Symptome und nicht die Ursache.\n\nDurchsucht die Ruinen nach Hinweisen und versucht herauszufinden, was ihr ursprünglicher Nutzen war. Und beeilt Euch, $n. Wir haben womöglich nicht genügend Zeit.', '', '', '', '', '', '', 47187),
(66422, 'deDE', 'Die Expedition geht weiter!', 'Trefft Rannan und Lathos beim Turm.', 'Eine antike Stätte, eine Organisation mit rätselhaften Motivationen... selbst Rannans I.R.R.E. und ihre Analysen...\n\nDas alles weckt den Entdecker in mir.\n\nWir müssen mehr darüber herausfinden, was hier vor sich geht.\n\nIm Süden gibt es eine Treppe, die hoch zu einem Turm führt. Gehen wir schnell weiter.', '', '', '', '', '', '', 47187),
(66421, 'deDE', 'Die Sturmschneise', '', '', '', '', '', '', '', '', 47187),
(66419, 'deDE', 'Alle für Einen', '', '', '', '', '', '', '', '', 47187),
(66412, 'deDE', 'Weiter so, Blattington', 'Sprecht mit Blattington in den Gärten.', 'Eine Bitte hätte dieser alte Drakonid noch an Euch, bevor Ihr geht.\n\nFrüher, als Fürst Blattington und ich uns gerade kennengelernt hatten, gingen wir zusammen auf alle möglichen Abenteuer. Ich glaube, dass er deshalb immer davonzieht. Ihm fehlt das Erkunden.\n\nLeider kann ich ihm das nicht mehr ermöglichen, Ihr aber schon! Ich weiß, Ihr könntet ihn an Orte bringen, die ich mir nicht mal erträumen kann.\n\nWir sollten Blattington allerdings vorher fragen, was er davon hält.', '', '', '', '', '', '', 47187),
(66391, 'deDE', 'In die Ruinen!', 'Trefft Rannan und Lathos in den Ruinen von Karnthar.', 'Hättet Ihr Interesse daran, etwas über meine Erfindung, die I.R.R.E. zu erfahren? Nein?\n\nNun, ich erzähle es Euch trotzdem... weil sie was gefunden hat.\n\nHeute hat sie eine GEWALTIGE WOGE arkaner Energie entdeckt, die von den Ruinen von Karnthar ausgeht. Lathos glaubt, dass die Splitterflammen etwas damit zu tun haben. Das ist die PERFEKTE Gelegenheit, die I.R.R.E. vorzuführen!\n\nWollt Ihr mitkommen? Das wird der Hammer.', '', '', '', '', '', '', 47187),
(66369, 'deDE', 'Der irdene Schutz', 'Aktiviert den irdenen Schutz.', 'Mit den Ringen, die Ihr gesammelt habt, habe ich einen Schutz ermächtigt. Dieser hat die Felsen der Erde selbst um sich herum gesammelt und einen lebendigen Irdenen erschaffen, um dieses Gebiet zu beschützen.\n\nTestet den irdenen Schutz, um zu sehen, ob er funktioniert.', '', '', '', '', '', '', 47187),
(66368, 'deDE', 'Insel im Sturm', 'Eliminiert $1oa lodernde Manifestationen und Schmelzer Igneus.', 'Ich hatte nicht viel Zeit zu rasten. Der elementare Angriff ist unerbittlich!\n\nIch würde einen Moment der Ruhe willkommen heißen. Das würde mir erlauben, mehr Zauberschutze für unsere Verteidigung herzustellen.\n\nSeht, was Ihr tun könnt, um die Zahlen der Angreifer zu mindern.', '', '', 'Schmelzer Igneus', '', '', '', 47187),
(66364, 'deDE', 'Drachen steigen lassen', 'Sammelt 10 frische Protodrachenschwingen von den Protodrachen der Dracheninseln für Temnaayu von den Tuskarr von Iskaara.', 'Lasst mich Euch etwas über eine einzigartige Gelegenheit erzählen.\n\nDie Protodrachen haben einen erstaunlichen Bewegungsreichtum in ihren Schwingen. Und die Verrippung! Sie ist äußerst dehnbar. Wir bauen unsere Drachen meistens aus gespannten Häuten, aber jetzt verbreiten die Protodrachen Chaos. Wenn Ihr mir einige ihrer Schwingen bringt, könnte ich Flugdrachen bauen, die der Stolz des Stammes wären.', '', '', '', '', '', '', 47187),
(66363, 'deDE', 'Basiliskenbuckelschild', 'Sammelt 20 starre Basiliskenbälge von den Basilisken der Dracheninseln für Dhurrel von den Zentauren der Maruuk.', 'Verkettete Schuppen sind der Schlüssel, um einen Pfeil abzuwehren. Unsere Buckelschilde sind die Besten der ganzen Ebenen. Aber mir fehlen Basiliskenbälge für die nächste Bestellung.\n\nIch kann Euch ansehen, dass Ihr Euch für unser Handwerk interessiert. Sammelt Basiliskenbälge auf den Dracheninseln, dann weise ich Euch in unsere Techniken ein.', '', '', '', '', '', '', 47187),
(66356, 'deDE', 'Eisenbaum', '', '', '', '', '', '', '', '', 47187),
(66354, 'deDE', 'Der Funke', 'Rekonstruiert die beschädigten Teile des Schwursteins.', 'Die Schmiede ist bereit. Jetzt muss sie nur angefeuert werden.\n\nPlatziert die beschädigten Schwursteinfragmente in der Schmiede, und Furorion wird den Funken spenden, der den Prozess entzündet.', '', '', '', '', '', '', 47187),
(66353, 'deDE', 'I.R.R.E. Anomalien', 'Benutzt die I.R.R.E., um drei arkane Anomalien zu bannen.', 'Hier gibt es JEDE MENGE arkaner Energie...\n\nDoch die I.R.R.E. kann dabei helfen! Das ist ein wahrhaft innovatives Gerät... das steckt auch so im Namen: \"Innovative, Revolutionäre Rannan-Erfindung\"! Sie kann arkane Energie aufspüren UND bannen.\n\nHier... haltet mal! Spürt Ihr schon die MACHT in Euren Händen? Nein?\n\nNun, wenn Ihr sie schon mal in der Hand habt, könnt Ihr damit ja auch diese Anomalien bannen!', '', '', '', '', '', '', 47187),
(66352, 'deDE', 'Was der Feind weiß', 'Findet Dokumente der Splitterflammen und bringt sie zu Lathos.', 'Es ist wichtig herauszufinden, was das Ziel der Mission der Splitterflammen in diesen Ruinen ist... und was das alles mit der arkanen Woge zu tun hat.\n\nWir werden das auf die gute alte Art machen: Aufklärung und Spionage.\n\nDie Ruinen sind von Anhängern der Splitterflammen überlaufen. Ich bin mir sicher, dass einige von ihnen Befehle bei sich tragen, die uns Einblicke in ihre mysteriösen Vorhaben erlauben.\n\nNutzt alle Mittel, die Euch zur Verfügung stehen, um an diese Dokumente zu gelangen.', '', '', '', '', '', '', 47187),
(66351, 'deDE', 'Rauch über dem Berg', 'Findet Pfadfinderin Yips\' Fluggerät.', '<Pfadfinder Jeb betrachtet die Bergkette hinter dem Lager und schnaubt.>\n\nDas gefällt mir nicht. Pfadfinderin Yips hätte schon vor Tagen hier sein sollen. Sie sollte mir helfen, diesem Haufen von Jungforschern beizubringen, wie man sicher diese Säulen hinaufklettert.\n\nJetzt sehe ich Rauch in der Ferne.\n\nDas gefällt mir ganz und gar nicht.', '', '', '', '', '', '', 47187),
(66349, 'deDE', 'Übungsfelsen', 'Entfernt $1oa Steine.', 'Entfernt diese Steine!', '', '', '', '', '', '', 47187),
(66344, 'deDE', 'Mit dem Wind im Rücken', 'Fliegt mit Gerithus und Merithra.', 'Die Primalisten haben also Klan Nokhud für ihre Sache gewonnen.\n\nBisher konnten wir die Primalisten zurückhalten, doch die Nokhud haben eine neue Waffe ins Spiel gebracht: eine Drachentöterballiste. Ich fürchte, dass Solethus nicht der letzte Drache sein wird, der ihrer verdorbenen Sturmmagie zum Opfer fällt.\n\nKommt. Ich bringe Euch zum Drachenrefugium der Schattenzuflucht. Und Ihr könnt mir erzählen, was Ihr von den Nokhud wisst, während die Khanam Matra ihre Streitkräfte sammelt. Wir müssen uns auf den nächsten Schritt vorbereiten.', '', '', '', '', '', '', 47187),
(66340, 'deDE', 'Ausflug ins Azurblaue', 'Triff Pakina und Masud den Weisen an der Flussgabelkreuzung.', 'Wir haben unseren Teil getan. Ich muss jedoch hierbleiben, um über den Schwurstein zu wachen und den grünen Drachenschwarm zu führen. Doch wisset, dass Ihr Euch unsere Dankbarkeit und unser Vertrauen verdient habt.\n\nIch habe erfahren, dass die Kirin Tor um Hilfe bitten, den Azurschwurstein zu beanspruchen. Damit bringt Ihr uns der Heilung Azeroths einen Schritt näher.\n\nFindet Pakina und Masud den Weisen von den Kirin Tor. Sie haben weitere Informationen. Gute Reise und angenehme Träume, $n.', '', '', '', '', '', '', 47187),
(66339, 'deDE', 'Angriff der Nokhud: Der Wind gehört dem Himmel', 'Besiegt Balakar Khan und rettet Ohn\'ahra beim Angriff der Nokhud.', 'Ist Eure Zeit bei uns zu Ende, $n, oder werdet Ihr uns einmal mehr helfen?\n\nMeine Späher haben berichtet, dass Balakar sich in seine Festung zurückgezogen hat, wo er Ohn\'ahra festhält. Das ist inakzeptabel!\n\nUnd in der Zwischenzeit stürmen die Plünderer der Nokhud über die Ebenen und richten Chaos an. Während wir gegen sie kämpfen, könnt Ihr die Festung der Nokhud infiltrieren und Ohn\'ahra retten. Würdet Ihr das für uns tun?', '', '', '', '', '', '', 47187),
(66337, 'deDE', 'Sturmbrecher', 'Bezwingt Koroleth.', '$n, zu mir! Der Sieg ist zum Greifen nahe!\n\nDie Reihen der Primalisten sind durchbrochen und ihr Krieg steht vor dem Ende. Alles, was wir bislang erreicht haben, ist nur von Bedeutung, wenn wir diese entscheidende Schlacht gegen die Primalistenanführerin Koroleth gewinnen.\n\nLasst es uns gemeinsam zu Ende bringen, Ihr und ich! Zusammen! In den Kampf, $GBruder:Schwester;!', '', 'Die Primalistenanführerin versucht, das Refugium der grünen Drachen zu zerstören.', 'Koroleth', '', '', '', 47187),
(66336, 'deDE', 'Die Insel des Smaragds', 'Trefft Merithra im Uralten Zweig.', 'Euer Beitrag zu all dem ist mir nicht entgangen, $gSterblicher:Sterbliche;. Es ist zu einem großen Teil Eurer Tapferkeit zu verdanken, dass wir die Primalisten besiegen konnten.\n\nIch habe die Zentauren eingeladen, sich mir unter dem Uralten Zweig anzuschließen. Ihr, zusammen mit der Khanam Matra und ihrem Volk, seid in unserem Zuhause willkommen.\n\nFolgt diesem Pfad durch den Bogen über das Wasser und zu den dahinterliegenden Bäumen. Dort werde ich auf Euch warten.', '', '', '', '', '', '', 47187),
(66335, 'deDE', 'Dekonstruktion weiterer Pylonen', 'Markiert die Primalistenpylonen mit der verzauberten Saat.', 'Da diese teuflischen Waffen nun zerstört sind, kann der grüne Drachenschwarm mit voller Stärke in die Schlacht eingreifen.\n\nWir sind mit der Lage am Boden besser vertraut. Wir müssen die Ziele für den Angriff von Merithra und ihren Drachen ausleuchten, damit sie aus der Luft angreifen können.\n\nMerithra hat mir diese verzauberte Saat gegeben. Platziert sie in der Nähe von Primalistenpylonen. Wir werden ihr Licht dazu verwenden, um Angriffe fliegender Drachen anzufordern.', '', '', '', '', '', '', 47187),
(66333, 'deDE', 'Gerechtigkeit für Solethus', 'Tötet $1oa Kriegstreiberinnen der Nokhud und zerstört $2oa Drachentöterballisten.', 'Solange auch nur ein grüner Drache noch atmet, werden diese Primalisten den Uralten Zweig nicht ohne Gegenwehr entweihen.\n\nWir wollen bei dieser Schlacht unseren Beitrag leisten, doch solange diese Drachentöterballisten auf dem Schlachtfeld stehen, kommen wir nicht vorwärts. Sie werden von den stärksten Kriegern der Nokhud bewacht, Ihr werdet Euch also auch noch um diese Krieger kümmern müssen.\n\nZerstört die Ballisten und die Kriegstreiberinnen der Nokhud. Eliminiert diese Bedrohung, und die grünen Drachen werden in dieser Schlacht das Blatt wenden.', '', '', '', '', '', '', 47187),
(66331, 'deDE', 'Die Primalistenfront', 'Sprecht mit Späherin Tomul, Ari und Belika, Ohn Seshteng und Merithra in der Sturmschneise.', 'Die Khanam Matra berichtet, dass sie und ihre Streitkräfte bei den Smaragdgärten angekommen sind. Sie haben Koroleth und ihre Primalisten gefunden. Allem Anschein nach sammelt sich eine gewaltige feindliche Invasion am Strand im Norden.\n\nWeise wie sie ist, hat sie mehrere Späher abgestellt, die verschiedene strategische Orte auf dem Schlachtfeld im Blick behalten. Geht und sammelt ihre Berichte. Trefft mich und meine Streitkräfte anschließend an der Front. Ruhm erwartet uns im Kampf. Und sollten wir erfolgreich sein, Vergeltung auch.', '', '', '', '', '', '', 47187),
(66329, 'deDE', 'Das Horn blasen', 'Seid $gZeuge:Zeugin; von Balakars und Koroleths Plänen.', 'Warum würden sie Ohn\'ahra herbringen? Es sei denn...\n\n$n! Ich glaube nicht, dass Balakar vorhat, das Horn zu zerstören. Ich glaube, das ist eine Falle! Wir müssen einen Weg an diesem Wind vorbei finden, schnell!', '', '', '', '', '', '', 47187),
(66328, 'deDE', 'Grüner Drache am Boden', 'Trefft die Khanam Matra beim Wasserloch.', 'Die Drachen sind über den Ebenen im Westen zu Boden gegangen. Wir müssen schnell zu ihnen gelangen, bevor die Nokhud uns zuvorkommen.\n\nWir wollen nicht, dass sie nur wegen Balakars Taten gleich alle Maruuk als Feinde betrachten.', '', '', '', '', '', '', 47187),
(66327, 'deDE', 'Windjäger', 'Hört Euch den Bericht von Späherin Tomul an.', 'Wir sollten einen Moment innehalten und unsere Strategie überdenken.\n\nWir brauchen Ohn\'ahras Segen, um das Horn von Drusahl zu blasen und die grünen Drachen zu beschwören. Ohne ihre Hilfe können wir diesen Krieg nicht gewinnen. Die Nokhud sind den anderen Klans bereits zahlenmäßig überlegen und nun haben sie Verstärkung von den Primalisten. Außerdem hat Koroleth jetzt auch noch unsere Windmutter gefangen genommen! Wir müssen daher Ohn\'ahra finden, bevor die Nokhud ihren finalen Angriff starten und Maruukai einkreisen.\n\nIch werde unverzüglich all unsere Späher entsenden. Ich hoffe nur, dass wir es schaffen, sie rechtzeitig zu finden.', '', '', '', '', '', '', 47187),
(66326, 'deDE', 'Handwerkszeuge', 'Sammelt $4oa |4Präzisionsschuppenhammer:Präzisionsschuppenhämmer;, $3oa |4Obsidianamboss:Obsidianambosse;, $2oa |4Schwarzstahlzange:Schwarzstahlzangen; und $1oa Drachenklauenstempel.', 'Eine derart mächtige Schmiede benötigt besondere Werkzeuge, die ihrer überwältigenden Hitze standhalten können.\n\nAber die Djaradin haben diesen Ort geplündert und viele der Werkzeuge gestohlen, die wir für diese Arbeit benötigen.\n\nErgattert die Werkzeuge von ihnen zurück, wenn Ihr könnt, damit wir unsere Verbündeten wieder bewaffnen können.', '', '', '', '', '', '', 47187),
(66324, 'deDE', 'Niemals vergessen', 'Bergt Gegenstände und Überlebende aus dem Unterstützungshort.', 'Das Gegengift ist fertig. Benutzt es, um im Unterstützungshort nach Überlebenden zu suchen. Beeilt Euch... Der Effekt wird nicht lange anhalten, also müsst Ihr es eventuell wiederholt anwenden.\n\nFalls einige meiner Leute noch atmen, dann rettet sie.\n\nUnd falls dem nicht mehr so ist, dann sammelt ihre Hornsignets, damit ihren Namen Ehre erwiesen werden kann.\n\nWährend Ihr dort drin seid, könnt Ihr vielleicht Beweise finden, wie es zu dieser Ansteckung kommen konnte.', '', '', '', '', '', '', 47187),
(66320, 'deDE', 'Der Strom der Zeit', 'Reist in die Wandernden Sande und sprecht mit Chromie.', 'Die Fäden der Zeit fließen wie ein Fluss mit vielen Armen und Biegungen. Manchmal kann sich der Fluss ändern. Doch eine Anomalie, die ungelöst bleibt, kann unser Schicksal zu einer falschen Zeitlinie verdammen.\n\nWir bewegen uns gerade schnell auf eine solche Anomalie zu. Ich habe Chronormu zu den Wandernden Sanden geschickt, um die Sache zu untersuchen, den Fluss zu korrigieren und uns auf die richtige Zeitlinie zurückzuführen.\n\nIch kann vorhersehen, dass Eure Hilfe von unschätzbarem Wert sein wird.\n\nBitte helft uns und trefft Euch mit Chronormu.', '', '', '', '', '', '', 47187),
(66308, 'deDE', 'Das Feuer schüren', 'Sammelt $1oa Stücke Aschenscherbenkohle.', 'Die Erschaffung neuer Waffen und Rüstungen in der Schmiede des Erdwächters wird uns den letztendlichen Sieg über die Djaradin sichern.\n\nDie Flammen der Schmiede müssen allerdings kontinuierlich geschürt werden. Aschenscherbenkohle spendet die stärkste Hitze, und die ist nötig, um Waffen zu schmieden.\n\nIhr findet Aschenscherbenkohle in Ablagerungen und Elementaren in der Aschenscherbenspalte.', '', '', '', '', '', '', 47187),
(66299, 'deDE', 'Geplante Ei-plosion', 'Tötet die Matriarchin des Kreischerschwarms.', 'Unser Prototyp hat funktioniert! Exzellent!\n\nJetzt wird es Zeit für das Hauptgericht. Dieses Mal seid IHR $gder Koch:die Köchin;.\n\nNach ein paar notwendigen Korrekturen werdet Ihr erneut in Eure Verkleidung schlüpfen. Nehmt im Anschluss unser Meisterwerk der EI-plosion, schmeißt es in diesen stinkenden Eintopf, begebt Euch zur Höhle der Matriarchin, serviert ihn ihr und gleitet dann zurück nach unten, während hinter Euch alles in die Luft fliegt.\n\nWenn alles nach Plan geht, wird das ihr letztes Abendmahl sein. Wegen der Explosion. Weil sie nicht mehr besonders hungrig sein wird, wenn sie tot ist.', '', 'Die zurückgezogen lebende Matriarchin der Kreischerschwarm-\nharpyien! Wollt Ihr ihren Hunger mit einer hohnzirperschen Sprengladung oder Eurem eigenen Fleisch stillen?', 'Matriarchin Avethyra, Anführerin der Kreischerschwarmharpyien', '', '', '', 47187),
(66279, 'deDE', 'Reisewecker', 'Bringt die Taschenuhr zu Orizmu in den Gärten.', 'Ah ja, diese Taschenuhr gehört einem der Verwalter, der mir bei der Pflege der Gärten hilft.\n\nEr gehört zu Nozdormu. Orizmu, wenn ich mich recht entsinne. Bei all den Kindern kommt man schnell mal durcheinander. An den meisten Tagen steht er neben dem Stundenglas in der Nähe von Alexstraszas Baum, ohne sich zu bewegen. Oder zu blinzeln.\n\nNozdormus Leute waren schon immer merkwürdig, wenn Ihr mich fragt. Aber er wird Euch sicher dankbar sein, wenn Ihr sie ihm zurückbringt.', '', '', '', '', '', 'Bringt die Taschenuhr zu Orizmu in den Gärten.', 47187),
(66278, 'deDE', 'Der Plunder eines Drakoniden', 'Bringt die Taschenuhr zu Gryrmpech in den Gärten.', '<Eine funkelnde Taschenuhr liegt zwischen den Müllhaufen. Vielleicht weiß Gryrmpech, was es damit auf sich hat.>', '', '', '', '', '', 'Bringt die Taschenuhr zu Gryrmpech in den Gärten.', 47187),
(66277, 'deDE', '[DNT] Making Quest', 'Tötet $1oa Banditen.', 'Willkommen, $gAbenteurer:Abenteurerin; zu Eurem ersten Auftrag! Heute werden wir niederträchtige Banditen töten. Los, geht sie töten!', '', '', '', '', '', '', 47187),
(66270, 'deDE', 'Hau-den-Gnoll', 'Besiegt die Möchtegernkriegsherren.', 'Oh, Licht... mehr sind unterwegs! Wie konnte das geschehen?\n\nAll meine sorgfältige Planung! All die Tage, die ich in diesem widerlichen See verbracht habe! Die Meucheleien!\n\nAll das hätte sie ins Chaos stürzen und ihre Siedlung zusammenbrechen lassen sollen, aber wir haben sie kaum verlangsamt!\n\nVielleicht... vielleicht habt Ihr recht, $n. Ich lag die ganze Zeit falsch...\n\nNein! Unmöglich! Wir stecken sowieso zu tief drin.\n\nGeht... kümmert Euch um diese Neuankömmlinge. Ich brauche Zeit, um mich zu sammeln.', '', '', '', '', '', '', 47187),
(66269, 'deDE', 'Nur, um sicher zu gehen', 'Tötet $1oa Elementaristen von Sturmfang.', 'Tötet... einfach alle, die aussehen, als wären sie magisch begabt. Oder als hätten sie organisatorische Fähigkeiten. Oder die besonders ehrgeizig aussehen.\n\nTut, was auch immer Ihr in diesem Fall für richtig haltet.\n\nWas Ihr \"für richtig haltet\" ist, nicht mehr mit mir zu sprechen? Also wirklich, $C! Die... haben eindeutig etwas Bösartiges vor!', '', '', '', '', '', '', 47187),
(66268, 'deDE', 'Aller guten Dinge sind drei', 'Tötet Blutklaue.', 'Was? Ein anderer hat das Kommando übernommen? Was ist aus dem lähmenden Machtvakuum geworden? Oder wenigstens aus der angemessenen Trauerzeit, um den Schein zu wahren?\n\nHaben sie den gar keinen Anstand? Keinen Sinn von Schicklichkeit? Keinen Respekt für einen fein säuberlich geschmiedeten Plan? Ich habe Tabellen angefertigt!\n\nKümmert Euch um diesen Blutklaue. Ich brauche einen Moment.\n\nUnd ich kann Eure lästigen Kommentare nicht brauchen, vielen Dank!', '', 'Wer ist gestorben und wer hat ihn zum Kriegsführer ernannt?', 'Blutklaue', '', '', '', 47187),
(66267, 'deDE', 'M.E.T.A.', 'Befreit $1oa missbrauchte Tiere.', 'Diese Unholde! Plünderung und Mord sind eine Sache, aber Tierquälerei? Das kann ich nicht zulassen.\n\nDie Gnolle haben Fallen aufgestellt, um Tiere zu fangen, mit denen sie ihre sabbernden Hyänenköter ernähren. Findet einen Weg, ihre flauschigen Gefangenen zu befreien, und zeigt diesen Grobianen, wie ein Magier ethisch korrekt mit Tieren umgeht!\n\nNatürlich macht das ethisch Sinn, wenn man meine kürzlichen Handlungen bedenkt. Was genau wollt Ihr da andeuten?', '', '', '', '', '', '', 47187),
(66266, 'deDE', 'Dreckige Bastarde', 'Erschlagt $1oa Hyänenmatriarchinnen und $2oa Hyänenköter.', 'Diese flohgebissenen Hyänenköter der Gnolle müssen verschwinden! Nicht nur, dass sie keine Manieren haben... Ihr glaubt nicht, an welchen Orten sie sich erleichtern... aber möglicherweise können sie mich trotz meiner beispiellosen Illusionen wittern.\n\nTut der wohlgesitteten Welt einen Gefallen und beseitigt sie.', '', '', '', '', '', '', 47187),
(66265, 'deDE', 'Wer ist der Nächste?', 'Tötet Knackzahn.', 'Aha! Nun, wie es scheint, hat ein anderer Gnoll das Kommando übernommen. Wie ich erwartet habe. Ja.\n\nEs ergibt natürlich Sinn, einen vertrauten Vize-Kriegsfürsten zu haben, um die Weiterführung der Regierung zu sichern, nicht wahr? Wir müssen sie einfach nur etwas härter treffen, wenn wir ihre Bürokratie zu Fall bringen wollen, hm?\n\nWas? Ob ich diesen Moment nutze, um darüber nachzudenken, ob ich diese Gnolle vorschnell verurteile? Lächerlich! Das sind Gnolle!\n\nSchnell jetzt! Tötet Knackzahn, bevor das Eisen kalt wird oder sie eine Wahl organisieren!', '', 'Wie viele Hyänen kann ein Gnoll eigentlich haben?', 'Knackzahn', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66264, 'deDE', 'Entwaffnet und sanftmütig', 'Sammelt $1oa Knochennagerwaffen.', 'Um ehrlich zu sein, wedeln sie dort oben mit einer beunruhigenden Menge an Waffen herum. Es sollte die Dinge beruhigen, wenn wir sie um einige davon erleichtern. Oder zumindest beruhigt es meine Nerven.\n\nWas wollen sie ohne Waffen schon groß anstellen? Euch mit bloßen Händen angreifen? Ha!', '', '', '', '', '', '', 47187),
(66263, 'deDE', 'Eine präzise Annäherung', 'Tötet Gerbfaust.', 'Gnolle sind furchtbare Kreaturen. Sie stinken. Sie kratzen sich. Sie lachen einen immer aus. Und es sind schon viele hier, und mehr kommen ständig an. Wir, und dabei meine ich Ihr, könnten sie tagelang niedermähen wie Weizen auf einem Feld und nicht wirklich etwas erreichen. Sie dürfen nicht hierbleiben.\n\nStattdessen müssen wir der Schlange den Kopf abschlagen! Erleichtert sie um ihre Führung, und sie werden vor Ratlosigkeit und Verzweiflung erstarren.\n\nWas soll das heißen, warum tun wir das? Ist es nicht offensichtlich? Es sind Gnolle! Das sollte Grund genug sein.', '', 'Welche Chance haben sie ohne ihren geliebten Anführer?', 'Gerbfaust', '', '', '', 47187),
(66262, 'deDE', 'Abwasserklärung', 'Säubert $1oa verrottende Haufen am See.', 'Fangen wir vorne an: Ich brauche meine Operationsbasis zurück! Aber mit den Amok laufenden Elementaren ist es nicht gerade leicht, auch nur Zeh zu fassen.\n\nUnd natürlich ist das die Schuld dieser elenden Gnolle.\n\nDie Gnolle haben so viel Müll, Innereien und weiß das Licht was noch in den See geworfen, dass die ansässigen Elementare angefangen haben, durchzudrehen.\n\nSeid so gut und sammelt ein paar der ekelhafteren Schweinereien auf, bevor die Lage sich weiter zuspitzt. Und viel wichtiger: bevor sie meine Robe besudelt!', '', '', '', '', '', '', 47187),
(66261, 'deDE', 'Ein kleiner Rückschlag', 'Trefft Detry.', 'Ah, Ihr seid genau das schwer gerüstete Individuum, das ich gehofft habe zu treffen.\n\nIch bin wegen sehr wichtiger Geschäfte der Kirin Tor hergekommen, seht Ihr, aber als ich mein Lager aufschlug, verjagte mich eine Horde dreckiger, verfilzter Gnolle.\n\nTatsächlich hat sich in der Nähe eine besorgniserregende Anzahl Gnolle versammelt, genug, um mich glauben zu lassen, dass sie eine Bedrohung für das ganze Gebirge darzustellen.\n\nAber keine Sorge, ich habe einen Plan! Trefft mich auf der anderen Seite des Sees, und ich erkläre Euch alles.', '', '', '', '', '', '', 47187),
(66259, 'deDE', 'Ein Sturm an schlechten Neuigkeiten', 'Übergebt Euren Bericht der Khanam Matra in Maruukai.', '$n, wir müssen der Khanam Matra erzählen, was alles passiert ist, inklusive der Gefangenschaft von Ohn\'ahra.\n\nIhr müsst so schnell wie möglich nach Maruukai. Ihr werdet jedoch ohne mich gehen müssen. Ich wurde beim Sturz verletzt und würde Euch nur aufhalten.\n\nSorgt Euch nicht um mich. Ich komme später nach. Geht!', '', '', '', '', '', '', 47187),
(66258, 'deDE', 'Oh nein, Ohn\'ahra!', 'Besiegt Feinde, während Boku versucht, Ohn\'ahra zu befreien.', 'Diese Primalistin schafft es gerade so, Ohn\'ahra festzuhalten. Sie scheint uns nicht zu bemerken.\n\nTigari Khan würde sagen, dass selbst die leichteste Brise, einen wankenden Stein umwerfen kann. Wenn ich ihren Zauber unterbrechen kann, selbst wenn es nur kurz ist, kann sich Ohn\'ahra vielleicht losreißen.\n\nHaltet Ihr die Wachen beschäftigt. Ich habe eine Idee.', '', '', '', '', '', '', 47187),
(66257, 'deDE', 'Vogelzauber', 'Verwendet Bokus Windtotems, um die Wagen der Nokhud zu zerstören.', 'Es heißt, dass Ohn\'ahra den Speer unseres Vorfahren Maruuk mit ihrer Macht erfüllt hat. Balakar Khan muss den Primalisten von dieser Legende erzählt haben.\n\nSie haben Magie von den Kindern von Ohn\'ahra gestohlen. Sie haben sie mit Sturmhexerei beschmutzt und Ballistenbolzen damit erfüllt. Wofür brauchen die Nokhud solche Waffen?\n\nWir sollten nicht darauf warten, es herauszufinden. Nehmt meine Totems und platziert eins auf jedem Wagen, dem Ihr begegnet. Meine Windmagie wird die Bolzen in Stücke zerschlagen.', '', '', '', '', '', '', 47187),
(66256, 'deDE', 'Adlermacher', 'Befreit $1oa Kinder von Ohn\'ahra und eliminiert $2oa Primalisten bei der Windspielanhöhe.', 'Wir haben herausgefunden, warum die Nokhud Mystikertotems wollen: Damit lassen sich die Kinder von Ohn\'ahra einfangen. Obwohl die Nokhud die Totems gestohlen haben, stecken eigentlich die Primalisten hinter dieser Lästerung.\n\nDie Kinder von Ohn\'ahra sind heilige Ohuna, gesegnet von der Windmutter höchstselbst. Bitte, $n, befreit jegliche Ohuna, denen Ihr begegnet! Und wenn Ihr irgendwelchen Primalisten über den Weg lauft...\n\n<Bokus Blick schweift ab, aber er bleibt von finsterer Entschlossenheit gezeichnet.>', '', '', '', '', '', '', 47187),
(66254, 'deDE', 'Ein pessimistischer Mystiker', 'Stellt die Totems der Ermächtigung um Boku herum auf.', 'Krieg? Drachen? Ich soll Ohn\'ahra für Euch kontaktieren?\n\nKann ich nicht! Ich kann Ohn\'ahra nicht hören, kein bisschen. Ich bin lediglich ein Initiand. Und es scheint, als hätte mir Ohn\'ahra ihren Segen entzogen. Vielleicht bin ich einfach nicht gut genug...\n\n<Boku beginnt, in einer Tasche herumzuwühlen.>\n\nAls meine Mentorin mich diesem Klan zuwies, schenkte sie mir diese Totems. Sie sagte, sie würden mir Kraft geben, wenn ich jemals an mir selbst zweifeln sollte.\n\nHelft Ihr mir, sie zu platzieren? Ich werde noch einmal versuchen, Ohn\'ahra anzurufen.', '', '', '', '', '', '', 47187),
(66252, 'deDE', 'Bericht erstatten', 'Kehrt nach Valdrakken zurück und berichtet Hauptmann Drine.', 'Die Primalisten hier sind zurückgedrängt, $n. Unsere Verstärkungen aus Valdrakken sollten bald eintreffen und die restlichen Primalisten beseitigen.\n\nIhr solltet zur Stadt zurückkehren und Hauptmann Drine Bescheid geben. Ich bin mir sicher, dass sie wissen wollen wird, was hier mit Kommandant Eranog vorgefallen ist.\n\nDanke noch mal für alles, $n.', '', '', '', '', '', '', 47187),
(66251, 'deDE', 'Feuerwehr', 'Tötet Magmakralle.', 'Kommandant Eranog hat uns hintergangen und dieser Bestie das Kommando überlassen.\n\nIhr habt bereits so viel für mich getan, doch ich kann es in meinem gegenwärtigen Zustand nicht mit diesem Monster aufnehmen.\n\nIch bitte Euch, tut mir diesen letzten Gefallen und helft sicherzustellen, dass das Tor der Südfeste nicht gegen diese Primalisten fällt.\n\nWir müssen ihren Anführer töten!\n\nHelft mir, $n!', '', 'Der Anführer der Primalisten, die das Tor der Südfeste angreifen.', 'Magmakralle', '', '', '', 47187),
(66250, 'deDE', 'Wo ist der Häuptling?', 'Begleitet Wächter Velomir und untersucht den Wachturm am Tor der Südfeste.', 'Das ist der einzige Teil der Festung, den wir noch nicht durchsucht haben, $n. Wenn sich Kommandant Eranog irgendwo befindet, dann muss es hier sein.\n\n<Velomir blickt zum nahe gelegenen Eingang.>\n\nSchauen wir mal, was wir herausfinden können.', '', '', '', '', '', '', 47187),
(66249, 'deDE', 'Befreit den Himmel', 'Bedient einen Belagerungsskorpion und verwendet ihn, um die Lüfte von den magmagebundenen Wahrgeborenen zu befreien.', 'Ihr habt beim Sammeln der Speere und der Seile gute Arbeit geleistet. Damit können wir sicherstellen, dass diese eingebildeten Primalisten nicht länger die Herrscher der Lüfte sind!\n\nWenn Ihr die Treppe hochgeht, findet Ihr eine Plattform mit mehreren Belagerungsskorpionen. Mit dem Seil könnt Ihr die Wurfarme bespannen und die Speere dienen als Munition. Damit solltet Ihr in der Lage sein, die magmagebundenen Drachen aus der Luft zu holen!\n\nWenn Ihr sie beseitigen könnt, sollte der Weg zur Spitze frei sein, um unsere Suche nach Kommandant Eranog fortzusetzen.', '', '', '', '', '', 'Trefft Euch mit Wächter Velomir auf dem Wachturm am Tor der Südfeste.', 47187),
(66248, 'deDE', 'Perfekte Verbindung', 'Sammelt $1oa Rollen mit schwerem Seil.', 'Diese Rolle mit schwerem Seil ist in gutem Zustand.\n\nWächter Velomir hat gesagt, dass Ihr ein Auge nach nützlichen Materialien offen halten sollt. Vielleicht kann er etwas damit anfangen, wenn Ihr noch mehr Rollen findet.', '', '', '', '', '', '', 47187),
(66247, 'deDE', 'Kaum benutzte Waffen', 'Sammelt $1oa magmagebundene Speere.', 'Dieser Speer scheint in gutem Zustand zu sein, wenn man bedenkt, in welchem Zustand sich sein ehemaliger Besitzer befindet.\n\nWächter Velomir hat erwähnt, dass Ihr nach nützlichen Materialien Ausschau halten sollt. Vielleicht können noch mehr dieser Speere von den Magmagebundenen erbeutet werden.', '', '', '', '', '', '', 47187),
(66246, 'deDE', 'Der Schlachtennebel', 'Sucht nach den Mitgliedern von Wächter Velomirs Einheit am Tor der Südfeste.', 'Der Angriff der Primalisten kam plötzlich und ohne Vorwarnung. Meine Einheit hat versucht, unseren Anführer zu finden, Kommandant Eranog. Aber bevor wir auf die andere Seite der Garnison gelangen konnten, wurden wir abgeschnitten.\n\nWährend der Schlacht hat der Anführer meiner Einheit, Unteroffizier Tagrik, drei Primalisten alleine aufgehalten, während Kaora, Mikor und ich an seiner Seite kämpften.\n\nIhre Schreie sind das Letzte, an das ich mich erinnern kann, bevor ich fiel.\n\nIch bitte Euch, $R, wenn Ihr irgendwelche Anzeichen von meiner Einheit findet, dann lasst mich wissen, was mit ihnen passiert ist.', '', '', '', '', '', '', 47187),
(66245, 'deDE', 'Gedenkt den Gefallenen', 'Sammelt $1oa Signets der Südfestengarnison.', 'So viele meiner Kameraden sind gefallen.\n\nBitte... sammelt ihre Erkennungssignets, auf dass ihre Namen nie vergessen werden.', '', '', '', '', '', '', 47187),
(66244, 'deDE', 'Nach Valdrakken', 'Reist nach Valdrakken und trefft Euch mit Alexstrasza der Lebensbinderin.', 'Dank Euch konnten wir einer absoluten Katastrophe knapp entgehen.\n\nDennoch sollten wir uns mit den anderen Aspekten treffen und von dem berichten, was sich hier ereignet hat.\n\nBitte trefft mich beim Sitz der Aspekte in Valdrakken. Ich bin sicher, dass die anderen Informationen zu den Plänen von Raszageth und ihren Primalisten haben.\n\nNördlich von hier, ein wenig nach Osten, gibt es einen Übergang nach Thaldraszus. Die Flugstrecke ist malerisch, aber lasst Euch nicht zu lange Zeit.', '', '', '', '', '', '', 47187),
(66242, 'deDE', 'Wetterkontrolle', 'Tötet $1oa sturmgebundene Essenzen und $2oa Sturmruferinitianden.', 'Dieser unnatürliche Sturm ist mit Magie aufgeladen. Die Nokhud scheinen zu lernen, die heilige Essenz der Windspielanhöhe zu manipulieren, um Sturmelementare zu erschaffen. Manche haben mehr Erfolg als andere...\n\n<Boku deutet auf einen unglücklichen Initianden der Nokhud in der Nähe, der immer noch von Blitzen verbrannt raucht.>\n\n$n, wir dürfen nicht zulassen, dass sie weitermachen.', '', '', '', '', '', '', 47187),
(66241, 'deDE', 'Rennen von Thaldraszus', '', 'Fliegt durch die Kontrollpunktringe, die die Strecke markieren.', '', '', '', '', '', '', 47187),
(66239, 'deDE', 'Ausbreitender Verfall', 'Trefft Euch mit Brena am Handelsaußenposten.', '<Brena wendet Kargtatzes Totem immer wieder in ihren großen Pranken hin und her.>\n\nKargtatze ist nur eine Schachfigur. Er ist nicht die Quelle dieser Fäulnis. Wir müssen sie finden, bevor sie sich noch weiter ausbreitet.\n\nDie nächste Tuskarrsiedlung von hier ist ein Handelsaußenposten, gleich am anderen Ende der Brücke nach Iskaara.\n\nWir sollten nach ihnen sehen... und zwar schnell.', '', '', '', '', '', '', 47187),
(66237, 'deDE', 'Spirituelle Verbündete', 'Sprecht mit den Behörden.', 'Unsere Ankunft wird nicht unbemerkt bleiben.\n\nGestattet mir, mit ihnen zu sprechen, bevor wir eintreten. Ich habe so etwas wie eine gemeinsame Geschichte mit dem Rat.\n\nWir haben später noch genug Zeit, alle vorzustellen.', '', '', '', '', '', '', 47187),
(66236, 'deDE', 'Ein gefangener Wind', 'Trefft Boku bei der Windspielanhöhe.', 'Die Nokhud sammeln Totems. Die Primalisten fangen Ohuna. Und Ohn\'ahra schweigt.\n\nWas auch immer die Nokhud vorhaben, wir müssen sie daran hindern. Ihr müsst zusammen mit Boku zur Windspielanhöhe reisen. Vermutlich warten unsere Feinde dort bereits.\n\nSucht dort nach Ohn\'ahra. Wenn ihre Kinder in Gefahr sind, wird sie sich zweifelsohne zu ihnen begeben... und wir müssen ihr helfen. Die Windmutter ist mächtig, doch ich fürchte, zu was diese Primalisten imstande sind.', '', '', '', '', '', 'Trefft Boku bei der Windspielanhöhe.', 47187),
(66232, 'deDE', 'Salziger Affront', 'Sammelt $1oa Kristallflocken an der Gorlocküste.', 'Wir würden Euch und Eure Freunde gerne als unsere Gäste wissen, nicht, dass jemand gefragt hätte. Aber wärt Ihr so $gein guter Nachbar:eine gute Nachbarin; und würdet mir einige Kristallflocken mitbringen, wenn Ihr an den Quellen vorbeikommt? Wir nutzen sie, um alle möglichen Dinge zu konservieren. Und wenn es um die Lagerung von Essen geht, ist das hier unerlässlich.\n\nDie größeren Gorlocs sind über und über mit dem Zeug bedeckt. Vielleicht könnt Ihr ja von denen ein paar Flocken ergattern.', '', '', '', '', '', '', 47187),
(66230, 'deDE', 'Bilderbuchauftrag', 'Findet Alvis \"Register\" und bringt es zu Wegbehüterin Alvi.', 'Die Tarasek haben alles mitgenommen, was sie in ihre Klauen bekommen konnten, inklusive meines Registers.\n\nDiese übergroßen Eidechsen horten Schmuckstücke und Trophäen zuhauf. Ich bin sicher, dass sie mein Register auch irgendwo verstaut haben. Könntet Ihr ein Auge danach offen halten, während Ihr auf dem Weg über den Pass seid?\n\nOh, und, $n, wenn es Euch gelingt, es zu finden, seht nicht hinein. Der Inhalt ist gewissermaßen... privat.', '', '', '', '', '', '', 47187),
(66228, 'deDE', 'Lager Antonidas', 'Trefft Euch mit Noriko der Allerinnernden im Lager Antonidas.', 'Die Kirin Tor haben unser Hauptlager südlich von hier aufgeschlagen: Lager Antonidas.\n\nIch glaube, Noriko und Khadgar sind gerade dort und rekrutieren Abenteurer, um Kalecgos bei der Rückeroberung des Azurschwursteins zu helfen.\n\nWenn Ihr unsere Sache unterstützen wollt, geht dorthin.', '', '', '', '', '', 'Trefft Euch mit Noriko der Allerinnernden im Lager Antonidas.', 47187),
(66227, 'deDE', 'Gutes Angeln', 'Fangt $3oa Blauflossenelritzen an Khuris Angelplatz.', 'Ein neues Paar Hände! Ich könnte etwas Hilfe brauchen, um genug Fisch für ein feines Essen zu fangen.\n\nDiese Kirin Tor scheinen über etwas in dieser Gegend beunruhigt zu sein, was sie magische Anomalien nennen, was immer das sein mag.\n\nEs sind alle willkommen, hierzubleiben, solange sie mit anpacken und mithelfen.\n\nNehmt Euch eine Angel und fangt an, zu fischen. Je mehr Hände, umso leichter die Arbeit!', '', '', '', '', '', '', 47187),
(66226, 'deDE', 'Begleiter für seelischen Beistand', 'Rettet die unschuldigen Kreaturen vor den Nokhud bei der Gratwasserzuflucht.', 'Bitte tut mir nicht weh...\n\nWas? Ihr seid hier, um zu helfen? Ihr müsst die Tiere retten!\n\nDie Nokhud haben ohne Vorwarnung angegriffen. Wir alle sind um unsere Leben gerannt! Ich konnte dem Tod gerade noch entkommen, indem ich in den See gesprungen bin.\n\nDie Tiere! Wir haben sie zurückgelassen. Bitte, ich flehe Euch an, rettet sie. Wer weiß, welche Grausamkeiten die Nokhud für sie geplant haben.', '', '', '', '', '', '', 47187),
(66225, 'deDE', 'Totale Totems', 'Sammelt $1oa Totembündel von den Nokhud bei der Gratwasserzuflucht.', 'Boku hat gefragt, warum ich eine Nachricht entsandt habe, die alle Mystiker zur Gratwasserzuflucht ruft.\n\nIch habe keine solche Nachricht entsendet. Balakar hat meine Mystiker vorsätzlich in eine Falle geführt, um Klan Ohn\'ir zu schwächen.\n\nDoch vielleicht gibt es noch einen weiteren Grund. Die Nokhud sammeln mystische Totems, so viele sie finden können. Diese Totems sind von Ohn\'ahra gesegnet.\n\nEs nicht klar, was die Nokhud damit vorhaben, doch wir dürfen nicht zulassen, dass sie sich an Ohn\'ahras Geschenken bedienen. Bringt so viele Totems zurück, wie Ihr könnt.', '', '', '', '', '', '', 47187),
(66224, 'deDE', 'Mystisches Mysterium', 'Trefft Euch mit Boku und reist zur Gratwasserzuflucht.', 'Es tut mir leid, ich habe es nicht geschafft, mit Ohn\'ahra Zwiesprache zu halten. Ihr werdet jemand anderen finden müssen, der die Bitte der Khanam Matra erfüllt.\n\nVor einigen Tagen wurden die anderen Mystiker im Zuge einer dringenden Bitte von Tigari Khan zur Gratwasserzuflucht gerufen. Sie sollten noch dort sein.\n\nTrefft mich außerhalb der Stadt. Das Mindeste, das ich tun kann, ist, Euch den Weg dorthin zu zeigen.', '', '', '', '', '', '', 47187),
(66223, 'deDE', 'Können wir das behalten?', 'Bringt Neelo $1oa Eiswasserfische. Kauft sie entweder in Iskaara oder angelt sie in einem beliebigen Ozean der Dracheninseln.', 'Er versucht nur, uns zu essen, weil er so hungrig ist!\n\nFisch! Niemand kann so leckeren, eiskalten, rohen Fisch abschlagen!\n\nEiswasserfische sind das Beste überhaupt! Ihr könnt sie überall im Ozean angeln! Aber falls Ihr selbst nicht angeln könnt, wird Euch Jinkutuk in Iskaara bestimmt welche verkaufen.\n\nBringt mir so viele, bis er nicht mehr hungrig ist!', '', '', '', '', '', '', 47187),
(66222, 'deDE', 'Die Ruhe vor dem Sturm', 'Kommuniziert Jebotais Befehle an die Bewohner von Teerakai.', 'Die Nokhud sind mächtig und haben viele Verbündete. Es wird uns alles abverlangen, ihnen standzuhalten.\n\n$n, Ihr habt das Vertrauen der Khanam Matra. Ihre Befehle waren, unser Volk vorzubereiten und unsere Freunde zu versammeln.\n\nIch brauche Eure Hilfe. Sucht Hojin auf, um den Rest der Khanswache zu mobilisieren. Macht Späherin Khenyug auf mögliche Orte aufmerksam, an denen die Nokhud eindringen könnten. Informiert Agura, dass mit Verwundeten zu rechnen ist, und sagt Gensai, dass er unsere Verpflegung vorbereiten soll.\n\nBezüglich der Mystiker... Ich glaube, dass sie vor Kurzem aufgebrochen sind. Ich werde prüfen, ob sich in Teerakai noch jemand von ihnen befindet.', '', '', '', '', '', '', 47187),
(66221, 'deDE', 'Es geht voran', 'Sprecht mit Alexstrasza beim Sitz der Aspekte in Valdrakken.', 'Mit der Wiederherstellung des Bronzeschwursteins kann Alexstrasza mit ihrem Plan fortfahren.\n\nReist nach Valdrakken, $n. Sie wird von Eurem Erfolg hören wollen.', '', '', '', '', '', '', 47187),
(66218, 'deDE', 'Störende Strolche', 'Findet Neelo und Nau.', 'Hallo noch mal.\n\nKönntet Ihr Norukk und mir einen Gefallen tun? Unsere Kinder Neelo und Nau sind zum Spielen rausgegangen. Sie wissen, dass sie längst zurück sein sollten.\n\nIch bin beschäftigt, also bitte geht sie suchen. Ich bezweifle, dass sie in Gefahr sind, meine Kinder wissen sich zu helfen.', '', '', '', '', '', '', 47187),
(66217, 'deDE', 'GESUCHT: Krojek der Küstenstreifer', 'Tötet Krojek den Küstenstreifer.', 'Wir haben den großen Hai beobachtet, der seit vielen Jahren als Krojek bekannt ist, und warten auf die beste Gelegenheit, ihn zu erlegen.\n\nSeine Jagdgründe haben sich immer näher an die Küste verschoben. Das bedeutet, dass es an der Zeit ist. Versammelt Euren Jagdtrupp und streckt ihn nieder!', '', 'Der Küstenstreifer, eine ehemalige Größe des hiesigen Ökosystems, hat seine Jagdgründe zu nah an Iskaara verlegt.', 'Krojek der Küstenstreifer', '', '', '', 47187),
(66213, 'deDE', 'Das Weben einer Geschichte', 'Erzählt der Ältesten Poa eine Geschichte über Fisch.', 'Meine liebe Frau, Poa, ist eine großartige Geschichtenerzählerin.\n\nAber dreißig Jahre sind vergangen, und sie erzählt manche immer und immer wieder! Bitte, $C, sprecht mit Poa und erzählt ihr eine neue Geschichte.\n\nWas sagt Ihr? Ihr wollt ihr von Euren Abenteuern erzählen? Macht Euch nicht lächerlich, davon will ich nichts hören. Die besten Geschichten handeln immer von Fisch. Erzählt ihr eine Geschichte über Fisch, und wenn Ihr Euch eine ausdenken müsst!', '', '', '', '', '', '', 47187),
(66212, 'deDE', 'Angeln: Querflossen-Flügelrossfisch', 'Zieht $1oa Querflossen-Flügelrossfische aus dem Meer um die Dracheninseln.', 'Weiß denn NIEMAND mehr, wie man RICHTIG angelt?\n\n<Lukoturukk zuckt wütend mit seinem Schnauzbart.>\n\nIhr da mit dem komischen Gesicht, bringt mir ein paar Fische. Und zwar FEINE Fische. Keine Grungeln!', '', '', '', '', '', '', 47187),
(66211, 'deDE', 'Brackenfellhöhle: Zur Quelle', 'Betretet die Brackenfellhöhle und stellt Faultriarchin Zornauge.', 'Wir können Euch für Eure Hilfe, die Brackenfellgnolle zurückzuschlagen, nicht genug danken.\n\nAber sie sammeln sich weiter und beziehen ihre Verfallmagie aus irgendeiner Quelle tief im Inneren der Brackenfellhöhle. Schlimmer noch, wir haben seit Wochen nichts mehr von den Tuskarr aus der Gegend gehört.\n\nIch fürchte, dort könnte etwas Furchtbares vorgefallen sein. Wir müssen unsere Heimat schützen. Bitte, sammelt Eure Streitmacht, findet unsere Leute und seht, was Ihr gegen diesen Verfall unternehmen könnt!', '', '', '', '', '', '', 47187),
(66210, 'deDE', 'Die Familie zusammenrufen', 'Sammelt $1oa Bestattungsgaben in der Gegend von Iskaara und legt sie dann in das Bestattungsboot.', 'Euer Freund Kalecgos möchte über Leylinien sprechen, aber es müssen Vorbereitungen für die Bestattung getroffen werden.\n\nKönntet Ihr die letzten Opfergaben aus der Umgebung von Iskaara einsammeln und sie im Bestattungsboot neben den guten alten Ponoliak legen, während ich mich mit ihm treffe?\n\nIch hoffe, Ihr nehmt Euch die Zeit, um auch die Stadt zu genießen! Mein Volk wird Euch herzlich willkommen heißen, insbesondere nach Eurer Hilfe in Brackenfell.', '', '', '', '', '', '', 47187),
(66206, 'deDE', 'Nozdormu, ich komme, um zu verhandeln', '', '', '', '', '', '', '', '', 47187),
(66201, 'deDE', 'Hufe des Krieges', 'Bringt die Nachricht der Khanam Matra zu Khanswache Jebotai in Teerakai.', 'Balakar wird seine Streitkräfte für den Krieg aufstellen. Ich werde es ihm gleichtun, doch wir sind zahlenmäßig unterlegen.\n\nDie Drachen haben um unsere Hilfe gebeten... und jetzt können wir ihre Hilfe brauchen, uns eine faire Chance zu geben. Um ihrem Ruf nach einem Bündnis zu antworten, muss ich das Horn von Drusahl blasen, doch ich brauche Ohn\'ahras Segen. Werdet Ihr mir helfen?\n\nGeht nach Teerakai und übergebt meine Kriegserklärung an meinen Leutnant, Jebotai. Er wird meine Streitkräfte zusammentrommeln und Euch den Weg zu den Mystikern zeigen, die Ohn\'ahra finden können.', '', '', '', '', '', 'Bringt die Nachricht der Khanam Matra zu Khanswache Jebotai in Teerakai.', 47187),
(66196, 'deDE', 'Ein Hilfequaken', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', '<Das Entchen schlägt in der Blase wild um sich und quakt verängstigt.>\n\n<Vielleicht wissen die Ökologen, wie man ihm helfen kann?>', '', '', '', '', '', 'Bringt das Entchen in der Blase zurück ins Ökologenlager.', 47187),
(66187, 'deDE', 'Der verrückte Mordigan und der Kristallkönig', 'Dekristallisiert Mordigan Eisenkiefer an der Gorlocküste.', 'Ich habe die Umgebung durchsucht. Wenn Mordigan irgendwo hier ist, muss er in dieser Höhle sein.\n\n<Dumpfe Flüche und Beleidigungen hallen aus dem Höhleneingang.>\n\nEr ist definitiv in dieser Höhle.\n\nLOU-C hat gesagt, diese Kristalle haben gefährliche dehydrierende Eigenschaften. Versucht, ihn von seinen... geologischen Funden zu trennen. Aber tut ihm nicht allzu sehr weh.\n\nEr ist in seinem Fachbereich ziemlich angesehen.', '', '', '', '', '', 'Sprecht mit Aelnara.', 47187),
(66177, 'deDE', 'Kein Zwerg bleibt zurück', 'Folgt der Spur von Mordigan Eisenkiefer entlang der Gorlocküste.', 'Das Salzniveau hier sprengt die Skala! Wir müssen Mordigan finden und ihn hier rausholen. Er muss inzwischen lebensgefährlich dehydriert sein.\n\nEr ist erst seit einigen Stunden fort. Versucht herauszufinden, welchen Weg der grimmige, alte Zwerg genommen hat!', '', '', '', '', '', 'Findet Aelnara an der Gorlocküste.', 47187),
(66176, 'deDE', 'Elementare Experimente', 'Führt $1oa Elementarexperimente an der Gorlocküste durch.', 'Geht und führt Experimente an den Wasserelementaren durch, die die Gorlocs belästigen!', '', '', '', '', '', 'Gut gemacht!', 47187),
(66175, 'deDE', 'Feldexperiment', 'Helft LOU-C dabei, ihre Tests in Walfängerwinkel durchzuführen.', 'Dank Euch arbeitet unsere geologische Untersuchung mit beinahe 96%iger Effizienz! \n\n<LOU-C zieht die Augenbrauen zusammen.>\n\nDas sind Anfängerzahlen.\n\nHelft mir, Eure gesammelten Proben mit dem Geoscanner 289-07 zu prüfen. Es sollte uns eine Grundvorstellung davon geben, was genau auf dem Plateau vor sich geht.', '', '', '', '', '', 'Sprecht mit LOU-C Fitzkog in Walfängerwinkel.', 47187),
(66169, 'deDE', 'Rache, heiß serviert', 'Tötet $1oa magmagebundene Primalisten am Tor der Südfeste.', 'Die Primalisten haben uns komplett überrumpelt.\n\n<Velomir spuckt angewidert aus.>\n\nMeine Wächterkameraden wurden von diesen Monstern zerfleischt. Ich hätte mich ihnen im Tod angeschlossen, wärt Ihr nicht aufgetaucht.\n\nIn der Ferne kann ich immer noch den Lärm der Schlacht vernehmen. Vielleicht gibt es noch mehr Überlebende. Vielleicht lebt sogar Kommandant Eranog noch.\n\nHelft mir und lenkt sie ab, damit ich mich näher ranschleichen kann.\n\nEs wäre perfekt, wenn Ihr ein paar dieser sogenannten \"Magmagebundenen\" töten könntet.', '', '', '', '', '', '', 47187),
(66167, 'deDE', 'Entblößter Süden', 'Reist zur Südfestengarnison.', 'Basierend auf Euren Entdeckungen vermute ich, dass die Primalisten die Garnison von Kommandant Eranog an der Südfeste angreifen. Doch meine Eidschuppen können die Stadt nicht verlassen, denn das würde den Primalisten nur in die Hände spielen.\n\nIch brauche erneut Eure Hilfe, $n.\n\nReist zur Südfeste und seht, was für Streitkräfte uns dort erwarten. Und wenn möglich, tretet mit den Garnisonswächtern dort in Kontakt.', '', '', '', '', '', '', 47187),
(66166, 'deDE', 'Augen und Ohren', 'Findet Hinweise in Valdrakken.', 'Die Primalisten haben ihre Propaganda unter den Einwohnern von Valdrakken verbreitet.\n\nUnsere Feinde sind zu gerissen, um sich in Anwesenheit meiner Eidschuppen zu verplappern, aber vielleicht könnt Ihr Euch nah genug heranschleichen, um ihre Unterhaltungen zu belauschen und herauszufinden, ob Ihr dadurch etwas in Erfahrung bringen könnt.\n\nIch habe Orte auf Eurer Karte für weitere Untersuchungen markiert.\n\nNehmt diesen verzauberten Stein mit. Solange Ihr ihn in Händen haltet, können wir miteinander kommunizieren.\n\nSeid Ihr bereit?', '', '', '', '', '', '', 47187),
(66164, 'deDE', 'Fischfinger', 'Findet $1oa gestohlene Teile an der Gorlocküste.', 'Jetzt, da Mordigan Steine lutscht, können wir uns um das Hauptproblem kümmern...\n\nDiese perfiden Fischleute haben meine Teile geklaut!\n\nWir waren noch keine Stunde in diesem schäbigen kleinen Kaff, und ZACK! Haben Gorlocs uns von überall überschwemmt! Rowe hat geschrien, Aelnara hat geheult und ich meinen Schraubenschlüssel wie eine wahnsinnige Gnomin geschwungen!\n\nKönnt Ihr die Situation retten und mir einige meiner Teile zurückbringen?', '', '', '', '', '', '', 47187),
(66163, 'deDE', 'Kein Versteck', 'Tötet $2oa Eindringlinge der Primalisten in Valdrakken.', 'Willkommen in Valdrakken, $R.\nDas Klima in der Stadt war in letzter Zeit etwas erhitzt, und damit meine ich nicht das Wetter.\n\nDie Primalisten schleichen durch die Gassen und schüren Uneinigkeit unter den Bürgern unserer Stadt.\n\nUnsere Feinde verkleiden sich nun als gewöhnliche Bürger der Stadt, um sich vor den Eidschuppen zu verstecken. Sie wissen, wie sie meinen Wachen aus dem Weg gehen, aber vor einem Fremdling werden sie sich nicht in Acht nehmen.\n\nNehmt dieses Drachenaugenjuwel, damit werdet Ihr ihre Tarnung durchschauen können.\n\nGeht! Identifiziert diese Eindringlinge und tötet sie!', '', '', '', '', '', '', 47187),
(66159, 'deDE', 'Eine schlimme Nachricht', 'Sprecht mit Alexstrasza beim Sitz der Aspekte in Valdrakken.', 'Kalecgos wollte nicht darüber sprechen, was im Azurblauen Gebirge passiert ist, bis Ihr eintrefft.\n\nAber was immer es auch ist... Ich empfinde eine unheilvolle Vorahnung, $n.', '', '', '', '', '', '', 47187),
(66156, 'deDE', 'Angesehen bei der Drachenschuppenexpedition', 'Sprecht mit Katalogisiererin Jakes im Drachenschuppenbasislager.', 'Eure Taten sind nicht unbemerkt geblieben. Ihr stellt immer wieder unter Beweis, dass Ihr $gein berühmter Forscher:eine berühmte Forscherin; seid!\n\nKehrt ins Drachenschuppenbasislager zurück. Ich habe einige Vorräte vorbereitet, die Euch in Euren Anstrengungen unterstützen sollen.', '', '', '', '', '', '', 47187),
(66155, 'deDE', 'Ruriqs Stromschnellenritt', 'Fahrt mit der Fallschreiter den Fluss hinunter.', 'Ich habe nicht mit der Zustimmung meines Bruders gerechnet... Aber sie ist willkommen.\n\nDie Zeit ist gekommen! Lasst uns sehen, ob unsere harte Arbeit sich ausgezahlt hat!\n\nTrefft mich auf der Fallschreiter, $n, dann legen wir flussabwärts ab und fangen unterwegs Fisch für Iskaara!', '', '', '', '', '', '', 47187),
(66154, 'deDE', 'Speichelproben', 'Sammelt $1oa Speichelproben an der Gorlocküste.', '<Der magere Untote greift sich an die Stirn und seufzt tief.>\n\nDas wird mich gar nicht gut dastehen lassen. An nur einem Tag haben wir es geschafft, die ansässigen Gorlocs aufzuscheuchen, die Hälfte unserer Ausrüstung zu verlieren und jetzt sind wir auch noch um einen Zwerg ärmer.\n\nIn dieser Situation schreibt das Protokoll vor, dass wir so effizient wie möglich arbeiten. Geht und dünnt unsere gezahnten Antagonisten aus und bringt mir ihren Speichel zur Untersuchung, wenn Ihr schon dabei seid.\n\nNur das gute Zeug, wohl gemerkt.', '', '', '', '', '', '', 47187),
(66152, 'deDE', 'Kein Entrinnen', 'Trefft Garz beim Lager im Nirgendwo.', 'Wir können nicht hierbleiben.\n\nIch weiß nicht, was wir tun können... oder wohin gehen...\n\nWir werden zum Lager im Nirgendwo zurückkehren. Die Tuskarr sollten wissen, was hier bei den Rostkiefern passiert ist.\n\nWenn wir unsere Geschichte weitererzählen und bewahren, wird sie sich vielleicht nicht wiederholen...', '', '', '', '', '', '', 47187),
(66151, 'deDE', 'Sein steinernes Herz', 'Tötet Steinherz.', 'Wir jaulen in Trauer um unseren Häuptling, auch wenn er noch lebt.\n\nWas von Steinherz übrig ist, befindet sich in der Höhle weiter vorn. Viele haben versucht, ihn zur Vernunft zu bringen.\n\nEr hat sie getötet, beinahe auch Narn.\n\nEr ist ein Monster! Das ist das wahre Ziel der Primalisten. Sie wollen uns in Stein und Feuer verwandeln, damit wir ihnen dienen.\n\nIn ihm ist kein bisschen Rostkiefer mehr übrig. Er muss vernichtet werden, bevor andere dasselbe Schicksal erleiden.', '', 'Das Geschenk der Primalisten hat den Körper des Rostkieferhäuptlings zu Stein erstarren lassen.', 'Steinherz', '', '', '', 47187),
(66150, 'deDE', 'Radzas Rettung', 'Rettet Radza Donnerklaue.', 'Radza Donnerklaue ist unsere Geisthüterin. Sie bewahrt unsere Traditionen und unsere Geschichte.\n\nDie Überzeugungen der Primalisten stehen entgegengesetzt zu allem, an das unser Klan glaubt. Ich wusste, sie würde sich Steinherz widersetzen!\n\nSteinherz wird alles dafür tun, sie zu unterwerfen. Ohne Radzas Segen kann niemand Häuptling sein!\n\nNarn sagt, dass Khargall Fünfzahn, die Wache des Häuptlings, versucht, sie zu brechen. Wenn Radza stirbt, stirbt unser Klan mit ihr.\n\nHelft ihr, $n, und seid darauf gefasst, dass er sie nicht ohne einen Kampf gehen lassen wird.', '', '', '', '', '', 'Trefft Euch mit Radza Donnerklaue im Rostkieferbau.', 47187),
(66149, 'deDE', 'Elementarer Einfluss', 'Zerstört $1oa Primalistentotems der Erdbindung und trefft Euch anschließend mit Narn tiefer im Rostkieferbau.', 'Narn sagt, dass nicht alle Rostkiefern Steinherz oder den Primalisten gefolgt sind.\n\nEinige Widerständler werden gegen ihren Willen gefangen gehalten. Von Totems, die Fels und Schlamm versprühen... Von ihnen werden sie unterworfen.\n\nZerschmettert die Totems und befreit sie!', '', '', '', '', '', 'Trefft Euch mit Narn im Rostkieferbau.', 47187),
(66148, 'deDE', 'Frühere Furbolgfamilie', 'Tötet $1oa Rostkieferfurbolgs und Elementare und trefft Euch anschließend mit Narn tiefer im Rostkieferbau.', 'Primalisten sind gekommen. Sie haben uns neue Kraft versprochen: die Macht über die Elemente.\n\nIch hätte nicht gedacht, dass Steinherz ihre Geschenke annehmen würde. Unser Klan brauchte keine Macht. Er hat nicht über die Folgen nachgedacht.\n\nSeine furchtbare Entscheidung kann nicht ungeschehen gemacht werden. Die Magie hat meinen Klan verdorben wie eine Krankheit, die eine Wurzel verfaulen lässt.\n\nEs bricht mir das Herz, aber das Einzige, was uns bleibt, ist, die Verderbten auszumerzen.', '', '', '', '', '', 'Trefft Euch mit Narn im Rostkieferbau.', 47187),
(66147, 'deDE', 'Kristalle im Wasser', 'Sammelt $1oa Kristallproben an der Gorlocküste.', 'Im Moment mag es nicht danach aussehen, aber wir sind Profis. Die Expedition hat uns damit beauftragt, eine Ansammlung seltener Kristalle in der Gegend aufzuspüren. Eine geologische Untersuchung, wenn man so will.\n\nIch bin immer noch erschüttert von dem Gorlocangriff. Wärt Ihr so freundlich, für mich nach diesen Kristallen zu suchen? Bringt Proben mit, wenn Ihr könnt.', '', '', '', '', '', '', 47187),
(66141, 'deDE', 'Gebrochene Traditionen, gebrochene Körper', 'Trefft Garz und Narn auf dem Weg zum Rostkieferbau.', 'Meine Furbolgfreunde sind nicht mehr sie selbst. Sie haben... schlimme Dinge getan. Jetzt sind sie zu etwas Schlimmerem geworden.\n\nFurbolgs haben sich noch nie gegen Furbolgs gewandt!\n\nMein Bruder und ich sind ihnen entkommen. Ich bin hergekommen, um Hilfe zu suchen, während er bei unserem Klanbau geblieben ist.\n\nHelft uns, bevor das das Ende unseres Klans ist!', '', '', '', '', '', '', 47187),
(66139, 'deDE', 'Endlich Feuer', 'Nutzt die konzentrierte Essenz des Wassers, um das lodernde Inferno in den Gärten zu bezwingen.', 'Na gut, junges Wesen. Ich habe all die Wasserelementaressenzen für Euch in diesem Krug verstaut.\n\nWenn Ihr ihn einfach auf den Großen werft, sollte das genügen. Ich meine, wann hat Wasser jemals nicht gegen Feuer gewirkt? Das ist eine idiotensichere Sache.\n\nDie Hitze, ähm, ist nicht gut für meine Gelenke, ich bleibe also einfach hier. Ihr könnt das sicher selbst erledigen.\n\nViel Glück, junges Wesen!', '', '', '', '', '', '', 47187),
(66138, 'deDE', 'Wie Sand im Stundenglas', 'Sammelt $1oa Haufen aus windgepeitschtem Zeitsand in den Gärten.', 'Wie auch der Rest der Gärten musste Nozdormus Stundenglas den Unruhen der Elementare standhalten. Turbulente Windelementare sind vorbeigezogen und haben den magischen Sand aus dem Inneren des Stundenglases verstreut.\n\nOhne diesen Sand ist Nozdormus Einfluss hier stark geschwächt.\n\nAls Verwalter in Ausbildung wurde ich damit beauftragt, das Stundenglas jederzeit zu überwachen. Wenn Ihr den Sand an meiner Stelle einsammeln könntet, wäre ich Euch auf ewig dankbar.', '', '', '', '', '', '', 47187),
(66137, 'deDE', 'Die Peitsche schwingen', 'Tötet $1oa invasive Todesblüten und Peitscherunkrautlinge in den Gärten.', 'Ich bin sicher, dass die Schotlinge nicht die einzigen Wildtiere sind, die sich wie die Axt im Wald benehmen.\n\nAlexstraszas Baum war mir schon immer ein Dorn im Auge. Ihre Lebensmagie zieht allerhand Flora und Fauna an, Gut und Böse gleichermaßen. Und ratet mal, wer sich um die Bösen kümmern muss? Der alte Gryrmpech natürlich!\n\nBei den Aspekten, ich werde zu alt für so etwas.\n\nDiese Verwalter sind nicht im Kämpfen ausgebildet, es liegt also an Euch, das Unkrautproblem der Lebensbindern zu lösen.', '', '', '', '', '', '', 47187),
(66136, 'deDE', 'Elementarextrakt', 'Sammelt $1a wässrige Essenzen in den Gärten.', 'Vor ein paar Tagen hat ein riesiger Feuerelementar den See verwüstet. Ich glaube, dass er hinter all diesem Chaos steckt, aber er ist zu groß, als dass wir ihn bekämpfen könnten. Irgendwie müssen wir ihn zuerst schwächen.\n\nSchreibt den alten Gryrmpech aber noch nicht zu früh ab, denn ich habe einen Plan!\n\nWasserelementare haben beschlossen, es sich im Pavillon des blauen Drachenschwarms gemütlich zu machen. Wenn Ihr genügend Essenz von ihnen sammelt, könnten wir sie gegen den Feuerelementar einsetzen.\n\nMan soll Feuer mit Feuer bekämpfen! Oder in diesem Fall eben mit Wasser, schätze ich.\n\nJedenfalls solltet Ihr Euch jetzt auf den Weg machen.', '', '', '', '', '', '', 47187),
(66135, 'deDE', 'Lehrling des Gärtners', 'Sucht nach Fürst Blattington in der Gartenhütte, indem Ihr Müllhaufen beseitigt.', 'Blattington! Fürst Blattington, wo bist du?\n\nMein Vorstandsassistent und Lehrling Fürst Blattington ist verschwunden! Er liebt das Erkunden, aber er ist noch schlechter als ich, wenn es darum geht, sich zu verteidigen. Ich bin ein Gärtner, kein Krieger!\n\nKönntet Ihr diesen Faulenzer bitte für mich finden? Ich brauche ihn hier, damit ich nachdenken kann. Er hält sich normalerweise im Schuppen auf und wühlt sich durch Müllhaufen.\n\nAber seid vorsichtig, er kann manchmal leicht reizbar sein.', '', '', '', '', '', '', 47187),
(66134, 'deDE', 'Schädlingsbekämpfung in Azeroth', 'Tötet $1oa aufgebrachte Setzlinge in den Gärten.', 'Ihr da! Schlüpfling!\n\nGeht mir zur Hand, ja? Diese Schotlinge zerfetzen meine ganzen Pflanzen!\n\nAlle möglichen Elementare sind in die Gärten eingedrungen und sie scheinen... die Tiere zu beeinflussen. Als ob ihre Energie die Schotlinge verrückt machen würde! Verrückter als sonst!\n\nIch habe mit diesen drei schon alle Hände voll zu tun. Bitte! Helft mir, bevor sie all meine Blumenbeete verwüsten.', '', '', '', '', '', '', 47187),
(66133, 'deDE', 'Schlüssel der Loyalität', 'Sammelt $1oa große Obsidianschlüssel.', '', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel in der Obsidianzitadelle ab.', 47187),
(66131, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlüssel.', 'Bringt mir einen zusammengesetzten Schlüssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel bei einer beliebigen Fraktion innerhalb der Schwarzdrachenzitadelle ab.', 47187),
(66130, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlüssel.', 'Bringt mir einen zusammengesetzten Schlüssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel bei einer beliebigen Fraktion innerhalb der Schwarzdrachenzitadelle ab.', 47187),
(66129, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlüssel.', 'Bringt mir einen zusammengesetzten Schlüssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel bei einer beliebigen Fraktion innerhalb der Obsidianzitadelle ab.', 47187),
(66126, 'deDE', 'Offenbarung unserer Vergangenheit', 'Findet $1oa zusammengesetzten Schlüssel.', 'Bringt mir einen zusammengesetzten Schlüssel.', '', '', '', '', '', 'Liefert den zusammengesetzten Schlüssel bei einer beliebigen Fraktion innerhalb der Obsidianzitadelle ab.', 47187),
(66124, 'deDE', 'Triumphaler Abgang', 'Entkommt mit Majordomus Selistra aus der Blitzfrostenklave.', 'Soweit ich sehen konnte, hat die Königin sich in die Wilde Brutstätte zurückgezogen. Sie dient als Außenposten, um die Protodrachen in der Gegend zu überwachen... Ich hoffe nur, dass ihre Verteidigung ausreicht.\n\nWir müssen sofort dorthin!', '', '', '', '', '', '', 47187),
(66123, 'deDE', 'Ab mit dem Kopf', 'Besiegt Jadzigeth in der Blitzfrostenklave.', 'Jadzigeth, einer von Raszageths niederträchtigen Leutnants, führt die Primalisten hier an.\n\nZeigen wir ihnen, was passiert, wenn sie sich gegen uns stellen.', '', 'Raszageths Leutnant wird so lange Ärger machen, bis jemand sie stoppt.', 'Jadzigeth', '', '', '', 47187),
(66122, 'deDE', 'Protokampf', 'Besiegt $2oa Protodrachen in der Blitzfrostenklave.', 'Diese Protodrachen verabscheuen uns. Sie glauben, wir sind eine verdorbene Drachenart, die von den Titanen manipuliert und geknechtet wird. Sie verstehen es nicht.\n\nDarum fühlen sie sich sogar noch sicher, während sie ihre Streitkräfte an unsere Mauern branden lassen.\n\nDoch sie irren sich.\n\nNehmt diesen Speer, $p. Tötet unsere Feinde.', '', '', '', '', '', 'Trefft Euch mit Majordomus Selistra bei der Blitzfrostenklave.', 47187),
(66121, 'deDE', 'Eivakuierung', 'Rettet 4 Eier aus der Blitzfrostenklave.', 'Die Primalisten haben unsere Eier für deren verdorbene Rituale gestohlen! Sie müssen aufgehalten werden.\n\nHelft uns, die Eier zu retten, bevor es zu spät ist. Markiert jedes Ei, das Ihr findet, $p. Ich werde dafür sorgen, dass sie sicher aus dem Gebiet geborgen werden.', '', '', '', '', '', 'Trefft Euch mit Majordomus Selistra bei der Blitzfrostenklave.', 47187),
(66119, 'deDE', 'Rubinlebensbecken: Invasion der Primalisten', 'Betretet die Rubinlebensbecken und haltet den Angriff der Primalisten auf.', 'Die Primalisten haben sich einen Weg in unser Zuhause gebahnt. Wir waren auf einen so intensiven Angriff nicht vorbereitet... Mehrere von ihnen konnten durchbrechen.\n\nEiner unserer Drakoniden ist ebenfalls durch, um ihnen zu folgen, doch er hat sich noch nicht zurückgemeldet. Ich fürchte das Schlimmste.\n\nIch stehe Wache. Solange ich lebe, wird kein weiterer von ihnen unsere Mauern durchbrechen, doch Ihr müsst Euch um die kümmern, die es hineingeschafft haben.\n\nLos!', '', '', '', '', '', '', 47187),
(66118, 'deDE', 'Basaltangriff', 'Zerstört $1oa zornige Klippen beim Blitzfrostangriff.', 'Raszageth und ihre Primalisten haben gigantische Erdelementare herbeigerufen, um unsere Mauern zu durchbrechen. Sie müssen aufgehalten werden!', '', '', '', '', '', '', 47187),
(66117, 'deDE', 'Säubert das Schlachtfeld', '', '', '', '', '', '', '', '', 47187),
(66116, 'deDE', 'Die größte Bedrohung', 'Findet Kommandant Lethanak beim Blitzfrostangriff.', 'Wir haben einfach zu viele verwundbare Eier, die wir schützen müssen. Wenn der Feind durchbricht, ist alles verloren!\n\nIch bin sicher, unsere Wachen marschieren auf dem Feld auf, um den Gegner zurückzudrängen. Sprecht mit Kommandant Lethanak. Er wird Eure Stärke dort einsetzen, wo sie am dringendsten gebraucht wird.', '', '', '', '', '', '', 47187),
(66115, 'deDE', 'Das Mandat der Roten', 'Sprecht mit den Pflegern beim Rubinlebensschrein.', 'Hingabe und Mitgefühl sind unsere Berufung. Wir helfen den anderen Schwärmen nicht nur ihretwegen, sondern zum Wohle der gesamten Drachenheit.\n\nVielleicht versteht Ihr uns besser, wenn Ihr mit der Drachenbrut hier beim Rubinlebensschrein sprecht.', '', '', '', '', '', '', 47187),
(66114, 'deDE', 'Für die Königin', 'Reitet mit Majordomus Selistra zum Rubinlebensschrein.', 'Wir beschützen unsere kostbaren Eier, um die Zukunft aller Drachenschwärme zu sichern. Mit ihrem Handeln werden uns die Primalisten nicht nur seelische Pein zufügen.\n\nSie bedrohen unsere Existenz.\n\nIch muss die Königin sofort darüber informieren.', '', '', '', '', '', '', 47187),
(66113, 'deDE', 'Eine unscheinbare Fuhre', 'Repariert den ausgeliehenen Wagen.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'deDE', 'Immer zur Hand', 'Sammelt einen urzeitlichen irdenen Kern und einen urzeitlichen geschmolzenen Kern.', 'Habt Ihr je so machtvolle Elementare gesehen?!\n\n<Grun grüßt.>\n\nHab die Wachen grummeln gehört, weil sie die ganze Zeit gegen sie kämpfen müssen, aber sie sehen nicht das große Ganze... größere Elementare heißt größere Handwerksmaterialien!\n\nWährend Ihr draußen seid, um für unsere Sicherheit Elementare zu beseitigen oder was auch immer ihr macht, nehmt ein paar Stücke der größten mit, dann kann ich mal versuchen, ob ich da was draus machen kann!', '', '', '', '', '', '', 47187),
(66111, 'deDE', 'Eindringende Elementare', 'Tötet $1oa Urelementare in der Botschaft von Schwingenrast.', 'Die Handwerker und Forscher der Drachenschuppenexpedition sind ungeeignet für die Härte der Schlacht.\n\nAber wir beide nicht, $p.\n\nLasst uns hier auf den Dracheninseln diese Stärke nutzen, um jene zu schützen, die sich nicht selbst schützen können.\n\nBeseitigt die Elementare, die vom Norden eindringen, sodass die Expedition sich auf ihre höheren Ziele konzentrieren kann.', '', '', '', '', '', '', 47187),
(66110, 'deDE', 'Dem Frieden eine Chance', 'Stellt Euch den Vertretern der Allianz vor.', 'Aka\'Magosh, $p.\n\nDiese Expedition steht unter dem Schutz der Horde wie der Allianz. Unsere Anweisungen sind klar: die Mitglieder der Drachenschuppenexpedition unterstützen, ganz gleich, wem sie sonst die Treue geschworen haben.\n\nDie Vertreter der Allianz, Kapitänin Garrick und ihr Sohn Henry, stehen auf der anderen Seite des Lagers Wache.\n\nIch habe mit Kapitänin Garrick gegen die Geißel gekämpft. Sie ist eine ehrbare Streiterin und wird der Expedition sehr dienlich sein.\n\nBietet ihr Eure Unterstützung an. Beweist ihr, dass die Horde ihre Vereinbarungen ehrt.', '', '', '', '', '', 'Sprecht mit Kapitänin Garrick in der Botschaft von Schwingenrast.', 47187),
(66108, 'deDE', 'Lösung mit dem Vorschlaghammer', 'Tötet Sogglmoggl, den König der Triefschlünde, und Wirblgirgl, den König der Windflossen.', 'Nun, ich bin froh, dass Tharu meine Sichtweise jetzt nachvollziehen kann. Und ich bin dankbar, dass Ihr Lebewesen retten konntet, während ich hier herumgetrödelt habe.\n\nDie Situation ist ernster als gedacht. Er hatte recht, dass wir sofort handeln müssen. Nach allem, was ich bisher in Erfahrung bringen konnte, wird dieses elementare Bombardement nicht aufhören, bis wir uns um die Gorlocs gekümmert haben.\n\nAn Tharus Stelle und praktisch gedacht würde ich mich direkt ihren Anführern zuwenden. Wenn sie niemanden mehr haben, um den sie sich versammeln können, sollten sie sich verziehen und das Sumpfland nicht mehr bedrohen.', '', '', '', '', '', '', 47187),
(66107, 'deDE', 'Wildtierrettung', 'Rettet die Lebewesen des Rastlosen Sumpflands.', 'Man muss kein Ökologe sein, um zu erkennen, dass das Sumpfland in echten Schwierigkeiten steckt.\n\nAber Iskha lässt uns hier in aller Ruhe tote Kreaturen untersuchen, während wir lieber verhindern sollten, dass sie überhaupt sterben! Der rote Drachenschwarm ist schließlich dafür da, das Leben zu schützen, nicht zu zerteilen!\n\nIch liebe Iskha, und er hat wirklich Ahnung, aber wenn wir warten, bis er fertig ist, gibt es kein Sumpfland mehr, das wir noch retten könnten.\n\nIch kümmere mich um seine ewige Nachdenkerei. Geht Ihr inzwischen raus, macht Euch Eure Stiefel schmutzig und rettet einige Lebewesen.', '', '', '', '', '', '', 47187),
(66106, 'deDE', 'Muscheln kuscheln', 'Sammelt $1oa wassererfüllte Muscheln und $1oa winderfüllte Muscheln von Triefschlund- und Windflossengorlocs.', 'Ich war ein Narr, Iskha nicht zu glauben, als er darauf beharrte, dass mehr dahintersteckte. Er wäre nicht mein Freund, wenn er mir nicht immer zwei Schritte voraus wäre.\n\nAber wir können es ihm gegenüber wiedergutmachen, indem wir etwas unternehmen. Wenn tatsächlich Muscheln für dieses elementare Chaos verantwortlich sind, geht doch in ihr Lager und entreißt die Muscheln ihren glitschigen Händen.\n\nBringt haufenweise Wind- und Wassermuscheln her, damit Iskha genug hat, um nach Herzenslust zu forschen.', '', '', '', '', '', '', 47187),
(66105, 'deDE', 'Lösung mit dem Skalpell', 'Tötet $1oa |4Tobendes:Tobende; Wasser und $1oa |4Tobenden Wind:Tobende Winde;.', 'Ich glaube, wir können von hier aus sicher genug Daten sammeln, aber...\n\nTharu ist ein herausragender Ökologe und er ist ein Mann der Tat. Dennoch ist das Ökosystem fragil, und wir könnten es beschädigen, wenn wir nicht vorsichtig sind. Ich gebe allerdings zu, dass wir nicht mehr viel Zeit haben.\n\nEs könnte sich vielleicht lohnen, ihn etwas zu verwöhnen.\n\nDie wütenden Elementare zu erledigen, sollte uns etwas Zeit verschaffen, ohne dass es unsere Forschung behindert. Aber achtet darauf, sie in gleichen Zahlen zu erledigen... Wir wollen das Gleichgewicht ja nicht noch weiter stören.', '', '', '', '', '', '', 47187),
(66104, 'deDE', 'Forensische Ökologie', 'Seziert die Gorlocleichen.', 'Ich weiß nicht mehr weiter, $n. Tharu und ich haben uns durch fast alle Leichen gewühlt, nur um am Ende zu stolpern, weil wir uns nicht auf einen Ansatz einigen können. Wenn er mir bloß zuhören würde!\n\n<Ökologe Iskha seufzt.>\n\nDer Stress durch die Situation setzt uns beiden zu. Ich habe bislang nicht einmal eine belastbare Hypothese.\n\nIhr seht aus, als würde Euch so schnell nichts auf den Magen schlagen. Könntet Ihr vielleicht die letzten beiden Gorlocs übernehmen? Ihr könnt Euch mein Skalpell borgen.', '', '', '', '', '', '', 47187),
(66103, 'deDE', 'Bemüht, jeden Wunsch zu erfüllen', 'Stellt das Können von $1oa Schwarzkrallenassassinen und -rächern am Obsidianbollwerk auf die Probe.', 'Wir müssen mehr Truppen aussenden, um die Obsidianzitadelle zu verteidigen. Jetzt, da wir Fuß gefasst haben, ist es wichtig, die Versorgung an frischen Rekruten nicht abreißen zu lassen.\n\nWir verfügen über zusätzliche Reservetruppen am Obsidianbollwerk. Die könnten uns den Rücken stärken.\n\nIm Prinzip sind sie gut ausgebildet, aber sie könnten davon profitieren, wenn jemand mit Eurer Erfahrung und Eurem Talent ihre Kampfkünste auf die Probe stellen würde. So stellen wir fest, ob sie wirklich bereit sind.', '', '', '', '', '', 'Trefft Euch mit Fao dem Unerbittlichen beim Obsidianbollwerk.', 47187),
(66101, 'deDE', 'Vom Himmel hoch', 'Nutzt die Scheibe des Feldmessers, um in den Himmel zu springen und die Umgebung auszuspähen.', 'Toddy und Naleidea haben einen sofortigen Untersuchungsbericht über die Umgebung angefordert.\n\nZum Glück habe ich ein verzaubertes Teleskop und eine Feldmesserscheibe, die uns helfen werden, nahegelegene Gebiete aus der Sicherheit der Wolken heraus auszuspähen.\n\nLeider habe ich tödliche Höhenangst und kann mich nicht überwinden, das Gerät zu betreten.\n\nIhr habt keine Höhenangst, oder?', '', '', '', '', '', '', 47187),
(66100, 'deDE', 'Gewichtiger Nachschub', 'Sammelt $1oa Säcke an Vorräten der Wegbehüterin.', 'Diesmal hab ich es echt vermasselt. Ich wollte mir nur kurz die Beine vertreten und kam gerade noch rechtzeitig zum Lager zurück, um mitanzusehen, wie sich die Tarasek alles unter den Nagel rissen, was nicht festgetackert war.\n\nDiese Vorräte waren teuer und ich kann nicht einfach um Hilfe bitten, um neue zu besorgen! Meine Schwester Nori hält mich jetzt schon für eine Versagerin.\n\nWenn Ihr sowieso das Tal passiert, könntet Ihr vielleicht die Augen nach verlorenen Säcken mit Vorräten offenhalten?', '', '', '', '', '', '', 47187),
(66087, 'deDE', 'Sperrstunde', 'Unterstützt die Zeitwanderer und vernichtet zeitverlorene Gegner, stärkt bronzene Verbündete, holt verlorene Artefakte zurück und schließt Zeitrisse in den Wandernden Sanden.', 'Diese Vorstöße strapazieren diese Zeitlinie, bis sie zerbricht. Wenn wir nur die Reihe unserer Zeitwanderer vollständig wäre!\n\nObwohl Ihr neu am Stab seid, sagt man mir, dass Ihr uns sehr geholfen habt. Mit zusätzlichem Ansporn könntet Ihr unserer Sache vielleicht noch mehr helfen.\n\nNormalerweise würde ich Euch gründlich ausbilden, aber es sind... ungewöhnliche Zeiten. Nehmt diese Rolle des fortgeschrittenen Wissens und nutzt sie, um die Eindringlinge zurückzudrängen! Aber beeilt Euch, die Effekte sind vorübergehender Natur.', '', '', '', '', '', '', 47187),
(66085, 'deDE', 'Könnten wir die Zeit zurückdrehen', 'Schließt die Zeitrisse mit Siaszerathel in den Wandernden Sanden.', 'Ein anständiger Zeitwanderer lässt keine Krise halb geklärt. Warum warten und lernen, wenn wir die Werkzeuge, die wir brauchen, bereits besitzen?\n\nDa Ihr nach wie vor meinen Stab habt, habe ich mir Ersatz besorgt. Den vermisst bestimmt niemand. Mein Plan lautet wie folgt: Wir schließen uns bei diesen Rissen zusammen und retten gemeinsam den Tag! Alle Tage, genaugenommen. Entschuldigung, dieser Zeitkram ist noch verwirrend für mich.\n\nWas sagt Ihr? Das sollte doch leicht genug sein, nicht wahr?', '', '', '', '', '', '', 47187),
(66084, 'deDE', 'Zeiten wie diese', 'Sammelt $1oa Temporalrückstände von zeitverlorenen Gegnern in den Wandernden Sanden.', 'Trotz des kleinen Malheurs bei der Ausbildung glaube ich, dass Ihr bereit seid, um uns hier zu helfen.\n\nDie Verzerrungen im Tal erlauben verschiedenen Zeitperioden, in unsere überzufließen. Uns ist noch ein Rätsel, warum diese Zeitlinien miteinander verbunden sind, und das ist beunruhigend. Wir brauchen mehr Informationen.\n\nBitte seht, ob Ihr etwas über die Kreaturen Erfahrung bringen könnt, die aus den verschiedenen Zeitlinien hierherkommen. Sicherlich hinterlassen sie bei der Passage irgendwelche Rückstände. Wenn wir sie untersuchen, finden wir hoffentlich einen Weg, diese Krise zu meistern.', '', '', '', '', '', '', 47187),
(66083, 'deDE', 'Fühlt sich an, wie beim ersten Mal', 'Sprecht mit Andantenormu und nehmt an der Zeitwandererausbildung teil.', 'Die Zeitwege zu behüten, ist eine gefährliche Aufgabe.\n\nAuch wenn Ihr $gkein Zeitwanderer:keine Zeitwanderin; seid, glaubt Botschafterin Chronormu, dass Ihr eine große Hilfe sein werdet. Aber damit Eure Sicherheit gewährleistet ist, müssen wir Euch ordentlich ausbilden.\n\nLeider sind unsere Ausbilder immer noch vermisst. Ich werde mein Bestes geben. Schauen wir mal, wie wir uns anstellen. Ich weiß, dass die Botschafterin sich auf uns beide verlässt.', '', '', '', '', '', '', 47187),
(66082, 'deDE', 'Zeit in der Flasche', 'Sammelt Zeitenergie von erlegten zeitgeladenen Wildtieren im Wallenden Wald von Thaldraszus.', 'Toll! Der Zeitwandererstab ist intakt! Aber er ist leer.\n\nIch weiß! Ihr könnt ihn mit der Temporalenergie wieder aufladen, die sich hier in der Natur ansammelt. Das bedeutet leider auch, dass Ihr die betroffenen Waldlebewesen besiegen müsst. Die Energien machen sie gefährlich und instabil und wir hätten die Population ohnehin dezimieren müssen...\n\nManchmal muss man für das größere Wohl Opfer bringen. Könnt Ihr helfen? Ich brauche noch einen Augenblick.', '', '', '', '', '', '', 47187),
(66081, 'deDE', 'Die Zeit läuft ab', 'Sammelt $1oa Temporalsammler im Wallenden Wald von Thaldraszus.', 'Wegen des Angriffs auf den Bronzetempel läuft überall Temporalenergie aus.\n\nDie Zeitwanderer haben überall im Wald Sammelgefäße aufgestellt, um die Magie aufzufangen. Alles, was gesammelt wird, kann als zusätzliche Macht verwendet werden! Das ist gut, denn diese Krise frisst Ressourcen.\n\nIch sollte die Gefäße einsammeln, aber ich muss erst noch Luft schnappen.\n\nKönntet Ihr sie für mich holen?', '', '', '', '', '', '', 47187),
(66080, 'deDE', 'Zeitprobleme', 'Findet die vermisste Rekrutin im Wallenden Wald in Thaldraszus.', 'Hallo, $C. Ihr kommt genau zur rechten Zeit!\n\nAm Tempel geht etwas vor sich und sorgt dafür, dass sich die Zeitwege destabilisieren und ins Tal überlaufen. Nicht nur das, wir vermissen auch einige Zeitwanderer!\n\nDeshalb haben wir zusätzliche Hilfe angefordert, doch eines unserer neusten Mitglieder ist noch nicht angekommen.\n\nKönntet Ihr sie suchen gehen? Da sich die Zeit im Bereich um das Tal herum im Wandel befindet, wissen wir nicht, welche Gefahren dort lauern!', '', '', '', '', '', '', 47187),
(66079, 'deDE', 'Furorion wartet', 'Trefft Euch mit Furorion am Obsidianbollwerk.', 'Diese Eier repräsentieren eine neue Generation der Drachenheit. Sie müssen beschützt und gehegt werden. Und doch... ist mein Herz voller Schmerz und ich sorge mich um Furorion. Ich fürchte, seine sture Entschlossenheit macht ihn geradezu tollkühn.\n\nIm Laufe der Jahre habe ich Eure treue Freundschaft zu schätzen gelernt, $n. Vielleicht könnt Ihr an meiner statt gehen und ihm helfen.\n\nIhr findet ihn am Obsidianbollwerk. Und bitte, gebt auf ihn acht. Von seinem Schwarm sind nur noch so wenige übrig.', '', '', '', '', '', 'Trefft Euch mit Furorion beim Obsidianbollwerk.', 47187),
(66078, 'deDE', 'Scharfes Training', 'Stellt das Können von $1oa Schwarzkrallenassassinen und -rächern auf die Probe.', 'Ich habe die Schwarzkrallen seit Jahren gehegt, ausgebildet und ermutigt, nach den gleichen Höhen zu streben, die Ihr erreicht habt.\n\nSie mögen nicht die gleichen hehren Ziele erreicht haben wie Ihr, doch sie zeichnen sich auf ihre Weise aus. Sie machen mich stolz.\n\nEs wäre uns allen eine Ehre, wenn Ihr ihr Können auf die Probe stelltet. Ich glaube, Ihr werdet in ihnen ein Stück von Euch selbst wiedererkennen.', '', '', '', '', '', '', 47187),
(66076, 'deDE', 'Uralter Flunker', '', '', '', '', '', '', '', '', 47187),
(66074, 'deDE', 'Urscythidenkönigin', '', '', '', '', '', '', '', '', 47187),
(66071, 'deDE', 'Fliegende Rocs', 'Unterstützt $1oa verletzte Blaufederrocs.', 'Mein Name ist Professorin Harleen Hohnzirper, berühmte Ornithologin der Extraklasse! Ich bin hergekommen, um die mythischen Blaufederrocs der Dracheninseln zu studieren, aber ich schätze, wir haben jetzt größere Hühnchen zu rupfen.\n\nIch nehme mal an, dass diese Harpyien aus Kalimdor kamen, als die Inseln sich öffneten. Sie sind hoch invasiv und veranstalten ein Festmahl, wie man es sonst nur bei Ogern am Buffet des Bilgewasserkasinos sieht.\n\nGeben wir den einheimischen Rocs hier die Chance, sich zu wehren. Nehmt dieses Medizinset und verwendet es, um die Verletzten wieder auf die Beine zu bringen.', '', '', '', '', '', '', 47187),
(66057, 'deDE', 'Wiederherstellen der Zuversicht', 'Repariert den Obsidianschwurstein.', 'Die zerbrochenen Fragmente wurden wieder zusammengefügt. Wir sind bereit, den Schwurstein zu reparieren.\n\nNun geht und helft Furorion, die Reparatur fertigzustellen.', '', '', '', '', '', 'Trefft Furorion am Obsidianthron', 47187),
(66056, 'deDE', 'Eine neue Zukunft schmieden', 'Bereitet die Schmiede des Erdwächters vor.', 'Die Schmiede des Erdwächters ist die mächtigste aller Drachenschmieden. Unsere Vorfahren schmiedeten darin die stärksten Waffen und Rüstungen, um Azeroth zu verteidigen.\n\nDas Feuer der Schmiede weist die nötige Kraft auf, um die zerbrochenen Fragmente des Schwursteins neu zusammenzufügen.\n\nLasst uns gehen und die Schmiede für die bevorstehende Arbeit vorbereiten.', '', '', '', '', '', 'Bringt die Aschenscherbenkohle zu Schmiedemeister Bazentus.', 47187),
(66055, 'deDE', 'Eine zerrüttete Vergangenheit', 'Findet $2oa Schwursteinfragmente.', 'Der Schwurstein ist beschädigt, es fehlen Teile.\n\nTut, was Ihr könnt, um die Fragmente zu beschaffen! Vielleicht kann man den Stein irgendwie reparieren!', '', '', '', '', '', '', 47187),
(66049, 'deDE', 'Obsidianschwurstein', 'Findet den Obsidianschwurstein.', 'Als Neltharion zum Erdwächter wurde, leistete er einen Schwur, die Welt zu behüten, $n. Dass er die tiefsten Orte der Erde schützen und mit seinem Schwarm als Azeroths Verteidiger dienen würde. Der Obsidianschwurstein repräsentiert dieses Versprechen.\n\nWir müssen den Stein aktivieren und die Dracheninseln wissen lassen, dass der schwarze Drachenschwarm zurückgekehrt ist!\n\nFolgt mir, $n.', '', '', '', '', '', '', 47187),
(66048, 'deDE', 'Beste Pläne und Absichten', 'Besprecht die Pläne mit verschiedenen Mitgliedern von Furorions Streitkräften.', 'Die Djaradin anzugreifen, die die Obsidianzitadelle kontrollieren, wird keine leichte Aufgabe. Selbst mit Furorion und seinen Schwarzkrallenstreitkräften müssen wir uns auf einen harten Kampf gefasst machen. Furorion mag sich seiner Sache sicher sein, aber... ich bin nicht so siegesgewiss.\n\nVielleicht können wir mit den Assistenten sprechen, die bei der Strategieplanung helfen, um Verbesserungen vorzuschlagen.', '', '', '', '', '', 'Berichtet Furorion am Obsidianbollwerk von Euren Entdeckungen.', 47187),
(66044, 'deDE', 'Erstürmung der Mauern', 'Schaltet die drei Belagerungsarmbrüste und den Champion Choruk aus.', 'Sabellian und die anderen Drachen halten die Djaradin fürs Erste zurück. Wir müssen schnell sein und die hohen Türme sichern, um unseren Sieg sicherzustellen.\n\nWir beide schalten die Belagerungsarmbrüste aus, die uns von oben bedrohen.\n\nLasst mich wissen, sobald Ihr bereit seid.', '', '', '', '', '', 'Trefft Euch mit Furorion.', 47187),
(66040, 'deDE', 'Zurück in die Zukunft', 'Verteidigt Eure Verbündeten gegen das Schwarze Imperium, bis das Temporalportal errichtet wurde.', 'Wir werden nicht mehr durch die Zeiten fallen, aber wir sind weit in die Vergangenheit gereist. Seeehr weit. \"Die-Titanen-waren-noch-nicht-auf-Azeroth\"-weit. Wieder nach Hause zu kommen, wird... keine leichte Aufgabe.\n\nAber wir Drachen können es schaffen!\n\nHaltet Ihr uns bitte diese Schergen des Schwarzen Imperiums vom Leib. Es sollte nicht allzu lang dauern!\n\nSchätze ich.\n\nVermutlich.\n\nMacht Euch keine Gedanken! Haltet einfach nur diese grässlichen Biester fern und wir kümmern uns um den Rest! Ganz einfach!', '', '', '', '', '', '', 47187),
(66039, 'deDE', 'Chromiezeit', 'Findet Chromie und schließt das Temporalstabilisierungsritual ab.', 'Das... das ist das Schwarze Imperium. Wir sind tatsächlich sehr weit in die Vergangenheit gereist.\n\nSeht! Dort sind Botschafterin Chronormu und Eternus! Wir müssen uns beeilen und das Ritual zu Ende bringen.\n\nSelbst meine Neugier ist nicht groß genug, als dass ich herausfinden wollte, wo sie beim nächsten Mal landen.', '', '', '', '', '', '', 47187),
(66038, 'deDE', 'Rennt durch die Zeit!', 'Rast durch die Zeit und folgt dem Pfad von Chromie und Eternus.', '$n, wir müssen rasch handeln, um Botschafterin Chronormu einzuholen, und das meine ich ganz wörtlich.\n\nZera und ich tun, was wir können, damit wir schneller Fortschritte machen. Wir müssen jedoch so gut es geht vermeiden, uns zu sehr in dieser Zeitperiode zu verfangen. Andernfalls werden wir noch langsamer und erwischen die Botschafterin womöglich nicht, bevor sie an Nozdormus Magie verloren ist.\n\nWir haben keine Sekunde zu verschwenden!\n\n|cFF0000FF(Wenn Ihr diese Quest akzeptiert, beginnt ein Timer.)|r', '', '', '', '', '', '', 47187),
(66037, 'deDE', 'Zurück in die Realität', 'Kehrt zu Nozdormu in die Gegenwart zurück.', 'Wir konnten Botschafterin Chronormus Verbindung zu unserer Zeit verstärken. Ich bin mir sicher, wenn wir sie wiederfinden, können wir das Ritual beenden.\n\nLasst uns fürs Erste wieder in unsere Gegenwart zurückkehren, in eine Welt mit... deutlich weniger Murlocs.', '', '', '', '', '', '', 47187),
(66036, 'deDE', 'Mugurlglrlgl!', 'Murglgulglrrlglgul!', 'Mrglgulglrrlglgul! Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<Ihr seid Euch nicht sicher, was genau er Euch sagen will, aber er gestikuliert wild, als würde er auf jemanden oder etwas einstechen. Dieser Murloc will wohl, dass Ihr etwas tötet.>', '', '', '', '', '', '', 47187),
(66035, 'deDE', 'Murlocpartikel', 'Laugt $1oa Temporalpartikel aus.', 'Eine alternative Zeitlinie, die aus Murlocs entsprungen ist?!\n\nVerzeiht meine egoistische Bitte, aber würdet Ihr einige Partikel Temporalenergie einsammeln, während Ihr nach Botschafterin Chronormu sucht?\n\nLauft einfach in die Partikel hinein und Euer Stab sollte den Rest erledigen. Ich werde die Daten später analysieren... wenn wir nicht gerade auf Reisen durch die Risse in Azeroths verschiedenen Realitäten sind.', '', '', '', '', '', '', 47187),
(66033, 'deDE', 'In die... Vergangenheit?', 'Nehmt das Portal und trefft Euch mit Andantenormu in Azmerloth.', 'Es ist bedauerlich, dass wir Chronormu nicht stabilisieren konnten. Aber es gibt einen weiteren Ort, an dem wir sie eventuell erwischen und ihren Sturz durch die Zeit stoppen können.\n\n<Nozdormu runzelt die Stirn.>\n\nDie Einblicke in die Vergangenheit dieser Zeitlinie sind... seltsam. Selbst verglichen mit einigen der Visionen, die ich im Laufe meines Lebens beobachtet habe.\n\nSeid vorsichtig, $n. Ich bin nicht sicher, was Euch erwartet, aber es ist mächtig und es... kommt mir irgendwie bekannt vor.', '', '', '', '', '', 'Nehmt das Portal und trefft Euch mit Andantenormu in Azmerloth.', 47187),
(66032, 'deDE', 'Rückkehr in die Gegenwart', 'Kehrt zu Nozdormu in die Gegenwart zurück.', 'Diese Zeitlinie ist düster und chaotisch. Die Störung hier war schwerwiegend. Ich werde eine Weile in dieser Zeitlinie bleiben und mich um die verbleibenden Wellen kümmern, die erscheinen könnten.\n\nKehrt zu Nozdormu zurück. Er wird von Eurem Erfolg erfahren wollen, auch wenn er weniger umfassend war, als wir es uns gewünscht hatten.', '', '', '', '', '', '', 47187),
(66031, 'deDE', 'Zeit verschaffen', 'Sammelt Elementaressenz für das Überlebendenlager.', 'Ich schätze, es sollte mich nicht überraschen, hier zu sein.\n\nDas ist nicht das Azeroth, das ich wollte, aber es ist das, was ich bekommen habe. Wir kämpfen dafür, das zu erhalten, was noch übrig ist, und dafür, unsere Welt zurückzubekommen... Aber Eure Ankunft hat für etwas Ärger gesorgt.\n\nWir nutzen die Essenz dieser Elementare da draußen für unseren Schutz. Seht Ihr diesen Schild? Das ist das Einzige, das uns davor bewahrt, entdeckt und vernichtet zu werden, und Ihr habt uns unserer Ressourcen beraubt. Bringt uns etwas von dieser Essenz zurück, dann überleben wir womöglich einen weiteren Tag.', '', '', '', '', '', '', 47187),
(66030, 'deDE', 'Widerstand ist nicht zwecklos', 'Heilt Widerstandskämpfer in der Zukunft der Primalisten.', 'Die temporalen Wellen haben den Leuten hier Probleme bereitet. Feinde tauchen auf, wo sie zuvor nicht waren, oder sind viel mächtiger, als sie sein sollten. Diese Veränderungen sind recht klein, aber verheerend.\n\nIch bitte Euch, den Widerstandskämpfern hier zu helfen. Heilt ihre Wunden, damit sie weiterkämpfen können. Setzt ihre Zeitlinien auf die richtigen Pfade zurück, so als hätten sie nie mit unserer interagiert. Es ist nicht viel, aber es ist alles, was wir für sie tun können.', '', '', '', '', '', '', 47187),
(66029, 'deDE', 'Temporalabstimmung', 'Wendet den Chronokristall in der Zukunft der Primalisten auf Eternus und Chromie an, um zu verhindern, dass sie weiter durch die Zeit fallen.', 'Chronormu und Eternus fallen durch die Zeit, aber ich spüre, dass sie hin und wieder anhalten. Diese kurzen Momente sind unsere Gelegenheit, sie zu finden.\n\n<Nozdormu beschwört einen kleinen Chronokristall herbei.>\n\nIch habe diesen Kristall mit meiner Macht sowie meiner eigenen Zeitresonanz erfüllt. Sie sind in eine... beunruhigende potenzielle Zukunft geraten. Findet sie und nutzt ihn. Hoffentlich könnt Ihr damit ihre temporale Position fixieren, bevor sie uns wieder entgleiten.', '', '', '', '', '', 'Kehrt zu Nozdormu in die Gegenwart zurück.', 47187),
(66028, 'deDE', 'In die Zukunft!', 'Reist in die Zukunft der Primalisten.', 'Ich habe Chronormus und Eternus\' Spur in eine potenzielle Zukunft verfolgt. Ich weiß nicht, was Ihr dort finden werdet, nur, dass sie dunkel und chaotisch ist.\n\nSoridormi hat einige unserer Zeitwanderer vorweg in diese Zukunft gebracht, um unsere Verbindung zu dieser Zeit aufrechtzuerhalten. Ihre beträchtliche Macht wird benötigt, um das Portal offen zu halten, sie wird sich also auf Eure Hilfe verlassen müssen.\n\nSoridormi kann Euch weitere Anweisungen geben, wenn Ihr sie aufsucht.\n\nBeeilt Euch, $n. Findet Chronormu.', '', '', '', '', '', 'Sprecht mit Soridormi in der Zukunft der Primalisten.', 47187),
(66027, 'deDE', 'Ruf an die blauen Drachen', 'Seht zu, wie Kalecgos den blauen Drachenschwarm zusammenruft.', 'Ich kann mich nicht länger davor fürchten, die blauen Drachen zu vereinen, $n. Es ist besser für uns, eine Familie zu sein, als... nur ein Schatten unseres einstigen Selbst.\n\nSelbst wenn ich den Schwurstein nicht wieder beanspruchen kann, werde ich seine Macht dennoch nutzen können, um eine Nachricht an alle blauen Drachen zu senden.\n\nEs ist Zeit, dass sie... von ihrem Aspekt zu hören bekommen.', '', '', '', '', '', '', 47187),
(66026, 'deDE', 'Schnelles Handeln ist geboten', 'Trefft Brena bei Brackenfell.', 'Der Grund für diese Angriffe muss in den Brackenfellgnollen selbst zu finden sein.\n\nWir kämpfen seit Generationen gegen sie, aber normalerweise sind sie nicht mehr als lästige Fliegen.\n\nUns bleibt keine andere Wahl, als direkt zu handeln. Diese Fäulnis wird sonst das Gleichgewicht im Azurblauen Gebirge zerstören, inklusive dessen, was Ihr sucht.\n\nTrefft uns außerhalb von Brackenfell. Wir werden jede Hilfe brauchen können, die wir bekommen.', '', '', '', '', '', '', 47187),
(66025, 'deDE', 'Bedrohung der Nokhud', 'Besprecht die nächsten Schritte.', 'Klan Nokhuds Armee nimmt Maruukai ein.\n\nLasst uns unsere nächsten Schritte in den Kammern des Khans besprechen. Wir müssen für die Sicherheit der Maruuk sorgen.', '', '', '', '', '', '', 47187),
(66024, 'deDE', 'Den Rücken freihalten', 'Tötet Wache Bahir.', 'Die Nokhud sind vernarrt in die uralten Kriegsgeschichten unseres Volkes. Eigentlich sind sie schwache, herumalbernde Kinder. Und blitzartig haben sie ihre Verbindung zu Ohn\'ahra durchtrennt.\n\nNun! Wenn sie den Weg der Verderbnis einschlagen, um Krieg zu beginnen, so werden wir ihnen entgegenkommen.\n\nNatürlich behielt Bahir das Kommando, um seine Flucht zu decken. Ihr Blut wird schon bald den Boden tränken.', '', 'Bahir, dem Balakar diese Verantwortung anvertraut hat, musste lange auf diesen Moment warten.', 'Wache Bahir', '', '', 'Kehrt zur Khanam Matra Sarest zurück.', 47187),
(66023, 'deDE', 'Waffenstillstand gebrochen', 'Tötet $1oa Streitkräfte der Nokhud.', 'Balakar bringt Schande über seinen Klan. Er führt sie in einen Sturm, geblendet durch seine Gier nach Macht.\n\nIhr Betrug enthüllt ihre Schwäche. Macht sie nieder.', '', '', '', '', '', '', 47187),
(66022, 'deDE', 'Die Khanam Matra', 'Berichtet Khanswache Akoto, um an Gemisaths Audienz mit der Khanam Matra teilzunehmen.', 'Ich kann nicht in den Gebieten der Zentauren bleiben, ich muss so schnell wie möglich in die Gärten zurückkehren.\n\nDie Khanam Matra hat zugestimmt, unser Hilfegesuch anzuhören. Sie erwartet meine Ankunft oben auf dem Krutal, dem zentralen Gebäude von Maruukai.\n\nAuch wenn ich zunächst mit ihr alleine sprechen muss, seid Ihr herzlich eingeladen, Euch uns anzuschließen.', '', '', '', '', '', '', 47187),
(66021, 'deDE', 'Unwillkommener Fremdling', 'Besiegt $1oa Zentauren der Nokhud.', 'Hah! Seht Euch an. Schwach. So wie diese mickrigen Jäger, die Euch hergebracht haben.\n\nIhr möchtet die Nokhud kennenlernen? Unsere Sprache ist der Kampf.\n\n\"Der Tabarr\", so nennt sich unser Kampfritual. Wir trainieren. Wir üben. Dadurch werden wir hart. Nun gibt es keine Schwäche in unserem Klan.\n\nSchon zu viele Worte. Geht, übt.', '', '', '', '', '', 'Kehrt zu Späherin Tomul zurück.', 47187),
(66020, 'deDE', 'Omen und Räucherwerk', 'Sammelt $1oa Süßnuckelblüten, mahlt sie zu Süßnuckelräucherwerk und helft dann Ohn Seshteng beim Ritual.', 'Ich erzählte Tigari Khan vom Omen, das wir erhalten hatten, bevor wir Maruukai betraten. Sie äußerte ihre Bedenken, da sich der Wind auch für sie kalt anfühlte.\n\nWir kultivieren hier bestimmte Blumen. Wir nehmen ihre Blüten und zerkleinern und verbrennen sie, um eine tranceähnliche Wirkung zu erzeugen. So vertiefen wir unsere Verbindung zu den Omen.\n\nIch bitte Euch, solche Blumen zu sammeln, damit wir mit ihnen ein Räucherwerk machen können. Vielleicht erfahren wir mithilfe meiner Khan mehr über Ohn\'ahras Not.', '', '', '', '', '', '', 47187),
(66019, 'deDE', 'Unsere Ahnen ehren', 'Helft Qariin Dotur dabei, ein Mahl für die Ahnen vorzubereiten.', 'Unsere Ahnen schreiten an unserer Seite auf den Winden von Ohn\'ahra, sie führen und beschützen uns. Alle Maruuk, tote und lebendige, versammeln sich unter einem Waffenstillstand am Khural.\n\nDer Geruch dieses Mahls ruft unsere Vorfahren zu unserem Feuer. Wenn sie kommen, beginnt der Khural.', '', '', '', '', '', '', 47187),
(66018, 'deDE', 'Klan Nokhud', 'Begleitet Tomul zu Wache Bahir.', '<Während Sansok Khan in Gebärden spricht, formuliert Okir die Worte.>\n\nKlan Nokhud ist als neuester an die Macht gekommen. Ihr verstorbener Khan, Jhakan, hat eine mächtige Armee aufgestellt, um sich Gebiete von ihren Vorgängern anzueignen. Das ist der Brauch unseres Volkes.\n\nWährend Jhakan sich Respekt verdient hat, trifft das nicht auf seinen Sohn zu. Balakar hat seinen Vater getötet und die Kontrolle über den Klan ergriffen. Seitdem sind sie noch engstirniger geworden. Aber um die Maruuk zu verstehen, müsst Ihr sie verstehen.', '', '', '', '', '', 'Trefft Späherin Tomul in der Nähe des Lagers der Nokhud.', 47187),
(66017, 'deDE', 'Klan Ohn\'ir', 'Trefft Ohn Seshteng bei den Mystikerbecken.', '<Während Sansok Khan in Gebärden spricht, formuliert Okir die Worte.>\n\nDie Mystiker unserer Länder, so wie Ohn Seshteng, gehören zum Klan Ohn\'ir. Der Klan besteht nicht aus Familien, sondern eher aus Zentauren aus allen Teilen der Ebenen mit einer angeborenen Verbindung zu Ohn\'ahra. Sie verbringen ihr Leben damit, diese Verbindung zu pflegen und ihre Fähigkeiten zu perfektionieren. Letztendlich erhalten sie Anweisungen, um unterschiedliche Klans zu beraten und unsere Länder zu beschützen.\n\nOhn Seshteng ging, um mit ihrem Khan über das Omen zu sprechen, das sie erhalten hat. Schließt Euch ihr an, um mehr über die Ohn\'ir zu erfahren.', '', '', '', '', '', 'Trefft Ohn Seshteng bei den Mystikerbecken.', 47187),
(66016, 'deDE', 'Klan Teerai', 'Meldet Euch bei Qariin Dotur.', '<Während Sansok Khan in Gebärden spricht, formuliert Okir die Worte.>\n\nKlan Teerai ist der Klan unserer Khanam Matra, unsere direkte Verbindung zu den Vorfahren der Maruuk. Sie bewahren unsere Traditionen und erzählen unsere Geschichten.\n\nUm die Maruuk zu verstehen, müsst Ihr den Klan Teerai verstehen. Eine der Töchter der Khanam Matra, Qariin Dotur, bereitet ein Mahl für unsere Ahnen vor. Helft ihr. Sie wird Euch über unser Volk lehren.', '', '', '', '', '', 'Meldet Euch bei Qariin Dotur.', 47187),
(66015, 'deDE', 'Der Schwurstein der blauen Drachen', 'Begleitet Kalecgos, um den Schwurstein der blauen Drachen zu beanspruchen.', 'Das Azurblaue Gebirge hat sich fürs Erste stabilisiert, und immer mehr blaue Drachen sind aufgetaucht... genau im rechten Moment.\n\nEs ist Zeit, in die Azurarchive zurückzukehren und den Schwurstein wieder zu beanspruchen.\n\nIch möchte, dass Ihr auch anwesend seid, $n. Ihr wart während dieser Tortur eine große Bereicherung.', '', '', '', '', '', '', 47187),
(66011, 'deDE', 'In Gedenken an Ysera', 'Findet Theramus erneut.', 'Oh nein! Ich glaube, ich verstehe ihn jetzt. Theramus... er vermisst Ysera und sie kann nicht zurückkehren.\n\nKommt! Ich kann mir vorstellen, wohin er gegangen ist. Wir werden ihn nicht weiter belästigen, aber es wäre gut, ihm zu sagen, dass es uns leidtut und dass wir ihm den Abstand geben, den er braucht.\n\nWir sind füreinander da, inmitten der Natur, die uns umgibt.', '', '', '', '', '', '', 47187),
(66009, 'deDE', 'Zur Verteidigung Vakthros\'', 'Besiegt Korthrox den Zerstörer.', 'Es ist Zeit, $n. Die Streitkräfte der Primalisten in der Luft schwinden, jetzt, wo Ihr die Situation am Boden unter Kontrolle gebracht habt.\n\nRazageth hat nach einem ihrer Leutnants gerufen, um die Truppen der Primalisten zu verstärken, dank Eurer Anstrengungen.\n\nIhr müsst Euch um dieses Monster kümmern, während ich weiter gegen Razageth vordringe und Khadgar helfe.\n\nHaltet die Augen nach meiner Magie offen, während Ihr kämpft. Ich werde tun, was ich kann, um Euch zu helfen.\n\nEs ist Zeit, dass Razageth den Zorn des Aspekts der Magie zu spüren bekommt!', '', 'Einer von Raszageths Leutnants, der die blauen Drachen zerstören will.', 'Korthrox der Zerstörer', '', '', 'Sprecht mit Khadgar weiter oben in Vakthros.', 47187),
(66007, 'deDE', 'Die Luft ist rein', 'Zerstört $1oa Lavaleuchtfeuer.', 'Die Primalisten halten Kalecgos mithilfe dieser massiven Kugeln fern.\n\nWenn das so weitergeht, wird Kalecgos noch verletzt. Sollte er scheitern, kann er Raszageth nicht mehr bekämpfen.\n\nMithilfe Eures ermächtigten Edelsteins müsstet Ihr Euch als Elementar tarnen können, um vorzuschleichen.\n\nVernichtet die Kugeln mit ihm. Dann müsste Kalecgos seine Macht entfesseln können.\n\nIch werde mich darauf konzentrieren, den Turm vor Raszageth zu beschützen.', '', '', '', '', '', 'Trefft Kalecgos in einer Höhle im Vakthrosgipfel.', 47187),
(66006, 'deDE', 'Rückkehr zu Roscha', 'Bringt die Vorräte zu Hufschmiedin Roscha zurück.', 'Baba konnte sich ausruhen und Roschas Vorräte sind wieder da. Wir können zurückkehren, ohne sie zusätzlich aufzuregen.\n\nNehmt einige Kisten mit, wenn Ihr geht. Den Rest werde ich von unseren Kriegern abholen lassen.', '', '', '', '', '', '', 47187),
(66005, 'deDE', 'Medaillon einer gefallenen Freundin', 'Bringt das Medaillon einer gefallenen Freundin zu Khasar zurück.', '<Dieser zerkaute Metallbrocken war einst ein wunderschönes und bedeutendes Ornament der Zentauren der Shikaar.\n\nKhasar könnte mehr über seinen Besitzer wissen.>', '', '', '', '', '', 'Bringt das Medaillon einer gefallenen Freundin zu Khasar zurück.', 47187),
(66004, 'deDE', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'deDE', 'Ringe, sie zu binden', 'Sammelt $1oa geschmolzene Fesselringe.', 'Die Djaradin hier sind wagemutig geworden. Sie haben Flammenelementare gebunden und lassen sie durch die Gegend wüten. Die Wildtiere sind geflohen, und die Elementare sind unseren Lagern gefährlich nahe.\n\nZum Glück konnte ich eine kleine steinerne Bastion errichten, um diese feurige Flut, die die Djaradin entfesselt haben, standzuhalten... Und wir werden nicht scheitern!\n\nSammelt die magischen Ringe ein, die diese Flammenelementare binden. Wir werden die Ringe verwenden, um unsere Verteidigung gegen sie zu verstärken.', '', '', '', '', '', '', 47187),
(66001, 'deDE', 'Eine letzte Hoffnung', 'Rettet das letzte energieerfüllte Drachenei.', 'Eine ganze Brut an Welplingen ist verloren...\n\n<Sendrax richtet sich auf und schiebt ihr Kinn vor.>\n\nEs gibt einen Ort, an dem wir noch nicht nachgesehen haben. Die große Ritualstätte, an der dieser Protodrache die Eier abgelegt hat.\n\nStellen wir uns gemeinsam ihrer grausamen Verteidigung entgegen, $p. Retten wir, so viele wir können.', '', '', '', '', '', '', 47187),
(66000, 'deDE', 'Bibliothek von Alexstrasza', 'Rettet $1oa Werke von kultureller Bedeutung.', '<Die Seiten dieses Buchs sind völlig verkohlt.\n\nDie Primalisten verbrennen offenbar gezielt die uralten Folianten und bedrohen damit die Geschichte der Drachenschwärme selbst. Es ist, als wollten die Primalisten die Drachenschwärme geradezu aus der Geschichte tilgen.\n\nRettet, was Ihr könnt.>', '', '', '', '', '', '', 47187),
(65999, 'deDE', 'Blutrünstig', 'Tötet $1oa Eindringlinge der Primalisten.', 'Kommandant Lethanak warnte uns Rekruten, dass die Sturmfresserin Raszageth Berichten zufolge aus ihrem Gefängnis entkommen sein soll. Wie es scheint, sind ihre Untergebenen ihr gefolgt und bedrohen jetzt alles, was uns lieb und teuer ist.\n\nSie kommen schnell voran. Bei der letzten Patrouille wurden diese Ruinen noch als verlassen gemeldet.\n\nWir müssen die Primalisten hier aufhalten.\n\nFür die Lebensbinderin, und für alle Drachenschwärme!', '', '', '', '', '', '', 47187),
(65998, 'deDE', 'Zukunft der Schwärme', 'Rettet die Rubindracheneier.', 'Einem Drakoniden kann nach dem Abschluss keine höhere Aufgabe übertragen werden, als jedes einzelne Drachenei mit dem eigenen Leben zu verteidigen.\n\nDafür werden wir ausgebildet. Dafür existieren wir.\n\nIch kann mich nicht länger verstecken und tatenlos zusehen, $p. Die Primalisten gefährden die gesamte Zukunft der Drachenschwärme, indem sie diese Eier stehlen und mit Energie erfüllen!\n\nWir sind deutlich in der Unterzahl, aber werdet Ihr dennoch an meiner Seite stehen? Werdet Ihr kämpfen, um die Drachenschwärme zu retten?', '', '', '', '', '', '', 47187),
(65997, 'deDE', 'Sendrax auf der Spur', 'Findet Sendrax in den Ruinen des Konservatoriums der Lebensbinderin.', 'Kadettin Sendrax kam hier vor nicht allzu langer Zeit vorbei.\n\nSie hatte den Befehl von Kommandant Lethanak für alle Drakoniden, sich bei den Lebensbecken zu sammeln. Unser gesamtes Verteidigungsregiment ist kurz darauf in diese Richtung aufgebrochen.\n\nUnsere Späher waren zu der Zeit jedoch noch auf Patrouille in den alten Ruinen, also ist sie ihnen hinterher, um auch ihnen die Befehle zu übermitteln.', '', '', '', '', '', 'Trefft Sendrax im Konservatorium der Lebensbinderin.', 47187),
(65996, 'deDE', 'Veteranen zur Hilfe', 'Helft den verletzten Wachen und findet Sendrax.', 'Kommandant Lethanak war wie gewohnt verständnisvoll. Wir werden die Hilfe unserer erfahrensten Wachen benötigen, um die Bedrohung abwenden zu können. Sie zu versammeln, war der perfekte Auftrag für eine junge Kadettin wie Sendrax, doch vielleicht könnte sie etwas Unterstützung brauchen.\n\nSendrax\' Pfad führt sie nach Westen, der möglicherweise von dieser aufkommenden Bedrohung überwältigt wurde. Sie werden ebenfalls Unterstützung brauchen. Nehmt dieses Gebräu und unterstützt sie.', '', '', '', '', '', 'Trefft Sendrax im Außenposten des Konservatoriums.', 47187),
(65995, 'deDE', 'Die Obsidianzitadelle', 'Bringt die Pläne der Qalashi zu Furorion.', '<Auf den ersten Blick scheint es sich dabei um interne Kommunikation zwischen den Djaradinlagern zu handeln.\n\nDie Worte \"Obsidianzitadelle\" springen Euch ins Auge.\n\nMöglicherweise wäre Furorion hieran interessiert.>', '', '', '', '', '', '', 47187),
(65994, 'deDE', 'Djaradingerechtigkeit', '', '', '', '', '', '', '', '', 47187),
(65993, 'deDE', 'Stimmungskiller', 'Tötet Fleischwölfin Sotok in der Schuppenknackerfeste.', 'Ah, ja.\n\nKurz nach meiner Ankunft habe ich gesehen, wie die Anführerin dieser Riesen von ihrem Raubzug zurückkehrte. Irgendwo im Lager feiert sie ihren Sieg.\n\nEs wäre eine Schande, wenn jemand ihre Feierlichkeiten stören würde, meint Ihr nicht auch?', '', 'Die Drahtzieherin des Angriffs auf den Drachenherzaußenposten.', 'Fleischwölfin Sotok', '', '', 'Trefft Furorion in der Schuppenknackerfeste.', 47187),
(65992, 'deDE', 'Schwarzkralleninformationen', 'Sprecht mit Furorions Spionen, die sich in der Schuppenknackerfeste versteckt halten.', 'Während Selistra und ich ihre Blicke nach oben lenken konnten, sind Schatten durch ihre Verteidigung geschlüpft.\n\nMeine Agenten, die Schwarzkrallen, halten in ihrer Festung Augen und Ohren offen. Trefft sie und lasst sie wissen, dass Ihr auf unserer Seite steht. Sie werden Euch wertvolle Informationen über unsere Feinde übermitteln.', '', '', '', '', '', 'Trefft Furorion in der Schuppenknackerfeste.', 47187),
(65991, 'deDE', 'Zeit für eine Abrechnung', 'Trefft Furorion und Majordomus Selistra bei der Schuppenknackerfeste.', 'Kadettin Sendrax hat mich über die Pläne von Majordomus Selistra informiert. Der Lebensbinderin sei Dank für diese Hilfe. Das Einschreiten gibt uns genug Zeit, unsere Verwundeten zur Behandlung zurück zu den Lebensbecken zu bringen.\n\nIch wünschte, ich könnte Selistra Verstärkung senden, doch ich brauche meine Wachen in der Nähe der Verwundeten. Begebt Euch zur feindlichen Festung und trefft sie dort.\n\nIch wünschte, es gäbe einen anderen Weg, die Djaradin unter Kontrolle zu bekommen. Aber es geht nicht anders...\n\nIhr müsst tun, was Ihr tun müsst.', '', '', '', '', '', '', 47187),
(65990, 'deDE', 'Welpenerlösung', 'Rettet $1oa wimmernde Welplinge aus dem Drachenherzaußenposten.', 'Sie fielen über uns her, bevor wir überhaupt reagieren konnten. Meine Wachen hielten so lange dagegen, wie sie nur konnten, während wir die Kleinen und Hilflosen in Sicherheit brachten. Ich befürchte aber, dass im Außenposten noch mehr von ihnen sind.\n\nÜberquert diese Brücke und sucht nach Überlebenden.', '', '', '', '', '', '', 47187),
(65989, 'deDE', 'Djaradin auf dem Vormarsch', 'Tötet $1oa Djaradin im Drachenherzaußenposten.', 'Wir verfügen vielleicht nicht über die Streitkräfte, unseren Außenposten zurückzuerobern, aber wir müssen uns auch nicht kampflos ergeben.\n\nZeigt ihnen, dass wir immer noch Biss haben.', '', '', '', '', '', '', 47187),
(65977, 'deDE', 'Erholung der Kirin Tor', 'Rettet $1oa sterbende Magier.', 'Als die Primalisten unsere Expedition angegriffen haben, habe ich befürchtet, dass wir etliche Magier verloren hätten.\n\nAber es scheint, als hätten die Primalisten sie entführt und würden sie in diesem Moment foltern!\n\nBitte, Ihr müsst die überlebenden Magier retten. Sie mögen uns in diesem Kampf nicht unterstützen können, aber deshalb dürfen wir sie nicht im Stich lassen!', '', '', '', '', '', 'Trefft Khadgars Projektion noch tiefer in der Bergkette von Vakthros.', 47187),
(65962, 'deDE', 'Der nie endende Countdown', 'Sprecht mit Chromie, wenn Ihr bereit seid.', 'Ich hätte nie gedacht, dass ich unseren Tempel einmal retten würde, indem ich jene Sicherheitsmechanismen zerstöre, die ihn schützen sollen. Aber sei\'s drum!\n\nNachdem wir die Zeitelementare nun vernichtet haben, unsere Zeitwanderer befreit sind und unsere Wächter bereitstehen, wird es endlich Zeit, die letzte Stasisblase zu zerstören und uns um Eternus zu kümmern.\n\nLasst mich wissen, wenn Ihr bereit seid. Ich weiß, dass mit Euch an meiner Seite nichts schiefgehen kann.', '', '', '', '', '', '', 47187),
(65958, 'deDE', 'Urgewalt', 'Nutzt den Elementarfokus, um Elementarenergie aus getöteten Primalisten und Elementaren zu extrahieren.', 'Ich befürchte, es wird schwerer für mich, die Abbilder aufrechtzuerhalten. Die Primalisten konzentrieren sich zunehmend darauf, mich aus dem Himmel zu holen.\n\nAber keine Sorge... Ich habe einen Plan.\n\nIhr müsst die Kugel, die Ihr an Euch genommen habt, nutzen, um Elementarmagie getöteter Primalisten einzusammeln.\n\nDiese elementare Energie brauchen wir, um die Aufmerksamkeit ihrer Streitkräfte von mir abzulenken.', '', '', '', '', '', 'Trefft Khadgars Projektion noch tiefer in der Bergkette von Vakthros.', 47187),
(65957, 'deDE', 'Keine Zeit für Helden', 'Tötet Modak Flammenspeier, Durchbohrerin Gigra und Olphis den Geschmolzenen.', 'Unseren Beobachtungen nach zu urteilen, basiert die Gesellschaft der Djaradin auf Stärke. Die Stärksten unter ihnen dienen den anderen als Vorbild und motivieren sie zum Kämpfen.\n\nUnter den Streitkräften unter uns befinden sich einige Vertreter der mächtigsten Djaradin... Eure Ziele.\n\nIhr, $n, werdet sie persönlich ausschalten. Das sollte ihrer Moral einen entscheidenden Dämpfer verpassen.', '', '', '', '', '', '', 47187),
(65956, 'deDE', 'Krallenschlag', 'Stört die Djaradinverteidigung.', 'Mit Eurer Hilfe werden meine Schwarzkrallenassassinen die Djaradin beseitigen, die die äußeren Gebiete verteidigen. Markiert potenzielle Ziele mit kleinen Betäubungsbomben und meine Assassinen erledigen den Rest.\n\nSputet Euch und eliminiert alles, das unser Vordringen behindern könnte.', '', '', '', '', '', '', 47187),
(65955, 'deDE', 'Der beste Freund eines Zentauren', 'Befreit Khasar und trefft ihn in der Höhle.', 'Hier draußen sind wir nicht sicher, $p.\n\nDie Gorlocs haben meinen Jagdbegleiter Baba in eine Höhle im Osten gedrängt.\n\nBefreit mich, dann werden wir Baba retten. Wir treffen uns in der Höhle, sobald der Weg frei ist.', '', '', '', '', '', '', 47187),
(65954, 'deDE', 'Die Hunde loslassen', 'Befreit die Bakar der Shikaar.', 'Ich habe das Heulen und Bellen der Bakar gehört, die aus dem Lager verschwunden sind.\n\nUnsere geliebten Hunde werden in Käfigen gefangen gehalten und warten darauf, von diesen... Dingern in Stücke gerissen zu werden.\n\nWir sind unseren Begleitern gegenüber verpflichtet zu helfen. Befreit sie und werdet $gZeuge:Zeugin; der wahren Macht der Bakar der Shikaar!', '', '', '', '', '', '', 47187),
(65953, 'deDE', 'Das Ora-Keulen', 'Sammelt $1oa Totems von Gorlocschamanen.', 'Unter all dem Wahnsinn, der sich in diesem Gorlocdorf abspielt, habe ich nichts Bedenklicheres entdeckt als die Gorlocschamanen.\n\nSie sind besonders bösartig und spielen leichtsinnig mit Sturmmagie, ohne die Konsequenzen zu bedenken.\n\nDas muss ein Ende haben. Tötet sie und bringt mir ihre Totems. Unsere Mystiker werden an ihnen sehr interessiert sein.', '', '', '', '', '', '', 47187),
(65952, 'deDE', 'Legendärer Häuptling', 'Tötet Häuptling Grrlgllmesch.', 'Die Gorlocs dieses Sumpfes waren einst simple Kreaturen. Lästig, sicher, aber niemals Plünderer, Diebe oder Hundefresser.\n\nEs ist ihr Häuptling Grrlgllmesch, der sie dazu gebracht hat, sich von ihrer wahren Natur abzuwenden.\n\nSetzt ihm ein Ende, damit die Gorlocs keine Bedrohung mehr für uns darstellen.', '', 'Der mächtigste aller Gorlocs, Grrlgllmesch, hat alles bezwungen, außer seiner eigenen Verzweiflung.', 'Häuptling Grrlgllmesch', '', '', '', 47187),
(65951, 'deDE', 'Sohlenlieferant', 'Sucht den Wald nach Khasar ab.', 'Die arme Roscha! Sie hat sich so für die Karawane abgerackert, und dann stehlen diese widerlichen Gorlocs all ihre Vorräte.\n\nSie hat schon so viel verloren... Ich gebe mein Bestes, um ihr zu helfen.\n\nKhasar hat sich wahrscheinlich allein auf die Suche nach ihren Vorräten gemacht und niemandem davon erzählt. So ist er einfach. Aber er ist schon viel zu lange weg. Viele Hunde sind auch verschwunden.\n\nWürdet Ihr bitte nach Khasar und den Hunden sehen, $p?', '', '', '', '', '', 'Sprecht mit Khasar in Schlickflossendorf.', 47187),
(65950, 'deDE', 'Diebische Gorlocs', 'Bringt die gestohlenen Vorräte aus dem Schlickflossendorf zurück.', 'Ist Hufschmiedin Roscha zur Karawane eingeladen? Nein! Aber wer muss Hufeisen für die Karawane anfertigen? Hufschmiedin Roscha. Und wen bestehlen die Schlickflossen? Natürlich Hufschmiedin Roscha. Pah.\n\nIch würde ja Khasar losschicken, aber wer weiß, wo der sich gerade wieder rumtreibt?\n\nFindet meine Vorräte. Zeigt diesen Kreaturen, dass man nicht von Hufschmiedin Roscha stiehlt.\n\nLos!', '', '', '', '', '', 'Sprecht mit Khasar in Schlickflossendorf.', 47187),
(65949, 'deDE', 'Einsame Eisen', 'Bringt das Medaillon zu Hufschmiedin Roscha zurück.', 'Wenn wir uns Ohn\'ahra im Wind anschließen, hinterlassen wir diese Medaillons.\n\nObwohl ich geholfen habe, dieses Medaillon herzustellen, bin ich nicht sein rechtmäßiger Besitzer.\n\nEs sollte zu Roscha zurückgebracht werden. Es ist die letzte Erinnerung an ihre Verlobte.\n\nBringt es zu ihr, damit sie trauern und ihren Frieden finden kann.', '', '', '', '', '', '', 47187),
(65948, 'deDE', 'Risse in der Zeit', 'Nutzt die östlichen und westlichen Kristalle, um Euren Zeitwandererstab weiter zu verstärken.', 'Als der Tempel verschlossen wurde, sind die Wächter ebenfalls eingeschlossen worden. Wenn wir sie rausholen wollen, müssen wir die Stasisblase platzen lassen! Dafür braucht Ihr leider einen vollständig ermächtigten Zeitwandererstab...\n\nOh, ich weiß! Ihr könnt Energie aus den Kristallen hier auf der Plattform ziehen. Das sollte Eurem Stab genug Wumms verleihen.\n\nDie Kristalle haben selbst Stasisfelder, also reißt sie einfach heraus und absorbiert ihre Energie mit Eurem Stab.\n\nUnd keine Sorge, falls sie zerbrechen: Die Kraft wohnt ihnen weiter inne, selbst wenn sie in Stücken sind!', '', '', '', '', '', '', 47187),
(65947, 'deDE', 'Zeitfixierte Zeitwanderer', 'Befreit $1oa Zeitwanderer aus Zeitblasen.', 'Ich bin so froh, dass Ihr hier seid! Ihr müsst die Lage hier auf den Plattformen für mich stabilisieren, während Dante und Zera mir helfen, unsere ewige Drachenfreundin festzuhalten.\n\nDie Sicherheitsvorkehrungen des Tempels haben Eternus in eine Stasisblase gesperrt, als sie versuchte, die Kontrolle über unseren Schwurstein zu erlangen. Unglücklicherweise wurden einige der anderen Zeitwanderer ebenfalls von diesen Sicherheitsvorkehrungen getroffen.\n\nMit Eurem Zeitwandererstab solltet Ihr sie problemlos befreien können... Kümmert Euch nur um die wütenden Zeitlinge, die dabei auftauchen!', '', '', '', '', '', '', 47187),
(65944, 'deDE', 'Lavaeruption', 'Zerstört $1oa Lavakugeln.', 'Die Primalisten haben den Berg entzweigerissen, um ihre Streitkräfte nach Vakthros hineinströmen zu lassen!\n\nIch habe einige Lavakugeln im vorderen Korridor erspäht, die sie nutzen, um ihr elementares Chaos weiter zu verbreiten.\n\nVernichtet sie, um ihr Vorrücken zu verlangsamen. Ich werde von hier oben aus tun, was ich kann, um Kalecgos zu helfen.', '', '', '', '', '', 'Trefft Khadgars Projektion tiefer in der Bergkette von Vakthros.', 47187),
(65943, 'deDE', 'Uroffensive', 'Besiegt $1oa Primalisten in Vakthros.', 'Khadgar und ich tun unser Bestes, um die Primalisten im Himmel abzuwehren, aber wir kommen nicht näher an den Turm heran.\n\nIhr müsst ihre Truppen am Boden dezimieren, damit wir uns Raszageth nähern und sie aufhalten können, bevor es zu spät ist.\n\nKämpft Euch zu den Primalisten voraus durch. Wenn ich meine Konzentration aufrechterhalten kann, wird dort ein weiteres Abbild auf Euch warten.', '', '', '', '', '', 'Trefft Kalecgos\' Abbild tiefer in der Bergkette von Vakthros.', 47187),
(65940, 'deDE', 'Auf zerstörten Wegen', 'Reist zusammen mit der Shikaarkarawane zum Flussübergang.', 'Ich hoffe, dass Ihr nichts gegen nasse Füße habt. Der nächste Teil unserer Reise führt uns über zwei Flüsse.\n\nOhn Seshteng möchte Euch eine Geschichte über unsere gesegnete Wächterin Ohn\'ahra erzählen. Ich lasse Euch mit Freuden in ihrer Obhut.', '', '', '', '', '', '', 47187),
(65939, 'deDE', 'Der Mut der Überzeugung', 'Erlangt die Kontrolle über die Obsidianzitadelle.', 'Eine heftige Schlacht steht uns bevor, aber unser Mut und unsere Entschlossenheit werden uns ihre zahlenmäßige Überlegenheit überwinden lassen.\n\nIch verlasse mich darauf, dass Ihr unsere Truppen mit Euren hervorragenden Fähigkeiten zum Sieg führen werdet.\n\nWir werden den Angriff beginnen, wenn Ihr bereit seid.', '', '', '', '', '', '', 47187),
(65938, 'deDE', 'Das einstige und zukünftige Team', 'Nutzt Euren Zeitwandererstab, um die Stasisblase an der Tempeltür zum Platzen zu bringen.', 'Alles klar! Zerstören wir die Stasisblase um die Tempeltüren herum und befreien wir unsere Wächter! Seid Ihr bereit für ein gewaltiges Tauziehen gegen die Zeit selbst?\n\nZieht an der Blase an der Tür wie zuvor an den Kristallen. Aber nehmt Euch in Acht: Die freigesetzte Zeitenergie wird sich gewiss sammeln und Euch angreifen. Ich weiß nicht genau, was Euch erwartet, aber immerhin werden die befreiten Wächter an Eurer Seite kämpfen, was auch geschieht.\n\nViel Glück, $n!', '', '', '', '', '', '', 47187),
(65937, 'deDE', 'Ein Beweis der Nachlässigkeit', 'Findet Beweise für die Schäden im Fliederstreifen und zeigt sie Theramus.', 'Wir dürfen nicht aufgeben. Er muss begreifen, was hier draußen geschieht! Wenn er die Höhle nicht verlassen will, müssen wir es ihm eben direkt zeigen.\n\nDazu könnte sicher alles Mögliche dienen. Es läuft so vieles schief, von der verderbten Flora bis hin zur leidenden Fauna!', '', '', '', '', '', '', 47187),
(65935, 'deDE', 'Chromie einholen', 'Trefft Chromie auf den Plattformen des temporalen Konflux.', 'Ihr habt uns geholfen, die Kontrolle über die Sande wiederzuerlangen, doch oben auf den Tempelplattformen spüre ich noch etwas Größeres. Lasst uns in die Lüfte steigen und uns dort oben mit Botschafterin Chronormu treffen.\n\nWie immer ist Eile geboten.', '', '', '', '', '', '', 47187),
(65930, 'deDE', 'Ringen von Wind und Wasser', 'Stellt Euch Kraunot, dem Geist der Luft, in der Nähe des Kauriqweilers.', 'Jetzt sollten wir uns den Geistern entgegenstellen können.\n\nHat Ruriq das nicht erwähnt? Die Traditionen unseres Stamms schreiben es vor, dass wir uns den Geistern im Kampf stellen müssen, bevor wir ihren Segen erbitten. Wie stark er ausfällt, hängt davon ab, wie sehr man sie beeindruckt hat.\n\nVielleicht hat die Leuchtfischerin deshalb darauf bestanden, dass wir alle zusammenarbeiten.\n\nKümmert Ihr Euch um Kraunot, den Geist der Luft, dann übernehmen Ruriq und ich Otu\'rorq, den Geist des Wassers.\n\nSie leben in der Höhle hinter dem Wasserfall gleich in der Nähe. Wir sehen uns dort, $gAbenteurer:Abenteurerin;.', '', 'Der Geist der launischen Winde in der Gegend um den Kauriqweiler. Es ist bekannt, dass er sich gerne von jungen Tuskarr herausfordern lässt, die sich beweisen wollen.', 'Kraunot', '', '', '', 47187),
(65929, 'deDE', 'Eisbrecher', 'Befreit gefrierendes Wasser aus dem Eis in der Nähe des Kauriqweilers.', 'Ich wusste, dass die Ahnen ihren Segen geben würden!\n\nWobei ich nicht viel über Geister weiß, Kauj ist der Schamane. Aber wir müssen die großen Geister der Luft und des Wassers beschwichtigen, bevor sie sich uns zeigen.\n\nJeder kann sehen, wie die Wasserelementare oben auf dem Berg langsam einfrieren. Das ist kein natürlicher Frost. In letzter Zeit strömt wesentlich mehr Kälte vom Berg herunter als sonst. Wenn niemand etwas dagegen unternimmt, könnte unser gesamter Fluss vereisen.\n\nBefreit sie aus ihren frostigen Gefängnissen!', '', '', '', '', '', '', 47187),
(65928, 'deDE', 'Unberechenbare Winde', 'Sammelt $1oa ruhelose Windpartikel von den ruhelosen Winden in der Nähe des Kauriqweilers.', 'Pah! Zusammenarbeiten will sie?\n\nAber... wenn die Leuchtfischerin denkt, dass wir damit den anderen Stämmen vielleicht helfen können... müssen wir es versuchen.\n\nDamit der Windgeist Kraunot von uns Notiz nimmt, müssen wir uns zuerst um sein Element kümmern. Die Windelementare in der Nähe sind aufgewühlt, seit das Land erwacht ist.\n\nWährend ich das Boot inspiziere, das Ihr zwei gebaut habt, könnt Ihr sie bekämpfen und mir ihre ruhelosen Partikel bringen. Das sollte die Ruhe in der Gegend wiederherstellen.', '', '', '', '', '', '', 47187),
(65926, 'deDE', 'Die Wasserfälle bezwingen', 'Helft Ruriq dabei, die Fallschreiter zu bauen.', 'Kennt Ihr die Geschichte der Leuchtfischerin? Sie hat ein Boot gebaut, stark genug, um Wasserfälle hinunterzufahren!\n\nDie Älteste Nava liebt es, diese Geschichte zu erzählen.\n\nIch denke, den ehrwürdigen Geistern der On\'tuq-Mammuts würde es große Ehre erweisen, wenn wir das Material aus ihren Körpern nutzen würden, um erneut ein solches Boot anzufertigen.\n\nMein Bruder ist dagegen, aber wenn es uns gelingt, könnten wir dabei helfen, Fische zu unseren Schwesterstämmen zu bringen, die es gerade sehr schwer haben.\n\nIhr habt Eure Fähigkeiten und Eure Leidenschaft bereits bewiesen! Gemeinsam können wir sicherlich etwas Großes erschaffen.', '', '', '', '', '', '', 47187),
(65925, 'deDE', 'Die Schlächter schlachten', 'Tötet Eiskriecher und Eisbohrer in der Nähe des Kauriqweilers.', 'Diese Wyrms gehören nicht hierher. Ich weiß nicht, was sie aus ihren unterirdischen Höhlen getrieben hat, aber jetzt können wir ihnen nicht mehr helfen.\n\nWir dürfen nicht zulassen, dass sie die einheimische Fauna zerstören.\n\nTötet die Wyrms, $n. Behaltet ihre Einzelteile, wenn nötig, und sucht mich im Weiler auf, sobald Ihr fertig seid.', '', '', '', '', '', 'Trefft Ruriq bei Kauriqweiler.', 47187),
(65921, 'deDE', 'Vergeltung der Refti', 'Tötet Primalisten und rettet Refti im Tyrholdreservoir.', 'Ich bekomme es einfach nicht aus meinem Kopf, $p. So viele meiner Schwestern wurden abgeschlachtet! Weggeworfene Leben... Ihre Opfer werden nicht ohne Folgen bleiben!\n\nMeine Soldaten haben die Primalisten aufgespürt und entdeckt, dass einige unserer Schwestern noch am Leben sind.\n\nWir müssen sie retten und sicherstellen, dass jeder dieser Primalisten meinen Zorn zu spüren bekommt!', '', '', '', '', '', '', 47187),
(65920, 'deDE', 'Für den Schutz!', 'Nutzt die fehlenden Schlüsselsteine, um die Reservoirschutze zu reparieren, und aktiviert dann die Konsole.', 'Wir können die Schutze endlich reparieren. Trotz unserer schweren Verluste muss unsere Arbeit vollendet werden.\n\n$p, wir benötigen erneut Eure Hilfe. Bringt jeden Schlüsselstein an seinen angestammten Platz, um die Schutze wiederherzustellen.\n\nKommt zurück, sobald Ihr das erledigt habt, damit wir die Konsole aktivieren und die Ordnung im Reservoir wiederherstellen können .', '', '', '', '', '', '', 47187),
(65918, 'deDE', 'Vorbeugende Maßnahme', 'Tötet $1oa entfesselte Elementare im Tyrholdreservoir.', 'Die Urelementare vermehren sich völlig unkontrolliert. Normalerweise würden meine Schwestern und ich uns darum kümmern, aber wir sind nicht in der Lage, gegen sie zu kämpfen. Wir haben einfach zu viele Soldaten verloren.\n\nAußerdem müssen die wenigen von uns, die hier verblieben sind, sich um dringendere Angelegenheiten kümmern.\n\n<Zuttiki zuckt schmerzerfüllt zusammen.>\n\nUnd hier kommt Ihr ins Spiel, $p. Würdet Ihr Euch um diese Elementare kümmern?', '', '', '', '', '', '', 47187),
(65916, 'deDE', 'Wir verhandeln nicht mit Primalisten', 'Tötet Primalistenanführer Ko\'jo und erlangt die fehlenden Schlüsselsteine im Tyrholdreservoir zurück.', 'Die Primalisten glaubten, sie könnten die Macht von Tyr übertreffen. Da lagen sie falsch.\n\nMeine Refti konnten sie in einer Höhle nicht weit von hier aufspüren. Wie ich dachte, befinden sie sich im Besitz der verschwundenen Schlüsselsteine.\n\nChampion, wenn wir dem Reservoir zu alter Pracht verhelfen wollen, müssen wir diese Steine zurückerlangen.\n\nAußerdem muss ihr Anführer sterben, damit sie keinen erneuten Angriff starten können.', '', '', '', '', '', '', 47187),
(65914, 'deDE', 'Mammuts im Mittelpunkt', 'Sammelt On\'tuq-Hautfetzen und On\'tuq-Stoßzähne von gefallenen Mammuts der On\'tuq in der Nähe des Kauriqweilers.', 'Unser Stamm hat sich damit gerühmt, die On\'tuq-Mammutherde seit Generationen heranzuziehen. Jetzt sind sie... verloren.\n\nNach diesem Massaker werden ihre Seelen sicher in Rage gefangen sein. Wir müssen ihnen die letzte Ehre erweisen, indem wir ihre Überreste sinnvoll verwerten.\n\nEs sind zu viele, wir können sie nicht alleine einsammeln. Bitte sammelt so viele Materialien von den Jungen und den Matriarchinnen ein, wie Ihr könnt, und trefft mich im Kauriqweiler.', '', '', '', '', '', 'Trefft Ruriq bei Kauriqweiler.', 47187),
(65913, 'deDE', 'Alles güter, Hüter?', 'Rettet Hüterin Mara vor den Primalisten im Tyrholdreservoir.', 'Den Titanen sei Dank! $C, wir brauchen Eure Hilfe!\n\nGerade eben erst wurden wir von Primalisten angegriffen. Meine Schwestern und ich konnten sie abwehren, aber nur unter schweren Verlusten...\n\nWir haben Zeit zum Trauern, sobald meine Hüterin in Sicherheit ist! Eine Gruppe Primalisten hat sich während der Kämpfe abgesetzt... Ich schwöre, wenn sie unserer Hüterin Leid zufügen...\n\nIhr müsst ihr helfen, bevor es zu spät ist!', '', '', '', '', '', '', 47187),
(65911, 'deDE', 'Azurblaue Ausrichtung', 'Kehrt zu Kalecgos in den Azurarchiven zurück.', 'Die Bande dieser Gemeinschaft... Freunde, Familie... die Vertrautheit, die sie miteinander teilen.\n\nIch... hatte so etwas nie. Der blaue Drachenschwarm hatte so etwas nie. Und vielleicht liegt es daran, dass wir nie die Gelegenheit dazu hatten.\n\nJetzt haben wir sie. Ich muss meinesgleichen versammeln.\n\nSucht mich in den Azurarchiven auf. Es gibt viel zu tun.', '', '', '', '', '', 'Kehrt zu Kalecgos in den Azurarchiven zurück.', 47187),
(65907, 'deDE', 'Lieblingsobst', 'Sammelt wilde Strauchfrüchte aus den Geysiren von Ohn\'iri und füttert damit $1oa faulenzende Schlammstampfer.', 'Die Mystikerausbildung ist so langweilig. Die Hälfte der Zeit beobachte ich Wasser dabei, wie es nass ist. Meine Brüder sind schon draußen in der Wildnis unterwegs, verändern die Welt und jagen Drachen und Primalisten.\n\nEgal. Ich habe versprochen, Euch etwas Großartiges zu zeigen! Wusstet Ihr, dass Schlammstampfer Strauchfrucht lieben? Sie wächst in der Nähe bei den Geysiren. Sammelt ein paar davon, dann können wir sie gemeinsam füttern.', '', '', '', '', '', '', 47187),
(65906, 'deDE', 'Eine aufgebrachte Initiandin', 'Sprecht mit Initiandin Radiya bei den Quellen von Ohn\'iri auf den Ebenen von Ohn\'ahra.', 'Ich habe einen interessanten Brief von den Quellen von Ohn\'iri erhalten.\n\nWas den Inhalt des Briefes angeht, so beschreibt er, ich zitiere, furchtbare Gefangenschaft, kontrollwütige Mentoren und extreme Langeweile. Er ist formell unterzeichnet, Initiandin Radiya. Schaut, da ist auch eine Zeichnung von einem Adler... er tritt eine Zentaurin namens Meluun von einer Klippe.\n\nNun. Ich vermute, es handelt sich hier um einen Hilferuf, falls Ihr es Euch selbst ansehen möchtet. Um ehrlich zu sein, ich glaube, Radiya ist in Ordnung. Sie schickt mir häufig solche Briefe.', '', '', '', '', '', 'Sprecht mit Initiandin Radiya bei den Quellen von Ohn\'iri auf den Ebenen von Ohn\'ahra.', 47187),
(65905, 'deDE', 'Mehr als Unkraut', 'Beseitigt Überwucherungen und Monster im Fliederstreifen.', 'Vielleicht sollten wir Theramus etwas Freiraum lassen.\n\nAber wir dürfen deshalb nicht untätig sein. Der Hain zerstört sich mit zunehmender Geschwindigkeit selbst. Bitte helft uns!', '', '', '', '', '', '', 47187),
(65904, 'deDE', 'Genug ist genug', 'Bringt die Beweise für die Schäden im Fliederstreifen zu Theramus.', 'Griesgrämig oder nicht, Theramus hat eine Aufgabe zu erledigen. Solange er sich drinnen versteckt, kann er die Folgen seiner Abwesenheit nicht abschätzen.\n\nLasst uns zusammen gehen. Wir werden ihm die Beweise präsentieren.', '', '', '', '', '', '', 47187),
(65903, 'deDE', 'Flausch ist unschlagbar', 'Fangt $1oa Wiesenspringer.', 'Armer Theramus. Ich habe eine Idee, wie man ihn wieder aufmuntern kann!\n\nNehmt dieses Netz und fangt ein paar der einheimischen Springer. Sie sind zwar friedlich, aber schnell. Sie haben sich an der Küste gut eingelebt.\n\nWir werden sie zu Theramus bringen. Er wird buchstäblich von flauschigen Freuden überschwemmt werden!', '', '', '', '', '', '', 47187),
(65902, 'deDE', 'Futter oder Flausch', 'Bringt das gewürzte Schildkrötenfleisch und die Wiesenspringer zu Theramus.', 'Sieh sich einer dieses saftige und köstlich gewürzte Schildkrötenfleisch an! Das ist natürlich nur eine rein objektive Betrachtung. Ich bin Vegetarierin.\n\nNa los! Er hat den vermutlich den ganzen Tag über noch kein Fleisch gegessen.', '', '', '', '', '', '', 47187),
(65901, 'deDE', 'Rausschleichen', 'Platziert die Lufttotems in Quellen von Ohn\'iri und informiert danach Radiya.', 'Ich habe Hausarrest für unbestimmte Zeit! Weiß meine Ohn nicht, dass ich nächstes Frühjahr sechzehn werde? Ich sollte weggehen dürfen, wann immer ich will.\n\nIhr seht aus, als könntet Ihr mir helfen. Ich habe einen Fluchtplan: Indem ich diese Totems kanalisiere, kann ich die Luft konzentrieren und einen ordentlichen Wirbel erzeugen. Aber ich kann nicht herumlaufen und sie platzieren, ich stehe nämlich unter maximaler Windaufsicht. Sogar Togo wird mir nicht helfen.\n\nAber mit Eurer Hilfe... bitte! Ich verspreche Euch, ich werde Euch etwas Großartiges zeigen.', '', '', '', '', '', 'Trefft Euch mit Radiya beim Spiegel des Himmels.', 47187),
(65900, 'deDE', 'Verdächtig gewürztes Steak', 'Sammelt $1oa Stücke wunderbar zartes Schildkrötenfleisch, $2oa Reptilieneierschalen und $3oa Sauerblüten.', 'Die Idee meiner Schwester ist bezaubernd, aber Theramus braucht einen echten Muntermacher.\n\nEine großzügige Portion Sauerblüte ist genau das Richtige. Wir können daraus eine Paste herstellen, die ich auf sein Lieblingsessen streichen kann: Schildkrötenfleisch!\n\nHelft Ihr mir, die Zutaten zu beschaffen?', '', '', '', '', '', '', 47187),
(65899, 'deDE', 'Findet Theramus', 'Durchsucht die nahe gelegenen Höhlen und findet Theramus.', '$R! Seid Ihr hier, um den wunderschönen Fliederstreifen zu besichtigen? Tut mir leid, dass er sich gerade in solch einem Zustand befindet. Ich schwöre, dass er normalerweise nicht so ungepflegt aussieht!\n\nTheramus, der Hüter des Gartens, wollte sich heute eigentlich mit uns treffen, damit wir die Probleme angehen können. In letzter Zeit ist er mit der Pflege etwas überfordert, also helfen Felina und ich aus. Aber wir können nicht alles erledigen.\n\nWürdet Ihr für uns nach ihm suchen? Vielleicht hat er es vergessen.', '', '', '', '', '', 'Kehrt zu Celina Knisterblatt zurück.', 47187),
(65898, 'deDE', 'Protoprobleme', 'Beschafft den Locus und besiegt den Protodrachen, der ihn bewacht.', 'Ich mag die Splitterflammen zwar nicht, aber nicht einmal ich kann einfach tatenlos zuschauen, wie sie sich so zerfleischen. Das kommt mir nur allzu bekannt vor.\n\nWas auch immer dieser Locus ist, er ist in unseren Händen besser aufgehoben als in ihren. Folgt der Spur aus Leichen, dann finden wir ihn bestimmt.\n\nAber seid vorsichtig, $p. Ich befürchte, das Nest ist nicht ganz so verlassen, wie es den Anschein hat.', '', '', '', '', '', '', 47187),
(65896, 'deDE', 'Alte Wunden', 'Helft den Bewohnern von Sturmwind, die Wunden der Vergangenheit zu heilen.', 'Dachtet Ihr wirklich, Ihr könntet Euch unbemerkt in diese Stadt stehlen? Nein, mir entgeht nichts!\n\nIch hatte schon einmal recht, was Eure Art betrifft, und ich will verdammt sein, wenn ich die Drachen meine Heimat erneut zerstören lasse.\n\nDies war einst ein Park voller Frieden und Gelächter. Doch dann kam Euer Ahne, Todesschwinge. Oh ja, ich weiß alles über ihn.\n\nSeht Euch doch das Vermächtnis der Zerstörung an, das er hinterlassen hat. Der Schmerz hallt bis heute in den Straßen wider.', '', '', '', '', '', '', 47187),
(65895, 'deDE', 'Konkurrenz belebt das Geschäft', 'Sammelt Informationen über die Splitterflammen.', 'Pah! Durch das Abschlachten von Arbeitern werden wir auch nicht schlauer.\n\nSucht ihre Anführer. Einer davon wird wissen, was wir benötigen.\n\nAch, und noch etwas, $n. Belauscht sie dieses Mal, bevor Ihr sie umbringt. So erfahrt Ihr vielleicht etwas Nützliches.', '', '', '', '', '', 'Trefft Adenedal nahe der Spitze der Ruinen.', 47187),
(65893, 'deDE', 'Die Reliktsuche', 'Sammelt $1oa Artefaktfragmente von Nelthazan.', 'Die Splitterflammen sind hier. Würdet Ihr irgendwelchen Splittern kostbare Artefakte anvertrauen?\n\nIch glaube kaum. Aber wir müssen herausfinden, was sie hier wollen, wenn wir weiterkommen möchten. Nehmt ihnen so viele wie möglich ab und zeigt sie mir dann.\n\nDieses Rätsel besteht aus mehr Teilen, als wir in der Erde finden werden.', '', '', '', '', '', '', 47187),
(65892, 'deDE', 'Zersplitterte Splitterflammen', '', '', '', '', '', '', '', '', 47187),
(65891, 'deDE', 'Ein Mittel zum Zweck', 'Verwendet die verzauberten Werkzeuge in der Nähe von $1oa Geröllhaufen.', 'Gut. Ich habe mir gerade überlegt, dass ich $geinen Abenteurer:eine Abenteurerin; wie Euch brauchen könnte. Stark. Robust. Willens, für ein kleines Handgeld zu arbeiten.\n\nEs ist, als wäret Ihr meinem Wunsch entsprungen. Das habe ich gut gemacht. Diese Ruinen haben die Aufmerksamkeit anderer erregt. Aber sie machen bei den Ausgrabungen bestimmt etwas falsch. Sie werden die Proben verderben!\n\nNehmt dies hier. Platziert es bei interessanten Artefakten in den Ruinen. Es ist so verzaubert, dass es alles Nötige erledigt.', '', '', '', '', '', '', 47187),
(65890, 'deDE', 'Die Ruinen von Nelthazan', 'Trefft den Himmelsschreiber Adenedal bei den Ruinen von Nelthazan.', 'Die Drachenschuppenexpedition benötigt Eure Unterstützung.\n\nEin Himmelsschreiber wurde zum Sammeln von Informationen in die Ruinen geschickt. Sie sollten unbewohnt sein, aber ich kann ihn bis hier schreien hören.\n\nEr muss in einer brenzligen Situation sein, wenn er bis hierher zu hören ist.\n\nAuf dieser Expedition kümmern wir uns um einander. Sogar um die Unerträglichen. Sucht nach ihm und schützt ihn vor was auch immer er dort gefunden hat.', '', '', '', '', '', '', 47187),
(65887, 'deDE', 'Zu den Bergen', 'Trefft Khadgars und Kalecgos\' Abbilder am Fuß der Bergkette von Vakthros.', 'Was für ein Anblick da oben, wie Khadgar und Kalecgos die Primalisten am Himmel bekämpfen!\n\nSie haben mehrere Abbilder von sich beschworen, um Euch durch das gigantische Loch zu helfen, das die Primalisten erschaffen haben.\n\nZwei davon befinden sich gerade am Fuß der Berge.\n\nWenn die Dinge sich zum Schlechten wenden... nun, dann werde ich den Rest von uns im Azurblauen Gebirge informieren.', '', '', '', '', '', 'Trefft Khadgars und Kalecgos\' Abbilder am Fuß der Bergkette von Vakthros.', 47187),
(65886, 'deDE', 'Zu Rhonins Schild', 'Trefft Euch mit Drok Schriftstecher im Turmausguck.', 'Raszageth und die Primalisten starten einen Großangriff auf Vakthros. Wir dürfen nicht zulassen, dass sie Erfolg haben!\n\nKhadgar und ich werden vorgehen und die Situation aus dem Himmel unter Kontrolle bringen.\n\nIn der Zwischenzeit müsst Ihr Euch zu Rhonins Schild aufmachen, einem der letzten Lager der Kirin Tor in dieser Gegend.\n\nIhr seid schneller, wenn Ihr von der Spitze des Archivs mit Eurem Drachen losfliegt.\n\nStellt sicher, dass es den Kirin Tor gut geht und begebt Euch dann nach Vakthros.\n\nWir zählen auf Eure Bodenunterstützung.', '', '', '', '', '', 'Trefft Euch mit Drok Schriftstecher in Rhonins Schild.', 47187),
(65875, 'deDE', 'Ein Drache macht blau', 'Findet die Getränke für Vazallia.', 'Ein ganzes Leben in der Scherbenwelt... ständige Kämpfe. So wenig Zeit zum Entspannen.\n\nHin und wieder braucht ein Drache einen Tag am Meer, mit einem richtig kalten Getränk in seinen Klauen.\n\nHey, vielleicht könnt Ihr mir dabei helfen, mich zu entspannen! Tut mir einen Gefallen und schaut, ob Ihr einige dieser Getränke findet, um unseren Vorrat aufzustocken.', '', '', '', '', '', '', 47187),
(65874, 'deDE', 'Eine verdorbene Offenbarung', 'Sprecht mit Hanu, der Ältesten Poa und Norukk.', 'Hm...\n\n<Brel starrt das seltsame Totem unverwandt an und dreht und wendet es in ihren wuchtigen Händen.>\n\nWir müssen die Barthaare zusammenstecken und herausfinden, was es damit auf sich hat.', '', '', '', '', '', '', 47187),
(65873, 'deDE', 'Anführer der Schattenpfotenbande', 'Tötet Kargtatze und nehmt sein Totem an Euch.', 'Kargtatze ist der wahre Anführer der Gnolle in diesem Teil des Waldes. Wir hatten in der Vergangenheit bereits... unangenehme Begegnungen mit ihm.\n\nAber diesmal war etwas anders. Er hatte ein seltsames Totem bei sich, das seine gesamte Essenz zu verzerren.\n\nWir müssen Kargtatze aufhalten und dieses Totem in unseren Besitz bringen. Ich befürchte, die Gnolle spielen mit etwas, das dunkler ist, als wir es uns vorstellen können.', '', 'Kargtatze war zwar schon immer boshaft, aber seit er ein verderbtes Totem trägt, ist er noch aggressiver geworden.', 'Kargtatze der Miefende', '', '', '', 47187),
(65872, 'deDE', 'Böse Gnolle mit bösen Absichten', 'Tötet $1oa Schattenpfotengnolle in Kargtatzes Höhle.', 'Ich wittere etwas Seltsames in der Luft. Hier stimmt etwas nicht...\n\nHanu hat die Gnolle in dieser Höhle als eigenartig beschrieben... und krank. Wir sollten mehr über den Ursprung von alldem herausfinden.\n\nAber werdet nicht übermütig. So kränklich sie auch aussehen, sie dürften hochgradig hinterhältig und gefährlich sein.', '', '', '', '', '', '', 47187),
(65871, 'deDE', 'Kein Weg an den Gnollen vorbei', 'Rettet Norukk und $1oa weitere gefangene Tuskarr.', 'Ich bin der Fährte der gefangenen Tuskarr gefolgt. Sie und mein Mann Norukk sind in dieser Höhle.\n\nNorukk gibt oft nicht genügend auf sich selbst acht, deshalb tue ich das normalerweise für ihn. Aber ein wenig Hilfe werde ich nicht ablehnen.\n\nBitte rettet sie!', '', '', '', '', '', '', 47187),
(65870, 'deDE', 'Vorräte!', 'Bergt die Behälter mit Jagdausrüstung.', 'In den Riesenbaumhügeln war keine Spur von unserer gestohlenen Jagdausrüstung. Sie muss in dieser Höhle sein.\n\nHaltet die Augen nach Ausrüstungsbehältern offen und seid auf alles gefasst.\n\nIch würde nicht davon ausgehen, dass die Gnolle die Behälter unbewacht zurückgelassen haben.', '', '', '', '', '', '', 47187),
(65869, 'deDE', 'Noch ein Hinterhalt', 'Sprecht mit Akiun und untersucht $2oa Leichen in der Nähe.', 'Eine Tragödie. Und möglicherweise nur die erste von vielen.\n\nFindet heraus, was Akiun weiß, und untersucht dann alle, die bei dem Angriff ums Leben gekommen sind.\n\nIch habe da so meine Vermutungen, was hier geschehen ist. Finden wir heraus, ob die Spuren meine Theorie bestätigen.\n\nIch werde versuchen, meinen aufgewühlten Freund zu beruhigen.', '', '', '', '', '', '', 47187),
(65868, 'deDE', 'Nichts zum Knabbern', 'Holt $1oa Bestattungsgaben zurück.', 'Ich habe eine von Ponoliaks Bestattungsgaben gefunden, von diesen Schattenpfotengnollen verschandelt und dann weggeworfen... Sie war voller Bissspuren.\n\nDiese Gabe, zusammen mit anderen, wird für die Beerdigungszeremonie unseres jüngst verstorbenen Häuptlings von Iskaara benötigt.\n\nEs ist eine Schande, etwas so Heiliges als Kauspielzeug zu verwenden. Bitte haltet die Augen nach weiteren Bestattungsgaben offen.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Höhle in den Riesenbaumhügeln.', 47187),
(65867, 'deDE', 'Heulen in den Riesenbaumhügeln', 'Tötet Durgun, Kerwal und Bakra.', 'Die Gnolle, die unsere Karawane angegriffen haben, wurden von drei Leutnants angeführt.\n\nDurgun wurde von einem Dutzend Hyänen begleitet.\n\nKerwal lachte jedes Mal wie wahnsinnig, wenn wir ihn verfolgen wollten und in eine seiner Stahlfallen getappt sind.\n\nBakra hat uns erbarmungslos verspottet.\n\nWenn wir auch nur darauf hoffen wollen, das wiederzuerlangen, was gestohlen wurde, müssen sie sterben.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Höhle in den Riesenbaumhügeln.', 47187),
(65866, 'deDE', 'Fallen auslösen', 'Löst $1oa Klingenkieferfallen aus.', 'Die Hügel vor uns sind mit Klingenkieferfallen gespickt.\n\nAber wenn Ihr aufmerksam seid, solltet Ihr sie aufspüren können. Löst sie mit diesem alten Trick der Tuskarr vorsichtig aus: Nehmt einem langen Stock. Natürlich könntet Ihr das auch tun, indem Ihr in sie hineintretet, aber das würde ich nicht empfehlen.\n\nSucht Hanu auf, sobald Ihr genügend von ihnen entfernt habt. Die Älteste Poa und ich werden nachkommen, sobald wir können.', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Höhle in den Riesenbaumhügeln.', 47187),
(65865, 'deDE', 'Sie haben uns festgesetzt!', 'Tötet Gnollscharfschützen.', 'Diese Scharfschützen der Gnolle sind gnadenlos... und überraschend zielsicher.\n\nSolange sie ihre Waffen auf uns gerichtet haben, können wir nicht einmal daran denken, in die Riesenbaumhügel aufzubrechen.\n\nDünnt ihre Reihen aus und zeigt ihnen, dass wir keine lebenden Zielscheiben sind!', '', '', '', '', '', 'Trefft Hanu am Eingang von Kargtatzes Höhle in den Riesenbaumhügeln.', 47187),
(65864, 'deDE', 'Die Karawane erwischen', 'Holt Brena in der Nähe der Riesenbaumhügel ein.', 'Ihr solltet Brena hinterher. Ihre Karawane ist gerade einmal vor ein paar Stunden hier durchgekommen.\n\nSie haben die wertvollsten Besitztümer unseres verstorbenen Häuptlings für ein Begräbnis zu seinen Ehren gesammelt.\n\nDa die Karawane schwer beladen war, dürfte sie noch nicht weit gekommen sein.', '', '', '', '', '', '', 47187),
(65855, 'deDE', 'Hilfe für das Azurblaue Gebirge', 'Kehrt zu Noriko der Allerinnernden im Lager Antonidas zurück.', 'Die Energie des Schwursteins kann nicht wieder beansprucht werden, bis die Leylinien innerhalb des Azurblauen Gebirges repariert wurden.\n\nEinige von ihnen können womöglich nur mithilfe von Kalecgos\' Fähigkeiten erreicht werden... aber Ihr könnt dennoch helfen.\n\nFindet heraus, ob die Tuskarr überlebt haben, und sucht sie in dem Fall auf. Sie haben zu meiner Zeit hier gelebt und besitzen umfangreiches Wissen über diese Gegend.\n\nSprecht mit einem unserer arkanen Helfer, um zu Euren Verbündeten zurückzukehren.', '', '', '', '', '', 'Sprecht mit Noriko der Allerinnernden im Lager Antonidas.', 47187),
(65854, 'deDE', 'Erneute Beanspruchung des Schwursteins', 'Seht zu, wie Kalecgos den Azurschwurstein neu beansprucht.', 'Hervorragende Arbeit. Offenbar ist es uns gelungen, die Leylinien in den Azurarchiven zu reparieren.\n\nFrüher, als der blaue Drachenschwarm vereint war, hätte ich meinen Brüdern und Schwestern gesagt, nie an der Stärke der Sterblichen zu zweifeln.\n\nTrefft mich am Schwurstein südlich von hier. Ich werde ihn beanspruchen und mich dann auf den Weg nach Thaldraszus begeben.', '', '', '', '', '', 'Sprecht mit Sindragosa.', 47187),
(65852, 'deDE', 'Direkt zur Spitze', 'Sucht im Beutel nützlicher Waren nach dem arkanen Trittstein und nutzt ihn an einem arkanen Fokuspunkt, um die Spitze der Azurarchive zu erreichen.', 'Anscheinend entzieht etwas an der Spitze des Turms die arkanen Energien.\n\nNun, da Ihr die Energien hier unten stabilisiert habt, solltet Ihr in der Lage sein, die arkanen Magien der Gegend zu \"reiten\".\n\nSucht in Eurer Tasche nach etwas, das sich \"Arkaner Trittstein\" nennt. Setzt ihn ein, damit wir uns oben treffen können.', '', '', '', '', '', 'Trefft Kalecgos an der Spitze der Azurarchive.', 47187),
(65850, 'deDE', 'Der Kreislauf des Meeres', 'Sprecht mit Brena, um an der Beerdigungszeremonie teilzunehmen.', 'Danke, $n. Ich habe von unseren neuen Freunden alles Nötige erfahren.\n\nDie Bestattungszeremonie für ihren ehemaligen Häuptling beginnt bald. Angesichts ihrer Güte und Gastfreundschaft uns gegenüber wäre es nur angemessen, daran teilzunehmen, bevor wir in die Archive zurückkehren.\n\nRedet mit Brena und lasst sie wissen, dass wir jederzeit bereit sind.', '', '', '', '', '', '', 47187),
(65849, 'deDE', 'Nach Iskaara', 'Trefft Brena in Iskaara.', 'Ich danke Euch, $n. Dank Euch ist meine Familie in Sicherheit.\n\nJetzt können wir endlich nach Iskaara zurückkehren und den alten Ponoliak der See übergeben. Er war mein Mentor und ein guter Häuptling.\n\nBitte, schließt Euch uns an! Jeder kann sich an der Feier des Kreislaufs des Meeres beteiligen.', '', '', '', '', '', 'Trefft Brena in Iskaara.', 47187),
(65848, 'deDE', 'Auf zum Folianten', 'Sprecht mit Kalecgos, damit er das Portal öffnet, und nutzt, was er beschwört, um die Verderber von Brackenfell auszuschalten und schließlich das kranke Urtum zu vernichten.', 'Wir müssen diesen Baum aufhalten! Dank der Leykristalle kann ich endlich mithelfen.\n\nSprecht mich an, wenn Ihr bereit seid. Ich werde ein Portal zu den Azurarchiven öffnen und versuchen, etwas Nützliches hervorzubringen.\n\nHaltet Abstand, es könnte ziemlich instabil sein.', '', '', '', '', '', 'Sprecht mit Kalecgos in der Leykristallhöhle.', 47187),
(65847, 'deDE', 'Neuausrichtung', 'Konzentriert Euch auf den Leykristall und zerstört dann 3 Verfallansteckungen.', 'Nun zu dieser Leylinie. Meine Befürchtungen scheinen sich zu bestätigen... der Verfall hat sich in der Linie ausgebreitet.\n\nWir müssen den Verfall entfernen und den Heilungsprozess beschleunigen, aber ich kann mit meinem Spiegelbild alleine nicht genug Energie hineinkanalisieren.\n\nKonzentriert Euch auf diesen Leykristall hier. Meine Verbindung zu Euch wird mir dabei helfen, mich physikalisch hierherzuteleportieren. Dann werde ich stark genug sein.', '', '', '', '', '', 'Sucht Kalecgos außerhalb von Brackenfell auf.', 47187),
(65846, 'deDE', 'Liegengelassenes Ley', 'Sammelt $1oa Leykristalle in den Brackenfellrandgebieten.', 'Die Leylinie muss hier sein. Ich spüre sie!\n\nAber zunächst müssen wir die Gnolle aufhalten. Dieses Urtum ist vermutlich ihre mächtigste Waffe.\n\nEs befinden sich einige Leykristalle hier, die die Gnolle gesammelt haben. Zum Glück scheinen sie die Macht, die den Kristallen innewohnt, nicht zu verstehen.\n\nBringt mir so viele, wie Ihr könnt. Sie werden mein Spiegelbild stärken und mir helfen, etwas Nützliches aus den Archiven zu beschwören, um das Monster auszuschalten.', '', '', '', '', '', '', 47187),
(65845, 'deDE', 'Echos der Gefallenen', 'Platziert Brenas Totem in der Nähe von $1oa Leichen der Tuskarr, um Kontakt zu ihren Geistern aufzunehmen.', 'Hier liegen Tuskarr! Die Leichen meiner Freunde, meines Volkes... meiner Familie. Sie sind vor nicht einer Woche erst zur Jagd aufgebrochen.\n\nSie sind schon zu verwest, um sie zu bergen.\n\nIhre Geister sind noch hier. Ihr Zorn, ihre Reue fesselt sie an diesen Ort. Kaqiata, Litokk, Tuyuki...\n\nIch bitte Euch, $n, nehmt mein Totem und stellt es in der Nähe ihrer Leichen auf. Ich werde ihre Geister anrufen... auf dass sie endlich Frieden finden.', '', '', '', '', '', '', 47187),
(65844, 'deDE', 'Die Fäulnis herausschneiden', 'Tötet $1oa verfaulende Treants und $2oa Fäulniswerfer von Brackenfell.', 'Dieser Verfall muss die Gehirne der Gnolle wie ihre Körper zerfressen haben!\n\nWie zerstörerisch sie auch sein mögen: Gnolle sind in diesem Land heimisch... genau wie wir.\n\nWir beobachteten jedoch bereits, wie sie den Verfall bis zu den Riesenbaumhügeln ausbreiteten. Wenn das so weitergeht, werden sie noch das Gebirge infizieren und sich selbst vernichten.\n\nDas dürfen wir nicht zulassen. Es ist bedauerlich, aber... wir müssen ihnen ein Ende setzen.', '', '', '', '', '', '', 47187),
(65842, 'deDE', 'Entwaffnendes Verhalten', 'Schaltet Waffenmeisterin Vordak aus und sammelt $1oa Weltenbrecherwaffen.', 'Ich habe wenig für die Weltenbrecherdrachkin übrig. Sie hängen einem fehlgeleiteten Glauben an, dass Todesschwinge zurückkehren wird, und helfen uns nicht mit dem Obsidianthron.\n\nWaffenmeisterin Vordak, die dem Schwarzen Prinzen einst die Treue schwor, hat etliche hier in der Zitadelle hergestellten Waffen gestohlen und den Weltenbrechern übergeben. Diesen Diebstahl werde ich nicht dulden. Diesen Verrat auch nicht.\n\nGeht zur Schwelenden Spitze und holt die Waffen zurück... wenn nötig mit Gewalt.', '', '', 'Waffenmeisterin Vordak', '', '', '', 47187),
(65841, 'deDE', 'Die Ausbreitung verhindern', '', '', '', '', '', '', '', '', 47187),
(65838, 'deDE', 'Die Brackenfelle brechen', 'Untersucht die Brackenfellrandgebiete.', 'Wenn die Gnolle Verfallmagie entdeckt haben, sind die Leylinien und das Land selbst in großer Gefahr.\n\nMeine Spiegelbilder sind zu ausgedünnt, um elementaren Störungen dieses Ausmaßes zu widerstehen. Bitte betretet den Wald und untersucht den Verfall.\n\nIch werde mit unseren neuen Freunden von den Tuskarr zusammenarbeiten und einen Ort suchen, an dem ich mein Spiegelbild aufrechterhalten kann. Ich treffe Euch anschließend tiefer im Wald.\n\nWir müssen dem ein Ende setzen!', '', '', '', '', '', 'Sprecht mit Kalecgos im Brackenfellgestrüpp.', 47187),
(65837, 'deDE', 'Probleme im Nadelholz', 'Sprecht mit Wächter Olekk im Nadelholzposten auf den Ebenen von Ohn\'ahra.', 'Die Primalisten haben im Shikaarhochland angegriffen.\n\nSolltet Ihr Informationen besitzen oder helfen können, begebt Euch zum Nadelholzposten und sucht nach Olekk. Sagt ihm, ich habe Euch geschickt. <Tirren kichert.> Ich hoffe, der eingestaubte Huffuß erinnert sich an mich.\n\nBleibt auf der Straße, $p. Die Ebenen sind nicht mehr so friedlich wie früher.', '', '', '', '', '', 'Sprecht mit Wächter Olekk im Nadelholzposten auf den Ebenen von Ohn\'ahra.', 47187),
(65836, 'deDE', 'Eine stürmische Demonstration', 'Formiert Euch mit Watu im Weisenkronenpinienwald neu.', '<Watu steht ohne Probleme auf, als ob seine Verletzung verschwunden wäre.>\n\nI-i-ich... habe mir den Splitter reingerammt. Nichts schmerzt mehr. Ich fühle mich gut. Blendend. Gewaltig.\n\nOlekk ist immer noch nicht zurück. Etwas stimmt nicht. Er hätte niemals ohne mich gehen sollen!', '', '', '', '', '', '', 47187),
(65834, 'deDE', 'Tötet die Königin', 'Tötet die Schaudernetzkönigin.', 'Und fertig ist der Lack! Mit ein bisschen Wissen, gesundem Raten und ein paar neugemeißelten Runen haben wir jetzt einen magischen... Enterfüller? Entfüller? Ausfüller?\n\nEgal! Bin ziemlich sicher, dass er irgendwas Unschönes mit der Königin anstellen wird. Und um die Bedrohung loszuwerden, müssen wir sie loswerden. Die Kleinen zu zerquetschen, verzögert alles nur, wir müssen dies im Keim ersticken.', '', 'Es darf niemals eine Spinnenkönigin geben.', 'Schaudernetzkönigin', '', '', '', 47187),
(65833, 'deDE', 'Einmischung der Primalisten', 'Erbeutet die drei Frostruferrunensteine.', 'Die Primalisten erfüllen die Spinnen mit Elementareis, um sie als Kanonenfutter gegen die Verteidigung der Drachen im Gebirge einzusetzen und sie zu überrennen. Das dürfen wir nicht zulassen.\n\nDie drei Frostbeulen haben das Kommando. Schaltet sie aus und bringt mir ihre Runensteine, mit denen sie die Urmagie fokussieren. Damit sollten wir den Magiestrom unterbrechen können.', '', '', '', '', '', '', 47187),
(65832, 'deDE', 'Zwergenfrostschutz', 'Findet $1oa Fläschchen Zwergenfrostschutz.', 'Ich stecke ein bisschen in der Klemme, $uJunge:Mädel;. Diese Frostlutscher von Primalisten haben mich in diesen zu groß geratenen Eiswürfel gepackt und der einzige Grund, warum ich nicht völlig einfriere, ist mein geheimer Vorrat an Stöffchen... und er geht zur Neige!\n\nDummerweise haben diese Dreckskerle meinen weniger geheimen Vorrat geklaut.\n\nWärt Ihr so gut, mir meine Fläschchen zurückzubringen, bevor mein verdammtes Blut einfriert?\n\nOh, und $uJunge:Mädel;... Wenn Ihr sie aus dem Hintern einer Spinne ziehen müsst, erzählt mir lieber nichts davon. Will ich gar nicht wissen.', '', '', '', '', '', '', 47187),
(65806, 'deDE', 'Maruukai', 'Reist nach Maruukai.', '<Während Sansok Khan in Gebärden spricht, formuliert Okir die Worte.>\n\nMaruukai liegt an einem Berghang in der Nähe dieses Waldes. Unsere Reise ist fast zu Ende.\n\nDer Khural ist eine Zeit des Friedens bei den Maruuk, aber Ohn Seshtengs Omen ist beunruhigend. Wir müssen auf der Hut sein.', '', '', '', '', '', '', 47187),
(65805, 'deDE', 'Verbindung zu Ohn\'ahra', 'Sammelt $1oa Teile Flussschilf, $2oa Vogelschwanzfedern und ein Salamantherherz am Flussufer.', 'Der Wind zeigt sich hier ruhelos, $n. Ohn\'ahra ruft. Und ich muss ihrem Ruf folgen.\n\nIch brauche Reagenzien für mein Ritual: Schilf vom Flussufer, Federn von den Schwänzen der Stockenten und das Herz eines Salamanthers. Sammelt diese Materialien am Fluss, damit ich ihrer Stimme folgen kann.', '', '', '', '', '', '', 47187),
(65804, 'deDE', 'Für Speisen und Rivalität', 'Erbeutet $1oa Teile frisches Wildfleisch von den Tieren in der Steppe des Wanderers.', 'Die Maruuk reisen aus allen Teilen der Ebenen an, um am Khural teilzunehmen. Die Zusammenkunft erstreckt sich über mehrere Tage.\n\nSo viele Zentauren satt zu bekommen, ist kein leichtes Unterfangen. Die Jäger der Shikaar liefern das Fleisch für alle gemeinsamen Mahlzeiten. Nach unserer Tradition jagen wir auf dem Weg nach Maruukai.\n\nAuch Ihr müsst Euren Beitrag leisten.', '', '', '', '', '', '', 47187),
(65803, 'deDE', 'Zur Stadt', 'Reist mit der Shikaarkarawane zur Steppe des Wanderers.', 'Der Khural ist eine Zeit, wo die Klans sich besprechen und Geschichten austauschen. Es gibt viele Zentaurenklans auf den Ebenen, aber wir alle sind Maruuk.\n\nDie Karawane ist reisefertig. Da Maruukai etwas weiter weg ist, werden wir Halt machen müssen.\n\nWenn Ihr bereit zum Aufbruch seid, findet Ihr mich am Wagen. Lasst uns nicht warten.', '', '', '', '', '', '', 47187),
(65802, 'deDE', 'Vorräte für die Reise', 'Sammelt $1oa Lagervorräte in der Gegend des Baumschrittaußenpostens und $2oa Wildblütenkapseln im nahen Wald.', '<Während Sansok Khan in Gebärden spricht, übersetzt Okir für sie.>\n\nWährend Ihr mit uns reist, müsst Ihr Euren Soll erbringen. Wilde Gorlocs haben kürzlich unsere medizinischen Vorräte geplündert, und wir benötigen dringend Nachschub. Sammelt die orangen Blüten, die Ihr im Umkreis des Außenpostens findet, damit wir mehr Heilumschläge herstellen können.\n\nUm den Außenposten herum liegen auch Vorräte, die zur Karawane gebracht werden müssen. Sammelt sie bitte mit auf.\n\nWenn Ihr alles beisammen habt, bringt es zu Tomul.', '', '', '', '', '', 'Meldet Euch bei Späherin Tomul.', 47187),
(65801, 'deDE', 'Vorstellungsrunde', 'Stellt Euch den Mitgliedern von Klan Shikaar vor.', '<Während Sansok Khan in Gebärden spricht, übersetzt Okir für sie.>\n\nEs ist Generationen her, seit ein Fremdling wie Ihr Fuß auf unser Land setzte. Angesichts der Primalisten, die unser Land heimsuchen und ihre verbotene Magie ausüben, ist mein Volk verständlicherweise misstrauisch.\n\nWenn Ihr mit uns reisen wollt, müsst Ihr Euch mit meinem Klan bekanntmachen. Stellt Euch den Mitgliedern vor.', '', '', '', '', '', 'Meldet Euch bei Späherin Tomul.', 47187),
(65798, 'deDE', 'Eine opportunistische Herangehensweise', 'Sammelt Waffen und erschlagt Nokhud-Kämpfer beim Vorstoß der Nokhud.', 'Die Shikaar haben gegen die Nokhud im Norden eine Angriffslinie gebildet. Es gefällt mir eigentlich nicht, uns zum Plündern herabzulassen, doch es ist leider ein notwendiges Übel, um unsere Vorräte aufzufüllen. Trotzt dem Schlachtfeld und kehrt mit Waffen zurück. Ich werde Eure Mühen entlohnen.\n\nWenn Ihr ebenjene Mühen auf die Seite der Nokhud konzentriert, werden die Ahnen mich hoffentlich nicht ganz so sehr verurteilen.', '', '', '', '', '', '', 47187),
(65796, 'deDE', 'Die beste Verteidigung...', 'Tötet Sirena die Zahnbrecherin.', 'Unser nächster Pfad führt uns durch das Territorium der Nokhud. In der Vergangenheit herrschte ein vorläufiger Frieden zwischen unseren Klans, aber die Zeiten haben sich geändert.\n\nWenn wir nicht zuerst handeln, machen wir uns angreifbar. Meine Späher haben berichtet, dass eine ihrer Kriegsanführerinnen nahe Drachentreff gesichtet wurde. Greift sie zuerst an, lasst ihr keine Zeit, ihre Truppen zu sammeln, um uns unterwegs überfallen.', '', '', '', '', '', '', 47187),
(65795, 'deDE', 'Auf in die Steppe', 'Trefft Botschafter Taurasza im Außenposten der Rubinschuppen.', 'Der grüne Drachenschwarm braucht jetzt Eure Hilfe. Die Tochter meiner Schwester und ihr Schwarm sind in den Smaragdgrünen Traum eingedrungen, um ihren eigenen Schwurstein zu stärken. Aber wir haben nichts mehr von ihnen gehört, seit ihr Schlummer begann.\n\nSucht die Zentauren auf, die über die Ebenen von Ohn\'ahra herrschen. Ihr könntet ihre Verbindung zum Land und seinen Geistern gut brauchen, wenn ihr die Grünen wecken wollt.\n\nSie sind ein stolzes und sehr territoriales Volk, das sehr empfindlich auf vermeintliche Beleidigungen reagiert. Sprecht mit unserem Botschafter. Er wird Euch vorbereiten.', '', '', '', '', '', 'Trefft Botschafter Taurasza im Außenposten der Rubinschuppen.', 47187),
(65794, 'deDE', 'Die Pflicht der Pflege', 'Seht zu, wie die Schwarzdracheneier erneut in den Lebensbecken ihren Platz finden.', 'Ich danke Euch, $C. Und mein Beileid dafür, dass Ihr so lange mit den beiden zu tun hattet.\n\nDer rote Drachenschwarm hat die Aufgabe, alle Drachen zu beschützen und zu pflegen, auch jene, derer wir vielleicht manchmal überdrüssig sind.\n\nMit der Rückkehr der Eier des schwarzen Drachenschwarms ist die Drachengemeinschaft so geeint wie seit tausenden von Jahren nicht mehr. Ich glaube, das ist es, was unseren Rubinschwurstein wiederherstellen wird.\n\nSprecht mich an, wenn Ihr bereit seid, die Eier zum Obsidianlebensbecken zu bringen.', '', '', '', '', '', '', 47187),
(65793, 'deDE', 'Eieskorte', 'Eskortiert die Eier zu den Lebensbecken.', 'Nachdem der Schwurstein wieder ermächtigt wurde, müssen wir nun die Zukunft unserer Art zu den Lebensbecken bringen. Es ist das Recht eines jeden wahren Drachenschwarms, seine Eier in seinen eigenen Gewässern pflegen zu lassen.\n\nLeider werden unsere Feinde den Himmel beobachten, nachdem wir uns offenbart haben. Wir werden die letzte Etappe der Reise zu Fuß zurücklegen, um ihren Blicken zu entgehen.\n\nTrefft mich in der Nähe des Obsidianbollwerks, $C. Als Champion der Lebensbinderin möchte ich Euch einladen, mich zu begleiten.', '', '', '', '', '', 'Sprecht mit Sabellian beim Rubinlebensschrein.', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65792, 'deDE', 'Zähne um Zahn', 'Tötet $1oa Felszähne mit Toluijin.', 'Toliqui hat behauptet, neulich einen Felszahn ohne Hilfe erlegt zu haben. Da unsere Seelen miteinander verbunden sind, möchte ich ihr nicht vorwerfen, gelogen zu haben. Stattdessen...\n\nIch will ihr und allen anderen beweisen, dass ich die bessere Hälfte unserer Seele bin! Die nächste Felszahnaufgabe wartet im Nordosten auf uns. Trefft mich dort!', '', '', '', '', '', '', 47187),
(65791, 'deDE', 'Lebensbinderin im Einsatz', 'Trefft Alexstrasza beim Rubinschwurstein.', 'Bald werden die Lebensbecken wieder gefüllt sein.\n\nDanke für Eure Hilfe dabei, $n. Es bedeutet mehr, als ich je in Worte fassen könnte.\n\nGeht und sucht die Lebensbinderin beim Schwurstein auf. Sagt ihr, dass wir bereit für die Eier sind.', '', '', '', '', '', 'Trefft Alexstrasza beim Rubinschwurstein.', 47187),
(65789, 'deDE', 'Wo Flüsse schlafen', 'Sammelt Reagenzien im Sumpfholzmoor.', 'Im Sumpfholzmoor lassen sich wichtige Reagenzien finden, die oft zur Kommunikation mit den Ahnen verwendet werden. Unglücklicherweise durchstreift der Schlickflossenstamm diese Gegend und hindert uns daran, sie einzusammeln.\n\nIch würde es sehr zu schätzen wissen, wenn Ihr ein paar der Gewächse im Moor und einige Ressourcen der Schlickflossen auftreiben könntet.', '', '', '', '', '', '', 47187),
(65783, 'deDE', 'Willkommen an unserem Feuer', 'Trefft Späherin Tomul am Baumschrittaußenposten.', 'Ihr habt Seite an Seite mit unseren Jägern gekämpft und Euch einen Platz an unserem Feuer verdient.\n\nUnsere Khan ist beim Jagdposten im Sumpf und bereitet unsere nächste Karawane vor. Ich werde sie über Eure Ankunft und Euer Anliegen benachrichtigen.\n\nDen Weg findet Ihr gewiss selbst.', '', '', '', '', '', 'Trefft Späherin Tomul am Baumschrittaußenposten.', 47187),
(65782, 'deDE', 'Hinter Schloss und Riegel', 'Beschafft den Weltenbrecherzellenschlüssel und befreit Ayasanth.', 'Als wir Gerüchte eines Todesschwingenkults gehört haben, befahl Majordomus Selistra mir, diese ehemaligen Schuppengeborenen wieder bei uns aufzunehmen. Wir hatten gehofft, dass es sich einfach nur um ein Missverständnis handelte.\n\nOffensichtlich lagen wir falsch.\n\nWir müssen uns um ihren Anführer kümmern, aber zuerst muss ich aus diesem Käfig entkommen. Findet den Schlüssel und bringt ihn mir.', '', '', '', '', '', '', 47187),
(65780, 'deDE', 'Bewährungsprobe', 'Tötet den lodernden Protodrachen.', 'Ein Geschenk der Drachen mag einige Zentauren beeindrucken, aber Klan Shikaar muss sehen, wie gut Ihr jagt.\n\nEiner unserer Jagdtrupps brachte gerade einen Protodrachen zu Boden, dem die Kraft der Flamme innewohnt. Beweist uns Euren Wert und helft dem Trupp, ihn zu töten.', '', 'Wenn ein junger Zentaur volljährig wird, nimmt er den Erwartungen gemäß oft an seiner ersten Protodrachenjagd teil.', 'Lodernder Protodrache', '', '', '', 47187),
(65779, 'deDE', 'Zu den Ebenen', 'Trefft die Späherin der Shikaar auf den Ebenen von Ohn\'ahra.', 'Der grüne Drachenschwarm ist in ihre Gärten in den nahen Ebenen zurückgekehrt. Königin Alexstrasza wünscht, dass Ihr Euch mit Merithra des Traums in Verbindung setzt.\n\nDie Zentauren dieser Ebenen sind stolze Jäger. Um in die Smaragdgärten zu gelangen, müsst Ihr mit ihnen zuerst diplomatische Beziehungen eingehen.\n\nZeigt Respekt, aber keine Schwäche.', '', '', '', '', '', 'Trefft die Späherin der Shikaar auf den Ebenen von Ohn\'ahra.', 47187),
(65778, 'deDE', 'Ein Mitbringsel für den Kreischerschwarm', 'Tragt Eure Verkleidung und verwendet das \"Prototypei\" gegen die Chefköchin der Matriarchin.', 'Seid Ihr bereit, Eure schauspielerischen Talente unter Beweis zu stellen, $n?\n\nWas? Keine solchen Talente? Dann ist es ja gut, dass ich Euch aus den Materialien, die Ihr gesammelt habt, eine federführende Kreischerschwarmverkleidung gefertigt habe!\n\nSegallia und ich brauchen noch Zeit, um das letzte \"Ei\" zu bauen, das die Matriarchin ausschalten wird. Ich habe allerdings eine kleinere Version als Prototyp gebaut, die Ihr an der Köchin ausprobieren könnt.\n\nUnd keine Bange! Unter all den Federn seid Ihr 12% besser vor diesen Explosionen geschützt!', '', '', '', '', '', '', 47187),
(65777, 'deDE', 'Schlammbedeckte Halskette', 'Macht jemanden ausfindet, der sich mit der Ebenenjagd und handgefertigten Artefakten auskennt.', '<Die uralten Muster auf der Halskette sind schwer zu entziffern, aber sie scheint aus Tierhaut und geschnitzten Knochenfragmenten zu bestehen.\n\nVielleicht kann Euch ein erfahrener Jäger mehr über den Wert dieses Objekte erzählen.>', '', '', '', '', '', '', 47187),
(65770, 'deDE', 'Ein Versprechen ist ein Versprechen', 'Versprecht Initiandin Radiya, ihr Geheimnis zu bewahren.', 'Die Tiere scheinen sich in Eurer Nähe wohlzufühlen. Das ist ein gutes Zeichen für Euren Geist.\n\nNun... könnt Ihr ein Geheimnis für Euch behalten? Ich möchte Euch einer Freundin vorstellen. Niemand weiß von ihr.\n\nIhr müsst mir zuerst versprechen, dass das zwischen uns bleibt. Meine Ohn würde mich von den Ebenen verbannen, wenn sie es herausfände.', '', '', '', '', '', 'Sprecht mit Godoloto der Ohuna.', 47187),
(65769, 'deDE', 'Eisige Spinnweben', 'Befreit $1oa eingesponnene Überlebende im Schaudernetztal.', 'Viele meiner Freunde und Kollegen wurden gefangen genommen, als die Arachniden und ihre Primalistenmeister angriffen.\n\nIch habe gesehen, wie sie mit gefrorenen Spinnweben gefesselt und verschleppt wurden. Ihnen droht ein Schicksal, das ich mir gar nicht ausmalen mag.\n\nBitte befreit so viele von ihnen wie möglich!', '', '', '', '', '', '', 47187),
(65761, 'deDE', 'Mehr Abenteuer als erwartet', 'Nutzt Godoloto, um Radiya zu finden und zu retten.', '<Godolotos Blick ist starr und vorwurfsvoll. Sie hustet.>\n\n<Vielleicht kann Euch die Ohuna helfen, Radiya zu finden und zu retten.>', '', '', '', '', '', '', 47187),
(65760, 'deDE', 'Zum Dienst melden', 'Folgen Sendrax zum Drachenherzaußenposten.', 'Ich habe bisher nur in Büchern über die Djaradin gelesen.\n\nUralte Rivalen der Drachen, mächtige Riesen und Herrscher über Erde und Lava... vollkommen darauf verschworen, die Drachen bis zur Auslöschung zu jagen.\n\n<Sendrax runzelt die Stirn beim Anblick des fernen Vulkans.>\n\nMein Ausbilder sagte, sie wären nicht mehr gesehen worden, seit die Drachen verschwunden sind, da sie tief in der Erde schlafen.\n\nSollten sie erwacht sein, ist jeder Welpling auf diesen Inseln in Gefahr!\n\nFolgt mir, ich bringe uns zu Kommandant Lethanak beim Drachenherzaußenposten.', '', '', '', '', '', 'Sprecht mit Kommandant Lethanak beim Drachenherzaußenposten.', 47187),
(65758, 'deDE', 'Grungir der Entdecker', 'Findet Grungir Eisenschnauze.', '$N! Mein Kollege aus der Forscherliga, Grungir Eisenschnauze, war nicht unter jenen, die Ihr gerettet habt. Zunächst hatte er sich den Weg freigekämpft, aber als er sah, wie wenige von uns es rausgeschafft hatten, kehrte er um und ging direkt wieder rein! Alleine!\n\nDieser Trottel ist ebenso mutig wie impulsiv. So ein Schicksal hat er nicht verdient.\n\nBitte findet ihn.', '', '', '', '', '', '', 47187),
(65752, 'deDE', 'Arkane Störenfriede', 'Tötet $1oa schlemmende Wyrms.', 'Eine große Anzahl Manawyrms absorbiert die wilde arkane Magie, die den Archiven entströmt.\n\nDie Rate, mit der sie das tun, stört das Gleichgewicht der Leylinien... was verhindert, dass der Azurschwurstein wiedererlangt werden kann.\n\nIch werde etwas von dem instabilen Arkana nutzen, das Ihr eingesammelt habt, um eine Art Haken zu bilden.\n\nNutzt ihn, um einige Wyrms zu erledigen. Die kurze Verzögerung wird genug für mich sein, um die Energien unten anzupassen.', '', '', '', '', '', '', 47187),
(65751, 'deDE', 'Plattformanpassungen', 'Bannt $1oa Einheiten instabiler Arkanenergie an der Spitze der Azurarchive.', 'Die letzte arkane Störung scheint hier oben zu sein.\n\nIch werde die Leyenergien weiter angleichen. Benutzt etwas von dem Arkana, das Ihr zuvor geborgen habt, um die Unterbrechungen hier auszugleichen.', '', '', '', '', '', '', 47187),
(65750, 'deDE', 'Achtbeinige Plage', 'Tötet $1oa Schaudernetzschleicher oder Schaudernetzkriecher und $2oa Pfleger der Primalisten im Schaudernetztal.', '$C!\n\nIch brauche Eure Hilfe, wenn Ihr bereit seid...\n\nDiese gemeinsame Expedition sollte die einzigartigen Arachniden in dieser Gegend studieren, aber wie Ihr sehen könnt, ist unser Plan gescheitert.\n\nWas wir ursprünglich für eine evolutionäre Anpassung hielten, ist stattdessen eine Perversion der natürlichen Ordnung durch die Primalisten!\n\nIch nehme meine Verantwortung als Naturschützerin ernst, aber die Zeit des Studiums lebender Exemplare ist vorbei. Wir können nicht zulassen, dass sich ihre Perversion ausbreitet. Stattdessen können wir ihre Leichen erforschen.\n\nWerdet Ihr uns dabei helfen?', '', '', '', '', '', '', 47187),
(65711, 'deDE', 'Den Donner rauben', 'Tötet die Sturmextraktoren und befreit Lizi das Donnerrückgrat aus dem Lager der Kaighan.', 'Ihr seid das! Ohn\'ahra sei Dank. Ich habe so getan, als wäre ich verletzt, um den nächsten Grobian in die Irre zu führen, der sich hierher traut. Uff... die Huflecker haben mich mit einem Bindungszauber belegt. Den werde ich noch brechen.\n\nSie halten Lizi in der Höhle gefangen. Bitte befreit sie. Ich komme hier schon allein klar.\n\nTut, was Ihr tun müsst.', '', '', '', '', '', '', 47187),
(65709, 'deDE', 'Arkanes Stutzen', 'Sucht im Beutel nützlicher Waren nach dem Leyszepter und nutzt es, um zwei Plattformen zu reparieren.', 'Wir können den Schwurstein in den Azurarchiven nicht aktivieren, bis wir das Problem mit der außer Kontrolle geratenen Leyenergie hier behoben haben.\n\nZwei der drei drakonischen Runen, die sie kontrollieren sollen, werden von instabilem Arkana unterdrückt.\n\nIch entschuldige mich, dass dies aufgrund von Khadgars Verantwortungen und dem Nichterscheinen meiner Leute nun Euch zufällt.\n\nIn dem Beutel nützlicher Waren, den Ihr habt, sollte ein Leyszepter sein.\n\nBenutzt es, um die Runen in der Nähe zu reparieren.', '', '', '', '', '', '', 47187),
(65702, 'deDE', 'In den Wahnsinn getrieben', 'Bergt $1oa Portionen instabiler Arkanenergie.', 'Die Azurarchive waren einst der Ort, wo die blauen Drachen sich versammelten, um über Magie zu diskutieren.\n\nNun bin ich hier der einzige meiner Art.\n\nVon hier aus werden die gewaltigen Leylinien unter dem Azurblauen Gebirge beaufsichtigt, aber dieser Ort und seine Diener sind außer Kontrolle geraten.\n\nIch glaube, wenn wir wieder Ordnung in diesen Ort bringen, kann ich den Azurschwurstein neu beanspruchen.\n\nDie verschiedenen Konstrukte und Elemente sind voller instabiler arkaner Energie, die umgeleitet werden muss.\n\nZerstört sie und sammelt ein, was Ihr könnt.', '', '', '', '', '', '', 47187),
(65701, 'deDE', 'Bewahrung oder Verheerung', 'Wählt eine Spezialisierung.', 'Falls es stimmt, was diese Drachen sagen, dann erwartet uns eine große Schlacht. Wir brauchen Eure Konzentration und Eure Stärke, $gRufer:Ruferin;.\n\nEs ist an der Zeit, dass Ihr Eure Kampfspezialisierung wählt. Werdet Ihr Eure Verbündeten bewahren oder Eure Feinde verheeren?\n\nUm Eure Kampffertigkeiten bis auf das Schärfste zu schleifen, wählt Verheerung.\n\nUm Euer Heilpotenzial zu maximieren, wählt den Weg der Bewahrung.\n\nJede Spezialisierung wird Euch gut dienen. Und vergesst nicht, Ihr könnt sie später noch ändern oder anpassen.', '', '', '', '', '', '', 47187),
(65691, 'deDE', 'Der Schatten seiner Schwingen', 'Stellt Cygenoth, Stimme von Neltharion, zur Rede.', 'Die Stimme von Neltharion hält sich weiter unten auf und verbreitet Lügen unter ihren Anhängern.\n\nEr scheint wie ich der Drachenbrut anzugehören, aber er spricht gebrochenes Drakonisch, als wäre er ein Ungeschuppter.\n\nIch vermute ein falsches Spiel, womöglich eine Illusion. Wenn wir ihn unterwerfen können, wird die Wahrheit sicherlich ans Licht kommen.', '', 'Selbsternannte Stimme von Neltharion und Anführer der Weltenbrecher.', 'Cygenoth', '', '', '', 47187),
(65690, 'deDE', 'Befürchtungen eines Kultisten', 'Findet Ayasanth im Schwelenden Horst.', 'Eine weitere Außenseiterin kam gestern hier an. Sie nannte sich \"Abgesandte\" des roten Drachenschwarms und bat um eine Audienz bei unserem Anführer, der Stimme Neltharions.\n\nDoch die Stimme wurde furchtbar wütend. Er sagte, dass der Erdwächter uns auf die Probe stellt, und dass wir sie hinrichten müssen!\n\nIch weiß, dass wir Fremden nicht trauen sollen, aber deshalb müssen wir sie ja nicht gleich töten! Bitte helft mir, sie zu retten.', '', '', '', '', '', 'Sprecht mit Ayasanth im Schwelenden Horst.', 47187),
(65689, 'deDE', 'Die vielen Abbilder von Kalecgos', 'Nutzt den Kristallpylon, um zu den Azurarchiven zu gelangen.', 'Schön, Euch offiziell kennenzulernen, $n. Mein Name ist Kalecgos, Erzmagier der Kirin Tor und Aspekt des blauen Drachenschwarms.\n\nIch habe Schwierigkeiten bei der Wiederherstellung der Azurarchive, um den Azurschwurstein erneut zu beanspruchen. Ich könnte ein zusätzliches Paar physischer Hände gut brauchen.\n\nIch bin gerade oben in den Archiven selbst. Es ist mir gelungen, den Pylon draußen zu reaktivieren, das sollte Euch erlauben, hier heraufzukommen.', '', '', '', '', '', 'Sprecht mit Kalecgos in den Azurarchiven.', 47187),
(65688, 'deDE', 'Treffen mit Kalecgos', 'Holt den Beutel nützlicher Waren und trefft Kalecgos am Fuße der Azurarchive.', 'Ich fürchte, wir werden unsere Aufmerksamkeit teilen müssen. Die Primalistenbedrohung im Osten muss unter Kontrolle gebracht werden.\n\nIch muss Euch darum bitten, an meiner statt zu den Azurarchiven zu reisen und Kalecgos dabei zu unterstützen, den Azurschwurstein neu zu beanspruchen.\n\nIhr werdet einige Vorräte einpacken müssen, die Euch dabei helfen werden, mit den ganzen Geschehnissen dort fertig zu werden.\n\nSprecht mit unserem Portalrüstmeister. Dort solltet Ihr etwas bekommen können, das Euch auf Eurem Wege hilft.\n\nViel Glück, $n. Kalecgos wird die Hilfe zu schätzen wissen.', '', '', '', '', '', 'Trefft Kalecgos am Fuß der Azurarchive.', 47187),
(65687, 'deDE', 'Schlagfertige Argumente', 'Tötet $1oa Weltenbrecherdrachkin.', 'Einige der anderen Schüler sind... ziemlich fies.\n\n<Barren reibt über eine frische Wunde auf seiner Schnauze.>\n\nFrüher war das nicht so. Aber dann kam Cygenoth und sagte: \"Wir sollten Stärke über alles andere stellen.\" Jetzt kämpfen alle die ganze Zeit.\n\nIch will mich ja wehren! Aber ihre Bälge sind zu dick... und ich bin zu klein.\n\nAber Ihr nicht! Ihr kämpft bestimmt andauernd gegen Fieslinge. Vielleicht könnt Ihr ja helfen?', '', '', '', '', '', '', 47187),
(65686, 'deDE', 'In das Azurblaue Gebirge', 'Trefft Euch mit Glania von den Gesegneten im Azurblauen Gebirge.', 'Seid gegrüßt, $n! \n\nPakina und ich sind hier im Auftrag der Kirin Tor und suchen Hilfe.\n\nDie Kirin Tor sind damit beschäftigt, die wilde arkane Magie, die sich überall im Azurblauen Gebirge findet, zu schützen.\n\nKalecgos, der Aspekt des blauen Drachenschwarms und einer unserer Anführer, benötigt Hilfe dabei, den Azurschwurstein erneut zu beanspruchen.\n\nWenn Ihr helfen könnt, reist die Straße weiter, um Glania von den Gesegneten aufzusuchen.\n\nSie kann Euch sagen, wo Eure Hilfe am meisten benötigt wird.', '', '', '', '', '', 'Trefft Euch mit Glania von den Gesegneten im Azurblauen Gebirge.', 47187),
(65615, 'deDE', 'Arkanes Eindringen', 'Untersucht den Arkanstrahl.', 'Das Leuchtfeuer vor uns... Ich bin mir sicher, es war noch nicht da, als wir eingesperrt wurden.\n\nZauberei ist nicht meine Stärke, aber ich erkenne arkane Magie, wenn ich sie sehe. Dieselbe Magie hat der blaue Drache in dem Hort angewandt.\n\nEr sagte einen Namen... Malygos. Er hört sich so vertraut an, aber die Lehren des Erdwächters scheinen wie in weiter Ferne. Bruchstückhaft.\n\nFalls uns dieser Malygos in Stasis versetzt hat, wurde vielleicht auch dieses arkane Leuchtfeuer auf seinen Befehl hin platziert.\n\nUntersucht den Bereich und meldet Euch wieder. Vergewissert Euch, dass mit dem Leuchtfeuer keine gegnerischen Verstärkungen herbeigerufen werden können.', '', '', '', '', '', '', 47187),
(65613, 'deDE', 'Ein ikonischer wie drakonischer Anblick', 'Nehmt ein Antlitz an.', 'Ich bin sicher, Eure Ankunft in Orgrimmar hat für ziemlichen Aufruhr bei den Einwohnern gesorgt. Zweifelsohne fühlten sich einige in Eurer Gegenwart wohler als andere.\n\nAls ich ein junger Drache war, nahm ich das Antlitz eines Sterblichen an, das Ihr nun seht. So konnte ich als Verbündeter unter den Tauren von Hochberg leben.\n\nAuch wenn sich Eure Pfade von meinen unterscheiden, fließt die Essenz der Drachenheit auch durch Eure Adern, $p. Vielleicht erlaubt sie Euch ebenfalls, ein Antlitz anzunehmen.\n\nLasst uns ein Stück gehen.', '', '', '', '', '', '', 47187),
(65606, 'deDE', 'Angesehen bei den Maruuk', 'Sprecht mir Agari in Maruukai.', 'Eure Bemühungen zur Förderung der Interessen des Klans sind nicht unbemerkt geblieben.\n\nKehrt nach Maruukai zurück. Ich habe einige Vorräte vorbereitet, um Euch bei Eurer Zusammenarbeit mit uns weiter zu unterstützen.', '', '', '', '', '', '', 47187),
(65595, 'deDE', 'Ein fauler Apfel', 'Tötet die Wurzel des Verfalls.', 'Verrottung lässt Gnolle hungern.\n\nVerrottung verletzt Freunde.\n\nWir jetzt Verrottung töten. Ist Aufgabe von Mohn-Archs.', '', 'Der widerwärtige Treant hat die Gnolle Verfallmagie gelehrt. Und miese Hygiene.', 'Wurzel des Verfalls', '', '', '', 47187),
(65594, 'deDE', 'Aus einem Gnoll einen Elefanten machen', 'Zerstört $2oa Totems des Verfalls.', 'Blöder Verfall denken, ist Boss. Aber ich Boss. Wir jetzt töten. Hab Schleim in Freunde verwandelt.', '', '', '', '', '', '', 47187),
(65490, 'deDE', 'Explosive Exkremente', 'Füllt Professorin Hohnzirpers Autoexkrementsammler.', 'Die Harpyien sind ja eine erfreuliche Überraschung und so, aber ich bin nur aus einem einzigen Grund in diese Berge gekommen: EXKREMENTE!\n\nGenauer gesagt, wegen der Exkremente von Blaufederrocs, die von Wanzen gefressen und verdaut wurden. Die Magensäfte der Skarabäen erhöhen den explosiven Stickstoffgehalt um das Zehnfache! Mindestens!\n\nHier nehmt Hohnzirpers Autoexkrementsammler. Tretet auf die Skarabäen auf dem Höhlenboden ein und benutzt den Sammler, um die Belohnungen zu ernten.\n\nBringt ihn vollständig gefüllt zurück, damit wir mit dem richtigen Spaß anfangen können: EXPLOSIONEN!', '', '', '', '', '', '', 47187),
(65486, 'deDE', 'Ein perfektes Bild', 'Nehmt das Katalogisiererfloß mit Fren und macht Bilder von der heimischen Tierwelt.', 'Entschuldigt, ich verlier mich manchmal sehr im Teleskop.\n\nFindet Ihr nicht auch, dass die Welt sich aus der Ferne viel leichter versteh\'n lässt? Keine Störungen von außen, nur die Natur, die ihren Weg ohne uns geht...\n\n<Akunda die Katalogisiererin seufzt.>\n\nWie ich sehe, hat Coralie Euch eine Kamera gegeben. Gut.\n\nFahrt mit Fren den Fluss entlang und macht ein paar Fotografien von den Wildtieren in ihrem natürlichen Lebensraum, damit ich sie studier\'n kann.', '', '', '', '', '', 'Kehrt zu Akunda der Katalogisiererin in ihrem Lager zurück.', 47187),
(65475, 'deDE', 'Kreischende Botschaft', 'Bringt die Schriftrolle des Kreischerschwarms zu Harleen Hohnzirper an den Blaufederklippen.', '<Ihr zieht einen Fetzen Pergament aus dem mit Blut getränkten, besudelten Ranzen von Rocfresser. Alles, was Ihr erkennt, ist das Bild einer Harpyie, die große Eier verschlingt.\n\nIhr seid Euch sicher, dass die dicken, unverständlichen Kratzspuren Eurer Lieblingsornithologin, Harleen Hohnzirper, einiges verraten werden.>', '', '', '', '', '', 'Bringt die Schriftrolle des Kreischerschwarms zu Harleen Hohnzirper an den Blaufederklippen.', 47187),
(65453, 'deDE', 'Urgeziefer', 'Tötet $1oa Urprotodrachen an der Wilden Küste.', '<Glutdresch wirft einen misstrauischen Blick auf die Protodrachen, die hinter ihr auf dem Gebirgskamm lauern.>\n\nIch könnte schwören, dass diese Protodrachen jedes Mal, wenn ich ihnen den Rücken zuwende, näher an das Lager herankommen...\n\nDas sind nicht die Drachen, die Ebyssian uns hier vorstellen wollte.\n\nDie Protodrachen sind skrupellose Raubtiere, mit denen man nicht verhandeln kann. Wir müssen ebenso skrupellos sein.\n\nDezimiert ihre Zahl, um ihre Kühnheit zu mäßigen, sonst ist diese Expedition zu Ende, bevor sie richtig begonnen hat.', '', '', '', '', '', 'Trefft Schuppenkommandantin Glutdresch in der Botschaft von Schwingenrast.', 47187),
(65452, 'deDE', 'Forscher in Not', 'Rettet 3 Mitglieder der Drachenschuppenexpedition an der Wilden Küste.', 'Missversteht das wissenschaftliche Vorgehen der Expedition nicht als Zaghaftigkeit, $p.\n\nWir sind keine Einsiedler, die in weit entfernten Türmen ihre Bücher studieren.\n\nWir sind Abenteurer, die in jedem Winkel Azeroths nach Wissen aus erster Hand suchen!\n\nDiese Leidenschaft für Abenteuer bringt uns oftmals in Gefahr, und einige Expeditionsmitglieder haben sich ein bisschen mehr vorgenommen, als sie bewältigen konnten...', '', '', '', '', '', 'Trefft Naleidea in der Botschaft von Schwingenrast.', 47187),
(65451, 'deDE', 'Übungsmaterialien', 'Sammelt $1oa Urprotowelpenschuppen.', 'So etwas wie diese Protodrachen habe ich noch nie auf Azeroth gesehen.\n\nIhre Schuppen scheinen von Natur aus feuerfest zu sein, stärker als Stahl, und sie büßen dabei nicht an Flexibilität ein. Unglaublich.\n\nMeine Kunsthandwerker... und zwar alle... wollen unbedingt ein paar dieser Schuppen in die Hände bekommen, um damit zu arbeiten.\n\nBeginnt mit den Welpen. Ihre kleineren Schuppen sollten biegsamer sein und uns dabei helfen, unsere Techniken zu verbessern.', '', '', '', '', '', 'Trefft Boss Magor in der Botschaft von Schwingenrast.', 47187),
(65444, 'deDE', 'Zu den Dracheninseln!', 'Nehmt die Draufgängerische Drachenschuppe vom Zeppelinturm außerhalb von Orgrimmar zu den Dracheninseln.', 'Unsere Expeditionsvorhut ist auf den Dracheninseln gelandet.\n\nDank den Bemühungen der mutigen Mitglieder der Drachenschuppenexpedition haben wir einen geschützten Landeplatz auf den Dracheninseln eingerichtet und Kontakt mit der Botschaft des Drachenschwarms aufgenommen.\n\nWollt Ihr uns auf unserer nächsten Reise zu den Dracheninseln begleiten?', '', '', '', '', '', 'Trefft Naleidea Flussglanz an der Küste der Dracheninseln.', 47187),
(65443, 'deDE', 'Expeditionskoordination', 'Rekrutiert Forscher, Handwerker und Gelehrte in ganz Orgrimmar für die Expedition zu den Dracheninseln.', 'Erfreut, Euch kennenzulernen, ich bin Naleidea Flussglanz!\n\nDie Einladung, die Dracheninseln aufzusuchen, ist eine überaus aufregende Aussicht! Meint Ihr nicht auch?\n\nDie Archäologische Akademie hat ihre Ressourcen mit den entsprechenden Mitgliedern unserer Expedition zusammengelegt, um uns bei der Koordination unserer Anstrengungen zu unterstützen. Als Mitglied der Drachenschuppenexpedition ist es mir eine Ehre, Euch willkommen zu heißen!\n\nZunächst müssen wir jedoch weitere Mitglieder für unsere Reise finden. Wollen wir beginnen?', '', '', '', '', '', 'Trefft Naleidea am Zeppelinturm außerhalb von Orgrimmar.', 47187),
(65439, 'deDE', 'Flüstern in den Winden', 'Sprecht mit Erzmagier Khadgar außerhalb von Orgrimmar.', 'Hallo, $p. Es ist lange her und ich wünschte, wir hätten mehr Zeit zum Plaudern.\n\nAber ich hatte gerade eine recht erhellende... nein, eher unheilvolle... ja, eine unheilvolle Unterhaltung mit einem alten Freund.\n\nManchmal kann eine Enthüllung immerhin beides sein.\n\nIch muss Euch berichten, was ich erfahren habe.', '', '', '', '', '', '', 47187),
(65438, 'deDE', 'Krasser Questbeginn', '', 'Der Beginn des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65437, 'deDE', 'Einladung der Aspekte', 'Sprecht mit Ebyssian.', 'Ihr kommt genau zur rechten Zeit, $p.\n\nIch habe gerade beim Rat der Horde vorgesprochen und er hat beschlossen, die Einladung der Aspekte auf die Dracheninseln anzunehmen.\n\nDie Einladung gilt genauso für Euch.\n\nVielleicht sind Euch auch hier in Orgrimmar einige ungewohnte Gesichter aufgefallen. Die Dracthyr sind gerade erst angekommen, aber Ihr werdet auf unserem gemeinsamen Abenteuer noch viel über sie erfahren.\n\nLasst uns weiter reden.', '', '', '', '', '', '', 47187),
(65436, 'deDE', 'Die Dracheninseln warten', 'Trefft Euch mit Furorion in Sturmwind.', 'Wundervolle Neuigkeiten, meine lieben Freunde! Die Dracheninseln erwachen!\n\nNach der Zerschlagung ließ mein Volk die Dracheninseln in einem tiefen Schlummer zurück. Doch nun endlich spüren wir den Ruf nach Hause.\n\nDie Inseln bergen viele Wunder, doch sie sind nicht ohne Gefahren. Um unser rechtmäßiges Erbe zurückzuerobern, sind wir auf die Hilfe unserer sterblichen Verbündeten angewiesen.\n\nTrefft mich in Sturmwind. Ich muss der Allianz die Einladung der Aspekte vorlegen.', '', '', '', '', '', '', 47187),
(65435, 'deDE', 'Die Dracheninseln warten', 'Trefft Euch mit Ebyssian in Orgrimmar.', 'Helden der Horde, ich bringe Neuigkeiten. Die Dracheninseln erwachen!\n\nNach der Zerschlagung fielen die Inseln in einen tiefen Schlummer. Doch nun endlich haben sie meinesgleichen und mich nach Hause berufen.\n\nDie Inseln bergen viele Wunder, doch auch nicht minder Gefahren. Um unser rechtmäßiges Erbe zurückzuerobern, sind wir auf die Hilfe unserer sterblichen Verbündeten angewiesen.\n\nIch werde dem Rat der Horde in Orgrimmar gleich die Einladung der Aspekte präsentieren. Trefft mich dort und wir werden sehen, was der Rat dazu sagt.', '', '', '', '', '', '', 47187),
(65422, 'deDE', 'Die Jagd nach Schätzen ist nicht leicht', 'Schnappt Euch die Kletterausrüstung, sucht Euch dann einen Haltegriff und klettert auf den Gipfel des Berges, ohne den Halt zu verlieren!', 'Ich kann es in Euren Augen sehen: Ihr wollt unbedingt den Gipfel dieses Berges erklimmen und herausfinden, was dort oben ist!\n\nWir Kletterer erkennen uns immer gegenseitig. Wir lassen uns von keinem Berg klein machen, nicht wahr?\n\nNur gut, dass ich eine Menge Kletterausrüstung dabei habe. Schnappt Euch einen Rucksack und findet einen Weg nach oben!', '', '', '', '', '', 'Sprecht mit Twitti Leuchtritzel auf der Spitze des Berges.', 47187),
(65421, 'deDE', 'Auf jeden Berg', 'Schnappt Euch die Kletterausrüstung, sucht Euch einen Haltegriff und klettert die Klippe hoch, um Pfadfinderin Yips zu befreien!', 'Hoffentlich lernt Ihr schnell, $C. Ich hab nämlich keine Zeit für eine Lehrstunde!\n\nSchnappt Euch einen Rucksack und findet einen Weg zur Spitze.\n\nWenn Ihr oben seid, werft unserer Yips diesen Fallschirm zu. Die arme Kleine hat sich in ein paar Ranken verfangen, als die Luftelementare unser Flugzeug zum Absturz gebracht haben!\n\nBeeilt Euch, damit wir schleunigst hier rauskommen!', '', '', '', '', '', '', 47187),
(65417, 'deDE', 'Verbindungen finden', '', '', '', '', '', '', '', '', 47187),
(65374, 'deDE', 'Zeit zum Rupfen', 'Rupft $1oa Kükenfedern aus.', 'Harleen hat mir erzählt, dass sie eine Verkleidung für Euch anfertigt! Wie aufregend! Aber sie braucht noch ein paar Federn von Rocküken, um das Kostüm zu vervollständigen.\n\nGlücklicherweise habe ich gerade die Reparatur des Federrupfers 3300 abgeschlossen!\n\nDer Kreischerschwarm fängt auf den unteren Klippen Rocküken ein, um sie aufzuziehen und für sich selbst zu züchten. Benutzt den Rupfer, um die Küken aus der Gefahr zu befreien. Er rupft auch automatisch einige ihrer Federn für Euch!\n\nZwei Fliegen mit einem Rupfer, würde ich sagen!', '', '', '', '', '', '', 47187),
(65373, 'deDE', 'Auseinandergerupft', 'Bergt 4 Teile des Federrupfers 3300.', 'Oh, nein... Ich habe einen gewaltigen Fehler gemacht.\n\nHarleen hat mir den berühmten Federrupfer 3300 anvertraut, eine phänomenale Erfindung von ihr persönlich!\n\nIch wollte in der Höhle südlich von hier Rocfedern für ihre Forschungsarbeit rupfen, aber die Harpyien haben mir aufgelauert und er zerbrach in mehrere Teile, als ich hinauslief.\n\nBitte sammelt die Teile ein! Sie liegen wahrscheinlich wie abgeworfene Schuppen überall auf dem Höhlenboden verstreut.\n\nIch kann ihn bestimmt wieder zusammensetzen. Kein Zweifel. Nun, wahrscheinlich.', '', '', '', '', '', '', 47187),
(65371, 'deDE', 'Ein eigenes Nest', 'Sammelt $1oa Kreischerschwarmkrallen, $2oa Kreischerschwarmstäbe und $3oa Flussbrutkerne.', 'Die Schriftrolle, die Ihr gefunden habt, ist ein Befehl, alle Blaufedereier zur Harpyienköchin Fritt-Erie zu bringen. Offenbar isst die Matriarchin des Kreischerschwarms nichts, was nicht ordentlich zubereitet und gewürzt wurde.\n\nAlso werden wir ihr ein besonderes Ei kredenzen. Eines, das EXPLOSIV lecker ist... und explodiert, wenn sie es isst... versteht sich.\n\nUnd wie werdet Ihr es ihr überbringen? In Verkleidung!\n\nTötet die Biester auf den unteren Klippen, sammelt die Teile auf dieser Liste ein, und ich fertige Euch ein Kostüm mit Federn und allem Drum und Dran.', '', '', '', '', '', '', 47187),
(65313, 'deDE', 'Appetit auf Geflügel', 'Tötet Hawthia Rocfresser.', 'Tharzera scheint in Ordnung zu sein, sie kann gut mit Geräten umgehen, aber sie gerät leicht in Panik.\n\nEin Beispiel: Als ich sie in die Höhlen direkt südlich von hier geschickt habe, wurde sie prompt von einer ungewöhnlich großen Harpyie dort herausgejagt. Anscheinend hat sie auch den anderen Befehle gegeben.\n\nKönnte sie die Matriarchin dieser Brut sein? Vielleicht eine Art Kommandantin? Geht rein und findet es heraus, $n.\n\nUnd scheut Euch nicht, ein paar Federn zu rupfen, wenn Ihr wisst, was ich meine.', '', 'Eine außergewöhnlich große Harpyie des Kreischerschwarms mit einem unstillbaren Appetit auf Blaufederknochen.', 'Hawthia Rocfresser', '', '', '', 47187),
(65307, 'deDE', 'Gnade zuerst', 'Heilt verletzte Dracthyr und Drakoniden.', 'Das Gift im Hort hat uns fast alle dahingerafft. Während das Gegengift zubereitet wird, müsst Ihr die Verwundeten suchen und sie heilen.\n\nJa, sogar die blauen Drakoniden. Die Heilschwingen stehen nicht untätig herum, während andere leiden.', '', '', '', '', '', '', 47187),
(65306, 'deDE', 'Fäulnisfarmer', 'Sammelt $1oa Portionen müffelnden Schleim von verrottenden Wurzeln.', 'Verfall. Eklig, stinkt und tut weh. Hab Idee, aber brauche Schleim. IHR SCHLEIM HOLEN!', '', '', '', '', '', '', 47187),
(65302, 'deDE', 'Schlüssel zum Königreich', 'Beschafft den Schlüssel und öffnet damit das Waffendepot.', 'Brauche Waffen für Plan. Hab gute Waffen, sind aber eingeschlossen. Gnolle Schlüssel in Lager gelassen haben, in beschütztem Waffendepot.\n\nHolt spitzigste Stöcke. Gibt meiste Blutflecken.', '', '', '', '', '', '', 47187),
(65287, 'deDE', 'Das Eigelb trennen', 'Sammelt $1oa Blaufedereier ein.', 'Ich habe die Schriftrolle entziffert und, Überraschung, es sind schlechte Nachrichten!\n\nDer Kreischerschwarm frisst die Blaufedern nicht nur, um sich zu ernähren. Vielmehr hat sich herausgestellt, dass sie einen oder zwei Zauber gefunden haben, die die angeborene Stärke der Rocs durch Verzehr auf sie übertragen. Das gilt insbesondere für die Eier!\n\nRettet unten an den Klippen so viele Roceier wie möglich. Das wird die Harpyien lange genug aufhalten, damit ich meinen Plan in die Tat umsetzen kann.\n\nUnd nehmt Euch vor umherwandernden Elementaren in Acht. Die Zauberei der Fluchweiber hat sie aufgescheucht!', '', '', '', '', '', '', 47187),
(65286, 'deDE', 'Drakonische Verbindungen', 'Betretet Sturmwind.', 'Normalerweise würde ein solcher Flug wesentlich länger dauern. Aber wenn der bronzene Aspekt selbst Eure Reise beschleunigt, ist es möglich, die Strecke in Rekord...\n\n<ähm>...zeit zurückzulegen.\n\nOh, die Soldaten mit den spitzen Waffen? Kein Grund zur Sorge. Lediglich eine Formalität.\n\nIch werde Euch eine Audienz beim Lordkommandanten verschaffen, während Ihr und Azurathel Euch an die Arbeit macht.\n\nGlücklicherweise verfüge ich über beachtlichen Einfluss in dieser Stadt.', '', '', '', '', '', 'Sprecht mit Azurathel.', 47187),
(65279, 'deDE', 'Ein königlicher Erlass', 'Tötet $1oa Krieger von Brackenfell und $2oa Schamanen von Brackenfell im Bachzahnbau.', 'Bekloppte Gnolle Krone nicht verstehen, nur Gewalt. Macht sie fertig oder ich Euch fressen.', '', '', '', '', '', '', 47187),
(65274, 'deDE', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'deDE', 'Rupft ihnen die Federn', 'Tötet $1oa Siecherinnen des Kreischerschwarms und $2oa Bannklauen des Kreischerschwarms.', 'Diese seltsamen geflügelten Wesen haben mich neugierig gemacht und ich wollte mich ihnen mal vorstellen. Ich wäre gefressen worden, wenn nicht Professorin Hohnzirper und ihr großes mechanisches Federvieh gewesen wären!\n\nKönntet Ihr uns helfen, diesen \"Kreischerschwarm\" loszuwerden? Die einheimischen Blaufederrocs haben Probleme, ihre Nester vor ihnen zu verteidigen.\n\nUnd ich möchte nicht, dass weitere Bekanntschaften mit ihnen so verlaufen wie meine...', '', '', '', '', '', '', 47187),
(65220, 'deDE', 'Navigation Playtest: Level Up (PART 2)', '', 'Das Ende des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65218, 'deDE', 'Navigation Playtest: Level Up (PART 1)', '', 'Der Beginn des Azurblauen Gebirges.', '', '', '', '', '', '', 47187),
(65133, 'deDE', 'Schwung mit dem Drachen nutzen', 'Taucht durch die Ringe und landet im Zielgebiet.', 'Und was, wenn sich Hindernisse im Weg befinden?\n\nWenn Ihr das Fliegen beherrscht, könnt Ihr Euren Schwung beibehalten und nach einem Sturzflug etwas Höhe gewinnen.\n\nWenn Ihr Euch dieses Mal in den Sturzflug begebt, führt Euch die Flugroute unterhalb des Landebereichs vorbei. Mit dem aufgenommenen Schwung könnt Ihr die verlorene Höhe am Ende des Kurses wiedergutmachen, um im Zielbereich zu landen.\n\nWenn Ihr irgendwo festhängt, benutzt die bronzene Taschenuhr. Celormu wird dann Eure Position zurücksetzen.', '', '', '', '', '', '', 47187),
(65120, 'deDE', 'Drachensturzflug leicht gemacht', 'Führt einen Sturzflug aus, gleitet dann durch die Ringe und landet im Zielgebiet.', 'Gleitend erreicht Ihr das gewünschte Ziel. Aber was, wenn Ihr schneller ankommen wollt?\n\nDurch den Sturzflug von einem hohen Punkt erhaltet Ihr einen Geschwindigkeitsschub.\n\nFliegt durch die Ringe zum Zielort.\n\nWenn Ihr irgendwo festhängt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurücksetzen.', '', '', '', '', '', '', 47187),
(65118, 'deDE', 'Drachenflug leicht gemacht', 'Gleitet durch die Ringe und landet im Zielgebiet.', 'Fangen wir mit den Grundlagen an.\n\nWenn Ihr geradeaus fliegt, werdet Ihr sehr schnell erschöpft sein. Nutzt die Schwerkraft und zielt leicht nach unten, um eine lange Strecke zu fliegen. Die Ringe zeigen Euch den allgemeinen Winkel an, den Ihr für den einfachen Gleitflug verwenden solltet.\n\nZuerst, ruft Euren Drachen herbei.\n\nDann fliegt durch die Ringe und landet am Zielort.\n\nWenn Ihr irgendwo festhängt, benutzt die bronzene Taschenuhr und Celormu wird Eure Position zurücksetzen.', '', '', '', '', '', '', 47187),
(65101, 'deDE', 'Ein ikonischer wie drakonischer Anblick', 'Nehmt Euer sterbliches Antlitz an.', 'Ihr habt mit Eurer Ankunft für jede Menge Aufsehen in Sturmwind gesorgt, $p. Zweifellos haben Euch manche Bürger... offener empfangen als andere.\n\nUm mit anderen Völkern besser kommunizieren zu können, nehmen wir Drachen ein sterbliches Antlitz an, so wie jenes, das Ihr vor Euch seht. Das beruhigt nicht nur Verbündete, sondern erleichtert es auch ungemein, durch Türen zu gehen.\n\nDie Dracthyr durchfließt offensichtlich die Essenz der Drachenheit. Ich vermute, auch Ihr besitzt unsere Fähigkeit, ein Antlitz anzunehmen.\n\nBegleitet mich.', '', '', '', '', '', 'Zeigt Furorion Euer Antlitz.', 47187),
(65100, 'deDE', 'Letzte Befehle', 'Organisiert die Evakuierung der Verbotenen Insel.', 'Der Sturm, den Raszageth entfesselt hat, ist zu mächtig. Wir müssen die einzige Heimat evakuieren, die wir je gekannt haben.\n\nEs gibt keinen Erdwächter mehr, der uns befehligen könnte. Zum ersten Mal steht es uns frei, unsere eigenen Entscheidungen zu treffen. Unser eigenes Schicksal zu bestimmen.\n\nWo immer Ihr auch hingeht in diesem neuen Zeitalter, ich hoffe, dass Ihr würdige Verbündete findet. Erzählt ihnen unsere Geschichte.\n\nWas mich betrifft, ich werde hierbleiben und nach Überlebenden suchen. Vielleicht stoße ich dabei ja noch auf Antworten zu unserer Vergangenheit.\n\nDas Glück sei mit uns allen, $p.', '', '', '', '', '', 'Erstattet Eurem Schuppenkommandanten Bericht.', 47187),
(65098, 'deDE', 'Konsequenzen des Mutes', 'Findet Ebyssian.', 'Danke, dass Ihr mich geheilt habt, $n. Ich hoffe, dass wir unser gegenseitiges Vertrauen aufbauen können.\n\n<Furorion schaudert.>\n\nDie Sturmfresserin. Ich bin noch nie einem Drachen mit solch einer rohen Elementarenergie gegenübergestanden. Ob es noch mehr wie sie gibt?\n\nWartet... Wo ist Ebyssian? Hat er überlebt? Ihr müsst ihn finden!', '', '', '', '', '', 'Sprecht mit Glutthal.', 47187),
(65097, 'deDE', 'Lauft!', 'Rückzug!', 'Stürme werden uns überrollen! Wir müssen evakuieren!\n\nRettet so viele, wie Ihr könnt. Und findet mir diese schwarzen Drachen!', '', '', '', '', '', 'Sprecht mit Furorion.', 47187),
(65087, 'deDE', 'Die Beute im Inneren', 'Verteidigt das Gewölbe.', 'Die Primalisten wollen also, was im Gewölbe ist?\n\n<Sarkareth kneift die Augen zusammen.>\n\nLasst sie nur kommen.\n\nWir werden ihnen zeigen, wozu die Dracthyr geboren wurden!', '', '', '', '', '', '', 47187),
(65084, 'deDE', 'Das Froststeingewölbe', 'Versammelt Euch beim Froststeingewölbe.', 'Seht dort, auf der Insel! Primalistentruppen ziehen sich am Froststeingewölbe zusammen.\n\nDer Sturm, den sie entfesseln möchten, muss dort drinnen eingeschlossen sein.\n\n<Glutthal zuckt zusammen und ringt mit ihren zerrütteten Erinnerungen.>\n\nWir haben diesen Gegner schon einmal bekämpft... und wir haben gewonnen. Neltharion ordnete an, dass das Gewölbe geschützt werden soll, aber ich... weiß nicht mehr, warum...\n\nEs bleibt keine Zeit, um sich in Erinnerungen zu verlieren. Versammelt Euch mit Sarkareth und den Schwarzschuppen am Gewölbe. Sorgt dafür, dass der Feind nicht durchbricht!', '', '', '', '', '', 'Erstattet Schuppenkommandant Sarkareth im Froststeingewölbe Bericht.', 47187),
(65075, 'deDE', 'Die Heilschwingen', 'Sprecht mit Glutthal.', '$gRufer:Ruferin;, Ihr habt meinen Dank dafür, dass Ihr meinem Weyrn in seiner Stunde größter Not geholfen habt.\n\nNachdem wir unsere Stärke wiedererlangt haben, werden sich die Heilschwingen mit dem Rest unserer Truppen treffen.\n\nGlutdresch sagt mir, dass Glutthal ihren gesamten Weyrn verloren hat. Ich fürchte, ich verfüge nicht über die Magie, eine solche Wunde zu heilen.\n\nSie mag stoisch wirken, aber Glutthal schmerzt der Verlust zutiefst, $n. Sagt ihr, dass ich unterwegs bin.', '', '', '', '', '', 'Sprecht mit Glutthal.', 47187),
(65074, 'deDE', 'Leichte Beute', 'Tötet $1oa Scythiden.', 'Die Wildnis rund um den Hort beheimatet Scythiden. Sie sind gefräßige Insektoide, oft territorial und aggressiv.\n\nAll die Verwundeten würden für diese Bestien leichte Beute abgeben. Ich will nicht, dass sie unsere Heiler angreifen, während sie sich erholen.\n\nTötet so viele von ihnen wie möglich, während ich mich nach Viridia umsehe.\n\nSie ist... sehr tapfer.', '', '', '', '', '', '', 47187),
(65073, 'deDE', 'Ein giftiges Problem', 'Sammelt $1oa Giftdrüsen.', 'Ihr erholt Euch schnell, $n. Gut.\n\nDiejenigen, die meinem Hort entflohen sind, heilen, aber es sind noch mehr im Inneren gefangen. Wenn Ihr hineinstürmt, um sie zu retten, werde ich Euch nur wieder herausziehen müssen.\n\nRund um die Kaldera liegen Käfernester verteilt. Ihre Giftdrüsen könnten ein Mittel sein, um die Wirkung dieses Gifts zu neutralisieren.\n\nIch bin nicht dazu in der Lage, sie selbst einzusammeln. Ich muss auf Eure Fertigkeiten vertrauen, $gRufer:Ruferin;.', '', '', '', '', '', '', 47187),
(65071, 'deDE', 'Halpa!', 'Rettet Klein Ko.', 'Ich brauch Halpa!\n\nIch bin To\'no und war auf Erkundung, da bin ich gut drin, aber ich habe nicht bemerkt, dass meine Schwester Ko mir gefolgt ist. Ich brauch Eure Halpa, sie zu finden, weil sie in Schwierigkeiten ist, also hab ich Eure Halpa, bitte?\n\nSie ist in diese Höhle gegangen, aber sie ist im Verstecken nicht so gut wie ich und unsere Eltern sind zu weit weg.\n\nKönnt Ihr sie finden, bevor es die Monster tun?', '', '', '', '', '', 'Bringt die Kinder zu ihren Eltern.', 47187),
(65063, 'deDE', 'In den Bau', 'Folgt Glutdresch, um Viridia zu finden.', 'Was auch immer das für ein Gift ist, dass sich in diesem Hort ausgebreitet hat, es ist stark genug, selbst unsere besten Heiler auszuschalten.\n\nDas verheißt nichts Gutes, weder für mich noch für Euch, $n.\n\nAber das spielt keine Rolle. Dort sitzen Dracthyr in der Falle. Wir gehen rein, egal wie riskant.\n\nAtmet tief durch und folgt mir!', '', '', '', '', '', 'Sprecht mit Viridia.', 47187),
(65060, 'deDE', 'Kaldera der Heiler', 'Trefft Glutdresch in der Kaldera der Heiler.', 'Eure Vision vom arkanen Leuchtfeuer hat offenbart, dass Dracthyr in ihren Horten eingesperrt sind. Wir können es uns nicht erlauben, noch mehr unserer Leute zu verlieren.\n\n<Glutthal hält mit gerunzelter Stirn inne.>\n\nDie Heilschwingen sind die besten Heiler in unseren Rängen. Ihr Hort liegt innerhalb der Kaldera der Heiler. Glutdresch kennt den Weg.\n\nLasst niemanden zurück, $gRufer:Ruferin;.', '', '', '', '', '', 'Sprecht mit Glutdresch bei der Kaldera der Heiler.', 47187),
(65057, 'deDE', 'Auf zu Glutthal', 'Erstattet Glutthal Bericht.', 'Nun, da der Kampf vorüber ist, erwartet Ihr, dass ich Glutthal Bericht erstatte. Erwartet Azurathel, dass ich ihren Befehlen folge?\n\nIch denke nicht.\n\nDie Schwarzschuppen sind einzig dem Erdwächter unterstellt. Und bis jetzt habe ich keine Befehle von Neltharion erhalten.\n\n<Sarkareths Blick verfinstert sich.>\n\nDennoch bin ich nicht blind gegenüber der Bedrohung, welche diese Primalisten darstellen. Ich bin mir sicher, dass ich ihre Art zuvor schon bekämpft habe und dennoch...\n\nWir werden am Boden vorstoßen, wenn meine Leute wieder einsatzbereit sind. Wegtreten, $gRufer:Ruferin;.', '', '', '', '', '', '', 47187),
(65052, 'deDE', 'Die Schwarzschuppen', 'Gelangt zu Schuppenkommandant Sarkareth.', 'Wir haben es hinter den Primalisteneinfall geschafft. Nun müssen wir den Hort erreichen.\n\nSchuppenkommandant Sarkareth ist hart im Nehmen und sein Weyrn hält stand. Aber ein Drache hat die Schwarzschuppen festgenagelt.\n\nEs ist an der Zeit, dem Kampf beizutreten!\n\nGeht voran. Gebt das Signal, wenn wir in Reichweite des Drachen sind. Dann schlagen wir mit sämtlichen uns zur Verfügung stehenden Kräften zu.\n\nNehmt Euch vor Hinterhalten in Acht. Ich habe kein gutes Gefühl dabei.', '', 'Eine uralte Bestie, die die Schwarzschuppen gefangen hält.', 'Ekrazathal', '', '', 'Sprecht mit Schuppenkommandant Sarkareth.', 47187),
(65050, 'deDE', 'Eine herbeigezauberte Armee', 'Tötet $1oa beschworene Elementare.', 'Die Primalisten beschwören eine Elementararmee. Wir müssen annehmen, dass sie vorhaben, sie gegen unsere Truppen einzusetzen.\n\nNun, nicht solange wir Wache halten.\n\nLasst Feuer auf sie niedergehen, $gRufer:Ruferin;! Brennt diese Elementare von der Insel und schaltet ihre Beschwörer aus, bevor sie weitere herbeirufen.', '', '', '', '', '', 'Trefft Azurathel im Sturmrisskrater.', 47187),
(65049, 'deDE', 'Mischt die Tarasek auf', 'Tötet $1oa Tarasek.', 'Die Tarasek sind unberechenbar und wild. Wie urzeitliche Drakoniden sozusagen.\n\nNeltharion hat sie nie als viel mehr als Futter betrachtet. Übungsziele. Aber sie sind gerissene Jäger und tödlich, wenn sie in Rudeln vorgehen.\n\nSollten sie von den Primalisten elementare Macht erhalten, würden sie wesentlich gefährlicher werden.\n\nDas können wir nicht zulassen, $n. Dünnt ihre Reihen aus.', '', '', '', '', '', 'Trefft Azurathel im Sturmrisskrater.', 47187),
(65046, 'deDE', 'Die Primalisten', 'Findet Hinweise über die Ursprünge und Absichten der Primalisten.', 'Meine Erinnerungen sind noch immer benebelt von der Stasis, aber ich bin mir sicher, dass wir diesen Primalisten zuvor schon begegnet sind.\n\n<Derwischian beißt die Fangzähne zusammen.>\n\nEs hat keinen Zweck! Es fühlt sich an, als würde ich Fragmenten eines Traumes hinterherjagen, wenn ich versuche, mich zu erinnern.\n\nVielleicht schlagt Ihr Euch besser. Sucht nach Hinweisen, was... oder wer... diese Eindringlinge antreibt.', '', '', '', '', '', 'Trefft Derwischian im Sturmrisskrater.', 47187),
(65045, 'deDE', 'Sturmrisskrater', 'Trefft Azurathel im Sturmrisskrater.', 'Derwischians Bericht ist beunruhigend. Eine feindliche Streitmacht, die sich selbst als Primalisten bezeichnet, ist in den Sturmrisskrater eingefallen und hat die Schwarzschuppen am Belagerungshort festgenagelt.\n\nDie Eindringlinge beschwören gewaltsame Elementare und rekrutieren die grausamen Tarasek für ihre Sache.\n\nAzurathel wird am Krater Eure Hilfe brauchen. Durch Flügel oder Kralle, rettet unsere Leute.\n\nSobald die Schwarzschuppen in Sicherheit sind, veranlasst ein Treffen zwischen ihrem Kommandanten und mir. Seid gewarnt. Sarkareth kann... reizbar sein.', '', '', '', '', '', 'Sprecht mit Azurathel im Sturmrisskrater.', 47187),
(65036, 'deDE', 'Trainieren wie wir kämpfen', 'Übt \'Segeln\'.', 'Durch Ringe zu fliegen, hilft, die Grundlagen zu erlernen, aber wir trainieren so unerbittlich, wie wir kämpfen.\n\nVersucht nun, ein wenig in der Umgebung zu \'Segeln\', bis Ihr den Bogen heraushabt. Natürlich müsst Ihr auf die Wildtiere achten und Eure Augen nach möglichen Gefahren offenhalten, aber deswegen trainieren wir ja.\n\nMeldet Euch bei Glutthal zurück, sobald Ihr bereit seid. Viel Glück!', '', '', '', '', '', 'Sprecht mit Schuppenkommandantin Glutthal, wenn Ihr bereit seid, fortzufahren.', 47187),
(64877, 'deDE', 'Navigation Playtest: Level Up (PART 2)', '', 'Genießt das Ende des Tieflands!', '', '', '', '', '', '', 47187),
(64873, 'deDE', 'Die Flügel ausbreiten', 'Übt \'Segeln\'.', 'Es ermutigt mich zu sehen, dass so viele dem Kriegshort entkommen sind. Mein eigener Weyrn... hatte nicht so viel Glück.\n\n<Glutthal steht einen Moment schweigend da.>\n\nEs gibt noch weitere Horte überall auf der Insel, voller Dracthyr in Gefahr. Es wird stärkere Flügel brauchen, um sie zu erreichen.\n\nKonzentriert Euch. Erinnert Euch an das, was Ihr gelernt habt. Bekommt wieder ein Gefühl für den Wind. Ihr müsst Eure Stärke wiedererlangen und zu den anderen Horten fliegen.\n\nDie Zeit für Ruhe ist vorüber.', '', '', '', '', '', '', 47187),
(64872, 'deDE', 'Das innere Feuer', 'Erlernt \'Feueratem\' und übt ermächtigte Angriffe.', 'Ihr seid $gein Rufer:eine Ruferin;, $n, und gehört zu den Besten der Besten. Elitesoldaten wie Ihr haben die Fertigkeiten aller unserer Weyrns gemeistert.\n\nIch erwarte einiges von Euch.\n\nAuch wenn Eure Erinnerungen ausgelöscht wurden, fließt die Macht der Drachen durch Eure Venen. Nutzt sie.\n\nEine Eurer mächtigsten Waffen ist der Atemangriff. Das innere Feuer wird stärker, je länger Ihr einatmet.\n\nDie Insektenschwärme über unserem Übungsfeld sollten passende Ziele abgeben.', '', '', '', '', '', '', 47187),
(64871, 'deDE', 'Der Drache auf der Schwelle', 'Besiegt Lapisagos und flieht aus dem Kriegshort.', 'Dieser blaue Drache wird den Hort zum Einsturz bringen und uns hier einsperren!\n\nEr behauptet, auf Malygos\' Befehl hin zu handeln. Dieser Name ist mir vertraut, doch... warum sollte ein Drache uns zu Gefangenen machen wollen?\n\nHört mir gut zu, $p. Wir wurden ausgebildet, um an der Seite der Drachen zu kämpfen, nicht gegen sie. Doch uns bleibt keine Wahl.\n\nTun wir, was wir tun müssen, $gRufer:Ruferin;.', '', 'Er steht unserer Flucht im Weg.', 'Lapisagos', '', '', '', 47187),
(64866, 'deDE', 'In den Kessel', 'Bereitet Euch darauf vor, den Hort zu verlassen.', 'Eure Fertigkeiten werden gebraucht, $gRufer:Ruferin;.\n\nDer Hort zerfällt und wir sind knapp an Vorräten. Wir müssen den Durchgang nach draußen erreichen, aber zuerst müssen wir diese arkane Barriere überwinden.\n\nIn der Kammer dahinter befinden sich Dracthyr, welche Hilfe benötigen. Versorgt ihre Wunden. Vernichtet jegliche Gegner, die sich Euch in den Weg stellen.\n\nEs ist vielleicht das letzte Mal, dass wir gemeinsam durch diese Hallen gehen, $n. Macht etwas daraus.', '', '', '', '', '', '', 47187),
(64865, 'deDE', 'Aufrüsten', 'Beschafft Waffen, Rüstungen und Vorräte.', 'Gegner sind eingedrungen, unsere Leute werden in einer magischen Stasis gehalten und unser Hort scheint zusammenzubrechen.\n\nDeshalb trainieren wir, $n. Im Zweifelsfall greift auf das zurück, was Ihr wisst.\n\nAber das Wichtigste zuerst. Waffen, Rüstungen, Vorräte. Sammelt, was Ihr finden könnt, und rüstet Euch aus, während ich unsere Streitkräfte zusammenrufe.\n\nDann werden wir den Erdwächter ausfindig machen. Neltharion kann uns sicherlich die Antworten auf unsere Fragen geben.', '', '', '', '', '', '', 47187),
(64864, 'deDE', 'Erwacht, Dracthyr', 'Weckt die anderen Dracthyr.', '<Ihr seht nur Erinnerungsfetzen vor Euch, während Ihr aus Eurem schier endlosen Schlaf erwacht.\n\nDer Dracthyr vor Euch reagiert nicht, so als wäre er durch eine unbekannte Macht festgefroren. Ihr spürt, dass Ihr die Macht besitzt, Euren Verbündeten zu befreien.\n\nMöglicherweise gibt es noch andere im Hort, die in solch einer Stasis gefangen sind.\n\nEs obliegt Euch, sie zu erwecken.>', '', '', '', '', '', 'Sprecht mit Schuppenkommandant Azurathel.', 47187),
(64863, 'deDE', 'Arkanwächter', 'Besiegt $1oa Wächter oder Konstrukte.', 'Die Konstrukte, welche durch den Hort patrouillieren, werden nicht durch die Magie des Erdwächters animiert.\n\n<Derwischians Blick verdüstert sich.>\n\nWir können keine Feinde in unseren Reihen dulden.\n\nVernichtet sie und räumt uns den Weg nach vorne frei.', '', '', '', '', '', '', 47187),
(64856, 'deDE', '[DNT] A Little Pruning', 'Tötet %1oa fleischfressende Peitscher.', 'Seid gegrüßt, $gSterblicher:Sterbliche;. Ich benötige Eure Hilfe.\n\nDie Gärten sind während der langen Abwesenheit der Drachenschwärme verwahrlost. Viele der Pflanzen sind... renitent geworden.\n\nIch muss mich um die Setzlinge kümmern und bin daher sehr beschäftigt. Bitte beseitigt diese feindliche Vegetation. Ihr werdet entsprechend belohnt.', '', '', '', '', '', '', 47187),
(64163, 'deDE', 'Rache an den Abtrünnigen', 'Findet und besiegt die Krieger der Zentaurenrebellen in den behelfsmäßigen Lagern auf der anderen Seite des Flusses.', 'Rebellenklans haben Anspruch auf einige unserer Lager auf der anderen Seite des Flusses erhoben.\n\nSolch aufrührerischen Umtriebe müssen unterbunden werden.\n\nDarf ich darauf vertrauen, dass Ihr in der Lage seid, diesen Rebellen in meinem Namen eine Lektion zu erteilen?\n\nIn den Lagern herrscht zudem ein heilloses Chaos, aber ignoriert das vorerst. Wir können das später klären, wenn die Ordnung wiederhergestellt ist.', '', '', '', '', '', '', 47187),
(64162, 'deDE', 'Rituelle Rivalen', 'Findet und besiegt den Khan der Rebellen in den behelfsmäßigen Lagern auf der anderen Seite des Flusses.', 'Ein weiterer rivalisierender Khan hat sich aus den Rebellenstämmen erhoben.\n\nIch würde mich selbst darum kümmern, aber ich muss die Dinge hier im Auge behalten.\n\nKann ich darauf vertrauen, dass Ihr ihnen eine Lektion erteilt?', '', '', '', '', '', '', 47187),
(64159, 'deDE', 'Seltene Vorräte zurückerobern', 'Holt Vorräte aus den behelfsmäßigen Lagern auf der anderen Seite des Flusses zurück.', 'Die Rebellen haben Vorräte aus den umliegenden Lagern gestohlen.\n\nIhr habt bewiesen, dass Ihr solche Situationen lösen könnt. Ich vertraue darauf, dass Ihr uns auch helfen könnt, diese Situation zu lösen.', '', '', '', '', '', '', 47187),
(42820, 'deDE', 'GEFAHR: Aegir Wellenschmetterer', '', '', '', '', '', '', '', '', 47187),
(37484, 'deDE', 'Hauptmannspfeife', 'Bringt Anne Dunworthy 100 Artefaktfragmente für eine Hauptmannspfeife.', '', '', '', '', '', '', '', 47187),
(3632, 'deDE', 'Gnomeningenieurskunst', 'Wenn Ihr etwas über die Gnomeningenieurskunst erlernen wollt, dann bringt die Anleitung der Ingenieurskunstdisziplinen zu Tüftlermeister Oberfunks nach Eisenschmiede.', 'Ingenieurskunst auf Expertenniveau gliedert sich in zwei Disziplinen auf: Gnom und Goblin. Gnomeningenieurskunst ist die weit Überlegenere der beiden! Es geht um die Konstruktion von wunderbaren Apparaten und Geräten, die das Leben schöner machen.$B$B$n, lest diese Anleitung. Wenn Ihr mehr über Gnomeningenieurskunst lernen wollt, dann bringt sie zu Tüftlermeister Oberfunks hier in Eisenschmiede. Denkt daran - das ist eine dauerhafte Mitgliedschaft und es ist nicht möglich, in die andere Disziplin einzutreten, also solltet Ihr Euch absolut sicher sein, dass Ihr Euch sicher seid, bevor Ihr seine Aufgabe ausführt.', '', '', '', '', '', '', 47187);
